INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('e2893216-0ffa-4b65-8f3c-e4073442e23a', 'Windmills', 'pull', 'intermediate', 'Windmills', NULL, 'a4d80286-a1bb-4f46-aa75-77b79cbbce41', 'c4784069-8e26-4a4f-ba7d-70a18744e239');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('c07bb256-d3c5-4b83-9305-170cd8a7c148', 'World''s Greatest Stretch', 'static', 'intermediate', 'Worlds_Greatest_Stretch', NULL, 'a4d80286-a1bb-4f46-aa75-77b79cbbce41', 'd53d7375-b364-4115-bb00-f7c2a1cb39c7');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('eb0fbdd3-6012-4147-94b5-95abfbad49b8', 'Wrist Circles', 'pull', 'beginner', 'Wrist_Circles', NULL, 'a4d80286-a1bb-4f46-aa75-77b79cbbce41', '732f4dc1-a724-4c5e-81f6-096c85eab7eb');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('672024cc-f098-4476-bdf4-3420b72064c2', 'Wrist Roller', 'pull', 'beginner', 'Wrist_Roller', '56c9062e-17be-4f87-8289-c63658262602', 'cc1d7bf1-e039-4b8a-8bf6-85e3107991c7', '732f4dc1-a724-4c5e-81f6-096c85eab7eb');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('331a4a5e-d64c-4c6b-bb9b-2df0d531fe9b', 'Wrist Rotations with Straight Bar', 'pull', 'beginner', 'Wrist_Rotations_with_Straight_Bar', 'c949815d-37fc-4139-be61-bf8a6a5c5f45', 'cc1d7bf1-e039-4b8a-8bf6-85e3107991c7', '732f4dc1-a724-4c5e-81f6-096c85eab7eb');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('f8d509ba-ef49-49f6-96d1-d7cfd6fa6847', 'Yoke Walk', '', 'intermediate', 'Yoke_Walk', '56c9062e-17be-4f87-8289-c63658262602', 'a7c2dc0a-b353-4be4-ad6f-473ea8ebd062', '9a7e2a74-c8e9-46e1-a44a-170ae173a9cb');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('2cff4472-3907-4c16-af3f-46c7d775c0cb', 'Zercher Squats', 'push', 'expert', 'Zercher_Squats', 'c949815d-37fc-4139-be61-bf8a6a5c5f45', 'cc1d7bf1-e039-4b8a-8bf6-85e3107991c7', '9a7e2a74-c8e9-46e1-a44a-170ae173a9cb');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('700641d7-f6a6-4907-a394-9bd73aa868d7', 'Zottman Curl', 'pull', 'intermediate', 'Zottman_Curl', 'e4ccde66-b691-4942-ab1b-a5cdd20418d9', 'cc1d7bf1-e039-4b8a-8bf6-85e3107991c7', 'd6d6d87c-2aba-4dfe-9c6d-fde6f7796b5c');
INSERT INTO exercises (id, name, force, level, external_id, equipment_id, category_id, primary_muscle_id) VALUES ('235e0211-a2ff-4566-87af-202b2965de35', 'Zottman Preacher Curl', 'pull', 'intermediate', 'Zottman_Preacher_Curl', 'e4ccde66-b691-4942-ab1b-a5cdd20418d9', 'cc1d7bf1-e039-4b8a-8bf6-85e3107991c7', 'd6d6d87c-2aba-4dfe-9c6d-fde6f7796b5c');
INSERT INTO instructions (id, instruction) VALUES ('3de96015-1f9e-4446-ad81-470c4c268390', 'Lie down on the floor and secure your feet. Your legs should be bent at the knees.');
INSERT INTO instructions (id, instruction) VALUES ('0dc14702-9667-4399-984b-849c23a07c5f', 'Place your hands behind or to the side of your head. You will begin with your back on the ground. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('889e1cbe-f3fa-4c5a-a7c0-fb7670716224', 'Flex your hips and spine to raise your torso toward your knees.');
INSERT INTO instructions (id, instruction) VALUES ('f036b297-c437-48f9-95d4-768ef58bb5e2', 'At the top of the contraction your torso should be perpendicular to the ground. Reverse the motion, going only  of the way down.');
INSERT INTO instructions (id, instruction) VALUES ('30a0edf5-4227-4b61-ab1a-242c5db6fc76', 'Repeat for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('1945fc67-dc53-4959-882f-950543ecac6c', 'Lie on your back, with one leg extended straight out.');
INSERT INTO instructions (id, instruction) VALUES ('c8793bfc-63ab-428b-b811-e68b5274264d', 'With the other leg, bend the hip and knee to 90 degrees. You may brace your leg with your hands if necessary. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('44de358b-5f4a-4e13-acb9-770acb6692e1', 'Extend your leg straight into the air, pausing briefly at the top. Return the leg to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0532d584-7068-42da-aa61-e648adfafb32', 'Repeat for 10-20 repetitions, and then switch to the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('d26e3c53-48eb-4bf7-917d-119884fccea6', 'Select a light resistance and sit down on the ab machine placing your feet under the pads provided and grabbing the top handles. Your arms should be bent at a 90 degree angle as you rest the triceps on the pads provided. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('aa37c3d1-c1bd-4106-bad6-05b68deee593', 'At the same time, begin to lift the legs up as you crunch your upper torso. Breathe out as you perform this movement. Tip: Be sure to use a slow and controlled motion. Concentrate on using your abs to move the weight while relaxing your legs and feet.');
INSERT INTO instructions (id, instruction) VALUES ('f99d4528-dbec-4cf8-a965-6093e5610a42', 'After a second pause, slowly return to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('e4dc16fd-7f47-47bd-81e1-4daf41d9fa34', 'Repeat the movement for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('7b384b22-6b44-452b-b4f7-4451c21e4ec8', 'Hold the Ab Roller with both hands and kneel on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('1d50cd2c-43f9-4808-802d-abc9053905ca', 'Now place the ab roller on the floor in front of you so that you are on all your hands and knees (as in a kneeling push up position). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9f4f713f-0489-47d8-bcf8-33eb0ed5fa6c', 'Slowly roll the ab roller straight forward, stretching your body into a straight position. Tip: Go down as far as you can without touching the floor with your body. Breathe in during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('5ba15593-c38f-4099-968e-d97a1184b215', 'After a pause at the stretched position, start pulling yourself back to the starting position as you breathe out. Tip: Go slowly and keep your abs tight at all times.');
INSERT INTO instructions (id, instruction) VALUES ('d011978c-085f-4433-b757-73760c2b6bfd', 'Lie face down with one leg on a foam roll.');
INSERT INTO instructions (id, instruction) VALUES ('e98dd032-48a3-4627-a9fb-c27134ba9465', 'Rotate the leg so that the foam roll contacts against your inner thigh. Shift as much weight onto the foam roll as can be tolerated.');
INSERT INTO instructions (id, instruction) VALUES ('5fcb313d-d3e0-49ad-b248-af0a2ab569f0', 'While trying to relax the muscles if the inner thigh, roll over the foam between your hip and knee, holding points of tension for 10-30 seconds. Repeat with the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('7a39d659-5805-4085-b722-c99650333aad', 'Lie on your back with your feet raised towards the ceiling.');
INSERT INTO instructions (id, instruction) VALUES ('c02acd52-2852-4dc4-9990-f48dd924be39', 'Have your partner hold your feet or ankles. Abduct your legs as far as you can. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b86b0900-20cc-414c-ab91-71e83a3155ed', 'Attempt to squeeze your legs together for 10 or more seconds, while your partner prevents you from doing so.');
INSERT INTO instructions (id, instruction) VALUES ('8ee975f6-9a8a-4bca-a0d8-83be15a80caa', 'Now, relax the muscles in your legs as your partner pushes your feet apart, stretching as far as is comfortable for you. Be sure to let your partner know when the stretch is adequate to prevent overstretching or injury.');
INSERT INTO instructions (id, instruction) VALUES ('ff4ae321-fc52-4fb0-83b8-c1fb8a3d4ff2', 'Clean and press a kettlebell overhead with one arm.');
INSERT INTO instructions (id, instruction) VALUES ('dabfdf9c-84fd-4d03-808c-f0a6e299814e', 'Keeping the kettlebell locked out at all times, push your butt out in the direction of the locked out kettlebell. Keep the non-working arm behind your back and turn your feet out at a forty-five degree angle from the arm with the kettlebell.');
INSERT INTO instructions (id, instruction) VALUES ('8cbad4f2-d240-4e62-afe6-c351956f2d5a', 'Lower yourself as far as possible.');
INSERT INTO instructions (id, instruction) VALUES ('d8354dc5-afc0-413d-ae62-db15dd648b0a', 'Pause for a second and reverse the motion back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2dce25ba-6334-4e70-8fdd-f636f748705a', 'Lie flat on the floor with your lower back pressed to the ground. For this exercise, you will need to put your hands beside your head. Be careful however to not strain with the neck as you perform it. Now lift your shoulders into the crunch position.');
INSERT INTO instructions (id, instruction) VALUES ('8a853b2c-08b3-4659-9921-77fd5abfae7d', 'Bring knees up to where they are perpendicular to the floor, with your lower legs parallel to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fcf53d46-e715-4f1f-bdb0-0324d22f6892', 'Now simultaneously, slowly go through a cycle pedal motion kicking forward with the right leg and bringing in the knee of the left leg. Bring your right elbow close to your left knee by crunching to the side, as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('5c233ff4-e9b8-4629-ab07-7b859dc8e1c0', 'Go back to the initial position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('867ef83e-133c-4f12-9332-7ca8ea40c076', 'Crunch to the opposite side as you cycle your legs and bring closer your left elbow to your right knee and exhale.');
INSERT INTO instructions (id, instruction) VALUES ('ebd29bbf-de86-4b8f-9b10-1efa3849ac52', 'Continue alternating in this manner until all of the recommended repetitions for each side have been completed.');
INSERT INTO instructions (id, instruction) VALUES ('29013e1d-4e21-41d4-8067-f3a581a05b80', 'Start off on your hands and knees, then lift your leg off the floor and hold the foot with your hand.');
INSERT INTO instructions (id, instruction) VALUES ('c89f6fc8-f381-426b-b681-b3fbcb367556', 'Use your hand to hold the foot or ankle, keeping the knee fully flexed, stretching the quadriceps and hip flexors.');
INSERT INTO instructions (id, instruction) VALUES ('6bacc00d-61bc-4138-a745-9e09fa0ef79f', 'Focus on extending your hips, thrusting them towards the floor. Hold for 10-20 seconds and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('492ef3a7-f40f-42b1-b2dc-bcbdef8d3d5d', 'Stand up with your torso upright and a dumbbell in each hand being held at arms length. The elbows should be close to the torso.');
INSERT INTO instructions (id, instruction) VALUES ('d72cea9e-240a-439c-9a3c-b9ec7e56e707', 'The palms of the hands should be facing your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b6593c58-dcc8-4a10-83ef-5bb482059ffb', 'While holding the upper arm stationary, curl the right weight forward while contracting the biceps as you breathe out. Continue the movement until your biceps is fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the biceps. Tip: Only the forearms should move.');
INSERT INTO instructions (id, instruction) VALUES ('e88dbf16-41e0-4eee-b25d-676b2e1628c2', 'Slowly begin to bring the dumbbells back to starting position as your breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('74df8b40-46ce-406f-b464-87cf8ece5d60', 'Repeat the movement with the left hand. This equals one repetition.');
INSERT INTO instructions (id, instruction) VALUES ('26cd25c1-5afe-4472-b648-fd94c81147a0', 'Continue alternating in this manner for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('ecb6e40b-e9ce-4ee9-b62e-e331b9fcf9e5', 'Lie on the floor with the knees bent and the feet on the floor around 18-24 inches apart. Your arms should be extended by your side. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6d620c5b-a374-4339-98b3-0789c31d544b', 'Crunch over your torso forward and up about 3-4 inches to the right side and touch your right heel as you hold the contraction for a second. Exhale while performing this movement.');
INSERT INTO instructions (id, instruction) VALUES ('6daa01a4-ec9d-4108-9ea4-404034eb9c6f', 'Now go back slowly to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('ce68cadf-63e7-4341-9f97-8eaa59ed96a3', 'Now crunch over your torso forward and up around 3-4 inches to the left side and touch your left heel as you hold the contraction for a second. Exhale while performing this movement and then go back to the starting position as you inhale. Now that both heels have been touched, that is considered 1 repetition.');
INSERT INTO instructions (id, instruction) VALUES ('2150de0a-4237-4066-8dfd-c455aba57def', 'Continue alternating sides in this manner until all prescribed repetitions are done.');
INSERT INTO instructions (id, instruction) VALUES ('1e2f5fc5-eeb7-4166-b7c4-850dc7379a30', 'Sit down on an incline bench with a dumbbell in each hand being held at arms length. Tip: Keep the elbows close to the torso.This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d29f4cd8-3425-45b5-9f3f-b4f6cfdd721c', 'While holding the upper arm stationary, curl the right weight forward while contracting the biceps as you breathe out. As you do so, rotate the hand so that the palm is facing up. Continue the movement until your biceps is fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the biceps. Tip: Only the forearms should move.');
INSERT INTO instructions (id, instruction) VALUES ('8191304c-9745-4c1e-95d2-67a26650b592', 'Slowly begin to bring the dumbbell back to starting position as your breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('2eae1c09-fd7e-4cba-91c5-99556d7ed71d', 'Assume a comfortable stance with one foot slightly in front of the other.');
INSERT INTO instructions (id, instruction) VALUES ('919a18ee-7126-48ed-82d8-faa5f16c0eea', 'Begin by pushing off with the front leg, driving the opposite knee forward and as high as possible before landing. Attempt to cover as much distance to each side with each bound.');
INSERT INTO instructions (id, instruction) VALUES ('32615d62-c8b6-4933-8784-a27f103c8f0c', 'It may help to use a line on the ground to guage distance from side to side.');
INSERT INTO instructions (id, instruction) VALUES ('8c886158-7707-4fd8-add7-68ced595363e', 'Repeat the sequence with the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('0b0fc328-8fe0-49f4-9f1f-a78b1823516f', 'Move the cables to the bottom of the tower and select an appropriate weight.');
INSERT INTO instructions (id, instruction) VALUES ('74377f3f-ca52-471b-8947-7b4bcf48ab9b', 'Grasp the cables and hold them at shoulder height, palms facing forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f7fa896c-2130-4c6f-ab00-50d18f84613e', 'Keeping your head and chest up, extend through the elbow to press one side directly over head.');
INSERT INTO instructions (id, instruction) VALUES ('942e1651-7bf6-4435-a4ec-d9aa17a545ef', 'After pausing at the top, return to the starting position and repeat on the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('1418b968-4379-4e7c-9141-00a3976a5c7f', 'In a standing position, hold a pair of dumbbells at your side.');
INSERT INTO instructions (id, instruction) VALUES ('7f0496e0-a021-4e4e-b4ec-372f3347d428', 'Keeping your elbows slightly bent, raise the weights directly in front of you to shoulder height, avoiding any swinging or cheating.');
INSERT INTO instructions (id, instruction) VALUES ('c01f9269-912a-4965-902d-368a7b106fb1', 'Return the weights to your side.');
INSERT INTO instructions (id, instruction) VALUES ('90b3ced2-3750-4c6a-8eb0-227677f22458', 'On the next repetition, raise the weights laterally, raising them out to your side to about shoulder height.');
INSERT INTO instructions (id, instruction) VALUES ('c9128814-4fed-4e4e-95e6-fa604c5352b5', 'Return the weights to the starting position and continue alternating to the front and side.');
INSERT INTO instructions (id, instruction) VALUES ('cddb4391-c7dc-4a9b-87e2-904605e4afc8', 'Lie on the floor with two kettlebells next to your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('2bd3c8dc-4381-49ff-88bc-a4f19ef80659', 'Position one in place on your chest and then the other, gripping the kettlebells on the handle with the palms facing forward.');
INSERT INTO instructions (id, instruction) VALUES ('bf4e9ac7-365b-47af-83fc-298bf9a81080', 'Extend both arms, so that the kettlebells are being held above your chest. Lower one kettlebell, bringing it to your chest and turn the wrist in the direction of the locked out kettlebell.');
INSERT INTO instructions (id, instruction) VALUES ('4c8f93b2-aa9f-46f0-8053-35405df6c414', 'Raise the kettlebell and repeat on the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('c1d79fc5-10f6-4836-b298-792fb98e4ddb', 'Place two kettlebells between your feet. To get in the starting position, push your butt back and look straight ahead.');
INSERT INTO instructions (id, instruction) VALUES ('4a97b3c8-067d-422c-bab9-68b347cba38d', 'Clean one kettlebell to your shoulder and hold on to the other kettlebell in a hanging position. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulders. Rotate your wrist as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('306f6191-4837-403a-857b-416d04f7633a', 'Lower the cleaned kettlebell to a hanging position and clean the alternate kettlebell. Repeat.');
INSERT INTO instructions (id, instruction) VALUES ('e132df5b-f11b-40c9-b207-066c79e1470b', 'Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('463af5c6-c43b-4afe-a5dd-164cf7afa7dd', 'Press one directly overhead by extending through the elbow, turning it so the palm faces forward while holding the other kettlebell stationary .');
INSERT INTO instructions (id, instruction) VALUES ('5c8cfa4c-b8fa-48b3-9fe3-c743a7025e37', 'Lower the pressed kettlebell to the starting position and immediately press with your other arm.');
INSERT INTO instructions (id, instruction) VALUES ('9c120eb2-56ac-4e14-ae5e-c52c28c7bfda', 'Place two kettlebells in front of your feet. Bend your knees slightly and push your butt out as much as possible. As you bend over to get into the starting position grab both kettlebells by the handles.');
INSERT INTO instructions (id, instruction) VALUES ('977bd8b5-f81f-4007-9bf0-629d6d41e621', 'Pull one kettlebell off of the floor while holding on to the other kettlebell. Retract the shoulder blade of the working side, as you flex the elbow, drawing the kettlebell towards your stomach or rib cage.');
INSERT INTO instructions (id, instruction) VALUES ('928f3007-be50-4a64-9efd-d282dd66add7', 'Lower the kettlebell in the working arm and repeat with your other arm.');
INSERT INTO instructions (id, instruction) VALUES ('2cf5639b-1959-4a52-98cc-70369f5a1088', 'Place two kettlebells on the floor about shoulder width apart. Position yourself on your toes and your hands as though you were doing a pushup, with the body straight and extended. Use the handles of the kettlebells to support your upper body. You may need to position your feet wide for support.');
INSERT INTO instructions (id, instruction) VALUES ('c103a8d4-6f94-4981-826d-57f6d9a40f9d', 'Push one kettlebell into the floor and row the other kettlebell, retracting the shoulder blade of the working side as you flex the elbow, pulling it to your side.');
INSERT INTO instructions (id, instruction) VALUES ('6990b2f1-4446-4905-877c-362e4df80b00', 'Then lower the kettlebell to the floor and begin the kettlebell in the opposite hand. Repeat for several reps.');
INSERT INTO instructions (id, instruction) VALUES ('7c3c7aca-903e-497b-9179-bfc082ff9bd3', 'Use a sturdy object like a squat rack to hold yourself.');
INSERT INTO instructions (id, instruction) VALUES ('544fd4b4-43e7-44a3-bfc4-ed25bfb90245', 'Lift the right leg in the air (just around 2 inches from the floor) and perform a circular motion with the big toe. Pretend that you are drawing a big circle with it. Tip: One circle equals 1 repetition. Breathe normally as you perform the movement.');
INSERT INTO instructions (id, instruction) VALUES ('cbf3fb4e-8ed7-42b7-83e6-e14f71be7042', 'When you are done with the right foot, then repeat with the left leg.');
INSERT INTO instructions (id, instruction) VALUES ('d7f7b668-038f-41ee-8014-67975b3cc6b3', 'From a lying position, bend your knees and keep your feet on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('1bf713d3-08c2-45f8-90e0-90ea3847e8f2', 'Place your ankle of one foot on your opposite knee.');
INSERT INTO instructions (id, instruction) VALUES ('be080df3-c918-4075-8116-a79eaa7d65f9', 'Grasp the thigh or knee of the bottom leg and pull both of your legs into the chest. Relax your neck and shoulders. Hold for 10-20 seconds and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('1dfd2a59-90f1-44e5-852a-42909a531974', 'Begin seated on the ground with your legs bent and your feet on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('554447fa-9d90-412e-9840-af7d6b5fa591', 'Using a Muscle Roller or a rolling pin, apply pressure to the muscles on the outside of your shins. Work from just below the knee to above the ankle, pausing at points of tension for 10-30 seconds. Repeat on the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('52198d11-4bbe-4be7-814f-5277680af4fe', 'Place a bar on the ground behind the head of an incline bench.');
INSERT INTO instructions (id, instruction) VALUES ('45dadb40-7d00-4b25-b520-2f5ed1413b28', 'Lay on the bench face down. With a pronated grip, pick the barbell up from the floor. Flex the elbows, performing a reverse curl to bring the bar near your chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('840bbd31-a1b0-46c8-b9f9-9298c5f92f5f', 'To begin, press the barbell out in front of your head by extending your elbows. Keep your arms parallel to the ground throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('21374f58-68c4-424d-a1c6-c8843eebb111', 'Return to the starting position and repeat to complete the set.');
INSERT INTO instructions (id, instruction) VALUES ('faa6209e-5ce7-4fbb-888b-d8f048a28ba1', 'Stand up and extend your arms straight out by the sides. The arms should be parallel to the floor and perpendicular (90-degree angle) to your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f56b71be-94b9-4e76-b741-0090c7a5e0ca', 'Slowly start to make circles of about 1 foot in diameter with each outstretched arm. Breathe normally as you perform the movement.');
INSERT INTO instructions (id, instruction) VALUES ('8b62a5b9-8253-4386-ab2b-0d45438cf092', 'Continue the circular motion of the outstretched arms for about ten seconds. Then reverse the movement, going the opposite direction.');
INSERT INTO instructions (id, instruction) VALUES ('8a45a580-ce22-478a-85bc-92292c958231', 'Sit on an exercise bench with back support and hold two dumbbells in front of you at about upper chest level with your palms facing your body and your elbows bent. Tip: Your arms should be next to your torso. The starting position should look like the contracted portion of a dumbbell curl.');
INSERT INTO instructions (id, instruction) VALUES ('4ad55563-8997-4653-b46a-3c4801c07f75', 'Now to perform the movement, raise the dumbbells as you rotate the palms of your hands until they are facing forward.');
INSERT INTO instructions (id, instruction) VALUES ('45b1eb9f-fd1b-44f3-be38-d97a59ff932f', 'Continue lifting the dumbbells until your arms are extended above you in straight arm position. Breathe out as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('84c4122f-73c4-4030-8b22-88003eab978b', 'After a second pause at the top, begin to lower the dumbbells to the original position by rotating the palms of your hands towards you. Tip: The left arm will be rotated in a counter clockwise manner while the right one will be rotated clockwise. Breathe in as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('96292bf4-c264-4ca9-bd5d-14a7fb02045b', 'Lay down on a flat bench holding a dumbbell in each hand with the palms of the hands facing towards the ceiling. Tip: Your arms should be parallel to the floor and next to your thighs. To avoid injury, make sure that you keep your elbows slightly bent. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bc8a52ad-8733-41a0-b7fa-f8237c301677', 'Now move the dumbbells by creating a semi-circle as you displace them from the initial position to over the head. All of the movement should happen with the arms parallel to the floor at all times. Breathe in as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d32df01e-c225-49d1-b018-b678607001b4', 'Reverse the movement to return the weight to the starting position as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('d85867cf-972d-4b40-83ed-ba782649069e', 'This trainer is effective for developing Atlas Stone strength for those who don''t have access to stones, and are typically made from bar ends or heavy pipe.');
INSERT INTO instructions (id, instruction) VALUES ('19b7ccf5-e61c-4423-98f6-750f915a3550', 'Begin by loading the desired weight onto the bar. Straddle the weight, wrapping your arms around the implement, bending at the hips.');
INSERT INTO instructions (id, instruction) VALUES ('a37fc0e4-584c-41d3-9ebc-6303eb9dbe35', 'Begin by pulling the weight up past the knees, extending through the hips. As the weight clears the knees, it can be lapped by resting it on your thighs and sitting back, hugging it tightly to your chest.');
INSERT INTO instructions (id, instruction) VALUES ('8252b1c3-91bc-4b60-9aab-ca09eefb4c70', 'Finish the movement by extending through your hips and knees to raise the weight as high as possible. The weight can be returned to the lap or to the ground for successive repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('56677ade-405b-4968-ad44-ae0ac8b5bc00', 'Begin with the atlas stone between your feet. Bend at the hips to wrap your arms vertically around the Atlas Stone, attempting to get your fingers underneath the stone. Many stones will have a small flat portion on the bottom, which will make the stone easier to hold.');
INSERT INTO instructions (id, instruction) VALUES ('e3b10b66-b78b-45cf-97ca-653b85358194', 'Pulling the stone into your torso, drive through the back half of your feet to pull the stone from the ground.');
INSERT INTO instructions (id, instruction) VALUES ('be089fe6-371e-4538-a7ac-d6380b60ea60', 'As the stone passes the knees, lap it by sitting backward, pulling the stone on top of your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('2b940f12-c241-4b2a-a0e5-d9b143b87cad', 'Sit low, getting the stone high onto your chest as you change your grip to reach over the stone. Stand, driving through with your hips. Close distance to the loading platform, and lean back, extending the hips to get the stone as high as possible.');
INSERT INTO instructions (id, instruction) VALUES ('064649a7-65cf-44fd-b96e-ecb1cb860526', 'Approach the bar so that it is centered over your feet. You feet should be about hip width apart. Bend at the hip to grip the bar at shoulder width, allowing your shoulder blades to protract. Typically, you would use an over/under grip.');
INSERT INTO instructions (id, instruction) VALUES ('8a7f1958-9ec3-4de5-b6ae-60d2211ea29d', 'With your feet and your grip set, take a big breath and then lower your hips and flex the knees until your shins contact the bar. Look forward with your head, keep your chest up and your back arched, and begin driving through the heels to move the weight upward.');
INSERT INTO instructions (id, instruction) VALUES ('aa4de0ac-bb08-48a0-9233-8330c00f5587', 'After the bar passes the knees, aggressively pull the bar back, pulling your shoulder blades together as you drive your hips forward into the bar.');
INSERT INTO instructions (id, instruction) VALUES ('c9883e86-4760-4ce1-8014-98671d7aef7a', 'Lower the bar by bending at the hips and guiding it to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('a54ad49e-e3be-4e9a-a348-51829f37e3c7', 'Run a band around a stationary post like that of a squat rack.');
INSERT INTO instructions (id, instruction) VALUES ('2c7d0061-7f8a-4504-8170-04758dde7801', 'Grab the band by the handles and stand back so that the tension in the band rises.');
INSERT INTO instructions (id, instruction) VALUES ('e3621caa-6f64-4998-ac16-2585e7d01c9a', 'Extend and lift the arms straight in front of you. Tip: Your arms should be straight and parallel to the floor while perpendicular to your torso. Your feet should be firmly planted on the floor spread at shoulder width. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5b9c08cb-e1d6-465f-b472-51d28e11c8b0', 'As you exhale, move your arms to the sides and back. Keep your arms extended and parallel to the floor. Continue the movement until the arms are extended to your sides.');
INSERT INTO instructions (id, instruction) VALUES ('7ad01443-dd2c-45be-8d13-1f4798815e5b', 'After a pause, go back to the original position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('91421f06-d410-4382-a0a1-e9b775eade91', 'Load a sled with the desired weight, attaching a rope or straps to the sled that you can hold onto.');
INSERT INTO instructions (id, instruction) VALUES ('86f1b671-943a-4d28-85e0-7b37a45225c7', 'Begin the exercise by moving backwards for a given distance. Leaning back, extend through the legs for short steps to move as quickly as possible.');
INSERT INTO instructions (id, instruction) VALUES ('b44fa0fb-cf15-4f40-a4a0-f71867a78b33', 'This exercise is best done with a partner. If you lack a partner, the ball can be thrown and retrieved or thrown against a wall.');
INSERT INTO instructions (id, instruction) VALUES ('69fb45af-a26a-4725-aac1-ed0ea331d608', 'Begin standing a few meters in front of your partner, both facing the same direction. Begin holding the ball between your legs.');
INSERT INTO instructions (id, instruction) VALUES ('d2097f5a-1d15-4888-a447-df969ff3267b', 'Squat down and then forcefully reverse direction, coming to full extension and you toss the ball over your head to your partner.');
INSERT INTO instructions (id, instruction) VALUES ('6616d1b3-fe10-4998-9dc1-4f559c18a2c2', 'Your partner can then roll the ball back to you. Repeat for the desired number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('3e44e713-ab3d-4c86-8cfd-7262a79ffea0', 'Place a balance board in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('92af374f-f2eb-485d-b455-9b5638ed2a92', 'Stand up on it and try to balance yourself.');
INSERT INTO instructions (id, instruction) VALUES ('54d18fdf-8986-4ad3-97e9-43d2b031a199', 'Hold the balance for as long as desired.');
INSERT INTO instructions (id, instruction) VALUES ('dcb0a92e-191c-417a-b441-8c403f2ce1a2', 'Begin on the floor laying on your back with your feet on top of the ball.');
INSERT INTO instructions (id, instruction) VALUES ('dd77850b-bc00-43be-bb24-b0563be5b9d7', 'Position the ball so that when your legs are extended your ankles are on top of the ball. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c994fa47-60ab-4b8b-8310-113eeba72870', 'Raise your hips off of the ground, keeping your weight on the shoulder blades and your feet.');
INSERT INTO instructions (id, instruction) VALUES ('7a02aaac-4f12-4ebc-8146-c48eb8013c10', 'Flex the knees, pulling the ball as close to you as you can, contracting the hamstrings.');
INSERT INTO instructions (id, instruction) VALUES ('eb9bd989-567a-4d15-a9dd-abdbf3224b77', 'After a brief pause, return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a959d588-6eb5-4d20-952c-a08aa0b5f520', 'Choke the band around the center of the pullup bar. You can use different bands to provide varying levels of assistance.');
INSERT INTO instructions (id, instruction) VALUES ('ae635fec-d611-475a-bdc7-6fd63c1e63d2', 'Pull the end of the band down, and place one bent knee into the loop, ensuring it won''t slip out. Take a medium to wide grip on the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f8a83368-86e6-43db-a04d-d84f4723e8ab', 'Pull yourself upward by contracting the lats as you flex the elbow. The elbow should be driven to your side. Pull to the front, attempting to get your chin over the bar. Avoid swinging or jerking movements.');
INSERT INTO instructions (id, instruction) VALUES ('aaf070dd-3a53-4c65-aed1-bdce2dd8561d', 'Using a 41 inch band, stand on one end, spreading your feet a small amount. Bend at the hips to loop the end of the band behind your neck. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('eebd09ae-b9e6-41c1-9d42-1a3f41e7b13d', 'Keeping your legs straight, extend through the hips to come to a near vertical position.');
INSERT INTO instructions (id, instruction) VALUES ('6c67ebd2-5748-49a2-8f67-d7a04d0eff2a', 'Ensure that you do not round your back as you go down back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4eb0f319-579a-4070-aa5c-bcfb8ce69750', 'Loop the band around a post. Standing a little ways away, loop the opposite end around the neck. Your hands can help hold the band in position.');
INSERT INTO instructions (id, instruction) VALUES ('37155bc4-bee9-4b2c-81d9-8468957ee8b1', 'Begin by bending at the hips, getting your butt back as far as possible. Keep your back flat and bend forward to about 90 degrees. Your knees should be only slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('7c7ce6ab-1584-4a43-a04c-a43575f5402f', 'Return to the starting position be driving through with the hips to come back to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('97278904-a71d-4a17-b9a0-63514505cc20', 'Anchor a band around a solid post or other object.');
INSERT INTO instructions (id, instruction) VALUES ('d0e9a0aa-af1b-464c-987d-dceef040d0ed', 'Stand with your left side to the post, and put your right foot through the band, getting it around the ankle.');
INSERT INTO instructions (id, instruction) VALUES ('3fee0669-88ed-4ea7-bff4-7132c8347b19', 'Stand up straight and hold onto the post if needed. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b5ea4309-92fe-4502-b73a-5cef39d49e7a', 'Keeping the knee straight, raise your right legs out to the side as far as you can.');
INSERT INTO instructions (id, instruction) VALUES ('cb957d20-898a-4b40-b529-31d0f2321b3c', 'Return to the starting position and repeat for the desired rep count.');
INSERT INTO instructions (id, instruction) VALUES ('07bdb87c-a93d-40c4-895f-d7efea6809ab', 'Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('cd6edafe-c86a-4356-9547-8dc48965e631', 'Begin with your arms extended straight out in front of you, holding the band with both hands.');
INSERT INTO instructions (id, instruction) VALUES ('8a3dd308-4474-472e-9f44-fef4d29ac97b', 'Initiate the movement by performing a reverse fly motion, moving your hands out laterally to your sides.');
INSERT INTO instructions (id, instruction) VALUES ('04363bab-e568-47df-bfd3-2c2c0f2821a9', 'Keep your elbows extended as you perform the movement, bringing the band to your chest. Ensure that you keep your shoulders back during the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('b5daf488-32fb-4a65-a3b3-4af7d4c2add4', 'Pause as you complete the movement, returning to the starting position under control.');
INSERT INTO instructions (id, instruction) VALUES ('2f92c674-1d7a-4e94-9233-69d24b87ad90', 'Secure a band to the base of a rack or the bench. Lay on the bench so that the band is lined up with your head.');
INSERT INTO instructions (id, instruction) VALUES ('ad11bf2a-2b13-4152-9315-884a6c31dd47', 'Take hold of the band, raising your elbows so that the upper arm is perpendicular to the floor. With the elbow flexed, the band should be above your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('208cd866-649a-44eb-af30-025cbfce1ff2', 'Extend through the elbow to straighten your arm, keeping your upper arm in place. Pause at the top of the motion, and return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ff37fe3c-b103-4463-8c8a-7abd28946070', 'For this exercise you will need to get into a pushup position, but instead of having your hands of the floor, you will be grabbing on to an Olympic barbell (loaded with 5-10 lbs on each side) instead. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a3d99f20-9efd-4813-b780-4897baedb225', 'While keeping a slight arch on your back, lift your hips and roll the barbell towards your feet as you exhale. Tip: As you perform the movement, your glutes should be coming up, you should be keeping the abs tight and should maintain your back posture at all times. Also your arms should be staying perpendicular to the floor throughout the movement. If you don''t, you will work out your shoulders and back more than the abs.');
INSERT INTO instructions (id, instruction) VALUES ('9a26a211-e7c4-4460-890d-a2f3ca2139e0', 'After a second contraction at the top, start to roll the barbell back forward to the starting position slowly as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('7fc9a798-a3e6-4e6d-b569-3a9c4008ed0d', 'Hold an Olympic barbell loaded with 5-10lbs on each side and kneel on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('a9859b52-af18-4db6-8307-5139f7cd9969', 'Now place the barbell on the floor in front of you so that you are on all your hands and knees (as in a kneeling push up position). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5b7f8f76-480d-42be-b7f4-21d6eba2d613', 'Slowly roll the barbell straight forward, stretching your body into a straight position. Tip: Go down as far as you can without touching the floor with your body. Breathe in during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('0f2bcd52-ae67-4fdc-87be-07f0c8e9ad8a', 'After a second pause at the stretched position, start pulling yourself back to the starting position as you breathe out. Tip: Go slowly and keep your abs tight at all times.');
INSERT INTO instructions (id, instruction) VALUES ('f0dce66f-feb3-4438-8d6b-77019fe9a99a', 'Lie back on a flat bench. Using a medium width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over you with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fab34abb-7530-4046-9ce2-77ab02d7bff5', 'From the starting position, breathe in and begin coming down slowly until the bar touches your middle chest.');
INSERT INTO instructions (id, instruction) VALUES ('98373535-2c66-4a42-b494-308877514f17', 'After a brief pause, push the bar back to the starting position as you breathe out. Focus on pushing the bar using your chest muscles. Lock your arms and squeeze your chest in the contracted position at the top of the motion, hold for a second and then start coming down slowly again. Tip: Ideally, lowering the weight should take about twice as long as raising it.');
INSERT INTO instructions (id, instruction) VALUES ('fdb38054-d39a-459b-9885-72e74187fc26', 'When you are done, place the bar back in the rack.');
INSERT INTO instructions (id, instruction) VALUES ('30ca7a82-d764-4cc2-b94f-f41fb53f2489', 'Stand up with your torso upright while holding a barbell at a shoulder-width grip. The palm of your hands should be facing forward and the elbows should be close to the torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5388f3f4-ba4b-4069-8523-c4b38220eb0a', 'While holding the upper arms stationary, curl the weights forward while contracting the biceps as you breathe out. Tip: Only the forearms should move.');
INSERT INTO instructions (id, instruction) VALUES ('d24ebd29-babe-403f-9bdf-a223cb3c1fbb', 'Continue the movement until your biceps are fully contracted and the bar is at shoulder level. Hold the contracted position for a second and squeeze the biceps hard.');
INSERT INTO instructions (id, instruction) VALUES ('30232024-264c-4fb2-8ab8-4761c47d471d', 'Slowly begin to bring the bar back to starting position as your breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('f235a8c7-ef42-4d2c-8dff-8ff314b46ef6', 'Lie against an incline bench, with your arms holding a barbell and hanging down in a horizontal line. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('88b0c599-67cf-479c-b0eb-0e9eff791e91', 'While keeping the upper arms stationary, curl the weight up as high as you can while squeezing the biceps. Breathe out as you perform this portion of the movement. Tip: Only the forearms should move. Do not swing the arms.');
INSERT INTO instructions (id, instruction) VALUES ('0f688dc2-4562-49f9-9264-c8f943fe8684', 'After a second contraction, slowly go back to the starting position as you inhale. Tip: Make sure that you go all of the way down.');
INSERT INTO instructions (id, instruction) VALUES ('bbc8b3f8-e859-465a-8768-31f39941fd2b', 'Stand in front of a loaded barbell.');
INSERT INTO instructions (id, instruction) VALUES ('1a8a2560-2605-4852-9c13-888eb971fc98', 'While keeping the back as straight as possible, bend your knees, bend forward and grasp the bar using a medium (shoulder width) overhand grip. This will be the starting position of the exercise. Tip: If it is difficult to hold on to the bar with this grip, alternate your grip or use wrist straps.');
INSERT INTO instructions (id, instruction) VALUES ('8d795bfc-bc07-4a3b-8d40-fb72a24d136e', 'While holding the bar, start the lift by pushing with your legs while simultaneously getting your torso to the upright position as you breathe out. In the upright position, stick your chest out and contract the back by bringing the shoulder blades back. Think of how the soldiers in the military look when they are in standing in attention.');
INSERT INTO instructions (id, instruction) VALUES ('139e2a14-0c47-436c-a78e-c5bed989e621', 'Go back to the starting position by bending at the knees while simultaneously leaning the torso forward at the waist while keeping the back straight. When the weights on the bar touch the floor you are back at the starting position and ready to perform another repetition.');
INSERT INTO instructions (id, instruction) VALUES ('8cdd7d0c-5b91-4891-90a0-03b83d7dbf28', 'Perform the amount of repetitions prescribed in the program.');
INSERT INTO instructions (id, instruction) VALUES ('aa300b47-cd35-4d9a-b59a-3516d7f65d4f', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack just above shoulder level. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('b1274cb9-b2e4-4d1f-9d1a-92cde88dee94', 'Hold on to the bar using both arms at each side and lift it off the rack by first pushing with your legs and at the same time straightening your torso.');
INSERT INTO instructions (id, instruction) VALUES ('3a61604a-e3e9-4ecd-a143-1a562e0a5fb7', 'Step away from the rack and position your legs using a shoulder-width medium stance with the toes slightly pointed out. Keep your head up at all times and maintain a straight back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('28ebd092-47a7-4ea5-980a-640a46155f94', 'Begin to slowly lower the bar by bending the knees and sitting back with your hips as you maintain a straight posture with the head up. Continue down until your hamstrings are on your calves. Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('cf045cf3-ce11-423f-9283-23e90d881158', 'Begin to raise the bar as you exhale by pushing the floor with the heel or middle of your foot as you straighten the legs and extend the hips to go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fd1efce7-dd0a-46fe-9d7e-99d4e6fa0c41', 'Begin seated on the ground with a loaded barbell over your legs. Using a fat bar or having a pad on the bar can greatly reduce the discomfort caused by this exercise. Roll the bar so that it is directly above your hips, and lay down flat on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('916f8a09-f383-4620-b5c0-d020ee7662f9', 'Begin the movement by driving through with your heels, extending your hips vertically through the bar. Your weight should be supported by your upper back and the heels of your feet.');
INSERT INTO instructions (id, instruction) VALUES ('b44543fb-3fb7-436c-aaca-0bacd1743ecd', 'Extend as far as possible, then reverse the motion to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('43145b73-5f49-4de8-9461-f9aceaa72970', 'Using a medium width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over your neck with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a1934f11-891f-4ce0-864a-9a593479e208', 'As you breathe in, bring the bar down slowly until it is about 1 inch from your neck.');
INSERT INTO instructions (id, instruction) VALUES ('6de2edc4-2edd-4d63-bd8e-e88f1b33ca32', 'After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles. Lock your arms and squeeze your chest in the contracted position, hold for a second and then start coming down slowly again. It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('69795227-ee36-44e4-9207-c722f5d1102b', 'Stand up straight while holding a barbell behind you at arms length and your feet at shoulder width. Tip: A shoulder width grip is best with the palms of your hands facing back. You can use wrist wraps for this exercise for a better grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('70eba790-5c78-4782-bbfe-737a5f90ba6f', 'While keeping your head and eyes up and back straight, squat until your upper thighs are parallel to the floor. Breathe in as you slowly go down.');
INSERT INTO instructions (id, instruction) VALUES ('65cb9e73-a5a8-4eda-b02a-edb2c0e2e2f0', 'Pressing mainly with the heel of the foot and squeezing the thighs, go back up as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('df05805e-39e2-49e4-9f3c-03682e07d77c', 'Begin seated on the ground with a bench directly behind you. Have a loaded barbell over your legs. Using a fat bar or having a pad on the bar can greatly reduce the discomfort caused by this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('2ce8b978-2cc7-474f-b453-c4c7834a5e88', 'Roll the bar so that it is directly above your hips, and lean back against the bench so that your shoulder blades are near the top of it.');
INSERT INTO instructions (id, instruction) VALUES ('e2093657-2875-4308-a03b-7ddbee01cc74', 'Begin the movement by driving through your feet, extending your hips vertically through the bar. Your weight should be supported by your shoulder blades and your feet. Extend as far as possible, then reverse the motion to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2ca1ce3c-919c-4c1c-9494-e6644be63f28', 'Lie back on an incline bench. Using a medium-width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over you with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('241c0168-e6d3-4d5d-8652-4b6028ae26ef', 'As you breathe in, come down slowly until you feel the bar on you upper chest.');
INSERT INTO instructions (id, instruction) VALUES ('61187856-f67d-4459-a7e5-2d05988165ee', 'After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles. Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly again. Tip: it should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('0c184d81-54a8-4097-ac36-6c6557aef8fa', 'Lie back on an Incline Bench. Using a medium width grip (a grip that is slightly wider than shoulder width), lift the bar from the rack and hold it straight over you with your arms straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a92be7b3-8502-440f-9b14-a19310e9f0e8', 'While keeping the arms straight, lift the bar by protracting your shoulder blades, raising the shoulders from the bench as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('00a9e54b-cb29-4583-ae76-aed72c1ec6a1', 'Bring back the bar to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('76508058-f888-4455-a9dc-96c43b95002c', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack just below shoulder level. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('3f832aae-4ff3-4bf0-9b51-43d4c9b07a8a', 'Step away from the rack and step forward with your right leg and squat down through your hips, while keeping the torso upright and maintaining balance. Inhale as you go down. Note: Do not allow your knee to go forward beyond your toes as you come down, as this will put undue stress on the knee joint. li>');
INSERT INTO instructions (id, instruction) VALUES ('d6c95aa3-30be-480a-9056-a3cd3eed9e1c', 'Using mainly the heel of your foot, push up and go back to the starting position as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('a017fdb3-8a82-45a8-b157-ae831c30b2e0', 'Repeat the movement for the recommended amount of repetitions and then perform with the left leg.');
INSERT INTO instructions (id, instruction) VALUES ('9f621dfe-b0c0-41dc-9b30-bb79b9266e2b', 'Stand up straight while holding a barbell using a wide (higher than shoulder width) and overhand (palms facing your body) grip.');
INSERT INTO instructions (id, instruction) VALUES ('8c398583-d6e2-463a-b482-9f5846026e02', 'Bend knees slightly and bend over as you keep the natural arch of your back. Let the arms hang in front of you as they hold the bar. Once your torso is parallel to the floor, flare the elbows out and away from your body. Tip: Your torso and your arms should resemble the letter "T". Now you are ready to begin the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('e5ababf7-b50c-44d9-9517-060266649d5b', 'While keeping the upper arms perpendicular to the torso, pull the barbell up towards your upper chest as you squeeze the rear delts and you breathe out. Tip: When performed correctly, this exercise should resemble a bench press in reverse. Also, refrain from using your biceps to do the work. Focus on targeting the rear delts; the arms should only act as hooks.');
INSERT INTO instructions (id, instruction) VALUES ('436de9a8-8b86-418d-8f74-88f73cede4cb', 'Slowly go back to the initial position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('b669c7ae-c1c8-4383-87e2-c7170a448876', 'Place a loaded barbell on the ground, near the end of a bench. Kneel with both legs on the bench, and take a medium to narrow grip on the barbell. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9a3cf27f-3751-4b9d-94d9-0289cb361d89', 'To begin, extend through the hips to slowly roll the bar forward. As you roll out, flex the shoulder to roll the bar above your head. Ensure that your arms remain extended throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('aff7ac7c-f4b6-42f8-9bdd-5c9fd5e05f39', 'When the bar has been moved as far forward as possible, return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6deca8e4-623b-463a-8c5b-1b9f854ed95c', 'Place a block about 12 inches in front of a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('a1bb1c79-718b-4ab5-ad8b-1dd6843ee4a7', 'Sit on the bench and place the ball of your feet on the block.');
INSERT INTO instructions (id, instruction) VALUES ('2c751e39-118f-4cbe-bae5-216c581c4142', 'Have someone place a barbell over your upper thighs about 3 inches above your knees and hold it there. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('95af9410-cbc4-4d2a-969a-b1cf61aa774c', 'Raise up on your toes as high as possible as you squeeze the calves and as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('786db745-4bdd-4f20-b339-0aa4ae2c6fc1', 'After a second contraction, slowly go back to the starting position. Tip: To get maximum benefit stretch your calves as far as you can.');
INSERT INTO instructions (id, instruction) VALUES ('6f4e9df1-9fd4-4b91-b7e3-d957612b13ca', 'Sit on a bench with back support in a squat rack. Position a barbell at a height that is just above your head. Grab the barbell with a pronated grip (palms facing forward).');
INSERT INTO instructions (id, instruction) VALUES ('8f36ab64-d024-4591-bf33-ee852287add6', 'Once you pick up the barbell with the correct grip width, lift the bar up over your head by locking your arms. Hold at about shoulder level and slightly in front of your head. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d1d5994d-383d-4973-8508-8a51b6f9a21e', 'Lower the bar down to the shoulders slowly as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('3e675a2b-bf96-459a-9c92-b6c2908e4d26', 'Lift the bar back up to the starting position as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('84ff376e-b34f-4590-b0f4-b116594858dd', 'Stand up straight with your feet at shoulder width as you hold a barbell with both hands in front of you using a pronated grip (palms facing the thighs). Tip: Your hands should be a little wider than shoulder width apart. You can use wrist wraps for this exercise for a better grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ad0c8d3d-e2bc-49d5-adfb-1d65e7b67f04', 'Raise your shoulders up as far as you can go as you breathe out and hold the contraction for a second. Tip: Refrain from trying to lift the barbell by using your biceps.');
INSERT INTO instructions (id, instruction) VALUES ('7c91264d-79c5-453b-bd09-b22f3b94baef', 'Slowly return to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('bf536678-6e82-44ee-a99c-2055eae2af39', 'Stand up straight with your feet at shoulder width as you hold a barbell with both hands behind your back using a pronated grip (palms facing back). Tip: Your hands should be a little wider than shoulder width apart. You can use wrist wraps for this exercise for better grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9e3de0a0-7f89-4c10-9fe2-1ff8b10c442d', 'Raise your shoulders up as far as you can go as you breathe out and hold the contraction for a second. Tip: Refrain from trying to lift the barbell by using your biceps. The arms should remain stretched out at all times.');
INSERT INTO instructions (id, instruction) VALUES ('cfb9d826-57cb-4d15-ab2a-4184b043be53', 'Stand up straight while holding a barbell placed on the back of your shoulders (slightly below the neck). Your feet should be shoulder width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a3923168-7f21-4d8c-9519-828d4e9faa2c', 'While keeping your back straight and your head up, bend only at the waist to the right as far as possible. Breathe in as you bend to the side. Then hold for a second and come back up to the starting position as you exhale. Tip: Keep the rest of the body stationary.');
INSERT INTO instructions (id, instruction) VALUES ('c1c3e109-c4a0-4a25-b620-071bb6a2fdf5', 'Now repeat the movement but bending to the left instead. Hold for a second and come back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2d2b931e-1be4-444c-a97b-386379539b89', 'Stand up straight while holding a barbell placed on the back of your shoulders (slightly below the neck). Your feet should be placed wide apart with the foot of the lead leg angled out to the side. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('457f4a33-87b8-4adb-ae98-6392808f3cf8', 'Lower your body towards the side of your angled foot by bending the knee and hip of your lead leg and while keeping the opposite leg only slightly bent. Breathe in as you lower your body.');
INSERT INTO instructions (id, instruction) VALUES ('23cd96f7-9ebe-432d-ae3e-6667da2d3ef1', 'Return to the starting position by extending the hip and knee of the lead leg. Breathe out as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('f44e30d9-e508-42ab-a31e-603ff6be2f3b', 'After performing the recommended amount of reps, repeat the movement with the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('43d20f85-ee01-4196-ada8-7f6f18022a4a', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack to just below shoulder level. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('7b4c749d-7786-49d7-808a-59ff2cc75c67', 'Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times and also maintain a straight back. This will be your starting position. (Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances discussed in the foot stances section).');
INSERT INTO instructions (id, instruction) VALUES ('cd9e380d-70ef-4cd0-b255-e56063f9dbab', 'Begin to slowly lower the bar by bending the knees and hips as you maintain a straight posture with the head up. Continue down until the angle between the upper leg and the calves becomes slightly less than 90-degrees. Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('89827661-8d74-4bd6-a12c-49a86bbc645a', 'Begin to raise the bar as you exhale by pushing the floor with the heel of your foot as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('765d62b5-9738-4189-94b7-477b51c3b584', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first place a flat bench or a box behind you. The flat bench is used to teach you to set your hips back and to hit depth.');
INSERT INTO instructions (id, instruction) VALUES ('be5515c4-270d-4ac2-81a4-0bf95de6d9ab', '');
INSERT INTO instructions (id, instruction) VALUES ('c556046a-3719-4b7c-b0f3-9133839334f2', 'Then, set the bar on a rack that best matches your height. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('ef9dd13d-27a8-4023-b908-958ae3b56609', 'Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times as looking down will get you off balance and also maintain a straight back. This will be your starting position. (Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances discussed in the foot stances section).');
INSERT INTO instructions (id, instruction) VALUES ('bbde0d9a-1a4b-4c85-a0cf-04a12acc31fd', 'Begin to slowly lower the bar by bending the knees and sitting your hips back as you maintain a straight posture with the head up. Continue down until you slightly touch the bench behind you. Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('30f3d148-6f49-4b51-a74d-51c8d89ab713', 'Begin to raise the bar as you exhale by pushing the floor with the heel of your foot as you straighten the legs and extend the hips to go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('21ea5ba7-0327-40f8-bb43-4e3d3ab14165', 'Stand up straight while holding a barbell placed on the back of your shoulders (slightly below the neck) and stand upright behind an elevated platform (such as the one used for spotting behind a flat bench). This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bfed8429-14f1-4664-96cc-39c53bc907d6', 'Place the right foot on the elevated platform. Step on the platform by extending the hip and the knee of your right leg. Use the heel mainly to lift the rest of your body up and place the foot of the left leg on the platform as well. Breathe out as you execute the force required to come up.');
INSERT INTO instructions (id, instruction) VALUES ('de0220a9-9b43-465a-94e7-42dfe448d756', 'Step down with the left leg by flexing the hip and knee of the right leg as you inhale. Return to the original standing position by placing the right foot of to next to the left foot on the initial position.');
INSERT INTO instructions (id, instruction) VALUES ('39f5fd0e-9775-48c0-b13c-e47e88a36f7f', 'Repeat with the right leg for the recommended amount of repetitions and then perform with the left leg.');
INSERT INTO instructions (id, instruction) VALUES ('43d9f205-43fe-48d0-bb4a-63fe72eb1125', 'Begin standing with your feet shoulder width apart and a barbell across your upper back.');
INSERT INTO instructions (id, instruction) VALUES ('4e6478af-058a-499f-8ab7-ec5f84aa956d', 'Step forward with one leg, flexing the knees to drop your hips. Descend until your rear knee nearly touches the ground. Your posture should remain upright, and your front knee should stay above the front foot.');
INSERT INTO instructions (id, instruction) VALUES ('4a5324a5-1e56-4dc6-be76-6018934e94b9', 'Drive through the heel of your lead foot and extend both knees to raise yourself back up.');
INSERT INTO instructions (id, instruction) VALUES ('c6384f55-7498-4399-a9ea-b650e251642a', 'Step forward with your rear foot, repeating the lunge on the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('6d75dbb1-fcfd-4a0d-853d-e96f6905214c', 'For this exercise you will need a heavy rope anchored at its center 15-20 feet away. Standing in front of the rope, take an end in each hand with your arms extended at your side. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0d1867c7-07bc-4e54-9488-10999fb004e8', 'Initiate the movement by rapidly raising one arm to shoulder level as quickly as you can.');
INSERT INTO instructions (id, instruction) VALUES ('8e69579e-8bc1-4261-8f0e-30230ccff21a', 'As you let that arm drop to the starting position, raise the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('6baf8358-4a19-4309-975a-6e2af8d1d526', 'Continue alternating your left and right arms, whipping the ropes up and down as fast as you can.');
INSERT INTO instructions (id, instruction) VALUES ('f195dba6-3c9e-4f13-befc-dddd9a178a52', 'Wearing either a harness or a loose weight belt, attach the chain to the back so that you will be facing away from the sled. Bend down so that your hands are on the ground. Your back should be flat and knees bent. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6401bc06-90fb-41d0-beef-1e874a3f4305', 'Begin by driving with legs, alternating left and right. Use your hands to maintain balance and to help pull. Try to keep your back flat as you move over a given distance.');
INSERT INTO instructions (id, instruction) VALUES ('e4a7ac33-138a-4c24-8eb7-c7958f381954', 'Sit upright on the floor with your partner behind you.');
INSERT INTO instructions (id, instruction) VALUES ('3416658e-3651-4f8c-8f0f-1641c13ef07f', 'Place your hands behind your hand, and push your elbows back as far as you can. Your partner should hold your elbows. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b9fb4595-e9e6-419d-baa0-ac97bc5c0471', 'Gently attempt to pull your elbows forward with your hands still behind your head for 10 or more seconds. Your partner should prevent your elbows from moving.');
INSERT INTO instructions (id, instruction) VALUES ('0b96f131-66db-4983-acaf-a7b11936704b', 'Now, relax your muscles and have your partner gently pull the elbows back as far as it comfortable for you. Be sure to let your partner know when the stretch is adequate to prevent overstretching or injury.');
INSERT INTO instructions (id, instruction) VALUES ('8499e461-4d3d-4712-aafb-3bfaf364ebdd', 'For this exercise you will need to place a bench behind your back. With the bench perpendicular to your body, and while looking away from it, hold on to the bench on its edge with the hands fully extended, separated at shoulder width. The legs will be extended forward, bent at the waist and perpendicular to your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b92d44c1-59fb-4124-ad15-94b5ce711566', 'Slowly lower your body as you inhale by bending at the elbows until you lower yourself far enough to where there is an angle slightly smaller than 90 degrees between the upper arm and the forearm. Tip: Keep the elbows as close as possible throughout the movement. Forearms should always be pointing down.');
INSERT INTO instructions (id, instruction) VALUES ('e3aea0fc-97d4-42d6-a4d7-34ef7ae1e231', 'Using your triceps to bring your torso up again, lift yourself back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('568a9daf-f0d1-43aa-9ba3-0692a1bc0edd', 'Begin with a box or bench 1-2 feet in front of you. Stand with your feet shoulder width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('78c9d89d-46c9-49fb-bb0a-8fa6dacd1ee3', 'Perform a short squat in preparation for the jump; swing your arms behind you.');
INSERT INTO instructions (id, instruction) VALUES ('a9cd682d-2e16-42a4-9242-ea95a1f944e9', 'Rebound out of this position, extending through the hips, knees, and ankles to jump as high as possible. Swing your arms forward and up.');
INSERT INTO instructions (id, instruction) VALUES ('35cdd9f8-88b0-4a53-99b4-c17e96ee5590', 'Jump over the bench, landing with the knees bent, absorbing the impact through the legs.');
INSERT INTO instructions (id, instruction) VALUES ('22d27de2-87a8-4cab-92c0-1aea24140c9f', 'Turn around and face the opposite direction, then jump back over the bench.');
INSERT INTO instructions (id, instruction) VALUES ('a7e410ce-0369-4e22-af2b-a2c3987c7792', 'Begin by lying on the bench, getting your head beyond the bar if possible. Tuck your feet underneath you and arch your back. Using the bar to help support your weight, lift your shoulder off the bench and retract them, squeezing the shoulder blades together. Use your feet to drive your traps into the bench. Maintain this tight body position throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('cef3c3e2-9d16-4552-b5c0-4ca1c4c76595', 'However wide your grip, it should cover the ring on the bar. Pull the bar out of the rack without protracting your shoulders. Focus on squeezing the bar and trying to pull it apart.');
INSERT INTO instructions (id, instruction) VALUES ('641130c0-ab2e-4d17-905d-7a929c761d33', 'Lower the bar to your lower chest or upper stomach. The bar, wrist, and elbow should stay in line at all times.');
INSERT INTO instructions (id, instruction) VALUES ('c9f65b5c-622d-489d-894b-11f3a0908c1f', 'Pause when the barbell touches your torso, and then drive the bar up with as much force as possible. The elbows should be tucked in until lockout.');
INSERT INTO instructions (id, instruction) VALUES ('ffb6308a-c413-4ddd-b5af-114d110fecbc', 'Using a flat bench secure a band under the leg of the bench that is nearest to your head.');
INSERT INTO instructions (id, instruction) VALUES ('dc1a9c1c-405b-4153-a3c9-8527032b4075', 'Once the band is secure, grab it by both handles and lie down on the bench.');
INSERT INTO instructions (id, instruction) VALUES ('9fa9c435-5b33-4a3e-9c22-b02ece7e02f3', 'Extend your arms so that you are holding the band handles in front of you at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('4200dc17-5f39-42b4-b2fd-7937ba771fcc', 'Once at shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7aa258e6-c9bb-484c-be99-d1ac5fc18a1c', 'Bring down the handles slowly until your elbow forms a 90 degree angle. Keep full control at all times.');
INSERT INTO instructions (id, instruction) VALUES ('0645a61d-a0b3-427e-8ffa-9d187125fbb2', 'As you breathe out, bring the handles up using your pectoral muscles. Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly. Tip: It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('9fd0a33c-6583-4e40-8198-2c748cb08af4', 'Repeat the movement for the prescribed amount of repetitions of your training program.');
INSERT INTO instructions (id, instruction) VALUES ('ddc3fa87-4625-4470-a4aa-cd92402e130f', 'Adjust the leader chain, shortening it to the desired length.Place the chains on the sleeves of the bar.');
INSERT INTO instructions (id, instruction) VALUES ('1cbadfe1-fd0f-476c-8013-691b97b411cd', 'Lying on the bench, get your head beyond the bar if possible. Tuck your feet underneath you and arch your back. Using the bar to help support your weight, lift your shoulder off the bench and retract them, squeezing the shoulder blades together. Use your feet to drive your traps into the bench. Maintain this tight body position throughout the movement. However wide your grip, it should cover the ring on the bar.');
INSERT INTO instructions (id, instruction) VALUES ('88f3038b-20f7-40c8-afb1-a0a6a2ebb745', 'Pull the bar out of the rack without protracting your shoulders. Focus on squeezing the bar and trying to pull it apart. Lower the bar to your lower chest or upper stomach. The bar, wrist, and elbow should stay in line at all times.');
INSERT INTO instructions (id, instruction) VALUES ('4062f803-0473-48d2-8ee8-daca9c293308', 'Stand on the ground with one foot resting on a bench or box with your heel close to the edge.');
INSERT INTO instructions (id, instruction) VALUES ('69fd3311-bce7-48f1-be76-870ddd5142b4', 'Push off with your foot on top of the bench, extending through the hip and knee.');
INSERT INTO instructions (id, instruction) VALUES ('9f535913-145b-4db5-b680-3ce809562ba2', 'Land with the opposite foot on top of the box, returning your other foot back to the start position.');
INSERT INTO instructions (id, instruction) VALUES ('3055380c-249e-4920-98b4-2aeb3d96305f', 'Continue alternating from one foot to another to complete the set.');
INSERT INTO instructions (id, instruction) VALUES ('615e5a73-f604-4dfe-97ed-218b3ac5a4c2', 'Lie on a flat bench with a barbell using a shoulder grip width.');
INSERT INTO instructions (id, instruction) VALUES ('8a350879-8b3e-4ffa-bd21-fbf5a0847e37', 'Hold the bar straight over your chest with a bend in your arms. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0d686609-01a3-4375-b30e-d8349814f500', 'While keeping your arms in the bent arm position, lower the weight slowly in an arc behind your head while breathing in until you feel a stretch on the chest.');
INSERT INTO instructions (id, instruction) VALUES ('fb748b7a-1c4d-4a91-bf93-45430a800264', 'At that point, bring the barbell back to the starting position using the arc through which the weight was lowered and exhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('54a3a0a4-cffb-439f-93d3-e4173a3559a4', 'Hold the weight on the initial position for a second and repeat the motion for the prescribed number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('47b7eea0-0c86-49a3-a8d8-1c00c8280842', 'Place a dumbbell standing up on a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('f2719241-2fa4-4f19-a3f2-962d86707c2f', 'Ensuring that the dumbbell stays securely placed at the top of the bench, lie perpendicular to the bench (torso across it as in forming a cross) with only your shoulders lying on the surface. Hips should be below the bench and legs bent with feet firmly on the floor. The head will be off the bench as well.');
INSERT INTO instructions (id, instruction) VALUES ('93728b7a-38eb-464c-82c1-46796c8bf40f', 'Grasp the dumbbell with both hands and hold it straight over your chest with a bend in your arms. Both palms should be pressing against the underside one of the sides of the dumbbell. This will be your starting position. Caution: Always ensure that the dumbbell used for this exercise is secure. Using a dumbbell with loose plates can result in the dumbbell falling apart and falling on your face.');
INSERT INTO instructions (id, instruction) VALUES ('3e9a49b2-6bee-4b65-9633-e3b115f5c551', 'While keeping your arms locked in the bent arm position, lower the weight slowly in an arc behind your head while breathing in until you feel a stretch on the chest.');
INSERT INTO instructions (id, instruction) VALUES ('a395b94a-fbe2-47d7-954e-ddf719b8119b', 'At that point, bring the dumbbell back to the starting position using the arc through which the weight was lowered and exhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('4f0f1ce6-d485-4f3a-af39-929159f442c2', 'Lay flat on the floor with your arms next to your sides.');
INSERT INTO instructions (id, instruction) VALUES ('e948e5d7-9640-4fb0-99b7-3b667ff2ea58', 'Now bend your knees at around a 75 degree angle and lift your feet off the floor by around 2 inches.');
INSERT INTO instructions (id, instruction) VALUES ('4c80a2fb-7eae-43e6-afc4-be233aaeac9d', 'Using your lower abs, bring your knees in towards you as you maintain the 75 degree angle bend in your legs. Continue this movement until you raise your hips off of the floor by rolling your pelvis backward. Breathe out as you perform this portion of the movement. Tip: At the end of the movement your knees will be over your chest.');
INSERT INTO instructions (id, instruction) VALUES ('ef320dd0-0877-487e-a23c-39a4813aa69c', 'Squeeze your abs at the top of the movement for a second and then return to the starting position slowly as you breathe in. Tip: Maintain a controlled motion at all times.');
INSERT INTO instructions (id, instruction) VALUES ('47601fa0-562a-4e94-827e-e90de2b56c67', 'Holding a barbell with a pronated grip (palms facing down), bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Tip: Make sure that you keep the head up. The barbell should hang directly in front of you as your arms hang perpendicular to the floor and your torso. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5f02fe3d-a81b-41bb-aa60-029ed88f1555', 'Now, while keeping the torso stationary, breathe out and lift the barbell to you. Keep the elbows close to the body and only use the forearms to hold the weight. At the top contracted position, squeeze the back muscles and hold for a brief pause.');
INSERT INTO instructions (id, instruction) VALUES ('037e0ccc-9ce8-4d55-af37-169ad2613630', 'Then inhale and slowly lower the barbell back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('24f64e42-916e-47e7-a70d-08a1e7ea38ff', 'Stand up straight while holding a dumbbell in each hand and with an incline bench in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('03762138-9980-4601-a663-e460d4898f0c', 'While keeping your back straight and maintaining the natural arch of your back, lean forward until your forehead touches the bench in front of you. Let the arms hang in front of you perpendicular to the ground. The palms of your hands should be facing each other and your torso should be parallel to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('364541fa-c5d5-4dfa-8db5-204d443aa36a', 'Keeping your torso forward and stationary, and the arms straight with a slight bend at the elbows, lift the dumbbells straight to the side until both arms are parallel to the floor. Exhale as you lift the weights. Caution: avoid swinging the torso or bringing the arms back as opposed to the side.');
INSERT INTO instructions (id, instruction) VALUES ('5eab375d-16f4-4002-93cb-b0df8eaa0055', 'After a one second contraction at the top, slowly lower the dumbbells back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('06e01fe9-04c7-4e84-88ba-8cb35c732bfd', 'Repeat the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('c6029a4d-747e-401a-b567-19b7caedd00e', 'Select a weight and hold the handle of the low pulley with your right hand.');
INSERT INTO instructions (id, instruction) VALUES ('fd83169d-5228-4c86-92c0-fab05628cd6d', 'Bend at the waist until your torso is nearly parallel to the floor. Your legs should be slightly bent with your left hand placed on your lower left thigh. Your right arm should be hanging from your shoulder in front of you and with a slight bend at the elbow. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fcff9575-9ec4-44f5-b64f-e398e5fb433c', 'Raise your right arm, elbow slightly bent, to the side until the arm is parallel to the floor and in line with your right ear. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('7e00c8fb-0783-4179-acc5-8b02a349d762', 'Slowly lower the weight back to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('f3287c5f-8818-4c6e-afc3-81b06ec1859b', 'Repeat for the recommended amount of repetitions and repeat the movement with the other arm.');
INSERT INTO instructions (id, instruction) VALUES ('57ba90c1-6832-4b36-898f-4519b9019af0', 'Put weight on one of the ends of an Olympic barbell. Make sure that you either place the other end of the barbell in the corner of two walls; or put a heavy object on the ground so the barbell cannot slide backward.');
INSERT INTO instructions (id, instruction) VALUES ('cfaefaa7-d2c7-4de1-aeb2-f08bd5b83224', 'Bend forward until your torso is as close to parallel with the floor as you can and keep your knees slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('e6cd7344-1293-4009-9101-9dd25efd9af6', 'Now grab the bar with one arm just behind the plates on the side where the weight was placed and put your other hand on your knee. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5bb54053-b7d2-442c-9c9c-d841d588fc78', 'Pull the bar straight up with your elbow in (to maximize back stimulation) until the plates touch your lower chest. Squeeze the back muscles as you lift the weight up and hold for a second at the top of the movement. Breathe out as you lift the weight. Tip: Do not allow for any swinging of the torso. Only the arm should move.');
INSERT INTO instructions (id, instruction) VALUES ('79d8a4bf-d87d-4a74-ad05-101e817bae7a', 'Slowly lower the bar to the starting position getting a nice stretch on the lats. Tip: Do not let the plates touch the floor. To ensure the best range of motion, I recommend using small plates (25-lb ones) as opposed to larger plates (like 35-45lb ones).');
INSERT INTO instructions (id, instruction) VALUES ('14731a5b-2694-4dbc-9a07-6fe33fd6ef7c', 'Repeat for the recommended amount of repetitions and switch arms.');
INSERT INTO instructions (id, instruction) VALUES ('5f4fbe7a-e2aa-4844-8752-e4f31b834fab', 'Now grab the bar with both arms just behind the plates on the side where the weight was placed and put your other hand on your knee. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('735f680c-70e9-46c6-bd34-3ede07e64b2a', 'Pull the bar straight up with your elbows in (to maximize back stimulation) until the plates touch your lower chest. Squeeze the back muscles as you lift the weight up and hold for a second at the top of the movement. Breathe out as you lift the weight. Tip: Use a stirrup or double handle cable attachment by hooking it under the end of the bar.');
INSERT INTO instructions (id, instruction) VALUES ('e7102e58-9be1-4281-adc4-77dbcc62defe', 'With a dumbbell in each hand (palms facing your torso), bend your knees slightly and bring your torso forward by bending at the waist; as you bend make sure to keep your back straight until it is almost parallel to the floor. Tip: Make sure that you keep the head up. The weights should hang directly in front of you as your arms hang perpendicular to the floor and your torso. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1b6c1bd3-41d1-4aba-b4ef-77ac12dfbdf4', 'While keeping the torso stationary, lift the dumbbells to your side (as you breathe out), keeping the elbows close to the body (do not exert any force with the forearm other than holding the weights). On the top contracted position, squeeze the back muscles and hold for a second.');
INSERT INTO instructions (id, instruction) VALUES ('5043b0b5-9d04-4f6b-80dc-a4bf669855d7', 'Slowly lower the weight again to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('75dd57aa-333e-4a94-851f-ba883f4c6492', 'With a dumbbell in each hand (palms facing each other), bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Tip: Make sure that you keep the head up. The weights should hang directly in front of you as your arms hang perpendicular to the floor and your torso. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f80f8d58-231f-449e-b93d-7e9dfd80eec6', 'While keeping the torso stationary, lift the dumbbells to your side as you breathe out, squeezing your shoulder blades together. On the top contracted position, squeeze the back muscles and hold for a second.');
INSERT INTO instructions (id, instruction) VALUES ('c517b9b8-a24f-4ba8-b065-17ecfe25037d', 'Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulders by extending through the legs and hips as you raise the kettlebell towards your shoulder. The wrist should rotate as you do so. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8c6a2107-378a-45ee-9ea8-ad3bf9c05f21', 'Begin my leaning to the side opposite the kettlebell, continuing until you are able to touch the ground with your free hand, keeping your eyes on the kettlebell. As you do so, press the weight vertically be extending through the elbow, keeping your arm perpendicular to the ground.');
INSERT INTO instructions (id, instruction) VALUES ('54834199-7538-4d60-b4ed-7695a6e59c7e', 'Return to an upright position, with the kettlebell above your head. Return the kettlebell to the shoulder and repeat for the desired number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('aeaeaaa9-17ff-4496-afb9-fd66758d2eb8', 'To begin, seat yourself on the bike and adjust the seat to your height.');
INSERT INTO instructions (id, instruction) VALUES ('576578c0-6c6c-49cb-92b8-370b1eb3abb0', 'Select the desired option from the menu. You may have to start pedaling to turn it on. You can use the manual setting, or you can select a program to use. Typically, you can enter your age and weight to estimate the amount of calories burned during exercise. The level of resistance can be changed throughout the workout. The handles can be used to monitor your heart rate to help you stay at an appropriate intensity.');
INSERT INTO instructions (id, instruction) VALUES ('fcf91559-90a5-4d8d-a716-e158ac734b35', 'Begin by lying on the bench, getting your head beyond the bar if possible. One to five boards, made out of 2x6''s, can be screwed together and held in place by a training partner, bands, or just tucked under your shirt.');
INSERT INTO instructions (id, instruction) VALUES ('12e27dbd-c18b-4e19-b52a-eb658d21cada', 'Tuck your feet underneath you and arch your back. Using the bar to help support your weight, lift your shoulder off the bench and retract them, squeezing the shoulder blades together. Use your feet to drive your traps into the bench. Maintain this tight body position throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d0ab1010-e4c7-4552-adf0-b4c80ce1a951', 'You can take a standard bench grip, or shoulder width to focus on the triceps. Pull the bar out of the rack without protracting your shoulders. The bar, wrist, and elbow should stay in line at all times. Focus on squeezing the bar and trying to pull it apart.');
INSERT INTO instructions (id, instruction) VALUES ('69689404-cf27-4dc1-8157-5e39b43af9d8', 'Lower the bar to the boards, and then drive the bar up with as much force as possible. The elbows should be tucked in until lockout.');
INSERT INTO instructions (id, instruction) VALUES ('5f11b0c3-ab51-4ec8-aff2-7db3cef1186f', 'Assume a plank position on the ground. You should be supporting your bodyweight on your toes and forearms, keeping your torso straight. Your forearms should be shoulder-width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5152ece2-eb9b-4e52-a42b-5502df9ed8a2', 'Pressing your palms firmly into the ground, extend through the elbows to raise your body from the ground. Keep your torso rigid as you perform the movement.');
INSERT INTO instructions (id, instruction) VALUES ('ad4e0b9e-d210-4990-b065-bfc0b83571de', 'Slowly lower your forearms back to the ground by allowing the elbows to flex.');
INSERT INTO instructions (id, instruction) VALUES ('8f960351-56a8-45d0-906b-25554f95ec10', 'Repeat.');
INSERT INTO instructions (id, instruction) VALUES ('3dd66fe2-3286-43ca-8c12-3a582d6a2e19', 'Position a bar in a rack at chest height.');
INSERT INTO instructions (id, instruction) VALUES ('cf6ebce7-b005-4a04-b992-dcdc33d79355', 'Standing, take a shoulder width grip on the bar and step a yard or two back, feet together and arms extended so that you are leaning on the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('61c53f62-b35e-4208-9caf-6abdb3dbfaae', 'Begin by flexing the elbow, lowering yourself towards the bar.');
INSERT INTO instructions (id, instruction) VALUES ('8ce5df13-cd1c-442c-9a84-a6dc9024346b', 'Pause, and then reverse the motion by extending the elbows.');
INSERT INTO instructions (id, instruction) VALUES ('a2ae8fba-dded-47c1-9522-8765826d41a1', 'Progress from bodyweight by adding chains over your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('276bc7f2-3f34-4c92-89e6-fb24940066fd', 'Position two equally loaded EZ bars on the ground next to each other. Ensure they are able to roll.');
INSERT INTO instructions (id, instruction) VALUES ('e0a19604-2101-4ade-85be-ab35b215ea39', 'Assume a push-up position over the bars, supporting your weight on your toes and hands with your arms extended and body straight.');
INSERT INTO instructions (id, instruction) VALUES ('6d8ed78e-6087-4712-9016-468f20aa6644', 'Place your hands on the bars. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('49d74433-ce76-473f-b78d-04d3da1ea7b6', 'Using a slow and controlled motion, move your hands away from the midline of your body, rolling the bars apart. Inhale during this portion of the motion.');
INSERT INTO instructions (id, instruction) VALUES ('870332da-7ba8-46a0-8f51-84f2c92049bd', 'After moving the bars as far apart as you can, return to the starting position by pulling them back together. Exhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('3af70017-a9f0-496d-8747-6d9a46b47660', 'Begin by taking a medium to wide grip on a pull-up apparatus with your palms facing away from you. From a hanging position, tuck your knees to your chest, leaning back and getting your legs over your side of the pull-up apparatus. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9830356b-546f-4d9b-9a9b-d9ede38056a3', 'Beginning with your arms straight, flex the elbows and retract the shoulder blades to raise your body up until your legs contact the pull-up apparatus.');
INSERT INTO instructions (id, instruction) VALUES ('fda67182-4753-46b8-bdd6-bc84edbcb74e', 'Stand with your feet shoulder width apart. You can place your hands behind your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4f8b77f8-ae83-45d4-9cc4-df87d9b81a3d', 'Begin the movement by flexing your knees and hips, sitting back with your hips.');
INSERT INTO instructions (id, instruction) VALUES ('110f84ee-d8cb-4bce-8b84-ffbd8d6564e8', 'Continue down to full depth if you are able,and quickly reverse the motion until you return to the starting position. As you squat, keep your head and chest up and push your knees out.');
INSERT INTO instructions (id, instruction) VALUES ('de818666-5027-43f9-a7d6-9c55c5f676e2', 'Begin standing with your feet shoulder width apart and your hands on your hips.');
INSERT INTO instructions (id, instruction) VALUES ('4bf803be-182c-48b8-b68a-2a650470da05', 'Connect a standard handle to each arm of a cable machine, and position them in the most downward position.');
INSERT INTO instructions (id, instruction) VALUES ('a94df53d-be71-421b-b16a-7c952b5e1337', 'Grab a Bosu Ball and position it in front and center of the cable machine.');
INSERT INTO instructions (id, instruction) VALUES ('09955a08-c955-445c-b597-4d5d304a1315', 'Lie down on the Bosu Ball with the small of your back arched around the ball. Your rear end should be close to the floor without touching it.');
INSERT INTO instructions (id, instruction) VALUES ('42bdcf7d-4aae-4f46-a045-0809fdcb7e5a', 'With both hands, reach back and grab the handle of each cable.');
INSERT INTO instructions (id, instruction) VALUES ('e80ca7e8-0009-4f75-b571-0b3c23cee967', 'With your feet positioned in a wide stance, extend your arms straight out in front of you and in between your knees. Your hands should be at knee level.');
INSERT INTO instructions (id, instruction) VALUES ('76796202-db76-4d06-9699-4686dd25124d', 'Keep your arms straight and in-line with the upward angle of the cable. Elevate your torso in a crunching motion without dropping or bending your arms.');
INSERT INTO instructions (id, instruction) VALUES ('088217f0-a9cd-45ae-9e24-357f1ce40e4e', 'Maintain the rigid position with your arms. Slowly descend back to the starting position with your back arched around the Bosu Ball and your abdominals elongated.');
INSERT INTO instructions (id, instruction) VALUES ('6948e282-88f4-47e5-8f55-6bc78ca254d8', 'Repeat the same series of movements to failure.');
INSERT INTO instructions (id, instruction) VALUES ('6cc4e377-06c1-456d-ab1a-50ed33a40d78', 'Once you reach failure, keep your abs tight and raise your torso into plank position so your back is elevated off the Bosu Ball.');
INSERT INTO instructions (id, instruction) VALUES ('b94c8ff3-e1b9-4f11-98e3-0f71be5d25e0', 'Lower your arms down to your side; keep them straight. Start doing alternating side bends; reach for your heels! This finishing movement will focus on your obliques.');
INSERT INTO instructions (id, instruction) VALUES ('b0c3b95d-6ae7-4b0e-9990-faf2f88b56ca', 'Initiate the exercise by standing upright with a kettlebell in one hand.');
INSERT INTO instructions (id, instruction) VALUES ('e0f35aa3-3d55-4516-aecc-f9c828f76f0c', 'Swing the kettlebell back forcefully and then reverse the motion forcefully. Crush the kettlebell handle as hard as possible and raise the kettlebell to your shoulder.');
INSERT INTO instructions (id, instruction) VALUES ('546bea48-dcb8-4e73-92c4-bfa6fca0d9a6', 'Begin by lying on your back on the ground. Your legs should be straight and your arms at your side. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cc36e623-d1e6-4f06-99aa-cacaa5fea831', 'To perform the movement, tuck the knees toward your chest by flexing the hips and knees. Following this, extend your legs directly above you so that they are perpendicular to the ground. Rotate and elevate your pelvis to raise your glutes from the floor.');
INSERT INTO instructions (id, instruction) VALUES ('982effee-0317-4cd4-81cb-6f72888150b2', 'Assume a relaxed stance facing the box or platform approximately an arm''s length away. Arms should be down at the sides and legs slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('f707037e-aac4-4bb2-b835-6869f6500a27', 'Using the arms to aid in the initial burst, jump upward and forward, landing with feet simultaneously on top of the box or platform.');
INSERT INTO instructions (id, instruction) VALUES ('e15eeae6-7c53-40cb-8159-4aab914257c1', 'Immediately drop or jump back down to the original starting place; then repeat the sequence.');
INSERT INTO instructions (id, instruction) VALUES ('93f61198-ea69-4d02-9543-4b36e6ffec19', 'You will need several boxes lined up about 8 feet apart.');
INSERT INTO instructions (id, instruction) VALUES ('d35bdc5c-1e68-4b22-8ee2-4813038e8db7', 'Begin facing the first box with one leg slightly behind the other.');
INSERT INTO instructions (id, instruction) VALUES ('238d25ac-d3a5-4734-b9ef-7ad101078517', 'Drive off the back leg, attempting to gain as much height with the hips as possible.');
INSERT INTO instructions (id, instruction) VALUES ('add59643-4cea-4b59-934f-e8ff595ad8af', 'Immediately upon landing on the box, drive the other leg forward and upward to gain height and distance, leaping from the box. Land between the first two boxes with the same leg that landed on the first box.');
INSERT INTO instructions (id, instruction) VALUES ('dd38f2e4-dd4c-4c86-9a90-98afef2ee229', 'Then, step to the next box and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('b8c4687a-9f2c-45c4-86ab-83f59fe9947d', 'The box squat allows you to squat to desired depth and develop explosive strength in the squat movement. Begin in a power rack with a box at the appropriate height behind you. Typically, you would aim for a box height that brings you to a parallel squat, but you can train higher or lower if desired.');
INSERT INTO instructions (id, instruction) VALUES ('da409afa-541a-4772-9f53-524bf9093c04', 'Begin by stepping under the bar and placing it across the back of the shoulders. Squeeze your shoulder blades together and rotate your elbows forward, attempting to bend the bar across your shoulders. Remove the bar from the rack, creating a tight arch in your lower back, and step back into position. Place your feet wider for more emphasis on the back, glutes, adductors, and hamstrings, or closer together for more quad development. Keep your head facing forward.');
INSERT INTO instructions (id, instruction) VALUES ('bfcfbea5-d928-46f5-8339-b309641661c8', 'With your back, shoulders, and core tight, push your knees and butt out and you begin your descent. Sit back with your hips until you are seated on the box. Ideally, your shins should be perpendicular to the ground. Pause when you reach the box, and relax the hip flexors. Never bounce off of a box.');
INSERT INTO instructions (id, instruction) VALUES ('44027da5-a830-406f-a630-3a3375c66cd8', 'Keeping the weight on your heels and pushing your feet and knees out, drive upward off of the box as you lead the movement with your head. Continue upward, maintaining tightness head to toe.');
INSERT INTO instructions (id, instruction) VALUES ('108b2298-9c76-4d7c-aa8a-80e09037376b', 'Begin in a power rack with a box at the appropriate height behind you. Set up the bands on the sleeves, secured to either band pegs, the rack, or dumbbells so that there is appropriate tension. If dumbbells are used, secure them so that they don''t move. Also, ensure that the dumbbells you are using are heavy enough for the bands that you are using. Additional plates can be used to hold the dumbbells down. If more tension is needed, you can either widen the base on the floor or choke the bands. Typically, you would aim for a box height that brings you to a parallel squat, but you can train higher or lower if desired.');
INSERT INTO instructions (id, instruction) VALUES ('acdbac72-a3f0-475a-9aaf-0a741548c003', 'Keeping the weight on your heels and pushing your feet and knees out, drive upward off of the box as you lead the movement with your head. Continue upward, maintaining tightness head to toe. Use care to return the barbell to the rack.');
INSERT INTO instructions (id, instruction) VALUES ('c0e2df17-1947-499b-b20d-c3033c11757c', 'Begin in a power rack with a box at the appropriate height behind you. Typically, you would aim for a box height that brings you to a parallel squat, but you can train higher or lower if desired.');
INSERT INTO instructions (id, instruction) VALUES ('10654d33-61fb-4fdc-a2d7-68a403ad673a', 'To set up the chains, begin by looping the leader chain over the sleeves of the bar. The heavy chain should be attached using a snap hook. Adjust the length of the lead chain so that a few links are still on the floor at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('36793484-fbd6-4340-b760-b72fa220399f', 'Lie on your side, with your upper arm against the foam roller. The upper arm should be more or less aligned with your body, with the outside of the bicep pressed against the foam roller.');
INSERT INTO instructions (id, instruction) VALUES ('57578c7d-3431-45b6-9e68-2f1f2e8b95ff', 'Raise your hips off of the floor, supporting your weight on your arm and on your feet. Hold for 10-30 seconds, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('209bff0b-2abf-4f52-bae6-6410365f3320', 'Sit on a Military Press Bench with a bar at shoulder level with a pronated grip (palms facing forward). Tip: Your grip should be wider than shoulder width and it should create a 90-degree angle between the forearm and the upper arm as the barbell goes down. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6ee89f92-5e2b-44e5-8c60-022644edff41', 'Once you pick up the barbell with the correct grip, lift the bar up over your head by locking your arms.');
INSERT INTO instructions (id, instruction) VALUES ('42ff0920-4c12-47df-a92a-4fceaac90c75', 'Now lower the bar down to the back of the head slowly as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('86b3b1b5-1420-4b40-beee-8f3a37d6a1c8', 'Lower the bar down to the starting position slowly as you inhale. This is one repetition.');
INSERT INTO instructions (id, instruction) VALUES ('f583aac2-dcbc-4d14-80ec-d79457252478', 'Alternate in this manner until you complete the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('f8738d64-7639-4771-84e4-d18733375541', 'Begin a pushup position but with your elbows on the ground and resting on your forearms. Your arms should be bent at a 90 degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('95bc5591-6bd6-41e3-8c48-7432688e4c73', 'Arch your back slightly out rather than keeping your back completely straight.');
INSERT INTO instructions (id, instruction) VALUES ('62fdaf6d-496d-4ae3-9fca-d1d8a07e1520', 'Raise your glutes toward the ceiling, squeezing your abs tightly to close the distance between your ribcage and hips. The end result will be that you''ll end up in a high bridge position. Exhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('dca006cf-486b-461e-a435-766c245a6f50', 'Lower back down slowly to your starting position as you breathe in. Tip: Don''t let your back sag downwards.');
INSERT INTO instructions (id, instruction) VALUES ('ad5ab612-58e5-441c-8c91-3af29ceaab62', 'Lie flat on the floor on your back with the hands by your side and your knees bent. Your feet should be placed around shoulder width. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f6ed57da-4afd-4eb2-b121-eaf2a6c3b38d', 'Pushing mainly with your heels, lift your hips off the floor while keeping your back straight. Breathe out as you perform this part of the motion and hold at the top for a second.');
INSERT INTO instructions (id, instruction) VALUES ('8e04daf9-faf5-4305-9914-dbcaa96734d7', 'Slowly go back to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('1f402caf-3cd6-4437-841e-d92f66c446dc', 'Sit on the machine with your back flat on the pad.');
INSERT INTO instructions (id, instruction) VALUES ('35f7d529-3a22-4840-bfe2-dae8544c8610', 'Take hold of the handles. Tip: Your upper arms should be positioned parallel to the floor; adjust the machine accordingly. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fe2faaa3-a3cb-464d-927d-f1e60f3ae2a9', 'Push the handles together slowly as you squeeze your chest in the middle. Breathe out during this part of the motion and hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('fdaaddd4-e6b0-45c3-94ee-b2ae69f1d9f4', 'Return back to the starting position slowly as you inhale until your chest muscles are fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('793ecdfb-c2a3-4efa-92da-e0ef663e8ac2', 'Adjust the weight to an appropriate amount and be seated, grasping the handles. Your upper arms should be about 45 degrees to the body, with your head and chest up. The elbows should be bent to about 90 degrees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9e4be82f-ef12-4ae0-828b-9987ddf08c4c', 'Begin by extending through the elbow, pressing the handles together straight in front of you. Keep your shoulder blades retracted as you execute the movement.');
INSERT INTO instructions (id, instruction) VALUES ('c79698eb-9455-464f-8149-61399e1f8bf5', 'After pausing at full extension, return to th starting position, keeping tension on the cables.');
INSERT INTO instructions (id, instruction) VALUES ('dbb8719e-3ec6-4216-8c8d-239a0e651b6d', 'You can also execute this movement with your back off the pad, at an incline or decline, or alternate hands.');
INSERT INTO instructions (id, instruction) VALUES ('c68e8fd1-f8ae-4d5b-ad0e-ee03a7291288', 'To get yourself into the starting position, place the pulleys on a high position (above your head), select the resistance to be used and hold the pulleys in each hand.');
INSERT INTO instructions (id, instruction) VALUES ('9c5dff66-28b0-46d4-8dff-7f3feed1c87e', 'Step forward in front of an imaginary straight line between both pulleys while pulling your arms together in front of you. Your torso should have a small forward bend from the waist. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('009120e3-f671-4365-89a8-23bba69468fb', 'With a slight bend on your elbows in order to prevent stress at the biceps tendon, extend your arms to the side (straight out at both sides) in a wide arc until you feel a stretch on your chest. Breathe in as you perform this portion of the movement. Tip: Keep in mind that throughout the movement, the arms and torso should remain stationary; the movement should only occur at the shoulder joint.');
INSERT INTO instructions (id, instruction) VALUES ('efb6e1ef-ca06-4fab-b627-38c7b0c4c7eb', 'Return your arms back to the starting position as you breathe out. Make sure to use the same arc of motion used to lower the weights.');
INSERT INTO instructions (id, instruction) VALUES ('3982f5e0-e6d9-4aa4-a955-9d4c2a38b196', 'Hold for a second at the starting position and repeat the movement for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('dc7c5cab-a4e3-46ca-a762-c7d4004d8dd1', 'Kneel below a high pulley that contains a rope attachment.');
INSERT INTO instructions (id, instruction) VALUES ('c7364738-cf7c-4773-8bc5-97c534aa03a0', 'Grasp cable rope attachment and lower the rope until your hands are placed next to your face.');
INSERT INTO instructions (id, instruction) VALUES ('006f665e-498e-48a3-b903-4ede6cea846e', 'Flex your hips slightly and allow the weight to hyperextend the lower back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('714b1850-725b-4d23-8371-5e6f0a194ec1', 'With the hips stationary, flex the waist as you contract the abs so that the elbows travel towards the middle of the thighs. Exhale as you perform this portion of the movement and hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('0611f9ed-7980-4ca6-93d5-6adea9e2f062', 'Slowly return to the starting position as you inhale. Tip: Make sure that you keep constant tension on the abs throughout the movement. Also, do not choose a weight so heavy that the lower back handles the brunt of the work.');
INSERT INTO instructions (id, instruction) VALUES ('ed187340-6b01-4f99-8f24-0e4b25b325d0', 'Move the cables to the bottom of the towers and select an appropriate weight. Stand directly in between the uprights.');
INSERT INTO instructions (id, instruction) VALUES ('a21d8d19-1c94-4b77-bcb0-b7023466ebcd', 'To begin, squat down be flexing your hips and knees until you can reach the handles.');
INSERT INTO instructions (id, instruction) VALUES ('1dc9b5f7-0836-4d4b-bc88-baa1e673f01a', 'After grasping them, begin your ascent. Driving through your heels extend your hips and knees keeping your hands hanging at your side. Keep your head and chest up throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('5be91197-054b-4511-98f3-1d9a38a428c2', 'After reaching a full standing position, Return to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('a85944e1-e839-4dac-b6b3-0c8e88e523bb', 'Attach a rope attachment to a low pulley and stand facing the machine about 12 inches away from it.');
INSERT INTO instructions (id, instruction) VALUES ('ac63154b-3dd7-4bbc-a648-e634a057e773', 'Grasp the rope with a neutral (palms-in) grip and stand straight up keeping the natural arch of the back and your torso stationary.');
INSERT INTO instructions (id, instruction) VALUES ('f27f968d-7577-4ed9-aaa9-1893867bec39', 'Put your elbows in by your side and keep them there stationary during the entire movement. Tip: Only the forearms should move; not your upper arms. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0a826573-b9e1-4a54-b818-d826096ad5c9', 'Using your biceps, pull your arms up as you exhale until your biceps touch your forearms. Tip: Remember to keep the elbows in and your upper arms stationary.');
INSERT INTO instructions (id, instruction) VALUES ('5c5374bf-0b88-402a-a8ff-e2620b02d045', 'After a 1 second contraction where you squeeze your biceps, slowly start to bring the weight back to the original position.');
INSERT INTO instructions (id, instruction) VALUES ('f0df5f7f-80c4-41f5-a6f2-256c11117501', 'Stand in front of a low pulley facing forward with one leg next to the pulley and the other one away.');
INSERT INTO instructions (id, instruction) VALUES ('aa089ef1-b4ab-4f99-a4d5-8e42e5298841', 'Attach the ankle cuff to the cable and also to the ankle of the leg that is next to the pulley.');
INSERT INTO instructions (id, instruction) VALUES ('bffaeca3-9d48-436c-bc11-25b165952196', 'Now step out and away from the stack with a wide stance and grasp the bar of the pulley system.');
INSERT INTO instructions (id, instruction) VALUES ('8607b084-f250-417d-8755-c2b302595757', 'Stand on the foot that does not have the ankle cuff (the far foot) and allow the leg with the cuff to be pulled towards the low pulley. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a86c4f2b-c8bb-485c-8507-52ac3a0f4dba', 'Now perform the movement by moving the leg with the ankle cuff in front of the far leg by using the inner thighs to abduct the hip. Breathe out during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('ad727e8b-db61-43bd-bb49-0dc7ee6b3c0c', 'Repeat for the recommended amount of repetitions and then repeat the same movement with the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('76012b13-4d9c-45f3-9e2b-b1cf1c4c19cc', 'Lie on incline an bench facing away from a high pulley machine that has a straight bar attachment on it.');
INSERT INTO instructions (id, instruction) VALUES ('140c6df3-0030-4f9b-9a9d-009552f962db', 'Grasp the straight bar attachment overhead with a pronated (overhand; palms down) shoulder width grip and extend your arms in front of you. The bar should be around 2 inches away from your upper thighs. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('271fd6d6-84b1-4d29-84f0-f5a807321d44', 'Keeping the upper arms stationary, lift your arms back in a semi circle until the bar is straight over your head. Breathe in during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('4e1ad2c3-9671-4db6-b1ce-b3103aab4ffd', 'Slowly go back to the starting position using your lats and hold the contraction once you reach the starting position. Breathe out during the execution of this movement.');
INSERT INTO instructions (id, instruction) VALUES ('018a13c2-5115-4fd3-a176-8ed6676d7bfc', 'Grasp the straight bar attachment overhead with a pronated (overhand; palms down) narrow grip (less than shoulder width) and keep your elbows tucked in to your sides. Your upper arms should create around a 25 degree angle when measured from the floor.');
INSERT INTO instructions (id, instruction) VALUES ('44dd255f-55d9-4265-9b5c-d8a5aeca7e53', 'Keeping the upper arms stationary, extend the arms as you flex the triceps. Breathe out during this portion of the movement and hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('3b44eeef-641c-4aa0-bec8-22e51a4be112', 'Slowly go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9a6a3761-d1b1-4836-942f-b0433563eb6a', 'Sit next to a low pulley sideways (with legs stretched in front of you or crossed) and grasp the single hand cable attachment with the arm nearest to the cable. Tip: If you can adjust the pulley''s height, you can use a flat bench to sit on instead.');
INSERT INTO instructions (id, instruction) VALUES ('20577e54-c876-4911-a48d-b6646d79769d', 'Position the elbow against your side with the elbow bent at 90 and the arm pointing towards the pulley. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('53d66b19-049c-40b5-a03c-46d702beea99', 'Pull the single hand cable attachment toward your body by internally rotating your shoulder until your forearm is across your abs. You will be creating an imaginary semi-circle. Tip: The forearm should be perpendicular to your torso at all times.');
INSERT INTO instructions (id, instruction) VALUES ('702fc91f-ba83-4571-9ce1-af1004da910a', 'Slowly go back to the initial position.');
INSERT INTO instructions (id, instruction) VALUES ('b324a96a-fe2e-4491-a704-0137cf998e03', 'Repeat for the recommended amount of repetitions and then repeat the movement with the next arm.');
INSERT INTO instructions (id, instruction) VALUES ('92cfacde-2e34-42e1-b12e-89c068655922', 'Begin by moving the pulleys to the high position, select the resistance to be used, and take a handle in each hand.');
INSERT INTO instructions (id, instruction) VALUES ('58808ecd-a485-447b-b6d5-e5e84df36103', 'Stand directly between both pulleys with your arms extended out to your sides. Your head and chest should be up while your arms form a "T". This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3d990e9e-fd39-4960-9f53-0578a36f85a3', 'Keeping the elbows extended, pull your arms straight to your sides.');
INSERT INTO instructions (id, instruction) VALUES ('a06d454d-4666-4fbb-a72b-aca0d439f4ef', 'Return your arms back to the starting position after a pause at the peak contraction.');
INSERT INTO instructions (id, instruction) VALUES ('1ac617ce-f19d-4feb-abcb-a9c3a6a8ed4b', 'Continue the movement for the prescribed number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('d2dabb9d-39e9-415f-a5f1-b3163dba9683', 'Connect a rope attachment to a tower, and move the cable to the lowest pulley position. Stand with your side to the cable with a wide stance, and grab the rope with both hands.');
INSERT INTO instructions (id, instruction) VALUES ('bd79b6b0-a3f1-4dbd-9bb4-8ab269bc2224', 'Twist your body away from the pulley as you bring the rope over your shoulder like you''re performing a judo flip.');
INSERT INTO instructions (id, instruction) VALUES ('df3ae916-ab95-4c92-aeb9-be2623e4a7d9', 'Shift your weight between your feet as you twist and crunch forward, pulling the cable downward.');
INSERT INTO instructions (id, instruction) VALUES ('8a3791b3-d1b6-40df-8f9f-3e2733c5f211', 'Return to the starting position and repeat until failure.');
INSERT INTO instructions (id, instruction) VALUES ('a4ff60d1-f065-4d9d-9dc6-f7188234ccd3', 'Then, reposition and repeat the same series of movements on the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('fff5414b-55db-4bb8-a03a-31f1cb55759f', 'Lie on a flat bench and grasp the straight bar attachment of a low pulley with a narrow overhand grip. Tip: The easiest way to do this is to have someone hand you the bar as you lay down.');
INSERT INTO instructions (id, instruction) VALUES ('6e0ce85a-48c3-43e0-b397-50e9a49daf7c', 'With your arms extended, position the bar over your torso. Your arms and your torso should create a 90-degree angle. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('447c95f4-c373-4e32-99e7-639e78ed9596', 'Lower the bar by bending at the elbow while keeping the upper arms stationary and elbows in. Go down until the bar lightly touches your forehead. Breathe in as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('60c6ef9a-e8ca-4637-a2ac-2f0e999c9ed9', 'Flex the triceps as you lift the bar back to its starting position. Exhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('183e3544-9458-460a-8358-37e4459dc729', 'Hold for a second at the contracted position and repeat for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('25224f1d-6707-4b45-8bbf-ff4e8bffc912', 'With your right hand, grasp a single handle attached to the high-cable pulley using a supinated (underhand; palms facing up) grip. You should be standing directly in front of the weight stack.');
INSERT INTO instructions (id, instruction) VALUES ('8a3d7e6c-b065-4a9b-971d-dc5ef33af823', 'Now pull the handle down so that your upper arm and elbow are locked in to the side of your body. Your upper arm and forearm should form an acute angle (less than 90-degrees). You can keep the other arm by the waist and you can have one leg in front of you and the other one back for better balance. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('38426f76-ee4f-43e8-8573-05f7e801100a', 'As you contract the triceps, move the single handle attachment down to your side until your arm is straight. Breathe out as you perform this movement. Tip: Only the forearms should move. Your upper arms should remain stationary at all times.');
INSERT INTO instructions (id, instruction) VALUES ('564da77c-abf4-458e-b55b-326b2174fbff', 'Squeeze the triceps and hold for a second in this contracted position.');
INSERT INTO instructions (id, instruction) VALUES ('80fe89b9-b60a-4fa8-892d-98d1fab7e6cb', 'Slowly return the handle to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5728c77b-3c0c-4a92-a3f2-e98255894ad5', 'Repeat for the recommended amount of repetitions and then perform the same movement with the other arm.');
INSERT INTO instructions (id, instruction) VALUES ('e84e8dec-d3ef-4ab7-92e0-e70fb5e922ee', 'Place a preacher bench about 2 feet in front of a pulley machine.');
INSERT INTO instructions (id, instruction) VALUES ('6aaa10c9-c951-4316-97d8-3e77e873321d', 'Attach a straight bar to the low pulley.');
INSERT INTO instructions (id, instruction) VALUES ('0363e3cf-0711-4d67-be59-ebecdcd26e35', 'Sit at the preacher bench with your elbow and upper arms firmly on top of the bench pad and have someone hand you the bar from the low pulley.');
INSERT INTO instructions (id, instruction) VALUES ('13ae90d7-b6c2-4ce1-b9b3-b16377e6aacd', 'Grab the bar and fully extend your arms on top of the preacher bench pad. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5b0e58ff-6e00-411c-bbae-18f82a8b2ed5', 'Now start pilling the weight up towards your shoulders and squeeze the biceps hard at the top of the movement. Exhale as you perform this motion. Also, hold for a second at the top.');
INSERT INTO instructions (id, instruction) VALUES ('3e200e01-45fc-4226-9ffe-870d67366207', 'Now slowly lower the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1b006b39-e42e-4997-8e4b-e5c13ed63175', 'Adjust the pulleys to the appropriate height and adjust the weight. The pulleys should be above your head.');
INSERT INTO instructions (id, instruction) VALUES ('f1f97268-82d2-49df-bc60-ee2390fbf32c', 'Grab the left pulley with your right hand and the right pulley with your left hand, crossing them in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('66bbf988-9aa1-429b-aab4-a1161b8dd21e', 'Initiate the movement by moving your arms back and outward, keeping your arms straight as you execute the movement.');
INSERT INTO instructions (id, instruction) VALUES ('fc6a218f-7803-4523-95b0-a561a21f3763', 'Pause at the end of the motion before returning the handles to the start position.');
INSERT INTO instructions (id, instruction) VALUES ('b88e8097-8be5-4508-9563-b30302023db3', 'Connect an ankle strap attachment to a low pulley cable and position a mat on the floor in front of it.');
INSERT INTO instructions (id, instruction) VALUES ('bf7f0969-7c1c-48d7-97b3-4fc98d0307c9', 'Sit down with your feet toward the pulley and attach the cable to your ankles.');
INSERT INTO instructions (id, instruction) VALUES ('6659f6d9-e4ea-4b94-a457-1a4b2902558c', 'Lie down, elevate your legs and bend your knees at a 90-degree angle. Your legs and the cable should be aligned. If not, adjust the pulley up or down until they are.');
INSERT INTO instructions (id, instruction) VALUES ('4f591147-de36-4df4-991b-ef345c5bf121', 'With your hands behind your head, bring your knees inward to your torso and elevate your hips off the floor.');
INSERT INTO instructions (id, instruction) VALUES ('65cfdf2c-6e04-406f-9bf4-4361d2c8cab2', 'Pause for a moment and in a slow and controlled manner drop your hips and bring your legs back to the starting 90-degree angle. You should still have tension on your abs in the resting position.');
INSERT INTO instructions (id, instruction) VALUES ('bce773f9-274b-443b-adb6-6cffc5b6b154', 'Repeat the same movement to failure.');
INSERT INTO instructions (id, instruction) VALUES ('57823e4f-7e7b-4c9c-9230-1c19357da0e2', 'Attach a rope to the bottom pulley of the pulley machine.');
INSERT INTO instructions (id, instruction) VALUES ('a4203064-304a-4dfe-abd0-933d97b1aa0c', 'Grasping the rope with both hands, extend your arms with your hands directly above your head using a neutral grip (palms facing each other). Your elbows should be in close to your head and the arms should be perpendicular to the floor with the knuckles aimed at the ceiling. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('215e9eb4-7e23-406b-9354-eb7dd2eb0f75', 'Slowly lower the rope behind your head as you hold the upper arms stationary. Inhale as you perform this movement and pause when your triceps are fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('5238dfb0-309e-440e-9c07-2485a4bdc1a2', 'Return to the starting position by flexing your triceps as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('f847eb0d-d2ae-4e66-bcc9-e4158ebcedfa', 'Sit in the same position on a low pulley row station as you would if you were doing seated cable rows for the back.');
INSERT INTO instructions (id, instruction) VALUES ('85bc328d-ee53-4028-be7b-1b9b5c646ee4', 'Attach a rope to the pulley and grasp it with an overhand grip. Your arms should be extended and parallel to the floor with the elbows flared out.');
INSERT INTO instructions (id, instruction) VALUES ('6d6f9b7f-76c0-41a8-b798-28087031d032', 'Keep your lower back upright and slide your hips back so that your knees are slightly bent. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c529f8ce-0582-4c23-8235-e298c9915a9e', 'Pull the cable attachment towards your upper chest, just below the neck, as you keep your elbows up and out to the sides. Continue this motion as you exhale until the elbows travel slightly behind the back. Tip: Keep your upper arms horizontal, perpendicular to the torso and parallel to the floor throughout the motion.');
INSERT INTO instructions (id, instruction) VALUES ('a5cb9f80-c614-4403-9ba3-62e56c4bf2d9', 'Go back to the initial position where the arms are extended and the shoulders are stretched forward. Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('aa7db36b-daeb-4454-aa3d-1a8b1b20e18b', 'Connect a standard handle attachment, and position the cable to a middle pulley position.');
INSERT INTO instructions (id, instruction) VALUES ('7f654069-e234-4f4e-a79f-d3b26b5654cd', 'Lie on a stability ball perpendicular to the cable and grab the handle with one hand. You should be approximately arm''s length away from the pulley, with the tension of the weight on the cable.');
INSERT INTO instructions (id, instruction) VALUES ('db68cf50-abbd-4a17-bad9-97f590fe31e3', 'Grab the handle with both hands and fully extend your arms above your chest. You hands should be directly in-line with the pulley. If not, adjust the pulley up or down until they are.');
INSERT INTO instructions (id, instruction) VALUES ('625e1df2-e019-4e31-a2df-f9832e7e5055', 'Keep your hips elevated and abs engaged. Rotate your torso away from the pulley for a full-quarter rotation. Your body should be flat from head to knees.');
INSERT INTO instructions (id, instruction) VALUES ('290d33cf-1e8f-4b54-b773-4b4670e3ef41', 'Pause for a moment and in a slow and controlled manner reset to the starting position. You should still have side tension on the cable in the resting position.');
INSERT INTO instructions (id, instruction) VALUES ('af985ec5-bf16-431e-aeb1-ae3a56d932f2', 'Seat on a flat bench with your back facing a high pulley.');
INSERT INTO instructions (id, instruction) VALUES ('c7ae502e-85d3-4d38-b382-4f17fddbbc3e', 'Grasp the cable rope attachment with both hands (with the palms of the hands facing each other) and place your hands securely over both shoulders. Tip: Allow the weight to hyperextend the lower back slightly. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('df9567a5-2f3f-4918-98ed-da40416a7f29', 'With the hips stationary, flex the waist so the elbows travel toward the hips. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('cdfd7793-8061-442c-8588-32803ad3c7e6', 'As you inhale, go back to the initial position slowly.');
INSERT INTO instructions (id, instruction) VALUES ('b72a39c5-e994-40b3-8736-4103d4183967', 'Stand in the middle of two low pulleys that are opposite to each other and place a flat bench right behind you (in perpendicular fashion to you; the narrow edge of the bench should be the one behind you). Select the weight to be used on each pulley.');
INSERT INTO instructions (id, instruction) VALUES ('7e0abc8e-b543-449d-981b-d4a0795e99cb', 'Now sit at the edge of the flat bench behind you with your feet placed in front of your knees.');
INSERT INTO instructions (id, instruction) VALUES ('b77e195a-74db-425a-aad0-73b793395ce0', 'Bend forward while keeping your back flat and rest your torso on the thighs.');
INSERT INTO instructions (id, instruction) VALUES ('e761e436-c298-44ab-b8ac-0098292253f7', 'Have someone give you the single handles attached to the pulleys. Grasp the left pulley with the right hand and the right pulley with the left after you select your weight. The pulleys should run under your knees and your arms will be extended with palms facing each other and a slight bend at the elbows. This will be the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f71ca183-6e6c-4491-b525-9eac9042ae16', 'While keeping the arms stationary, raise the upper arms to the sides until they are parallel to the floor and at shoulder height. Exhale during the execution of this movement and hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('f1c4ec34-8fc3-412c-a2c9-6002e4b77ed4', 'Slowly lower your arms to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('e512c78a-b157-42b1-ad7b-7da981939b5e', 'Repeat for the recommended amount of repetitions. Tip: Maintain upper arms perpendicular to torso and a fixed elbow position (10 degree to 30 degree angle) throughout exercise.');
INSERT INTO instructions (id, instruction) VALUES ('9b4f3fdb-ee3a-48b3-9afc-424d5c980a35', 'Move the cables to the bottom of the towers and select an appropriate weight.');
INSERT INTO instructions (id, instruction) VALUES ('71a5dc39-4fa1-4f50-9013-5fbb3caa3b9c', 'Stand directly in between the uprights. Grasp the cables and hold them at shoulder height, palms facing forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('be656c31-bb8e-45b6-b667-78589fcc39a4', 'Keeping your head and chest up, extend through the elbow to press the handles directly over head.');
INSERT INTO instructions (id, instruction) VALUES ('5f8b1172-c413-4fb9-9845-69fa768c0af7', 'After pausing at the top, return to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('0fd27671-85b0-4d6b-8e6d-ef2538f86b6a', 'Grasp a cable bar attachment that is attached to a low pulley with a shoulder width or slightly wider overhand (palms facing down) grip.');
INSERT INTO instructions (id, instruction) VALUES ('f628bcaa-ae67-4dcc-8179-9aadc4e12795', 'Stand erect close to the pulley with your arms extended in front of you holding the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('72cdf634-77c2-4624-b2c0-a5d9c0763730', 'Lift the bar by elevating the shoulders as high as possible as you exhale. Hold the contraction at the top for a second. Tip: The arms should remain extended at all times. Refrain from using the biceps to help lift the bar. Only the shoulders should be moving up and down.');
INSERT INTO instructions (id, instruction) VALUES ('b2f7d163-a941-48ba-80b9-1cc66688bb18', 'Lower the bar back to the original position.');
INSERT INTO instructions (id, instruction) VALUES ('c9b6c7a1-bd50-42d5-9358-34c650108b59', 'Start out by placing a flat bench in front of a low pulley cable that has a straight bar attachment.');
INSERT INTO instructions (id, instruction) VALUES ('2f95eb5d-71db-464a-93ed-bc7a753c6443', 'Use your arms to grab the cable bar with a narrow to shoulder width supinated grip (palms up) and bring them up so that your forearms are resting against the top of your thighs. Your wrists should be hanging just beyond your knees.');
INSERT INTO instructions (id, instruction) VALUES ('c01e5a4c-e60e-4084-a133-81145f7bf909', 'Start out by curling your wrist upwards and exhaling. Keep the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('03e1a01e-0526-4778-8d1f-24585ff416c3', 'Slowly lower your wrists back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('8a2bb968-e448-41b7-bf6f-cf4016d9d249', 'Your forearms should be stationary as your wrist is the only movement needed to perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('9d6eccff-81fd-4cd0-b62c-53963e3fff3e', 'Position yourself on the calf machine so that the shoulder pads are above your shoulders. Your torso should be straight with the arms extended normally by your side. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a07ba40b-c043-44b5-bdb5-6fc7f29a636a', 'Raise your shoulders up towards your ears as you exhale and hold the contraction for a full second.');
INSERT INTO instructions (id, instruction) VALUES ('1cc463a2-2361-438c-bf6b-1ec5d46fd3b8', 'Slowly return to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('86fe9304-bfe7-498f-b2c8-c0b860a1765d', 'Adjust the seat so that your legs are only slightly bent in the start position. The balls of your feet should be firmly on the platform.');
INSERT INTO instructions (id, instruction) VALUES ('e252eb65-3365-4b0f-a6ff-72a61560d9f2', 'Select an appropriate weight, and grasp the handles. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4bfe577f-9183-4495-8123-04a6b6fd8950', 'Straighten the legs by extending the knees, just barely lifting the weight from the stack. Your ankle should be fully flexed, toes pointing up. Execute the movement by pressing downward through the balls of your feet as far as possible.');
INSERT INTO instructions (id, instruction) VALUES ('f66b6346-5426-46b5-8662-1fb7a36c16d6', 'After a brief pause, reverse the motion and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('cd28c655-d6d6-4f58-8e66-152e2bede69a', 'Using a leg press machine, sit down on the machine and place your legs on the platform directly in front of you at a medium (shoulder width) foot stance.');
INSERT INTO instructions (id, instruction) VALUES ('fd9e7bde-73f6-4d4b-8037-8f9b36b95a0b', 'Lower the safety bars holding the weighted platform in place and press the platform all the way up until your legs are fully extended in front of you without locking your knees. (Note: In some leg press units you can leave the safety bars on for increased safety. If your leg press unit allows for this, then this is the preferred method of performing the exercise.) Your torso and the legs should make perfect 90-degree angle. Now carefully place your toes and balls of your feet on the lower portion of the platform with the heels extending off. Toes should be facing forward, outwards or inwards as described at the beginning of the chapter. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('374697f8-3478-4be9-8074-860f5d34d26a', 'Press on the platform by raising your heels as you breathe out by extending your ankles as high as possible and flexing your calf. Ensure that the knee is kept stationary at all times. There should be no bending at any time. Hold the contracted position by a second before you start to go back down.');
INSERT INTO instructions (id, instruction) VALUES ('c940f6be-dc29-4442-a8c8-a35ae54a4be6', 'Go back slowly to the starting position as you breathe in by lowering your heels as you bend the ankles until calves are stretched.');
INSERT INTO instructions (id, instruction) VALUES ('02252fa2-ebe4-41d8-8f90-d03b076ab1ae', 'Hang on to a sturdy object for balance and stand on a dumbbell handle, preferably one with round plates so that it rolls as in this manner you have to work harder to stabilize yourself; thus increasing the effectiveness of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('96d68b40-7bf9-45f4-bd39-cbe0b313171e', 'Now roll your foot slightly forward so that you can get a nice stretch of the calf. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('dda10653-7214-4ec1-ae2e-d6c0d0ea9ac4', 'Lift the calf as you roll your foot over the top of the handle so that you get a full extension. Exhale during the execution of this movement. Contract the calf hard at the top and hold for a second. Tip: As you come up, roll the dumbbell slightly backward.');
INSERT INTO instructions (id, instruction) VALUES ('ebf37c31-3117-4b9f-8e51-bba602d8dba2', 'Now inhale as you roll the dumbbell slightly forward as you come down to get a better stretch.');
INSERT INTO instructions (id, instruction) VALUES ('e7bd8710-e325-46c3-bbad-d78494d442ea', 'Grab an exercise band and stand on it with your toes making sure that the length of the band between the foot and the arms is the same for both sides.');
INSERT INTO instructions (id, instruction) VALUES ('67bb5f9d-124f-4f31-96de-9b540af5627c', 'While holding the handles of the band, raise the arms to the side of your head as if you were getting ready to perform a shoulder press. The palms should be facing forward with the elbows bent and to the sides. This movement will create tension on the band. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5df8c1a1-c352-4050-8e7a-215a10d9f1b1', 'Keeping the hands by your shoulder, stand up on your toes as you exhale and contract the calves hard at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('c3a2590a-3ccd-49b4-8fd1-02a3968e90cd', 'After a one second contraction, slowly go back down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8b708f83-9989-4989-b8fb-8bf5a02d887a', 'Stand facing a wall from a couple feet away.');
INSERT INTO instructions (id, instruction) VALUES ('ba84ef85-3867-4745-b778-77c5c7aa2586', 'Lean against the wall, placing your weight on your forearms.');
INSERT INTO instructions (id, instruction) VALUES ('86ab7f4a-96fd-4f99-abb0-309f651935e1', 'Attempt to keep your heels on the ground. Hold for 10-20 seconds. You may move further or closer the wall, making it more or less difficult, respectively.');
INSERT INTO instructions (id, instruction) VALUES ('a1bc3631-d399-4e3c-8098-9e525baa2324', 'Stand facing a wall from several feet away. Stagger your stance, placing one foot forward.');
INSERT INTO instructions (id, instruction) VALUES ('ce089643-7175-4c02-81e4-5be17f50d313', 'Lean forward and rest your hands on the wall, keeping your heel, hip and head in a straight line.');
INSERT INTO instructions (id, instruction) VALUES ('5a162485-4213-457d-8902-d7946f792ca0', 'Attempt to keep your heel on the ground. Hold for 10-20 seconds and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('bac2ea6d-523a-4c9f-be74-72c10b9734cf', 'Begin seated on the floor. Place a foam roller underneath your lower leg. Your other leg can either be crossed over the opposite or be placed on the floor, supporting some of your weight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c5b32da4-8042-4ee0-88ba-6a69445583f6', 'Place your hands to your side or just behind you, and press down to raise your hips off of the floor, placing much of your weight against your calf muscle. Roll from below the knee to above the ankle, pausing at points of tension for 10-30 seconds. Repeat for the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('96f4efb0-5645-46fb-8384-401bacd1125d', 'This event apparatus typically has neutral grip handles, however some have a straight bar that you can approach like a normal deadlift. The apparatus can be loaded with a vehicle or other heavy objects such as tractor tires or kegs.');
INSERT INTO instructions (id, instruction) VALUES ('fcd38208-f9ce-44d3-acff-e8c607cac1c0', 'Center yourself between the handles if you are a strong squatter, or back a couple inches if you are a strong deadlifter. You feet should be about hip width apart. Bend at the hip to grip the handles. With your feet and your grip set, take a big breath and then lower your hips and flex the knees.');
INSERT INTO instructions (id, instruction) VALUES ('0af308ba-fc96-4bc8-94b1-3478fe3d4c3a', 'Look forward with your head, keep your chest up and your back arched, and begin driving through the heels to move the weight upward. As the weight comes up, pull your shoulder blades together as you drive your hips forward.');
INSERT INTO instructions (id, instruction) VALUES ('2882ce20-d173-4e0a-83da-13860ebe7887', 'Lower the weight by bending at the hips and guiding it to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('95676d2a-f2d3-430e-bd3c-9b8b5f458ebe', 'While standing upright, hold a barbell plate in both hands at the 3 and 9 o''clock positions. Your palms should be facing each other and your arms should be extended straight out in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('45a8d68b-85b9-4f87-9c06-7157f1300f73', 'Initiate the movement by rotating the plate as far to one side as possible. Use the same type of movement you would use to turn a steering wheel to one side.');
INSERT INTO instructions (id, instruction) VALUES ('56473448-5960-483a-afc8-e52d89294fdf', 'Reverse the motion, turning it all the way to the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('da22d88c-19ee-45be-9eb8-c18009e45993', 'Begin with your feet a few inches apart and your left arm up in a relaxed, athletic position.');
INSERT INTO instructions (id, instruction) VALUES ('7d43e429-bbb9-4561-8210-d2991fa0852d', 'With your right foot, quick step behind and pull the knee up.');
INSERT INTO instructions (id, instruction) VALUES ('0af5f8fa-ef93-485e-a846-0ef18b88c41f', 'Fire your arms back up when you pull the right knee, being sure that your knee goes straight up and down. Avoid turning your feet as you move and continue to look forward as you move to the side.');
INSERT INTO instructions (id, instruction) VALUES ('107f6d27-e0ce-464e-85bc-7cb702315738', 'Position yourself on the floor on your hands and knees.');
INSERT INTO instructions (id, instruction) VALUES ('5ec9169b-ca5a-4ae1-a3a7-17926cbc8e86', 'Pull your belly in and round your spine, lower back, shoulders, and neck, letting your head drop.');
INSERT INTO instructions (id, instruction) VALUES ('15f68324-f2ae-4527-a3f7-b7f4099e9c3d', 'Hold for 15 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('c0b06632-d664-42b3-ba43-fcbf47ebcfff', 'Begin standing while facing a wall or a partner.');
INSERT INTO instructions (id, instruction) VALUES ('82bd3a01-14a1-40cc-885b-01e1305b443c', 'Using both hands, position the ball behind your head, stretching as much as possible, and forcefully throw the ball forward.');
INSERT INTO instructions (id, instruction) VALUES ('099cdb8f-8d31-40d7-b71e-9288bd066fed', 'Ensure that you follow your throw through, being prepared to receive your rebound from your throw. If you are throwing against the wall, make sure that you stand close enough to the wall to receive the rebound, and aim a little higher than you would with a partner.');
INSERT INTO instructions (id, instruction) VALUES ('be6f2e6a-f072-4ef8-b72e-e9ada8b0e08d', 'You will need two cable handle attachments and a flat bench, as well as chains, for this exercise. Clip the middle of the chains to the handles, and position yourself on the flat bench. Your elbows should be pointing straight up.');
INSERT INTO instructions (id, instruction) VALUES ('7f12732b-e9b2-4639-8a0d-6b21cdc52149', 'Begin by extending through the elbow, keeping your upper arm still, with your wrists pronated.');
INSERT INTO instructions (id, instruction) VALUES ('bd9fc9aa-c887-4616-8c39-a48c73981a5e', 'Pause at the lockout, and reverse the motion to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('682462fc-adfd-48aa-9ce3-3bfaadf1684e', 'Begin by connecting the chains to the cable handle attachments. Position yourself on the flat bench in the same position as for a dumbbell press. Your wrists should be pronated and arms perpendicular to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('36d2b13b-9c17-4f1b-b009-e610df5cd723', 'Lower the chains by flexing the elbows, unloading some of the chain onto the floor.');
INSERT INTO instructions (id, instruction) VALUES ('0c9b646f-fda3-46a9-bc17-465253dc706a', 'Continue until your elbow forms a 90 degree angle, and then reverse the motion by extending through the elbow to lockout.');
INSERT INTO instructions (id, instruction) VALUES ('895c1db8-bd3c-4067-9c7b-4970b38424cf', 'Sit upright in a chair and grip the seat on the sides.');
INSERT INTO instructions (id, instruction) VALUES ('073cfc9e-e91a-4625-9216-5dc405876ea6', 'Raise one leg, extending the knee, flexing the ankle as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('10c53713-255c-4cfe-99e6-0e2c22d89eaa', 'Slowly move that leg outward as far as you can, and then back to the center and down.');
INSERT INTO instructions (id, instruction) VALUES ('07ddef4a-08f5-4105-b437-7ca0694fcef4', 'Repeat for your other leg.');
INSERT INTO instructions (id, instruction) VALUES ('d22ad91d-41c5-401a-ab78-ae2be6cb38c4', 'Sit upright on a chair.');
INSERT INTO instructions (id, instruction) VALUES ('3b1c3e9f-b252-4ad7-a1d1-312092d29ab1', 'Bend to one side with your arm over your head. You can hold onto the chair with your free hand.');
INSERT INTO instructions (id, instruction) VALUES ('e49ab1f3-1842-443e-890d-673bb87055ca', 'Hold for 10 seconds, and repeat for your other side.');
INSERT INTO instructions (id, instruction) VALUES ('a2cd6ad9-03e7-4c72-a04c-000732cb7137', 'To begin, first set the bar to a position that best matches your height. Once the bar is loaded, step under it and position it across the back of your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('34de08b4-b311-44d4-a855-2e9128c8d2eb', 'Take the bar with your hands facing forward, unlock it and lift it off the rack by extending your legs.');
INSERT INTO instructions (id, instruction) VALUES ('df70ffce-a1c8-4105-9e61-3602bdf6b323', 'Move your feet forward about 18 inches in front of the bar. Position your legs using a shoulder width stance with the toes slightly pointed out. Look forward at all times and maintain a neutral or slightly arched spine. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('110312ef-b200-4301-ba20-e38af68b2886', 'Slowly lower the bar by bending the knees as you maintain a straight posture with the head up. Continue down until the angle between the upper and lower leg breaks 90 degrees.');
INSERT INTO instructions (id, instruction) VALUES ('725dd7be-5c3b-43f5-88f0-3d8008ca2a6a', 'Begin to raise the bar as you exhale by pushing the floor with the heels of your feet, extending the knees and returning to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('72e61a9c-cfb1-42c3-9faa-3955e7b9c1b6', 'Sit on the edge of a chair, gripping the back of it.');
INSERT INTO instructions (id, instruction) VALUES ('bdd475df-4e75-4f4f-aee8-ddf16ca34c87', 'Straighten your arms, keeping your back straight, and pull your upper body forward so you feel a stretch. Hold for 20-30 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('5f446f3b-568c-422e-9479-aea948d4de14', 'Start off by standing with your legs together, holding a bodybar or a broomstick.');
INSERT INTO instructions (id, instruction) VALUES ('031ae194-5981-4bf9-9377-2536fb0cdeb2', 'Take a slightly wider than shoulder width grip on the pole and hold it in front of you with your palms facing down.');
INSERT INTO instructions (id, instruction) VALUES ('496abeaa-0ff4-4cc1-af19-ecffc305d1c5', 'Carefully lift the pole up and behind your head.');
INSERT INTO instructions (id, instruction) VALUES ('f98bf2d0-5c6a-45de-b328-55dcbc005352', 'Begin in a three point stance, squatted down with your back flat and one hand on the ground. Place the medicine ball directly in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('2bdb5b44-16a9-41dc-bdb5-aeee0e191d9f', 'To begin, take your first step as you pull the ball to your chest, positioning both hands to prepare for the throw.');
INSERT INTO instructions (id, instruction) VALUES ('13c0866e-da92-442e-b756-0653d07659ee', 'As you execute the second step, explosively release the ball forward as hard as possible.');
INSERT INTO instructions (id, instruction) VALUES ('346aeb42-1383-4cdb-97f1-7ca6d07df171', 'Begin in a kneeling position facing a wall or utilize a partner. Hold the ball with both hands tight into the chest.');
INSERT INTO instructions (id, instruction) VALUES ('83624953-892b-43cb-84fa-ceca3b72786f', 'Execute the pass by exploding forward and outward with the hips while pushing the ball as hard as possible.');
INSERT INTO instructions (id, instruction) VALUES ('9890366f-38c8-4825-947a-2a538ff19eb4', 'Follow through by falling forward, catching yourself with your hands.');
INSERT INTO instructions (id, instruction) VALUES ('32812cc0-a1bb-446e-b6c1-b6823038de40', 'Immediately return to an upright position. Repeat for the desired number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('691b09cd-ac36-4938-bc6d-3f4a05f3f4c3', 'Begin in a kneeling position holding the medicine ball with both hands tightly into the chest.');
INSERT INTO instructions (id, instruction) VALUES ('f43c7a4b-d00c-4d9d-bc25-b7a45968b38b', 'Execute the pass by exploding forward and outward with the hips while pushing the ball as far as possible.');
INSERT INTO instructions (id, instruction) VALUES ('45441f34-3cba-4693-b12b-099d992bf5b6', 'Begin in an athletic stance with the knees bent, hips back, and back flat. Hold the medicine ball near your legs. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('92cf28f4-c629-4eeb-8da7-99ff7d67eb97', 'While taking your first step draw the medicine ball into your chest.');
INSERT INTO instructions (id, instruction) VALUES ('dc298833-30fe-43df-bd10-1fd16d999e3d', 'As you take the second step, explosively push the ball forward, immediately sprinting for 10 yards after the release. If you are really fast, you can catch your own pass!');
INSERT INTO instructions (id, instruction) VALUES ('b5ce3906-748c-4ee3-93ca-fd1b8a90a858', 'Get on your hands and knees next to an exercise ball.');
INSERT INTO instructions (id, instruction) VALUES ('134dc056-6fd2-4004-afcb-c1f429cd845d', 'Place your elbows on top of the ball, keeping your arm out to your side. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f4090826-0ef2-4ab3-a3ac-cf344bfe6d73', 'Lower your torso towards the floor, keeping your elbow on top of the ball. Hold the stretch for 20-30 seconds, and repeat with the other arm.');
INSERT INTO instructions (id, instruction) VALUES ('bfecbbfa-6dd4-458f-acb3-222f0a7f8dfd', 'Get on your hands and knees, walk your hands in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('8f9e8844-2db2-490b-84cf-19be1418dd91', 'Lower your buttocks down to sit on your heels. Let your arms drag along the floor as you sit back to stretch your entire spine.');
INSERT INTO instructions (id, instruction) VALUES ('2efd722c-50d4-45f4-820e-d791480bdcea', 'Once you settle onto your heels, bring your hands next to your feet and relax. "breathe" into your back. Rest your forehead on the floor. Avoid this position if you have knee problems.');
INSERT INTO instructions (id, instruction) VALUES ('2856ed66-97c9-4e41-9e64-4788717a7137', 'Grab the pull-up bar with the palms facing your torso and a grip closer than the shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('20c8e6f3-68a2-4519-9de8-213924673f32', 'As you have both arms extended in front of you holding the bar at the chosen grip width, keep your torso as straight as possible while creating a curvature on your lower back and sticking your chest out. This is your starting position. Tip: Keeping the torso as straight as possible maximizes biceps stimulation while minimizing back involvement.');
INSERT INTO instructions (id, instruction) VALUES ('5049efd3-b9be-42bf-ba64-3f4eb4a3b843', 'As you breathe out, pull your torso up until your head is around the level of the pull-up bar. Concentrate on using the biceps muscles in order to perform the movement. Keep the elbows close to your body. Tip: The upper torso should remain stationary as it moves through space and only the arms should move. The forearms should do no other work other than hold the bar.');
INSERT INTO instructions (id, instruction) VALUES ('d26af168-584b-484f-ab01-82e4d7efcf1e', 'After a second of squeezing the biceps in the contracted position, slowly lower your torso back to the starting position; when your arms are fully extended. Breathe in as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('58cc0690-5fa7-4101-bf14-b7cf7c05c7ea', 'Repeat this motion for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('496fdd0d-f985-4946-b40c-714c2260fcaf', 'Get into a seated position on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('0ca38aa4-11b0-4706-9ef7-639ce9f36521', 'Place both hands at the rear of your head, fingers interlocked, thumbs pointing down and elbows pointing straight ahead. Slowly pull your head down to your chest. Hold for 20-30 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('ca4177ac-bfb8-4249-b2cd-d45a71f7ece2', 'The circus bell is an oversized dumbbell with a thick handle. Begin with the dumbbell between your feet, and grip the handle with both hands.');
INSERT INTO instructions (id, instruction) VALUES ('748fa617-16df-4667-9151-9c5b002bdc1d', 'Clean the dumbbell by extending through your hips and knees to deliver the implement to the desired shoulder, letting go with the extra hand.');
INSERT INTO instructions (id, instruction) VALUES ('16ff5488-feb4-4742-a9e9-eeda4fc0abd3', 'Ensure that you get one of the dumbbell heads behind the shoulder to keep from being thrown off balance. To raise it overhead, dip by flexing the knees, and the drive upwards as you extend the dumbbell overhead, leaning slightly away from it as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('08b31fee-dfa1-4d07-8697-c077bd56114f', 'Carefully guide the bell back to the floor, keeping it under control as much as possible. It is best to perform this event on a thick rubber mat to prevent damage to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('9fcdd8c5-e3c9-4b87-847f-eb006eed014c', 'With a barbell on the floor close to the shins, take an overhand (or hook) grip just outside the legs. Lower your hips with the weight focused on the heels, back straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('29b7a96e-0647-4c98-bd45-26c2a2941368', 'Begin the first pull by driving through the heels, extending your knees. Your back angle should stay the same, and your arms should remain straight. Move the weight with control as you continue to above the knees.');
INSERT INTO instructions (id, instruction) VALUES ('1e0f13d3-bb16-4872-8d52-c84b644cd362', 'Next comes the second pull, the main source of acceleration for the clean. As the bar approaches the mid-thigh position, begin extending through the hips. In a jumping motion, accelerate by extending the hips, knees, and ankles, using speed to move the bar upward. There should be no need to actively pull through the arms to accelerate the weight; at the end of the second pull, the body should be fully extended, leaning slightly back, with the arms still extended.');
INSERT INTO instructions (id, instruction) VALUES ('15eb8880-648f-47b8-986c-33997672b032', 'As full extension is achieved, transition into the third pull by aggressively shrugging and flexing the arms with the elbows up and out. At peak extension, aggressively pull yourself down, rotating your elbows under the bar as you do so. Receive the bar in a front squat position, the depth of which is dependent upon the height of the bar at the end of the third pull. The bar should be racked onto the protracted shoulders, lightly touching the throat with the hands relaxed. Continue to descend to the bottom squat position, which will help in the recovery.');
INSERT INTO instructions (id, instruction) VALUES ('3dcb639a-bb29-4022-9fa9-9ca635e4892b', 'Immediately recover by driving through the heels, keeping the torso upright and elbows up. Continue until you have risen to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('141f2bc3-3b43-43d3-b388-1f7f1d169473', 'Begin standing with a barbell close to your shins. Your feet should be directly under your hips with your feet turned out slightly. Grip the bar with a double overhand grip or hook grip, about shoulder width apart. Squat down to the bar. Your spine should be in full extension, with a back angle that places your shoulders in front of the bar and your back as vertical as possible.');
INSERT INTO instructions (id, instruction) VALUES ('1597e232-ce23-44c9-83f2-b8aab8cf05e5', 'Begin by driving through the floor through the front of your heels. As the bar travels upward, maintain a constant back angle. Flare your knees out to the side to help keep them out of the bar''s path.');
INSERT INTO instructions (id, instruction) VALUES ('e5d7489d-b067-4e0f-87fc-6735dcaa40be', 'After the bar crosses the knees, complete the lift by driving the hips into the bar until your hips and knees are extended.');
INSERT INTO instructions (id, instruction) VALUES ('35016022-9da4-4c23-9508-9422113208ff', 'With a barbell on the floor close to the shins, take an overhand or hook grip just outside the legs. Lower your hips with the weight focused on the heels, back straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9e25ee5a-560a-4d76-9c8e-bb35fd82931a', 'Begin the first pull by driving through the heels, extending your knees. Your back angle should stay the same, and your arms should remain straight and elbows out. Move the weight with control as you continue to above the knees.');
INSERT INTO instructions (id, instruction) VALUES ('70b26454-fdd1-49de-aa6c-c3f7237d6960', 'Next comes the second pull, the main source of acceleration for the clean. As the bar approaches the mid-thigh position, begin extending through the hips. In a jumping motion, accelerate by extending the hips, knees, and ankles, using speed to move the bar upward. There should be no need to actively pull through the arms to accelerate the weight; at the end of the second pull, the body should be fully extended, leaning slightly back, with the arms still extended. Full extension should be violent and abrupt, and ensure that you do not prolong the extension for longer than necessary.');
INSERT INTO instructions (id, instruction) VALUES ('99d457c2-8bd5-413f-8c93-baf67690e4d7', 'Begin with a shoulder width, double overhand or hook grip, with the bar hanging at the mid thigh position. Your back should be straight and inclined slightly forward.');
INSERT INTO instructions (id, instruction) VALUES ('01d1eb24-ea2e-4ea3-a13c-128485f72cda', 'Shrug your shoulders towards your ears. While this exercise can usually by loaded with heavier weight than a clean, avoid overloading to the point that the execution slows down.');
INSERT INTO instructions (id, instruction) VALUES ('121fd871-11ea-4852-a5a4-d40b9d2ad051', 'The second phase is the jerk, which raises the weight overhead. Standing with the weight racked on the front of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible.');
INSERT INTO instructions (id, instruction) VALUES ('c53feef8-b6d6-4164-b1bc-b0d39a5dc5d1', 'Drive through the heels create as much speed and force as possible, and be sure to move your head out of the way as the bar leaves the shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('1afeccaf-e6bf-4873-9c63-6de36bd50a3c', 'At this moment as the feet leave the floor, the feet must be placed into the receiving position as quickly as possible. In the brief moment the feet are not actively driving against the platform, the athletes effort to push the bar up will drive them down. The feet should be split, with one foot forward, and one foot back. Receive the bar with the arms locked out overhead. Return to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('243b3ee4-2561-4472-9e2d-d6b0218e8df3', 'Assume a shoulder-width stance, with knees inside the arms. Now while keeping the back flat, bend at the knees and hips so that you can grab the bar with the arms fully extended and a pronated grip that is slightly wider than shoulder width. Point the elbows out to sides. The bar should be close to the shins. Position the shoulders over or slightly ahead of the bar. Establish a flat back posture. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c3b40e44-a26a-4166-a1b3-980e069c8ea4', 'Begin to pull the bar by extending the knees. Move your hips forward and raise the shoulders at the same rate while keeping the angle of the back constant; continue to lift the bar straight up while keeping it close to your body.');
INSERT INTO instructions (id, instruction) VALUES ('72789053-3ad3-41f6-95e9-f0d3fce60411', 'As the bar passes the knee, extend at the ankles, knees, and hips forcefully, similar to a jumping motion. As you do so, continue to guide the bar with your hands, shrugging your shoulders and using the momentum from your movement to pull the bar as high as possible. The bar should travel close to your body, and you should keep your elbows out.');
INSERT INTO instructions (id, instruction) VALUES ('8439ef21-a56d-4a15-b665-89891a92f4b6', 'At maximum elevation, your feet should clear the floor and you should start to pull yourself under the bar. The mechanics of this could change slightly, depending on the weight used. You should descend into a squatting position as you pull yourself under the bar.');
INSERT INTO instructions (id, instruction) VALUES ('f4447250-1951-418a-b633-67d9130f915f', 'As the bar hits terminal height, rotate your elbows around and under the bar. Rack the bar across the front of the shoulders while keeping the torso erect and flexing the hips and knees to absorb the weight of the bar.');
INSERT INTO instructions (id, instruction) VALUES ('2bcd68de-dece-4742-a4d1-fafebec5b5f9', 'Stand to full height, holding the bar in the clean position.');
INSERT INTO instructions (id, instruction) VALUES ('43384ad2-b365-4d20-91e5-8b3141ab8c39', 'Without moving your feet, press the bar overhead as you exhale. Lower the bar under control .');
INSERT INTO instructions (id, instruction) VALUES ('5e8517a1-dcb8-46a9-a43c-e331601e3bd7', 'With a barbell on boxes or stands of the desired height, take an overhand or hook grip just outside the legs. Lower your hips with the weight focused on the heels, back straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b4ded190-bfc0-40fd-98d4-756759727754', 'Begin the first pull by driving through the heels, extending your knees. Your back angle should stay the same, and your arms should remain straight with the elbows pointed out.');
INSERT INTO instructions (id, instruction) VALUES ('4eedbee1-080c-4d85-bac6-75296982ca15', 'As full extension is achieved, transition into the receiving position by aggressively shrugging and flexing the arms with the elbows up and out. Aggressively pull yourself down, rotating your elbows under the bar as you do so. Receive the bar in a front squat position, the depth of which is dependent upon the height of the bar at the end of the third pull. The bar should be racked onto the protracted shoulders, lightly touching the throat with the hands relaxed. Continue to descend to the bottom squat position, which will help in the recovery.');
INSERT INTO instructions (id, instruction) VALUES ('acdb7744-daa5-4331-ae62-cb4b4a61aa2b', 'Immediately recover by driving through the heels, keeping the torso upright and elbows up. Continue until you have risen to a standing position. Return the weight to the boxes for the next rep.');
INSERT INTO instructions (id, instruction) VALUES ('468ab96d-2a0f-47ad-a7e5-0462106f0b9e', 'Move into a prone position on the floor, supporting your weight on your hands and toes.');
INSERT INTO instructions (id, instruction) VALUES ('383eda89-dcf1-4d6c-855f-61041c31a583', 'Your arms should be fully extended with the hands around shoulder width. Keep your body straight throughout the movement. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3cf87df9-6a28-42a3-a74d-500d30247a9f', 'Descend by flexing at the elbow, lowering your chest toward the ground.');
INSERT INTO instructions (id, instruction) VALUES ('4085a548-857f-4198-9804-a41e4af943ca', 'At the bottom, reverse the motion by pushing yourself up through elbow extension as quickly as possible until you are air borne. Aim to "jump" 12-18 inches to one side.');
INSERT INTO instructions (id, instruction) VALUES ('4d559578-00b4-4ffe-b205-761d12b8a652', 'As you accelerate up, move your outside foot away from your direction of travel. Leaving the ground, shift your body about 30 degrees for the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('eaf7d881-87f8-4a1f-be91-c4f3c58e9482', 'Return to the starting position and repeat the exercise, working all the way around until you are back where you started.');
INSERT INTO instructions (id, instruction) VALUES ('cd712fdd-c08f-4c6b-a068-d9dd83df926b', 'Lie back on a flat bench. Using a close grip (around shoulder width), lift the bar from the rack and hold it straight over you with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cb84edd0-991c-46d9-94a0-d31ccb8f73b3', 'As you breathe in, come down slowly until you feel the bar on your middle chest. Tip: Make sure that - as opposed to a regular bench press - you keep the elbows close to the torso at all times in order to maximize triceps involvement.');
INSERT INTO instructions (id, instruction) VALUES ('2604838a-f6f7-493c-bed8-b1f20bc5a7f1', 'After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your triceps muscles. Lock your arms in the contracted position, hold for a second and then start coming down slowly again. Tip: It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('6755f685-b579-4963-a9ff-4623989e44b3', 'Ensuring that the dumbbell stays securely placed at the top of the bench, lie perpendicular to the bench with only your shoulders lying on the surface. Hips should be below the bench and your legs bent with your feet firmly on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('36190500-4283-4a12-bd56-9ce6c34de3dd', 'Grasp the dumbbell with both hands and hold it straight over your chest at arm''s length. Both palms should be pressing against the underside of the sides of the dumbbell. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f30f6655-f488-449a-979c-76c70d52737b', 'Initiate the movement by lowering the dumbbell to your chest.');
INSERT INTO instructions (id, instruction) VALUES ('2bb09a0d-343d-4aa4-8d78-6ced36c53382', 'Return to the starting position by extending the elbows.');
INSERT INTO instructions (id, instruction) VALUES ('7c20673b-f583-48df-9e6a-410ea5360595', 'Attach a band to each end of the bar. Take the bar, placing a foot on the middle of the band. Stand upright with a narrow, supinated grip on the EZ bar. The elbows should be close to the torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7e963dae-4deb-4eb0-b1e5-3365ad8a5526', 'While keeping the upper arms in place, flex the elbows to execute the curl. Exhale as the weight is lifted.');
INSERT INTO instructions (id, instruction) VALUES ('2ec6ce81-03a3-424f-9688-455e4cf59b58', 'Lie on a flat bench with an EZ bar loaded to an appropriate weight.');
INSERT INTO instructions (id, instruction) VALUES ('7fe0cad1-5a1f-41a4-b273-5e493808ca13', 'Using a narrow grip lift the bar and hold it straight over your torso with your elbows in. The arms should be perpendicular to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fc272d5a-9453-4b76-a144-8ca464b000a9', 'Now lower the bar down to your lower chest as you breathe in. Keep the elbows in as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('5d09c98c-d39f-4db3-8f62-8a730ad3bd5d', 'Using the triceps to push the bar back up, press it back to the starting position by extending the elbows as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('6d76282d-7574-4792-bd61-35bdf95aa5d4', 'Stand up with your torso upright while holding an E-Z Curl Bar at the closer inner handle. The palm of your hands should be facing forward and they should be slightly tilted inwards due to the shape of the bar. The elbows should be close to the torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8cf7d403-9654-4376-afac-dedc092880fb', 'Sit down on a pull-down machine with a wide bar attached to the top pulley. Make sure that you adjust the knee pad of the machine to fit your height. These pads will prevent your body from being raised by the resistance attached to the bar.');
INSERT INTO instructions (id, instruction) VALUES ('9cdc83d8-b2c0-4dc4-a736-c9d88722e8bf', 'Grab the bar with the palms facing forward using the prescribed grip. Note on grips: For a wide grip, your hands need to be spaced out at a distance wider than your shoulder width. For a medium grip, your hands need to be spaced out at a distance equal to your shoulder width and for a close grip at a distance smaller than your shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('b95129b1-835e-4797-9e86-c839b9506143', 'As you have both arms extended in front of you - while holding the bar at the chosen grip width - bring your torso back around 30 degrees or so while creating a curvature on your lower back and sticking your chest out. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('34d172f4-e263-485b-80c3-4dc79e57df1c', 'As you breathe out, bring the bar down until it touches your upper chest by drawing the shoulders and the upper arms down and back. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary (only the arms should move). The forearms should do no other work except for holding the bar; therefore do not try to pull the bar down using the forearms.');
INSERT INTO instructions (id, instruction) VALUES ('8d9a16a8-4b5a-4f77-9ced-a3d76bf46bad', 'After a second in the contracted position, while squeezing your shoulder blades together, slowly raise the bar back to the starting position when your arms are fully extended and the lats are fully stretched. Inhale during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('dad24490-472f-48b1-9421-b0a1bfe2454a', '6. Repeat this motion for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('a8843f11-9291-429d-9b1e-fb4180b4b9f2', 'Lie on the floor and place your hands on an upright dumbbell. Supporting your weight on your toes and hands, keep your torso rigid and your elbows in with your arms straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f2efa23c-fed8-4837-8c41-84c2faa481e9', 'Lower your body, allowing the elbows to flex while you inhale. Keep your body straight, not allowing your hips to rise or sag.');
INSERT INTO instructions (id, instruction) VALUES ('a8f2e229-3526-4493-9fa5-00f0e25244e3', 'Press yourself back up to the starting position by extending the elbows. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('8c732b70-2371-4f61-95b8-a6e677879a07', 'After a pause at the contracted position, repeat the movement for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('465ec8d0-6c66-4b86-97d5-a03ed07f1d9c', 'Hold a barbell with both hands, palms up and a few inches apart.');
INSERT INTO instructions (id, instruction) VALUES ('e9bfb108-4837-4114-ad2e-caba6cf52f49', 'Stand with your torso straight and your head up. Your feet should be about shoulder width and your elbows close to your torso. This will be your starting position. Tip: You will keep your upper arms and elbows stationary throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('2695f5de-fd33-4b7d-8df1-2e9e189b1176', 'Curl the bar up in a semicircular motion until the forearms touch your biceps. Exhale as you perform this portion of the movement and contract your biceps hard for a second at the top. Tip: Avoid bending the back or using swinging motions as you lift the weight. Only the forearms should move.');
INSERT INTO instructions (id, instruction) VALUES ('ef58be04-8733-4f66-bf78-5f4e764385d1', 'Slowly go back down to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('532d194f-604b-4273-9f9b-8b6f1494f85d', 'Begin by lying on your back on the ground. Your legs should be straight and your arms extended behind your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9fc62e81-3fb2-4ce2-a098-0719e82834ec', 'To perform the movement, tuck the knees toward your chest, rotating your pelvis to lift your glutes from the floor. As you do so, flex the spine, bringing your arms back over your head to perform a simultaneous crunch motion.');
INSERT INTO instructions (id, instruction) VALUES ('610b4056-6bde-4103-afb7-0165346e0111', 'With the weight loaded, take a zurcher hold on the end of the implement. Place the bar in the crook of the elbow and hold onto your wrist. Try to keep the weight off of the forearms.');
INSERT INTO instructions (id, instruction) VALUES ('4882222a-7668-401e-9f55-31f416bd251d', 'Begin by lifting the weight from the ground. Keep a tight, upright posture as you being to walk, taking short, fast steps. Look up and away as you turn in a circle. Do not hold your breath during the event. Continue walking until you complete one or more complete turns.');
INSERT INTO instructions (id, instruction) VALUES ('703623dd-5a20-40a1-8381-d9d581564a69', 'Sit down on a flat bench with one dumbbell in front of you between your legs. Your legs should be spread with your knees bent and feet on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('9bd4e2a8-d5b3-4d90-b7ac-87cece13e46c', 'Use your right arm to pick the dumbbell up. Place the back of your right upper arm on the top of your inner right thigh. Rotate the palm of your hand until it is facing forward away from your thigh. Tip: Your arm should be extended and the dumbbell should be above the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3316ac7f-f93b-4b17-81db-4c1eb296208f', 'While holding the upper arm stationary, curl the weights forward while contracting the biceps as you breathe out. Only the forearms should move. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level. Tip: At the top of the movement make sure that the little finger of your arm is higher than your thumb. This guarantees a good contraction. Hold the contracted position for a second as you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('b97bc09b-70e2-4381-8f18-4ce611f83e99', 'Slowly begin to bring the dumbbells back to starting position as your breathe in. Caution: Avoid swinging motions at any time.');
INSERT INTO instructions (id, instruction) VALUES ('33fdf8b5-91ed-49b6-9bdf-f6ac8e308aff', 'Repeat for the recommended amount of repetitions. Then repeat the movement with the left arm.');
INSERT INTO instructions (id, instruction) VALUES ('0f91df02-3236-4ab3-9e98-35176c297607', 'Lie flat on your back and bend your knees about 60 degrees.');
INSERT INTO instructions (id, instruction) VALUES ('c4d60f4c-1d84-4d5c-801f-49de6735e12d', 'Keep your feet flat on the floor and place your hands loosely behind your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0d627ba8-38c5-4a22-96f4-4e71790eaa40', 'Now curl up and bring your right elbow and shoulder across your body while bring your left knee in toward your left shoulder at the same time. Reach with your elbow and try to touch your knee. Exhale as you perform this movement. Tip: Try to bring your shoulder up towards your knee rather than just your elbow and remember that the key is to contract the abs as you perform the movement; not just to move the elbow.');
INSERT INTO instructions (id, instruction) VALUES ('fce1b1b6-6415-4c40-a696-22c0d0daa2bd', 'Now go back down to the starting position as you inhale and repeat with the left elbow and the right knee.');
INSERT INTO instructions (id, instruction) VALUES ('42227eeb-41fc-46ca-b2b1-0ae88d19a4b3', 'Continue alternating in this manner until all prescribed repetitions are done.');
INSERT INTO instructions (id, instruction) VALUES ('f488b568-7bec-4fae-95da-7badf1e52a57', 'Stand up straight with a dumbbell in each hand. Your hands should be down at your side with your palms facing in.');
INSERT INTO instructions (id, instruction) VALUES ('ca2eab28-75ad-4622-b857-2779a362debe', 'While keeping your palms facing in and without twisting your arm, curl the dumbbell of the right arm up towards your left shoulder as you exhale. Touch the top of the dumbbell to your shoulder and hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('2e306f6f-3a1e-4fe5-90d0-f5d4bc8a7ae6', 'Slowly lower the dumbbell along the same path as you inhale and then repeat the same movement for the left arm.');
INSERT INTO instructions (id, instruction) VALUES ('64958571-614f-40b9-b697-8e3aae028d58', 'Continue alternating in this fashion until the recommended amount of repetitions is performed for each arm.');
INSERT INTO instructions (id, instruction) VALUES ('db7c1c7c-98c6-4053-a4cf-afce25e9fad5', 'Secure an exercise band around a stationary post.');
INSERT INTO instructions (id, instruction) VALUES ('9b6d8a82-4db0-43fa-8eef-790c334d2db7', 'While facing away from the post, grab the handles on both ends of the band and step forward enough to create tension on the band.');
INSERT INTO instructions (id, instruction) VALUES ('abb00a73-bce3-437a-84db-f547a91441ec', 'Raise your arms to the sides, parallel to the floor, perpendicular to your torso (your torso and the arms should resemble the letter "T") and with the palms facing forward. Have them extended with a slight bend at the elbows. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7b0af638-3db4-48f0-babe-269938d7f2ab', 'While keeping your arms straight, bring them across your chest in a semicircular motion to the front as you exhale and flex your pecs. Hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('79342a1b-b347-4724-87b9-23e1888ce608', 'Perform for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('9b0bcf08-805c-4d9a-9d06-527a7d3c2732', 'Stand with your feet shoulder width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('10e37c6f-30d6-489e-8188-24ba143b89c0', 'Perform a rear lunge by stepping back with one foot and flexing the hips and front knee. As you do so, rotate your torso across the front leg.');
INSERT INTO instructions (id, instruction) VALUES ('18cbf6b9-d4e0-475b-bfc7-92bf9b93f051', 'After a brief pause, return to the starting position and repeat on the other side, continuing in an alternating fashion.');
INSERT INTO instructions (id, instruction) VALUES ('3aac8fbc-4f7b-4132-b32e-28a8905a35f6', 'In the crucifix, you statically hold weights out to the side for time. While the event can be practiced using dumbbells, it is best to practice with one of the various implements used, such as axes and hammers, as it feels different.');
INSERT INTO instructions (id, instruction) VALUES ('a290127b-3b5a-4ee3-98e5-f18679e0b4d7', 'Begin standing, and raise your arms out to the side holding the implements. Your arms should be parallel to the ground. In competition, judges or sensors are used to let you know when you break parallel. Hold for as long as you can. Typically, the weights should be heavy enough that you fail in 30-60 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('462ca43c-e924-4627-a610-6166a271d848', 'Lie on the floor with your back flat and knees bent with around a 60-degree angle between the hamstrings and the calves.');
INSERT INTO instructions (id, instruction) VALUES ('6a9baeae-cbe4-4436-b1cd-9dc73965a5cb', 'Keep your feet flat on the floor and stretch your arms overhead with your palms crossed. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6414cf84-6257-408c-b837-bb703f53f738', 'Curl your upper body forward and bring your shoulder blades just off the floor. At all times, keep your arms aligned with your head, neck and shoulder. Don''t move them forward from that position. Exhale as you perform this portion of the movement and hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('412a3be7-c045-4240-8d99-80d9e2ac8f50', 'Slowly lower down to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('64d4beb1-419f-41e4-9707-aaa8c99727e0', 'Lie flat on your back with your feet resting on an exercise ball and your knees bent at a 90 degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('a9471175-7b36-47d4-a436-62f2891c24c3', 'Place your feet three to four inches apart and point your toes inward so they touch.');
INSERT INTO instructions (id, instruction) VALUES ('db12bc19-76a7-4115-8e95-39f91593c436', 'Place your hands lightly on either side of your head keeping your elbows in. Tip: Don''t lock your fingers behind your head.');
INSERT INTO instructions (id, instruction) VALUES ('cd078f16-43a8-4893-bea2-68f91c6d0161', 'Push the small of your back down in the floor in order to better isolate your abdominal muscles. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a2ee8151-6886-499c-a64c-e58d7af0ccf5', 'Begin to roll your shoulders off the floor and continue to push down as hard as you can with your lower back. Your shoulders should come up off the floor only about four inches, and your lower back should remain on the floor. Breathe out as you execute this portion of the movement. Squeeze your abdominals hard at the top of the contraction and hold for a second. Tip: Focus on a slow, controlled movement. Refrain from using momentum at any time.');
INSERT INTO instructions (id, instruction) VALUES ('28f25bc7-1752-4a58-a54f-2c24e37707c3', 'Lie flat on your back with your feet flat on the ground, or resting on a bench with your knees bent at a 90 degree angle. If you are resting your feet on a bench, place them three to four inches apart and point your toes inward so they touch.');
INSERT INTO instructions (id, instruction) VALUES ('9218c185-9b55-4864-b63d-caee206dec70', 'Now place your hands lightly on either side of your head keeping your elbows in. Tip: Don''t lock your fingers behind your head.');
INSERT INTO instructions (id, instruction) VALUES ('a39c9d24-251f-4828-9579-f877594fca22', 'While pushing the small of your back down in the floor to better isolate your abdominal muscles, begin to roll your shoulders off the floor.');
INSERT INTO instructions (id, instruction) VALUES ('6816455e-07b7-4e01-bbfb-8b52586c104f', 'Continue to push down as hard as you can with your lower back as you contract your abdominals and exhale. Your shoulders should come up off the floor only about four inches, and your lower back should remain on the floor. At the top of the movement, contract your abdominals hard and keep the contraction for a second. Tip: Focus on slow, controlled movement - don''t cheat yourself by using momentum.');
INSERT INTO instructions (id, instruction) VALUES ('2c39fbb1-74e1-460f-a4d7-668b178d4ce1', 'After the one second contraction, begin to come down slowly again to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('88c388f7-1ff8-4cc4-85eb-f6dd1ad2ac4c', 'Take a dumbbell in each hand with a pronated grip in a standing position. Raise your upper arms so that they are parallel to the floor, allowing your lower arms to hang in the "scarecrow" position. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('35769f71-9a83-40ec-afb0-3d24bb3779f3', 'To initiate the movement, externally rotate the shoulders to move the upper arm 180 degrees. Keep the upper arms in place, rotating the upper arms until the wrists are directly above the elbows, the forearms perpendicular to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('dabcbd13-3bd6-4c1c-b764-8d70a57c0264', 'Now press the dumbbells by extending at the elbows, straightening your arms overhead.');
INSERT INTO instructions (id, instruction) VALUES ('be2e8acd-010c-49ac-b594-97284c96420c', 'Return to the starting position as you breathe in by reversing the steps.');
INSERT INTO instructions (id, instruction) VALUES ('fac181db-5da1-4bfe-a698-744d3c5eb205', 'Sit up on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('fac24350-2152-40d4-8ed4-b96ce254a78f', 'Cross your right leg over your left, keeping the knee bent. Your left leg is straight and down on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('ed3852e0-7b90-4ddd-9ea9-d61964511c31', 'Place your left arm on your right leg and your right hand on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('b1e7b18f-89f1-4971-92b9-acf430e23101', 'Rotate your upper body to the right, and hold for 10-20 seconds. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('89d6f7f9-2ab7-4625-9482-d79d4637d3cc', 'Begin lying on your back with your hands extended above you toward the ceiling.');
INSERT INTO instructions (id, instruction) VALUES ('edf7454d-ae81-4ff8-8807-b34401807cb7', 'Bring your feet, knees, and hips up to 90 degrees.');
INSERT INTO instructions (id, instruction) VALUES ('84e88626-7676-4265-9f96-12cd5c1cfc07', 'Exhale hard to bring your ribcage down and flatten your back onto the floor, rotating your pelvis up and squeezing your glutes. Hold this position throughout the movement. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0d6ade2c-7053-4874-a905-f98bd84bad1e', 'Initiate the exercise by extending one leg, straightening the knee and hip to bring the leg just above the ground.');
INSERT INTO instructions (id, instruction) VALUES ('15885e88-6363-445e-a8cd-d91033a61542', 'Maintain the position of your lumbar and pelvis as you perform the movement, as your back is going to want to arch.');
INSERT INTO instructions (id, instruction) VALUES ('1b979f89-944c-4521-9015-5ccbc03373d8', 'Stay tight and return the working leg to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9b81eec1-2fa5-4497-a1ce-54b9ffdef317', 'Repeat on the opposite side, alternating until the set is complete.');
INSERT INTO instructions (id, instruction) VALUES ('cc2a31a5-3929-4958-995d-1e7348ded2f2', 'To deadlift with short bands, simply loop them over the bar before you start, and step into them to set up. For long bands, they will need to be anchored to a secure base, such as heavy dumbbells or a rack.');
INSERT INTO instructions (id, instruction) VALUES ('a134642b-8bdc-4692-93c7-46e60b3d43e4', 'With your feet, and your grip set, take a big breath and then lower your hips and bend the knees until your shins contact the bar. Look forward with your head, keep your chest up and your back arched, and begin driving through the heels to move the weight upward. After the bar passes the knees, aggressively pull the bar back, pulling your shoulder blades together as you drive your hips forward into the bar.');
INSERT INTO instructions (id, instruction) VALUES ('7af65208-e61c-4695-8557-0ad5223be530', 'You can attach the chains to the sleeves of the bar, or just drape the middle over the bar so there is a greater weight increase as you lift.');
INSERT INTO instructions (id, instruction) VALUES ('d98da03f-c7e2-4cb3-86ca-16c687470189', 'Approach the bar so that it is centered over your feet. You feet should be about hip width apart. Bend at the hip to grip the bar at shoulder width, allowing your shoulder blades to protract. Typically, you would use an overhand grip or an over/under grip on heavier sets. With your feet, and your grip set, take a big breath and then lower your hips and bend the knees until your shins contact the bar.');
INSERT INTO instructions (id, instruction) VALUES ('5e90111a-5792-4155-8cb0-d2518ddbe8b3', 'Look forward with your head, keep your chest up and your back arched, and begin driving through the heels to move the weight upward. After the bar passes the knees, aggressively pull the bar back, pulling your shoulder blades together as you drive your hips forward into the bar.');
INSERT INTO instructions (id, instruction) VALUES ('4a62e03f-02a7-402b-9725-2c1c8389ef9d', 'Secure your legs at the end of the decline bench and slowly lay down on the bench.');
INSERT INTO instructions (id, instruction) VALUES ('aa2d2668-9b4a-4bd3-97a5-bfa63c6a533b', 'Using a medium width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over you with your arms locked. The arms should be perpendicular to the floor. This will be your starting position. Tip: In order to protect your rotator cuff, it is best if you have a spotter help you lift the barbell off the rack.');
INSERT INTO instructions (id, instruction) VALUES ('1d5b4076-d5f7-4e15-952b-bd4ec0b71637', 'As you breathe in, come down slowly until you feel the bar on your lower chest.');
INSERT INTO instructions (id, instruction) VALUES ('1ac91209-97b4-46a0-b61c-ca4007201919', 'After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles. Lock your arms and squeeze your chest in the contracted position, hold for a second and then start coming down slowly again. Tip: It should take at least twice as long to go down than to come up).');
INSERT INTO instructions (id, instruction) VALUES ('56e78e30-5190-43a4-bca2-343beedf03b1', 'Using a close grip (a grip that is slightly less than shoulder width), lift the bar from the rack and hold it straight over you with your arms locked and elbows in. The arms should be perpendicular to the floor. This will be your starting position. Tip: In order to protect your rotator cuff, it is best if you have a spotter help you lift the barbell off the rack.');
INSERT INTO instructions (id, instruction) VALUES ('23f511d1-5693-4a45-800a-ec2b43572e3e', 'Using the triceps to push the bar back up, press it back to the starting position as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('dde0c169-ed8a-4a1a-86f1-fc8780334584', 'As you breathe in and you keep the upper arms stationary, bring the bar down slowly by moving your forearms in a semicircular motion towards you until you feel the bar slightly touch your forehead. Breathe in as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('625ef49f-5009-446c-b6fd-a16515b325ac', 'Lift the bar back to the starting position by contracting the triceps and exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('252e748e-81cd-4dd3-a46c-f68ad2f884de', 'Repeat steps 3-6 until the recommended amount of repetitions is performed.');
INSERT INTO instructions (id, instruction) VALUES ('807b3159-35d1-41f5-af48-363312c5c428', 'Secure your legs at the end of the decline bench and lie down.');
INSERT INTO instructions (id, instruction) VALUES ('4a82aef2-4cd9-42ef-9939-b8b8133418ae', 'While pushing the small of your back down in the bench to better isolate your abdominal muscles, begin to roll your shoulders off it.');
INSERT INTO instructions (id, instruction) VALUES ('7a7988ca-c9f9-46af-9877-2c4138c5696d', 'Continue to push down as hard as you can with your lower back as you contract your abdominals and exhale. Your shoulders should come up off the bench only about four inches, and your lower back should remain on the bench. At the top of the movement, contract your abdominals hard and keep the contraction for a second. Tip: Focus on slow, controlled movement - don''t cheat yourself by using momentum.');
INSERT INTO instructions (id, instruction) VALUES ('2f595237-9333-4d28-b4fb-59b9f3752e4d', 'Secure your legs at the end of the decline bench and lie down with a dumbbell on each hand on top of your thighs. The palms of your hand will be facing each other.');
INSERT INTO instructions (id, instruction) VALUES ('f47c5f03-86d4-468a-914e-431d9912d189', 'Once you are laying down, move the dumbbells in front of you at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('7fdcaa53-6edd-418f-8b6c-c8ac339d5b5b', 'Bring down the weights slowly to your side as you breathe out. Keep full control of the dumbbells at all times. Tip: Throughout the motion, the forearms should always be perpendicular to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('2e0cfc38-84b5-4cf5-b6e3-29fc814ce3d1', 'As you breathe out, push the dumbbells up using your pectoral muscles. Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly. Tip: It should take at least twice as long to go down than to come up..');
INSERT INTO instructions (id, instruction) VALUES ('e23eaae5-e4a8-4cb2-b5e7-7017bb3f5815', 'Once you are laying down, move the dumbbells in front of you at shoulder width. The palms of the hands should be facing each other and the arms should be perpendicular to the floor and fully extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9c8da10b-d83b-4e79-b285-57dbc5fb6b37', 'With a slight bend on your elbows in order to prevent stress at the biceps tendon, lower your arms out at both sides in a wide arc until you feel a stretch on your chest. Breathe in as you perform this portion of the movement. Tip: Keep in mind that throughout the movement, the arms should remain stationary; the movement should only occur at the shoulder joint.');
INSERT INTO instructions (id, instruction) VALUES ('8b5556e2-fc0c-4abe-ab5b-09eedc6883db', 'Return your arms back to the starting position as you squeeze your chest muscles and breathe out. Tip: Make sure to use the same arc of motion used to lower the weights.');
INSERT INTO instructions (id, instruction) VALUES ('0470042e-7463-4ba3-ad90-39365fb448f6', 'Hold for a second at the contracted position and repeat the movement for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('cdfef25e-2742-405c-904a-cd53af2a943c', 'As you breathe in and you keep the upper arms stationary (and elbows in), bring the dumbbells down slowly by moving your forearms in a semicircular motion towards you until your thumbs are next to your ears. Breathe in as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d1a9e9d2-2d41-4f1e-bfbd-2a36f2ede757', 'Lift the dumbbells back to the starting position by contracting the triceps and exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('248215b4-76fd-4829-816b-e53b9cc8ae95', 'Using a close grip (a grip that is slightly less than shoulder width), lift the EZ bar from the rack and hold it straight over you with your arms locked and elbows in. The arms should be perpendicular to the floor. This will be your starting position. Tip: In order to protect your rotator cuff, it is best if you have a spotter help you lift the barbell off the rack.');
INSERT INTO instructions (id, instruction) VALUES ('592b4215-7cf8-4026-8807-5fcdf5d804b9', 'Repeat until the recommended amount of repetitions is performed.');
INSERT INTO instructions (id, instruction) VALUES ('ce47761d-6ca7-46ec-aa1d-5010a83234ba', 'Raise your upper body off the bench until your torso is about 35-45 degrees if measured from the floor.');
INSERT INTO instructions (id, instruction) VALUES ('6b724fdd-e8c7-4214-b6b1-50e275e85bc8', 'Put one hand beside your head and the other on your thigh. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6147564b-9212-4963-895f-d4ecbcfd2ed6', 'Raise your upper body slowly from the starting position while turning your torso to the left. Continue crunching up as you exhale until your right elbow touches your left knee. Hold this contracted position for a second. Tip: Focus on keeping your abs tight and keeping the movement slow and controlled.');
INSERT INTO instructions (id, instruction) VALUES ('da66434f-c37f-4bf7-b32b-61ebc8561e32', 'Lower your body back down slowly to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('2eca2ee0-e6d0-477d-a0cf-4d08c81231a9', 'After completing one set on the right for the recommended amount of repetitions, switch to your left side. Tip: Focus on really twisting your torso and feeling the contraction when you are in the up position.');
INSERT INTO instructions (id, instruction) VALUES ('8c66a22a-3d97-41a8-a966-2304785040ba', 'Lie on the floor face down and place your hands about 36 inches apart while holding your torso up at arms length. Move your feet up to a box or bench. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6a908e5b-989d-4a55-973a-11e6f304633f', 'Next, lower yourself downward until your chest almost touches the floor as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('14cb2da0-6b5e-4eea-991c-e56690393120', 'Now breathe out and press your upper body back up to the starting position while squeezing your chest.');
INSERT INTO instructions (id, instruction) VALUES ('cc6142da-1178-456b-8afa-48f454a85a4d', 'After a brief pause at the top contracted position, you can begin to lower yourself downward again for as many repetitions as needed.');
INSERT INTO instructions (id, instruction) VALUES ('e4d6b8ff-3d4f-40c4-aa02-72f5b4455ef3', 'Lie on your back on a decline bench and hold on to the top of the bench with both hands. Don''t let your body slip down from this position.');
INSERT INTO instructions (id, instruction) VALUES ('15079013-5759-4a2e-8e3d-2188d7f0c51c', 'Hold your legs parallel to the floor using your abs to hold them there while keeping your knees and feet together. Tip: Your legs should be fully extended with a slight bend on the knee. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9bffc6f6-d2b9-435a-a0b6-6134d2a24a58', 'While exhaling, move your legs towards the torso as you roll your pelvis backwards and you raise your hips off the bench. At the end of this movement your knees will be touching your chest.');
INSERT INTO instructions (id, instruction) VALUES ('6e740d62-339a-4f1d-9668-5497d220554e', 'Hold the contraction for a second and move your legs back to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('c415c606-15a5-4ec3-a8b4-58bb93f14ce3', 'Place a decline bench underneath the Smith machine. Now place the barbell at a height that you can reach when lying down and your arms are almost fully extended. Using a pronated grip that is wider than shoulder width, unlock the bar from the rack and hold it straight over you with your arms extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('00d60dae-d846-4468-bb48-f8e45ff053d8', 'As you inhale, lower the bar under control by allowing the elbows to flex, lightly contacting the torso.');
INSERT INTO instructions (id, instruction) VALUES ('62b0b4ae-952c-4498-a926-907cb3f680e6', 'After a brief pause, bring the bar back to the starting position by extending the elbows, exhaling as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('3c8e4309-edff-403d-9bd6-82f7ecb6f4ef', 'When the set is complete, lock the bar back in the rack.');
INSERT INTO instructions (id, instruction) VALUES ('cea04067-c1eb-4fa9-949a-e6fdbc9607ca', 'Begin by having a platform or weight plates that you can stand on, usually 1-3 inches in height. Approach the bar so that it is centered over your feet. You feet should be about hip width apart. Bend at the hip to grip the bar at shoulder width, allowing your shoulder blades to protract. Typically, you would use an overhand grip or an over/under grip on heavier sets.');
INSERT INTO instructions (id, instruction) VALUES ('d1286c36-e119-4075-9b18-676807d6e78a', 'For this drill you will need two boxes or benches, one 12 to 16 inches high and the other 22 to 26 inches high.');
INSERT INTO instructions (id, instruction) VALUES ('710466d6-ae30-4899-bd24-fddeab3f61f8', 'Stand on one of the two boxes with arms at the sides; feet should be together and slightly off the edge as in the depth jump. Place the other box approximately two or three feet in front of and facing the performer.');
INSERT INTO instructions (id, instruction) VALUES ('8bbcd91a-052d-4228-a848-c64101629623', 'Begin by dropping off the initial box, landing and simultaneously taking off with both feet.');
INSERT INTO instructions (id, instruction) VALUES ('2fc0117f-edef-42cb-a316-a0512f0ce981', 'Rebound by driving upward and outward as intensely as possible, using the arms and full extension of the body to jump onto the higher box. Again, allow the legs to absorb the impact.');
INSERT INTO instructions (id, instruction) VALUES ('37c63553-5b18-4625-a6ba-731cf976ba78', 'Sit securely in a dip machine, select the weight and firmly grasp the handles.');
INSERT INTO instructions (id, instruction) VALUES ('0e382056-f93e-46da-ba46-31ed826fbddb', 'Now keep your elbows in at your sides in order to place emphasis on the triceps. The elbows should be bent at a 90 degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('ff04e763-c723-4f23-829d-8a0311a6b560', 'As you contract the triceps, extend your arms downwards as you exhale. Tip: At the bottom of the movement, focus on keeping a little bend in your arms to keep tension on the triceps muscle.');
INSERT INTO instructions (id, instruction) VALUES ('9e712d2f-43a9-49b5-8257-8002a6278b93', 'Now slowly let your arms come back up to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('a2c31974-b1e8-4d78-83e6-f8f9a375fa59', 'For this exercise you will need access to parallel bars. To get yourself into the starting position, hold your body at arms length (arms locked) above the bars.');
INSERT INTO instructions (id, instruction) VALUES ('fb304272-3eca-4ae7-bf2a-91cf1d7c6329', 'While breathing in, lower yourself slowly with your torso leaning forward around 30 degrees or so and your elbows flared out slightly until you feel a slight stretch in the chest.');
INSERT INTO instructions (id, instruction) VALUES ('243324d5-988e-44de-bf9c-23095787e687', 'Once you feel the stretch, use your chest to bring your body back to the starting position as you breathe out. Tip: Remember to squeeze the chest at the top of the movement for a second.');
INSERT INTO instructions (id, instruction) VALUES ('619b2f2b-eae6-4f5d-82b0-d1ac7cea96c9', 'To get into the starting position, hold your body at arm''s length with your arms nearly locked above the bars.');
INSERT INTO instructions (id, instruction) VALUES ('c9e18e81-6dd0-4ee6-8b21-88aa0383c5fa', 'Now, inhale and slowly lower yourself downward. Your torso should remain upright and your elbows should stay close to your body. This helps to better focus on tricep involvement. Lower yourself until there is a 90 degree angle formed between the upper arm and forearm.');
INSERT INTO instructions (id, instruction) VALUES ('19346f98-74bb-4542-b826-7cdd8b93eaf7', 'Then, exhale and push your torso back up using your triceps to bring your body back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('19ec815b-1dfe-4bc5-9a01-f993be39c991', 'For this exercise you will need access to a donkey calf raise machine. Start by positioning your lower back and hips under the padded lever provided. The tailbone area should be the one making contact with the pad.');
INSERT INTO instructions (id, instruction) VALUES ('ca30ab8b-6c0f-4f31-ac7b-1a0e895074c9', 'Place both of your arms on the side handles and place the balls of your feet on the calf block with the heels extending off. Align the toes forward, inward or outward, depending on the area you wish to target, and straighten the knees without locking them. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3b13fef6-bb7a-4b2f-b84b-679a7b421fc8', 'Raise your heels as you breathe out by extending your ankles as high as possible and flexing your calf. Ensure that the knee is kept stationary at all times. There should be no bending at any time. Hold the contracted position by a second before you start to go back down.');
INSERT INTO instructions (id, instruction) VALUES ('91686ac1-cc2e-4cac-a8c3-0051819be44a', 'Clean one kettlebell to your shoulder and hold on to the other kettlebell.');
INSERT INTO instructions (id, instruction) VALUES ('32753479-ad31-4256-90b7-a72e2fc24d6f', 'With a fluid motion, lower the top kettlebell while driving the bottom kettlebell up.');
INSERT INTO instructions (id, instruction) VALUES ('7e14e686-1f51-43a4-9d63-e159601ad26a', 'Hold a kettlebell by the handle in each hand.');
INSERT INTO instructions (id, instruction) VALUES ('4bf8ba18-55c1-4c34-b5a4-31208f7a1efb', 'Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a5aff5d1-cee4-4b06-aa73-bb706fcd1f8c', 'Dip your body by bending the knees, keeping your torso upright.');
INSERT INTO instructions (id, instruction) VALUES ('bab955ec-a065-4934-8a97-cb29945e4e4a', 'Immediately reverse direction, driving through the heels, in essence jumping to create momentum.');
INSERT INTO instructions (id, instruction) VALUES ('1341d95d-18ce-4427-9557-d2db72757ef9', 'As you do so, press the kettlebells overhead to lockout by extending the arms, using your body''s momentum to move the weights.');
INSERT INTO instructions (id, instruction) VALUES ('876e5dd4-f6bf-49dc-863b-c729f86d99e4', 'Return your feet to the ground in a split fashion, with one foot forward and one foot back.');
INSERT INTO instructions (id, instruction) VALUES ('9c5a863b-8a13-4b6b-b8fa-fee6345d6589', 'Keeping the weights overhead, return to a standing position, bringing your feet together. Lower the weights to perform the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('7c46b1e3-26b9-4c01-8923-9f33fc63c0b2', 'Clean two kettlebells to your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('4f4bc642-bcb1-4795-b0f3-8f8c9999007b', 'Squat down a few inches and reverse the motion rapidly. Use the momentum from the legs to drive the kettlebells overhead.');
INSERT INTO instructions (id, instruction) VALUES ('5ca66721-5882-4452-8f7a-f102134d0379', 'Once the kettlebells are locked out, lower the kettlebells to your shoulders and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('0b773ddf-a0e0-44b0-a795-dd30fcf2e923', 'Place two kettlebells behind your feet. Bend your knees and sit back to pick up the kettlebells.');
INSERT INTO instructions (id, instruction) VALUES ('30b56ef6-7323-42d9-8c50-53213609ab42', 'Swing the kettlebells between your legs forcefully and reverse the direction.');
INSERT INTO instructions (id, instruction) VALUES ('027eaa74-97e4-424a-895a-8ff34ef2b5d1', 'Drive through with your hips and lock the ketttlebells overhead in one uninterrupted motion.');
INSERT INTO instructions (id, instruction) VALUES ('1f6be8e1-6a25-45ef-8b94-183a2e26c509', 'Place a kettlebell in front of your front foot and clean and press a kettlebell overhead with your opposite arm. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulders. Rotate your wrist as you do so, so that the palm faces forward.');
INSERT INTO instructions (id, instruction) VALUES ('cb676b2f-bdf9-43d6-a93c-7fd4c90428ef', 'Keeping the kettlebell locked out at all times, push your butt out in the direction of the locked out kettlebell. Turn your feet out at a forty-five degree angle from the arm with the locked out kettlebell.');
INSERT INTO instructions (id, instruction) VALUES ('fa1f13d0-00fe-461f-822b-1372628fc5fa', 'Bending at the hip to one side, sticking your butt out, slowly lean until you can retrieve the kettlebell from the floor. Keep your eyes on the kettlebell that you hold over your head at all times.');
INSERT INTO instructions (id, instruction) VALUES ('ce4a5d71-165c-4acf-85ac-dc4bf6cc70a8', 'Pause for a second after retrieving the kettlebell from the ground and reverse the motion back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7a05062b-0b9e-452a-9421-d8f79906fa08', 'Begin standing with your knees slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('1d9b9e71-57e8-453c-a3b9-784dadf8f2f8', 'Quickly squat a short distance, flexing the hips and knees, and immediately extend to jump for maximum vertical height.');
INSERT INTO instructions (id, instruction) VALUES ('b1c0d736-2c91-4207-9724-ffe200dee0ce', 'As you go up, tuck your heels by flexing the knees, attempting to touch the buttocks.');
INSERT INTO instructions (id, instruction) VALUES ('21099c3a-b03c-4cb4-831c-f1dccf2e3973', 'Finish the motion by landing with the knees only partially bent, using your legs to absorb the impact.');
INSERT INTO instructions (id, instruction) VALUES ('7821ce0e-bbaa-496d-ad9d-8a28dae7bd0b', 'Lie facedown on top of an exercise ball.');
INSERT INTO instructions (id, instruction) VALUES ('81989e61-214b-4287-95f1-dd3a6e9c9bbd', 'While resting on your stomach on the ball, walk your hands forward along the floor and lift your legs, extending your elbows and knees.');
INSERT INTO instructions (id, instruction) VALUES ('b4f17ffd-9e90-41e4-b5c4-23e7f132011b', 'Grab a barbell with a supinated grip (palms facing forward) and get your elbows close to your torso and back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('94f1e1c6-9f93-4eb6-9515-e9f3d03ef277', 'As you exhale, curl the bar up while keeping the elbows to the back as you "Drag" the bar up by keeping it in contact with your torso. Tip: As you can see, you will not be keeping the elbows pinned to your sides, but instead you will be bringing them back. Also, do not lift your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('8b97eef0-bffe-4c8c-b7c6-89235d25d85e', 'Slowly go back to the starting position as you keep the bar in contact with the torso at all times.');
INSERT INTO instructions (id, instruction) VALUES ('10a2374b-50f0-43b3-ade9-cc7e0706d0f7', 'Position low boxes or other platforms 2-3 feet apart.');
INSERT INTO instructions (id, instruction) VALUES ('c41cd458-295d-4441-bbb4-22cec76d05f3', 'Move to a pushup position between them, supporting yourself by placing your hands on the boxes.');
INSERT INTO instructions (id, instruction) VALUES ('2f3e61bf-6d77-47b4-9fed-927071abae19', 'With good posture, drop from the platforms by pressing up and moving your hands to shoulder width, cushioning your landing by absorbing the impact through the arm.');
INSERT INTO instructions (id, instruction) VALUES ('d49f7a9a-e1d3-4215-8546-ee1179c64dc5', 'Stand (torso upright) with a dumbbell in each hand held at arms length. The elbows should be close to the torso and the palms of your hand should be facing your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('fa976c14-c42c-459c-a9fc-b1a55cc993d7', 'While holding the upper arm stationary, curl the right weight as you rotate the palm of the hands until they are facing forward. At this point continue contracting the biceps as you breathe out until your biceps is fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the biceps. Tip: Only the forearms should move.');
INSERT INTO instructions (id, instruction) VALUES ('02d62bb3-c14d-43f5-b336-67f4370a050d', 'Slowly begin to bring the dumbbell back to the starting position as your breathe in. Tip: Remember to twist the palms back to the starting position (facing your thighs) as you come down.');
INSERT INTO instructions (id, instruction) VALUES ('e928bf8f-b0f8-4b79-8671-b5db067b59cb', 'Lie down on a flat bench with a dumbbell in each hand resting on top of your thighs. The palms of your hands will be facing each other.');
INSERT INTO instructions (id, instruction) VALUES ('08986973-d88e-4773-989f-785cf4511e68', 'Then, using your thighs to help raise the dumbbells up, lift the dumbbells one at a time so that you can hold them in front of you at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('b4a5441e-8ab2-44cc-8058-c462883d0191', 'Once at shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you. The dumbbells should be just to the sides of your chest, with your upper arm and forearm creating a 90 degree angle. Be sure to maintain full control of the dumbbells at all times. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('851dd955-1a31-4307-b463-1988a17d6fb0', 'Then, as you breathe out, use your chest to push the dumbbells up. Lock your arms at the top of the lift and squeeze your chest, hold for a second and then begin coming down slowly. Tip: Ideally, lowering the weight should take about twice as long as raising it.');
INSERT INTO instructions (id, instruction) VALUES ('992cd87e-84fc-40e9-8c4d-fe665bef3ba0', 'Take a dumbbell in each hand and lay back onto a flat bench. Your feet should be flat on the floor and your shoulder blades retracted.');
INSERT INTO instructions (id, instruction) VALUES ('01f161fc-0358-4afb-a356-49b6ffec72d3', 'Maintaining a neutral grip, palms facing each other, begin with your arms extended directly above you, perpendicular to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3aaee6fd-46df-4323-b070-82488bb30cc3', 'Begin the movement by flexing the elbow, lowering the upper arms to the side. Descend until the dumbbells are to your torso.');
INSERT INTO instructions (id, instruction) VALUES ('7b8cc0b9-b16a-45d5-b6ac-75ac0e9fbb59', 'Pause, then extend the elbow and return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2427c74e-d658-446c-a68f-8176f0bd903b', 'Stand up straight with a dumbbell in each hand at arm''s length. Keep your elbows close to your torso and rotate the palms of your hands until they are facing forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('37d9e5e6-1fe6-4647-899f-04fe274e85db', 'Now, keeping the upper arms stationary, exhale and curl the weights while contracting your biceps. Continue to raise the weights until your biceps are fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a brief pause as you squeeze your biceps.');
INSERT INTO instructions (id, instruction) VALUES ('44484d81-53de-4d44-b8f5-911c4e50c630', 'Then, inhale and slowly begin to lower the dumbbells back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('615b2eac-a233-492b-b7db-24f0eb6b4d45', 'Begin standing with a dumbbell in each hand with your feet shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('076c8cf3-6fb7-4cfa-b41d-1a5ba79f7c43', 'Lower the weights to the floor by flexing at the hips and knees, pushing your hips back until the dumbbells reach the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3bc91264-cc2c-4e46-a097-521681303ed2', 'To initiate the movement, violently jump upward by extending the hips, knees, and ankles to acclerate the weights upward. Maintaining a neutral grip on the dumbbells, keep the arms straight until full extension is reached.');
INSERT INTO instructions (id, instruction) VALUES ('17f9cdb5-7cbe-4fd4-85b7-c8088a41d68d', 'After full extension, rebend the hips and knees to receive the weight in a squat position. Allow the arms to bend, guiding the dumbbells to your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('a64aa7e0-6a99-4d3f-8cbe-4e7e3bc7f133', 'Upon receiving the weight in the squat position, extend the hips and knees to finish in a standing position with the weights on your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('b294f45d-bf3e-44b4-9b59-c1c1e46e454d', 'Lay on the floor holding dumbbells in your hands. Your knees can be bent. Begin with the weights fully extended above you.');
INSERT INTO instructions (id, instruction) VALUES ('a708f3c2-eccd-495b-9745-95e69246eeda', 'Lower the weights until your upper arm comes in contact with the floor. You can tuck your elbows to emphasize triceps size and strength, or to focus on your chest angle your arms to the side.');
INSERT INTO instructions (id, instruction) VALUES ('be94cf84-e61b-416d-a2bb-1949df4517c8', 'Pause at the bottom, and then bring the weight together at the top by extending through the elbows.');
INSERT INTO instructions (id, instruction) VALUES ('acea4700-c649-4424-ad70-13bfd18e0b42', 'Lie down on a flat bench with a dumbbell on each hand resting on top of your thighs. The palms of your hand will be facing each other.');
INSERT INTO instructions (id, instruction) VALUES ('bcf18dbe-9325-4bff-8b3b-9d66637c1dd6', 'Then using your thighs to help raise the dumbbells, lift the dumbbells one at a time so you can hold them in front of you at shoulder width with the palms of your hands facing each other. Raise the dumbbells up like you''re pressing them, but stop and hold just before you lock out. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2d07dc74-2959-4e96-8528-e36609e71946', 'Using a neutral grip, lean into an incline bench.');
INSERT INTO instructions (id, instruction) VALUES ('57c975a1-19b0-44e4-8ac3-45c90b7f5a8c', 'Take a dumbbell in each hand with a neutral grip, beginning with the arms straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('16ba121c-42f2-4e58-8e72-556a93ddee7d', 'Retract the shoulder blades and flex the elbows to row the dumbbells to your side.');
INSERT INTO instructions (id, instruction) VALUES ('8b375747-4ce4-4052-afd7-42842a1cfa07', 'Pause at the top of the motion, and then return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('70b9bf37-4b01-4c86-9295-9e774e50fd9e', 'Sit on an Incline Bench while holding a dumbbell on each hand on top of your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('a325a099-e486-41c1-a80b-eeb8acf95bb0', 'Lift your legs up to kick the weights to your shoulders and lean back. Position the dumbbells above your shoulders with your arms extended. The arms should be perpendicular to the floor with your palms facing forward and knuckles pointing towards the ceiling. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('83ba6381-486a-40b3-a6f0-43f05fa343ff', 'While keeping the arms straight and locked, lift the dumbbells by raising the shoulders from the bench as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('00a4c843-ce23-420b-ad6a-c474bae34e60', 'Bring back the dumbbells to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('53f13663-83a0-4495-a8b0-1ba6794426dc', 'Stand with your torso upright holding two dumbbells in your hands by your sides. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('dd3dcf88-ae31-4efd-a6db-15803cd36c56', 'Step forward with your right leg around 2 feet or so from the foot being left stationary behind and lower your upper body down, while keeping the torso upright and maintaining balance. Inhale as you go down. Note: As in the other exercises, do not allow your knee to go forward beyond your toes as you come down, as this will put undue stress on the knee joint. Make sure that you keep your front shin perpendicular to the ground.');
INSERT INTO instructions (id, instruction) VALUES ('2c2e0b59-6f7b-49b7-bd59-e975afc18628', 'While holding a dumbbell in one hand, lay with your chest down on a slightly inclined (around 15 degrees when measured from the floor) adjustable bench. The other hand can be used to hold to the leg of the bench for stability.');
INSERT INTO instructions (id, instruction) VALUES ('7e15237a-9f10-4b31-a49b-374c5f990d25', 'Position the palm of the hand that is holding the dumbbell in a neutral manner (palms facing your torso) as you keep the arm extended with the elbow slightly bent. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b2aefbfb-e4ba-4a51-8631-d18a625dfb29', 'Now raise the arm with the dumbbell to the side until your elbow is at shoulder height and your arm is roughly parallel to the floor as you exhale. Tip: Maintain your arm perpendicular to the torso while keeping your arm extended throughout the movement. Also, keep the contraction at the top for a second.');
INSERT INTO instructions (id, instruction) VALUES ('c8e60811-7a23-442d-baec-a06ce9ed1a28', 'Slowly lower the dumbbell to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('595cec89-5a36-4e85-903b-8c85c890c878', 'Lie on a flat bench face down with one arm holding a dumbbell and the other hand on top of the bench folded so that you can rest your head on it.');
INSERT INTO instructions (id, instruction) VALUES ('39490e37-d405-4dce-97bd-08ffc5d66aec', 'Bend the elbows of the arm holding the dumbbell so that it creates a 90-degree angle between the upper arm and the forearm.');
INSERT INTO instructions (id, instruction) VALUES ('8a83c125-d993-40e0-b956-7270ae6acc7b', 'Now raise the upper arm so that the forearm is perpendicular to the floor and the upper arm is perpendicular to your torso. Tip: The upper arm should be parallel to the floor and also creating a 90-degree angle with your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1bede50f-225b-45fe-a29d-16de0de57d1e', 'As you breathe out, externally rotate your forearm so that the dumbbell is lifted forward as you maintain the 90 degree angle bend between the upper arms and the forearm. You will continue this external rotation until the forearm is parallel to the floor. At this point you will hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('b37318ab-c232-4820-9728-7b01758576b3', 'As you breathe in, slowly go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9af5ba75-5250-4a1d-9374-818e5062bd2a', 'While holding a dumbbell in each hand, lay with your chest down on a slightly inclined (around 15 degrees when measured from the floor) adjustable bench.');
INSERT INTO instructions (id, instruction) VALUES ('bf2696ed-137f-4194-9f1b-73c9cbfb2999', 'Position the palms of the hands in a neutral manner (palms facing your torso) as you keep the arms extended with the elbows slightly bent. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('88fa862b-3a7e-47c9-9375-a80e8fab51c2', 'Now raise the arms to the side until your elbows are at shoulder height and your arms are roughly parallel to the floor as you exhale. Tip: Maintain your arms perpendicular to the torso while keeping them extended throughout the movement. Also, keep the contraction at the top for a second.');
INSERT INTO instructions (id, instruction) VALUES ('5a5b8ea6-1874-47dc-81f2-e02c361edb36', 'Slowly lower the dumbbells to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('a334a07a-88fb-421e-b2a6-0b0ea3f5f6ee', 'Repeat for the recommended amount of repetitions and then switch to the other arm.');
INSERT INTO instructions (id, instruction) VALUES ('9874e0a2-b002-4ae7-8e88-50b3b5b30de6', 'Lie sideways on a flat bench with one arm holding a dumbbell and the other hand on top of the bench folded so that you can rest your head on it.');
INSERT INTO instructions (id, instruction) VALUES ('bf74d6ba-fa07-4694-ab4e-8eb71a524251', 'Now raise the upper arm so that the forearm is parallel to the floor and perpendicular to your torso (Tip: So the forearm will be directly in front of you). The upper arm will be stationary by your torso and should be parallel to the floor (aligned with your torso at all times). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b38e602f-c2d5-4fad-981b-4671a90b4a99', 'As you breathe out, externally rotate your forearm so that the dumbbell is lifted up in a semicircle motion as you maintain the 90 degree angle bend between the upper arms and the forearm. You will continue this external rotation until the forearm is perpendicular to the floor and the torso pointing towards the ceiling. At this point you will hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('dd100949-c856-49c4-8edc-43168a8e6e86', 'Grab a dumbbell and either sit on a military press bench or a utility bench that has a back support on it as you place the dumbbells upright on top of your thighs or stand up straight.');
INSERT INTO instructions (id, instruction) VALUES ('0c8ceb36-5fa6-4a32-926b-a31d10747811', 'Clean the dumbbell up to bring it to shoulder height. The other hand can be kept fully extended to the side, by the waist or grabbing a fixed surface.');
INSERT INTO instructions (id, instruction) VALUES ('bbed4bad-8bd9-42d9-bb6b-e8e2f5f6dfc6', 'Rotate the wrist so that the palm of your hand is facing forward. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1fd7b77d-f178-42dc-a0d1-9f14156acb97', 'As you exhale, push the dumbbell up until your arm is fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('ce5b2c95-41f6-4f99-95fb-cd4b9e63cd30', 'After a second pause, slowly come down back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('b9c38678-3337-4233-ad02-20fcd72c4ec8', 'Repeat for the recommended amount of repetitions and then switch arms.');
INSERT INTO instructions (id, instruction) VALUES ('c918a41b-9749-4f59-ab32-b86c7dabf2ff', 'Clean the dumbbell up to bring it to shoulder height and then extend the arm over your head so that the whole arm is perpendicular to the floor and next to your head. The dumbbell should be on top of you. The other hand can be kept fully extended to the side, by the waist, supporting the upper arm that has the dumbbell or grabbing a fixed surface.');
INSERT INTO instructions (id, instruction) VALUES ('e088ac11-c662-4a9c-9134-d996d9a94bfc', 'Rotate the wrist so that the palm of your hand is facing forward and the pinkie is facing the ceiling. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4f6ef096-2fdc-47b2-8663-2df11c044b45', 'Slowly lower the dumbbell behind your head as you hold the upper arm stationary. Inhale as you perform this movement and pause when your triceps are fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('af6a1020-9ae8-49d1-bc45-dd70280a0eb9', 'Return to the starting position by flexing your triceps as you breathe out. Tip: It is imperative that only the forearm moves. The upper arm should remain at all times stationary next to your head.');
INSERT INTO instructions (id, instruction) VALUES ('1b4d789b-67ff-448e-910c-edc8f9b7870c', 'Grab a dumbbell and stand up straight with your arm extended in front of you with a slight bend at the elbows and your back straight. This will be your starting position. Tip: The dumbbell should be resting on top of your thigh with the palm of your hands facing your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('9aa18e77-c459-4391-98ab-3e2e9d09d26b', 'Keep the other hand can be kept fully extended to the side, by the waist or grabbing a fixed surface. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7af1b959-9108-45a9-bdeb-6327f7dfaa0a', 'Use your side shoulders to lift the dumbbell as you exhale. The dumbbell should be close to the body as you move it up. Continue to lift it until the dumbbell is nearly in line with your chin. Tip: Your elbows should drive the motion. As you lift the dumbbell, your elbow should always be higher than your forearm. Also, keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('10f24bda-6f4d-43a7-baa9-d82c14d4fb12', 'Lower the dumbbell back down slowly to the starting position. Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('485ab59b-e23e-4e25-9eee-f309b4446133', 'Grab a dumbbell on each hand and lie face down on an incline bench with your shoulders near top of the incline. Your knees can rest on the seat or your legs can be straddled to the sides (my preferred way).');
INSERT INTO instructions (id, instruction) VALUES ('640c32a9-cb87-4e55-9717-b3445a87523c', 'Let your arms extend and hang naturally in front of you so that they are perpendicular to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('8822fd81-d789-41b3-9265-46c1b350d263', 'Now keep your elbows in by your side and face the palms forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fd65c40f-5657-4d7b-93f1-8ec3f8bc4e89', 'Raise the dumbbells by contracting the biceps until your arms are fully flexed. Exhale as you perform this portion of the movement and ensure that only the forearms move. The upper arms should remain stationary at all times.');
INSERT INTO instructions (id, instruction) VALUES ('a9a8110b-30b7-4cd5-80fa-bd8cc0b069e8', 'Lower the dumbbells until your arms are fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('90881feb-6504-4983-8ce3-5e080d9877e2', 'Repeat for the recommended amount of times.');
INSERT INTO instructions (id, instruction) VALUES ('30426bfa-bdfd-4949-9646-7d3b79bffaba', 'Grab a dumbbell in each arm and stand up straight with your arms extended by your sides with a slight bend at the elbows and your back straight. This will be your starting position. Tip: The dumbbell should be next to your thighs with the palm of your hands facing back.');
INSERT INTO instructions (id, instruction) VALUES ('262818e4-2b3a-4d40-a3c1-0521012ab79e', 'Use your side shoulders to lift the dumbbells as you exhale. The dumbbells should be to the side of the body as you move them up. Continue to lift it until the dumbbells are nearly in line with your chin. Tip: Your elbows should drive the motion. As you lift the dumbbell, your elbow should always be higher than your forearm. Also, keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('b6eb3ebf-c661-4e7b-b033-1ed77b3caafb', 'Lower the dumbbells back down slowly to the starting position. Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('c95ee821-ef57-4086-995f-46729f8010ba', 'Step backward with your right leg around two feet or so from the left foot and lower your upper body down, while keeping the torso upright and maintaining balance. Inhale as you go down. Tip: As in the other exercises, do not allow your knee to go forward beyond your toes as you come down, as this will put undue stress on the knee joint. Make sure that you keep your front shin perpendicular to the ground. Keep the torso upright during the lunge; flexible hip flexors are important. A long lunge emphasizes the Gluteus Maximus; a short lunge emphasizes Quadriceps.');
INSERT INTO instructions (id, instruction) VALUES ('0daf92cc-b6a6-4c4c-8755-5a514f84821c', 'Push up and go back to the starting position as you exhale. Tip: Use the ball of your feet to push in order to accentuate the quadriceps. To focus on the glutes, press with your heels.');
INSERT INTO instructions (id, instruction) VALUES ('e0fce27a-f649-4513-bf12-35787e73b6ed', 'Now repeat with the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('dbd8721e-70e5-4fcb-9306-a72be83ed33e', 'This corrective exercise strengthens the muscles that stabilize your shoulder blade. Hold a light weight in each hand, hanging at your sides. Your thumbs should pointing up.');
INSERT INTO instructions (id, instruction) VALUES ('aa18515a-953b-4a86-ace9-96c29ecf84d2', 'Begin the movement raising your arms out in front of you, about 30 degrees off center. Your arms should be fully extended as you perform the movement.');
INSERT INTO instructions (id, instruction) VALUES ('81e102d4-9b87-45a9-a6e1-8a0c667b45d3', 'Continue until your arms are parallel to the ground, and then return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('792585a5-7d2c-4b62-90d4-c960cee21cd2', 'Position a box a couple feet to the side of a bench. Hold a dumbbell to your chest with both hands and seat yourself on the bench facing the box. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e9b9f289-45cf-4edd-af79-c0d5c2f0d9bc', 'Plant your feet firmly on the ground as you lean forward, extending through the hips and knees to jump up and forward.');
INSERT INTO instructions (id, instruction) VALUES ('b7b66d1b-ce34-4c79-af03-00433dbba13f', 'Land on the box with both feet, absorbing the impact by allowing the hips and knees to bend.');
INSERT INTO instructions (id, instruction) VALUES ('d6b2ccb2-ecc8-495b-a6a7-60a98e6315de', 'Step down and return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bf6e452c-91a8-42ea-b476-057cbbd156dd', 'Place a block on the floor about 12 inches from a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('43d69a58-e165-4de8-8f03-651c9eb37da9', 'Sit on a flat bench and place a dumbbell on your upper left thigh about 3 inches above your knee.');
INSERT INTO instructions (id, instruction) VALUES ('6ad65248-29fe-4051-85da-d813630b3309', 'Now place the ball of your left foot on the block. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2787ab5e-19e9-42e1-8173-dea43ad553d8', 'Raise your toes up as high as possible as you exhale and you contract your calf muscle. Hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('02564358-7c64-4d31-a33a-68b1432cb6d0', 'Slowly return to the starting position, stretching as far down as possible.');
INSERT INTO instructions (id, instruction) VALUES ('f4957112-451d-471f-8732-c56c8fece65c', 'Repeat for your prescribed number of repetitions and then repeat with the right leg.');
INSERT INTO instructions (id, instruction) VALUES ('ccc0deb9-f65f-4e5d-84cc-6c130c96c0d7', 'While holding a dumbbell in each hand, sit on a military press bench or utility bench that has back support. Place the dumbbells upright on top of your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('3e5ba3fa-b7ce-44dc-8cb8-afb506101ecb', 'Now raise the dumbbells to shoulder height one at a time using your thighs to help propel them up into position.');
INSERT INTO instructions (id, instruction) VALUES ('7da536da-23d0-4472-a6d2-a4296e4bd901', 'Make sure to rotate your wrists so that the palms of your hands are facing forward. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('505f1b86-c632-4d4f-b550-4556aee8502e', 'Now, exhale and push the dumbbells upward until they touch at the top.');
INSERT INTO instructions (id, instruction) VALUES ('abc4323e-7078-4b5e-9722-c3033025b56b', 'Then, after a brief pause at the top contracted position, slowly lower the weights back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('7ce64380-e690-4ecf-9558-2f6beca577b6', 'Stand erect with a dumbbell on each hand (palms facing your torso), arms extended on the sides.');
INSERT INTO instructions (id, instruction) VALUES ('3085e4cb-e812-4e68-9b54-ea8992e94bc9', 'Lift the dumbbells by elevating the shoulders as high as possible while you exhale. Hold the contraction at the top for a second. Tip: The arms should remain extended at all times. Refrain from using the biceps to help lift the dumbbells. Only the shoulders should be moving up and down.');
INSERT INTO instructions (id, instruction) VALUES ('c95e4b48-9707-40ad-984b-82ea3588bd0f', 'Lower the dumbbells back to the original position.');
INSERT INTO instructions (id, instruction) VALUES ('044f3fa2-424a-4805-8be2-492f585ecaec', 'Stand up straight while holding a dumbbell on the left hand (palms facing the torso) as you have the right hand holding your waist. Your feet should be placed at shoulder width. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bc62b830-eac9-4a16-bf43-f42fc523b13d', 'Repeat for the recommended amount of repetitions and then change hands.');
INSERT INTO instructions (id, instruction) VALUES ('9a59d794-39d4-47e5-a8c0-941c6976d088', 'Stand up straight while holding a dumbbell on each hand (palms facing the side of your legs).');
INSERT INTO instructions (id, instruction) VALUES ('b938870d-de99-43df-93de-30976069315c', 'Position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times as looking down will get you off balance and also maintain a straight back. This will be your starting position. Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances discussed in the foot stances section.');
INSERT INTO instructions (id, instruction) VALUES ('3d9f851c-1183-433a-b55c-595421e8dc20', 'Begin to slowly lower your torso by bending the knees as you maintain a straight posture with the head up. Continue down until your thighs are parallel to the floor. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('1fb52683-1033-4861-ad06-c5e1775a584a', 'Begin to raise your torso as you exhale by pushing the floor with the heel of your foot mainly as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('79410551-863b-400f-9cd1-889b4b80e35e', 'Stand up straight with a flat bench behind you while holding a dumbbell on each hand (palms facing the side of your legs).');
INSERT INTO instructions (id, instruction) VALUES ('454aed25-3c83-4727-8726-40d20f2e6b1f', 'Begin to slowly lower your torso by bending the knees as you maintain a straight posture with the head up. Continue down until you slightly touch the bench behind you. Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('d1391301-ff61-40ba-98bb-1b304358983d', 'Begin to raise the bar as you exhale by pushing the floor with the heel of your foot mainly as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9acbe832-2395-42c4-8490-71261e254500', 'Lie down on a flat bench holding two dumbbells directly above your shoulders. Your arms should be fully extended and form a 90 degree angle from your torso and the floor.');
INSERT INTO instructions (id, instruction) VALUES ('3b044d7f-efd6-44b2-a414-0cb731df4ec5', 'The palms of your hands should be facing forward, and your elbows should be tucked in. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d8e21ff9-dbd5-476e-9386-d63bba3deaff', 'Now, inhale and slowly lower the dumbbells until they are near your ears. Be sure to keep your upper arms stationary and your elbows tucked in.');
INSERT INTO instructions (id, instruction) VALUES ('56f21090-0ee8-408d-8395-7642b6ce04c6', 'Then, exhale and use your triceps to return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4ec8d9c8-6fb1-4f61-bd2b-cb1e861f856a', 'Keeping your arms straight, swing them straight up in front of you 5-10 times, increasing the range of motion each time until your arms are above your head.');
INSERT INTO instructions (id, instruction) VALUES ('e1f3eeb8-958c-4fc1-aef6-b03a957b01e8', 'Stand with your hands together, arms extended directly in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('64ea2373-9f22-4e35-bb2d-5ef2c2ea0740', 'Keeping your arms straight, quickly move your arms back as far as possible and back in again, similar to an exaggerated clapping motion. Repeat 5-10 times, increasing speed as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('98b8bf1d-f86b-453e-b777-983a75fd4d1a', 'Stand up straight while holding an EZ curl bar at the wide outer handle. The palms of your hands should be facing forward and slightly tilted inward due to the shape of the bar. Keep your elbows close to your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8fbe90c7-ee2c-4956-a663-facd6e17c66b', 'Now, while keeping your upper arms stationary, exhale and curl the weights forward while contracting the biceps. Focus on only moving your forearms.');
INSERT INTO instructions (id, instruction) VALUES ('7d78e207-90a2-47ac-b5bd-57b7c036bb07', 'Continue to raise the weight until your biceps are fully contracted and the bar is at shoulder level. Hold the top contracted position for a moment and squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('799ba621-b40f-4660-940e-245a6930240c', 'Then inhale and slowly lower the bar back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('32e9ae5a-f0ff-4162-a48d-8aedf7e968a4', 'Using a close grip, lift the EZ bar and hold it with your elbows in as you lie on the bench. Your arms should be perpendicular to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4343c3a1-94f8-44e5-953b-da83ee5b2f4b', 'Keeping the upper arms stationary, lower the bar by allowing the elbows to flex. Inhale as you perform this portion of the movement. Pause once the bar is directly above the forehead.');
INSERT INTO instructions (id, instruction) VALUES ('6b12af4b-348c-4065-99ab-09bf8461b594', 'Lift the bar back to the starting position by extending the elbow and exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('bceeee33-382e-4712-9ca7-8516834415cb', 'Sit or stand with your feet slightly apart.');
INSERT INTO instructions (id, instruction) VALUES ('c00cb76f-10fe-45fd-b0e8-659a78510857', 'Place your hands on your shoulders with your elbows at shoulder level and pointing out.');
INSERT INTO instructions (id, instruction) VALUES ('ba2938c0-102b-4ebe-95a2-1019ad5f6f9b', 'Slowly make a circle with your elbows. Breathe out as you start the circle and breathe in as you complete the circle.');
INSERT INTO instructions (id, instruction) VALUES ('c908a497-27ab-4361-9871-89979a5ed612', 'Lie on the floor, crossing your right leg across your bent left knee. Clasp your hands behind your head, beginning with your shoulder blades on the ground. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('47f9ef68-2746-4128-8a6e-6af8bd26bbf2', 'Perform the motion by flexing the spine and rotating your torso to bring the left elbow to the right knee.');
INSERT INTO instructions (id, instruction) VALUES ('d0504b6b-f0a9-47d5-b224-99272235195b', 'Return to the starting position and repeat the movement for the desired number of repetitions before switching sides.');
INSERT INTO instructions (id, instruction) VALUES ('852fbd54-7fb9-4442-8094-b932c762505e', 'Stand up straight.');
INSERT INTO instructions (id, instruction) VALUES ('dd238f98-11af-41a5-a0db-7abe2ab1af21', 'Place both hands on your lower back, fingers pointing downward and elbows out.');
INSERT INTO instructions (id, instruction) VALUES ('4808994d-a1f4-4a33-a071-babe40ccc442', 'Then gently pull your elbows back aiming to touch them together.');
INSERT INTO instructions (id, instruction) VALUES ('cddc3430-65eb-4582-8180-e16ba58c3827', 'Position a bar onto a rack at shoulder height loaded to an appropriate weight. Place a short, raised platform behind you.');
INSERT INTO instructions (id, instruction) VALUES ('a221acb7-28d2-48ca-8f08-60441bc346b6', 'Rack the bar onto your upper back, keeping your back arched and tight. Step onto your raised platform with both feet. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('88b13509-6394-4cda-ade6-e3d3464603a6', 'Begin by stepping backwards with one leg. Descend by flexing your hips and knees until your knee touches the floor.');
INSERT INTO instructions (id, instruction) VALUES ('f200644e-6291-4668-90cb-bc8a80d4b841', 'Pause, and extend through the hips and knees to rise up, returning all the way to the starting position before alternating.');
INSERT INTO instructions (id, instruction) VALUES ('9e9a4d03-7f2f-416c-92ed-86ffdcf8511d', 'Get a platform of some sort (it can be an aerobics or calf raise platform) that is around 4-6 inches in height.');
INSERT INTO instructions (id, instruction) VALUES ('07e2b74a-7584-40eb-aea3-0d32d5b81425', 'Place it on the seat of the cable row machine.');
INSERT INTO instructions (id, instruction) VALUES ('ef75b1bf-89d9-4541-b378-61276eb0ab84', 'Sit down on the machine and place your feet on the front platform or crossbar provided making sure that your knees are slightly bent and not locked.');
INSERT INTO instructions (id, instruction) VALUES ('d4240ad4-5efe-460e-ba1c-de12d7d5f94c', 'Lean over as you keep the natural alignment of your back and grab the V-bar handles.');
INSERT INTO instructions (id, instruction) VALUES ('f8dbfe9b-fa17-4f59-992e-5767b76be040', 'With your arms extended pull back until your torso is at a 90-degree angle from your legs. Your back should be slightly arched and your chest should be sticking out. You should be feeling a nice stretch on your lats as you hold the bar in front of you. This is the starting position of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('220b2287-ccd8-48fc-a38f-cf71777d759f', 'Keeping the torso stationary, pull the handles back towards your torso while keeping the arms close to it until you touch the abdominals. Breathe out as you perform that movement. At that point you should be squeezing your back muscles hard. Hold that contraction for a second and slowly go back to the original position while breathing in.');
INSERT INTO instructions (id, instruction) VALUES ('81619f9d-aef9-479d-b9f3-be8976bdcb63', 'To begin, step onto the elliptical and select the desired option from the menu. Most ellipticals have a manual setting, or you can select a program to run. Typically, you can enter your age and weight to estimate the amount of calories burned during exercise. Elevation can be adjusted to change the intensity of the workout.');
INSERT INTO instructions (id, instruction) VALUES ('a256f2a7-e583-4373-aacb-c64bc9eb2561', 'The handles can be used to monitor your heart rate to help you stay at an appropriate intensity.');
INSERT INTO instructions (id, instruction) VALUES ('95c0dd37-9f99-4917-bb17-739ebfbc5164', 'Lie on an exercise ball with your lower back curvature pressed against the spherical surface of the ball. Your feet should be bent at the knee and pressed firmly against the floor. The upper torso should be hanging off the top of the ball. The arms should either be kept alongside the body or crossed on top of your chest as these positions avoid neck strains (as opposed to the hands behind the back of the head position).');
INSERT INTO instructions (id, instruction) VALUES ('b34ecfe0-35e9-4e4f-a55d-ae5ca2d31dcf', 'Lower your torso into a stretch position keeping the neck stationary at all times. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('36158acd-2a77-4ced-85b1-1dd55aebd303', 'With the hips stationary, flex the waist by contracting the abdominals and curl the shoulders and trunk upward until you feel a nice contraction on your abdominals. The arms should simply slide up the side of your legs if you have them at the side or just stay on top of your chest if you have them crossed. The lower back should always stay in contact with the ball. Exhale as you perform this movement and hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('51615ae8-cc8e-40ec-b89b-6c334969f605', 'As you inhale, go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7aea5a48-118d-421e-bfb2-689488384c5f', 'Place an exercise ball nearby and lay on the floor in front of it with your hands on the floor shoulder width apart in a push-up position.');
INSERT INTO instructions (id, instruction) VALUES ('a159b617-519b-4ea3-b2bb-0bc0fd8aeecf', 'Now place your lower shins on top of an exercise ball. Tip: At this point your legs should be fully extended with the shins on top of the ball and the upper body should be in a push-up type of position being supported by your two extended arms in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('46f6a8ea-18f9-4598-8e7f-c4bbc419229c', 'While keeping your back completely straight and the upper body stationary, pull your knees in towards your chest as you exhale, allowing the ball to roll forward under your ankles. Squeeze your abs and hold that position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('30315a8c-f4c9-494f-a9f7-add4723e8609', 'Now slowly straighten your legs, rolling the ball back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('31579c39-3bb2-446a-9ce4-b5736f945f00', 'Lie on the floor and position a kettlebell for one arm to press. The kettlebell should be held by the handle. The leg on the same side that you are pressing should be bent, with the knee crossing over the midline of the body.');
INSERT INTO instructions (id, instruction) VALUES ('62b32b99-caa5-483a-accd-dd238d0019f1', 'Press the kettlebell by extending the elbow and adducting the arm, pressing it above your body. Return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b171587c-1750-429a-a155-61334fde9e85', 'Bend the elbows of the arm holding the dumbbell so that it creates a 90-degree angle between the upper arm and the forearm. Tip: Keep the arm parallel to your torso.');
INSERT INTO instructions (id, instruction) VALUES ('ecc75309-b282-42a0-97fc-eb73245edaf1', 'Now bend the elbow while keeping the upper arm stationary. In this manner, the forearm will be parallel to the floor and perpendicular to your torso (Tip: So the forearm will be directly in front of you). The upper arm will be stationary by your torso and should be parallel to the floor (aligned with your torso at all times). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('219a162f-dc30-468f-8b41-639cd60f4ec1', 'Choke the band around a post. The band should be at the same height as your elbow. Stand with your left side to the band a couple of feet away.');
INSERT INTO instructions (id, instruction) VALUES ('5e1c581b-7548-4633-97e2-65f6cb3909b8', 'Grasp the end of the band with your right hand, and keep your elbow pressed firmly to your side. We recommend you hold a pad or foam roll in place with your elbow to keep it firmly in position.');
INSERT INTO instructions (id, instruction) VALUES ('94e26561-2b2a-47f3-a3e9-51d5c25fed1f', 'With your upper arm in position, your elbow should be flexed to 90 degrees with your hand reaching across the front of your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8e6f5f56-f48e-4146-bbb9-acf92f36e526', 'Execute the movement by rotating your arm in a backhand motion, keeping your elbow in place.');
INSERT INTO instructions (id, instruction) VALUES ('3efb44b6-0143-40fb-9174-a80428c877f8', 'Continue as far as you are able, pause, and then return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('be01ba12-f40c-4800-91b0-718f57b079a7', 'Adjust the cable to the same height as your elbow. Stand with your left side to the band a couple of feet away.');
INSERT INTO instructions (id, instruction) VALUES ('95a02f6c-a491-404c-843c-501ee34b6d7b', 'Grasp the handle with your right hand, and keep your elbow pressed firmly to your side. We recommend you hold a pad or foam roll in place with your elbow to keep it firmly in position.');
INSERT INTO instructions (id, instruction) VALUES ('16ae5899-5a12-4842-94b0-73994fa15e06', 'Facing a high pulley with a rope or dual handles attached, pull the weight directly towards your face, separating your hands as you do so. Keep your upper arms parallel to the ground.');
INSERT INTO instructions (id, instruction) VALUES ('dcf049ad-7343-4920-a764-e1a9be933531', 'There are various implements that can be used for the farmers walk. These can also be performed with heavy dumbbells or short bars if these implements aren''t available. Begin by standing between the implements.');
INSERT INTO instructions (id, instruction) VALUES ('78dd8e66-1b21-487e-9773-a5d26e1f7b25', 'After gripping the handles, lift them up by driving through your heels, keeping your back straight and your head up.');
INSERT INTO instructions (id, instruction) VALUES ('dbc5e946-da24-47dc-99fb-78824062d02e', 'Walk taking short, quick steps, and don''t forget to breathe. Move for a given distance, typically 50-100 feet, as fast as possible.');
INSERT INTO instructions (id, instruction) VALUES ('ec43bbb6-abaa-4496-b228-ceb6c9457b60', 'Start in a relaxed position with one leg slightly forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1957b991-ff5e-4776-8ccf-8c0894dc025c', 'Skip by executing a step-hop pattern of right-right-step to left-left-step, and so on, alternating back and forth.');
INSERT INTO instructions (id, instruction) VALUES ('01531fac-f785-47ae-a1b4-420b4df76498', 'Perform fast skips by maintaining close contact with the ground and reduce air time, moving as quickly as possible.');
INSERT INTO instructions (id, instruction) VALUES ('632a0604-b265-42c9-bb58-d17820967f0d', 'Hold a barbell with both hands and your palms facing up; hands spaced about shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('b3224452-16e8-499c-b75e-fcc4d9cf05cb', 'Place your feet flat on the floor, at a distance that is slightly wider than shoulder width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('aeaf0cc1-5608-4265-83a8-e994652673aa', 'Lower the bar as far as possible by extending the fingers. Allowing the bar to roll down the hands, catch the bar with the final joint in the fingers.');
INSERT INTO instructions (id, instruction) VALUES ('eca56775-a431-4b91-b6fc-ceb44c54ca76', 'Now curl bar up as high as possible by closing your hands while exhaling. Hold the contraction at the top.');
INSERT INTO instructions (id, instruction) VALUES ('092bb69d-6c8b-4003-9375-59400394b036', 'Position a flat bench between two low pulleys so that when you are laying on it, your chest will be lined up with the cable pulleys.');
INSERT INTO instructions (id, instruction) VALUES ('3cbfbc96-f5fe-4af5-b1df-8237ddea7109', 'Lay flat on the bench and keep your feet on the ground.');
INSERT INTO instructions (id, instruction) VALUES ('d1c6c588-a3ac-440e-99c8-9be3bd77b86e', 'Have someone hand you the handles on each hand. You will grab each single handle attachment with a palms up grip.');
INSERT INTO instructions (id, instruction) VALUES ('2323bd13-abf7-4b8f-89c9-e959db8cd071', 'Extend your arms by your side with a slight bend on your elbows. Tip: You will keep this bend constant through the whole movement. Your arms should be parallel to the floor. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3fc9b581-b1da-46fa-bbad-e5e601a676a2', 'Now start lifting the arms in a semi-circle motion directly in front of you by pulling the cables together until both hands meet at the top of the movement. Squeeze your chest as you perform this motion and breathe out during this movement. Also, hold the contraction for a second at the top. Tip: When performed correctly, at the top position of this movement, your arms should be perpendicular to your torso and the floor touching above your chest.');
INSERT INTO instructions (id, instruction) VALUES ('33e9331b-c6e7-48bb-ade5-fff13513f548', 'Slowly come back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('35eaa3c0-46fb-4918-834d-27186884a0e2', 'Lie on an exercise mat or a flat bench with your legs off the end.');
INSERT INTO instructions (id, instruction) VALUES ('703683ec-a4d5-47bc-ad37-89abce4c525c', 'Place your hands either under your glutes with your palms down or by the sides holding on to the bench (or with palms down by the side on an exercise mat). Also extend your legs straight out. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fbaef433-d3da-4ea5-b2c0-febf74faa1c9', 'Bend your knees and pull your upper thighs into your midsection as you breathe out. Continue this movement until your knees are near your chest. Hold the contracted position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('51a46596-3106-45f3-b69e-ceaacdd9b927', 'As you breathe in, slowly return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('907d4844-cac2-4b8b-a0d6-e800f9478400', 'Lie with your back flat on a bench and your legs extended in front of you off the end.');
INSERT INTO instructions (id, instruction) VALUES ('8949ee77-fff3-4cfe-86a3-46619fcea71a', 'Place your hands either under your glutes with your palms down or by the sides holding on to the bench. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f590d1df-db6d-4164-9949-07b3d205a5ae', 'As you keep your legs extended, straight as possible with your knees slightly bent but locked raise your legs until they make a 90-degree angle with the floor. Exhale as you perform this portion of the movement and hold the contraction at the top for a second.');
INSERT INTO instructions (id, instruction) VALUES ('05e9ee79-7f15-471d-baed-58521a8681c1', 'Now, as you inhale, slowly lower your legs back down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('112a8388-4f17-4f7c-a0d1-c72e45481bea', 'Hold the dumbbell towards the side farther from you so that you have more weight on the side closest to you. (This can be done for a good effect on all bicep dumbbell exercises). Now do a normal incline dumbbell curl, but keep your wrists as far back as possible so as to neutralize any stress that is placed on them.');
INSERT INTO instructions (id, instruction) VALUES ('440db781-2d27-408c-bc2a-bb02bb469ca9', 'Sit on an incline bench that is angled at 45-degrees while holding a dumbbell on each hand.');
INSERT INTO instructions (id, instruction) VALUES ('76da4adc-69fc-4ff2-a7ee-868319a3d250', 'Let your arms hang down on your sides, with the elbows in, and turn the palms of your hands forward with the thumbs pointing away from the body. Tip: You will keep this hand position throughout the movement as there should not be any twisting of the hands as they come up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1184cd84-ff8b-4eb4-81b4-20d39660ad8f', 'Curl up the two dumbbells at the same time until your biceps are fully contracted and exhale. Tip: Do not swing the arms or use momentum. Keep a controlled motion at all times. Hold the contracted position for a second at the top.');
INSERT INTO instructions (id, instruction) VALUES ('ed33cda3-20fc-4be5-bdfc-ed6f53a3db04', 'As you inhale, slowly go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('09b2badb-466d-4d4a-b0ea-ce178c2ea5d8', 'You can use a partner for this exercise or brace your feet under something stable.');
INSERT INTO instructions (id, instruction) VALUES ('30aa5100-bd59-49b9-b9aa-0b607109d808', 'Begin on your knees with your upper legs and torso upright. If using a partner, they will firmly hold your feet to keep you in position. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('116b3c4f-3274-4c2d-ba8b-7e7596576d93', 'Lower yourself by extending at the knee, taking care to NOT flex the hips as you go forward.');
INSERT INTO instructions (id, instruction) VALUES ('71aa76b2-a6a7-445d-933e-d4601a288e16', 'Place your hands in front of you as you reach the floor. This movement is very difficult and you may be unable to do it unaided. Use your arms to lightly push off the floor to aid your return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ad2ff705-0956-4d73-866b-e93d4163a825', 'Adjust the j-hooks so they are at the appropriate height to rack the bar. Begin lying on the floor with your head near the end of a power rack. Keeping your shoulder blades pulled together; pull the bar off of the hooks.');
INSERT INTO instructions (id, instruction) VALUES ('9c0bcc9b-5c14-4851-94e2-d3213f004cdd', 'Lower the bar towards the bottom of your chest or upper stomach, squeezing the bar and attempting to pull it apart as you do so. Ensure that you tuck your elbows throughout the movement. Lower the bar until your upper arm contacts the ground and pause, preventing any slamming or bouncing of the weight.');
INSERT INTO instructions (id, instruction) VALUES ('2036cd1f-39d0-436a-8c0f-8ef3ddb71e1d', 'Press the bar back up as fast as you can, keeping the bar, your wrists, and elbows in line as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('00463f59-0313-4cb7-bc31-fc68212ab383', 'Adjust the j-hooks so they are at the appropriate height to rack the bar. For this exercise, drape the chains directly over the end of the bar, trying to keep the ends away from the plates.');
INSERT INTO instructions (id, instruction) VALUES ('2b3957d5-a653-4105-8c95-b9647d879f51', 'Begin lying on the floor with your head near the end of a power rack. Keeping your shoulder blades pulled together, pull the bar off of the hooks.');
INSERT INTO instructions (id, instruction) VALUES ('1b4c3045-d297-421e-92a0-0338e035fb88', 'On a flat bench lie facedown with the hips on the edge of the bench, the legs straight with toes high off the floor and with the arms on top of the bench holding on to the front edge.');
INSERT INTO instructions (id, instruction) VALUES ('2485379c-5fb5-4161-8467-1a8641fb3250', 'Squeeze your glutes and hamstrings and straighten the legs until they are level with the hips. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d9bc06a5-8302-4da2-bc41-219e842f7e6d', 'Start the movement by lifting the left leg higher than the right leg.');
INSERT INTO instructions (id, instruction) VALUES ('e38dc89c-d1eb-41e6-a707-495838901bc9', 'Then lower the left leg as you lift the right leg.');
INSERT INTO instructions (id, instruction) VALUES ('6ccd3284-79c9-499d-9865-fc1b18399033', 'Continue alternating in this manner (as though you are doing a flutter kick in water) until you have done the recommended amount of repetitions for each leg. Make sure that you keep a controlled movement at all times. Tip: You will breathe normally as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('91e27f13-4945-4166-8066-f40dcb1b1895', 'This exercise stretches the fascia of the muscles in the feet. Start off seated with your shoes removed. Using a foot roller or a similar object, such as a small section of pvc pipe, place your foot against the roller across the arch of your foot. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e41a4dfd-a0ca-4e88-8d8c-4643423f8ac9', 'Press down firmly, rolling across the arch of your foot. Hold for 10-30 seconds, and then switch feet.');
INSERT INTO instructions (id, instruction) VALUES ('4409604e-c310-485b-bcab-44ab7ba5bfa3', 'Attach a dual handled chain or rope attachment to the sled. You should be facing away from the sled, holding a handle in each hand.');
INSERT INTO instructions (id, instruction) VALUES ('6c40dba1-a66d-402d-95eb-23666a69a5a6', 'Begin the movement by moving forward for one step. Leaning forward, extend through the legs and hips to move, pausing with each step to extend through the elbows, pressing your hands forward. Step forward until you return to the start position prepared to press.');
INSERT INTO instructions (id, instruction) VALUES ('77d5bd42-246c-4183-95db-c4e00c03dabd', 'This drill teaches you the proper positioning of both the bar and your body during the clean and front squat.');
INSERT INTO instructions (id, instruction) VALUES ('6f04e787-9a1d-4c9b-bf36-6348912c9098', 'Place the barbell on the front of the shoulders, releasing your grip and extending your arms out in front of you. The shoulders should be pushed forward to create a shelf, and the bar should be in contact with the throat. Ensure that you only move your shoulder blades forward; don''t round the thoracic spine.');
INSERT INTO instructions (id, instruction) VALUES ('0cc44446-c83e-4cda-870c-0f63c6549d93', 'Squat by flexing the knees and hips, sitting in between your legs. Keep the torso upright, the arms up, and the shoulders forward, and the bar should stay in place. Go to the bottom of the squat, until your hamstrings contact your calves.');
INSERT INTO instructions (id, instruction) VALUES ('8d99b99b-3a9f-4aea-bd8f-f5d765c1f539', 'Return to the upright position by driving through the front of the heel and extending the knees and hips.');
INSERT INTO instructions (id, instruction) VALUES ('c7dbd77f-2c8d-486e-a60d-acc2aa3795e1', 'Cross your arms over your chest.');
INSERT INTO instructions (id, instruction) VALUES ('290bb681-a72a-4149-b90d-7c1e30791f1c', 'With your head up and your back straight, position your feet at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('724d5c9e-63b9-44cd-a77e-538acf586655', 'Keeping your back straight and chest up, squat down as you inhale until your upper thighs are parallel, or lower, to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('2a302b07-b6a0-4d48-b119-3c9f2b596f22', 'Now pressing mainly with the ball of your feet, jump straight up in the air as high as possible, using the thighs like springs. Exhale during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('7eec57d7-a437-4da2-9a7c-05b3dee0b26c', 'When you touch the floor again, immediately squat down and jump again.');
INSERT INTO instructions (id, instruction) VALUES ('cfe61719-5690-471d-8f02-df48851e0ba6', 'Stand with your hands behind your head, and squat down keeping your torso upright and your head up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c327e431-e01a-402d-b28b-08867f28a90a', 'Jump forward several feet, avoiding jumping unnecessarily high. As your feet contact the ground, absorb the impact through your legs, and jump again. Repeat this action 5-10 times.');
INSERT INTO instructions (id, instruction) VALUES ('634a3d0a-7584-49bf-b0ee-537052e57107', 'Lie with your back flat on the floor (or exercise mat) and your legs extended in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('0a8f4076-5b99-4cd3-bdff-5307a341d73f', 'Now bend at the knees and place your outer thighs by the floor (or mat) as you make the soles of your feet touch each other.');
INSERT INTO instructions (id, instruction) VALUES ('63cf0a4c-9377-45cd-9c24-98ad5efdd250', 'Now try pushing both soles and bringing them up as near you as possible while you keep the outer thighs on the floor (or at least almost touching it). Tip: In this position your legs should create a diamond shape.');
INSERT INTO instructions (id, instruction) VALUES ('bd45d88e-3d65-4b66-99e7-68a2e3ec2846', 'Now, cross your arms in front of you by touching the opposite shoulders. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('264d0b92-b596-4e5a-a7fa-28334814cad4', 'As you exhale flatten your lower back to the floor while curling the torso upwards. Tip: This will be like performing the first 1/4 movement of a sit up. Hold at the top position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('bf7454dc-9f08-465a-bd68-2610d5d7c725', 'As you inhale, slowly lower back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ff9347d5-84c1-4c4e-a736-00d59f6aefbf', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack that best matches your height. Once the correct height is chosen and the bar is loaded, bring your arms up under the bar while keeping the elbows high and the upper arm slightly above parallel to the floor. Rest the bar on top of the deltoids and cross your arms while grasping the bar for total control.');
INSERT INTO instructions (id, instruction) VALUES ('cdb5ba1d-b185-4f78-955d-9408b95da2c9', 'Lift the bar off the rack by first pushing with your legs and at the same time straightening your torso.');
INSERT INTO instructions (id, instruction) VALUES ('7266f7ab-f857-492d-a4fe-ea9ff557925a', 'Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times as looking down will get you off balance and also maintain a straight back. This will be your starting position. (Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances described in the foot positioning section).');
INSERT INTO instructions (id, instruction) VALUES ('a634b90b-18cc-4c16-977c-119a72570950', 'Begin to slowly lower the bar by bending the knees as you maintain a straight posture with the head up. Continue down until the angle between the upper leg and the calves becomes slightly less than 90-degrees (which is the point in which the upper legs are below parallel to the floor). Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('1372210b-88e6-4804-b1c8-67ae64d58fa4', 'Begin to raise the bar as you exhale by pushing the floor mainly with the middle of your foot as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('45b72a5d-a63b-468d-b7c3-15f45f1ca824', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set a flat bench behind you and set the bar on a rack that best matches your height. Once the correct height is chosen and the bar is loaded, bring your arms up under the bar while keeping the elbows high and the upper arm slightly above parallel to the floor. Rest the bar on top of the deltoids and cross your arms while grasping the bar for total control.');
INSERT INTO instructions (id, instruction) VALUES ('5220be7f-ef5e-484d-b685-541881b7716d', 'Begin to slowly lower the bar by bending the knees as you maintain a straight posture with the head up. Continue down until you touch the bench with your glutes. Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('8311179c-d82d-4173-b8ad-e36d3f580a83', 'Begin to raise the bar as you exhale by pushing the floor mainly with the heel of your foot as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('de699ea9-d73e-43fe-84c2-1d28f0797f96', 'Begin with a box of an appropriate height 1-2 feet in front of you. Stand with your feet should width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3a205733-1559-4871-a657-1c8eff9d19f8', 'Perform a short squat in preparation for jumping, swinging your arms behind you.');
INSERT INTO instructions (id, instruction) VALUES ('aab1b47d-3502-4982-9a2c-2cafab8c749b', 'Land on the box with the knees bent, absorbing the impact through the legs. You can jump from the box back to the ground, or preferably step down one leg at a time.');
INSERT INTO instructions (id, instruction) VALUES ('055538e4-7941-4084-99a0-03395efc4f95', 'Select the weight on a low pulley machine and grasp the single hand cable attachment that is attached to the low pulley with your left hand.');
INSERT INTO instructions (id, instruction) VALUES ('3b949256-6809-4d0d-8f6e-b65ecf177a4f', 'Face away from the pulley and put your arm straight down with the hand cable attachment in front of your thighs at arms'' length with the palms of the hand facing your thighs. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('75503763-a2a3-4bc1-9bfc-bf2d87495824', 'While maintaining the torso stationary (no swinging), lift the left arm to the front with a slight bend on the elbow and the palms of the hand always faces down. Continue to go up until you arm is slightly above parallel to the floor. Exhale as you execute this portion of the movement and pause for a second at the top.');
INSERT INTO instructions (id, instruction) VALUES ('a2624f0b-3d74-48bf-9ca2-9ba0409d7a27', 'Now as you inhale lower the arm back down slowly to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('17066b5a-4476-4307-bed8-8873b993889c', 'Once all of the recommended amount of repetitions have been performed for this arm, switch arms and perform the exercise with the right one.');
INSERT INTO instructions (id, instruction) VALUES ('1f9e1f1b-3bfc-4747-86e3-ba348e104752', 'Set up a row of cones or other small barriers, placing them a few feet apart.');
INSERT INTO instructions (id, instruction) VALUES ('55f13745-f7da-4bdb-ada7-ed4b8f28b8df', 'Stand in front of the first cone with your feet shoulder width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a89aaae5-ad37-48fd-9ad1-9954220fa764', 'Begin by jumping with both feet over the first cone, swinging both arms as you jump.');
INSERT INTO instructions (id, instruction) VALUES ('4ae48435-d763-46d0-a0a5-009f716f3671', 'Absorb the impact of landing by bending the knees, rebounding out of the first leap by jumping over the next cone.');
INSERT INTO instructions (id, instruction) VALUES ('aa205fc9-78a8-45c0-882d-8a7c2439d66f', 'Continue until you have jumped over all of the cones.');
INSERT INTO instructions (id, instruction) VALUES ('6f823115-21ab-4a6b-866d-a5ef885472fe', 'Pick a couple of dumbbells and stand with a straight torso and the dumbbells on front of your thighs at arms length with the palms of the hand facing your thighs. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('18575bd9-b53c-4322-8840-5ea261065122', 'While maintaining the torso stationary (no swinging), lift the left dumbbell to the front with a slight bend on the elbow and the palms of the hands always facing down. Continue to go up until you arm is slightly above parallel to the floor. Exhale as you execute this portion of the movement and pause for a second at the top. Inhale after the second pause.');
INSERT INTO instructions (id, instruction) VALUES ('047db9df-9e35-4df6-9948-c5e0263dc784', 'Now lower the dumbbell back down slowly to the starting position as you simultaneously lift the right dumbbell.');
INSERT INTO instructions (id, instruction) VALUES ('15e0190e-dcfc-4632-9be5-ccf994bcf121', 'Continue alternating in this fashion until all of the recommended amount of repetitions have been performed for each arm.');
INSERT INTO instructions (id, instruction) VALUES ('45c1e113-7ad5-4690-bea6-c08e25e8348e', 'Sit down on an incline bench with the incline set anywhere between 30 to 60 degrees while holding a dumbbell on each hand. Tip: You can change the angle to hit the muscle a little differently each time.');
INSERT INTO instructions (id, instruction) VALUES ('749b007c-8d22-4d92-b90d-82b87939b6b6', 'Extend your arms straight in front of you and have your palms facing down with the dumbbells raised about 1 inch above your thighs. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0fcaa50b-8eb5-4d8b-8d4d-41b91336117b', 'Slowly raise the dumbbells straight up until they are slightly above your shoulders, while keeping your elbows locked. Squeeze at the top for a second and make sure you breathe out during this portion of the movement. Tip: Keep your head resting down against the bench and your legs on the floor at all times.');
INSERT INTO instructions (id, instruction) VALUES ('e5f11503-a6b8-4abb-b7ac-d27f62c65f27', 'Lower the arms back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('859b262f-103e-4dbd-9eae-203e5ae64765', 'Stand next to a chair or other support, holding on with one hand.');
INSERT INTO instructions (id, instruction) VALUES ('33619565-d7af-4b98-b6c7-34659c572f6b', 'Swing your leg forward, keeping the leg straight. Continue with a downward swing, bringing the leg as far back as your flexibility allows. Repeat 5-10 times, and then switch legs.');
INSERT INTO instructions (id, instruction) VALUES ('217f1391-341b-4c03-9fde-95fbba8c6e40', 'While standing straight, hold a barbell plate in both hands at the 3 and 9 o''clock positions. Your palms should be facing each other and your arms should be extended and locked with a slight bend at the elbows and the plate should be down near your waist in front of you as far as you can go. Tip: The arms will remain in this position throughout the exercise. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8f1599c9-ed69-43bb-a33e-5f8d4f1832e9', 'Slowly raise the plate as you exhale until it is a little above shoulder level. Hold the contraction for a second. Tip: make sure that you do not swing the weight or bend at the elbows. Your torso should remain stationary throughout the movement as well.');
INSERT INTO instructions (id, instruction) VALUES ('6b28816b-1b71-4c3a-8214-ef99c6a8ea79', 'As you inhale, slowly lower the plate back down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9a321020-5ff1-4b58-8a04-da58700f8cc4', 'Lie on a flat bench while holding a barbell using a palms down grip that is about 15 inches apart.');
INSERT INTO instructions (id, instruction) VALUES ('79b08396-0d2a-4600-b731-5aa621b32bf9', 'Place the bar on your upper thighs, extend your arms and lock them while keeping a slight bend on the elbows. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('62bc1b42-b4a2-40ca-baf4-5e1730cde951', 'Now raise the weight using a semicircular motion and keeping your arms straight as you inhale. Continue the same movement until the bar is on the other side above your head . (Tip: the bar will travel approximately 180-degrees). At this point your arms should be parallel to the floor with the palms of your hands facing the ceiling.');
INSERT INTO instructions (id, instruction) VALUES ('2b48368a-53c3-4bdd-b983-bdafe5e80b30', 'Now return the barbell to the starting position by reversing the motion as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('a2c7d4e2-78c7-4a24-8344-9800dac9eccb', 'To begin, first set the bar in a rack slightly below shoulder level. Rest the bar on top of the deltoids, pushing into the clavicles, and lightly touching the throat. Your hands should be in a clean grip, touching the bar only with your fingers to help keep it in position.');
INSERT INTO instructions (id, instruction) VALUES ('c6b9e88f-8ca8-4400-960d-8cdc4d5063a7', 'Lift the bar off the rack by first pushing with your legs and at the same time straightening your torso. Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head and elbows up at all times. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9cf6ee90-68b6-4cce-b3db-3c5846afcbde', 'Bend at the knees, sitting down between your legs. Continue down until your hamstrings are on your calves. Keep your knees aligned with your feet by consciously using your abductors to push your knees out as you squat.');
INSERT INTO instructions (id, instruction) VALUES ('cd9b5d3c-dfdb-44b4-b695-defa5aa86cd7', 'Begin to raise the bar as you exhale by pushing the floor mainly with the heel or middle of your foot as you straighten the legs again and return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6c8de032-0455-40c5-a21f-2b229909df67', 'Looking straight ahead at all times, squat as low as you can and pause at the bottom. As you squat down, push your knees out. You should squat between your legs, keeping an upright torso, with your head and chest up.');
INSERT INTO instructions (id, instruction) VALUES ('3316ca80-e175-4ddf-961f-05ac3294ea9e', 'Rise back up by driving through your heels and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('2d93ba5c-f54f-4830-aa5e-19639bc99441', 'While maintaining the torso stationary (no swinging), lift the dumbbells to the front with a slight bend on the elbow and the palms of the hands always facing down. Continue to go up until you arms are slightly above parallel to the floor. Exhale as you execute this portion of the movement and pause for a second at the top.');
INSERT INTO instructions (id, instruction) VALUES ('2b618c9e-a228-462d-a608-74712f32114b', 'As you inhale, lower the dumbbells back down slowly to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bedef12e-86c2-4369-91fb-6aab8f710843', 'Either standing or seated on a high bench, grasp two stirrup cables that are attached to the high pulleys. Grab with the opposing hand so your arms are crisscrossed about you and your palms are facing forward.');
INSERT INTO instructions (id, instruction) VALUES ('6c4d75ed-b381-482c-9de9-eed4efb07ab3', 'Keeping your chest up and maintaining a slight arch in your lower back, pull the handles down as if you were doing a regular pulldown. The range of motion will be more of an arc. During the movement, rotate your hands so that in the bottom position your palms face each other rather than forward. Return slowly to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('47213641-ce44-47f0-919d-d4d76e97ed49', 'Grasp the pull-up bar with a shoulder width underhand grip.');
INSERT INTO instructions (id, instruction) VALUES ('44406ded-ee6a-481e-b142-2edb86470699', 'Now hang with your arms fully extended and stick your chest out and lean back. Tip: You will be leaning back throughout the entire movement. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1750592c-d42b-4bb1-90fb-a878fc06ae40', 'Start pulling yourself towards the bar with your spine arched throughout the movement and your head leaning back as far away from the bar as possible. Exhale as you perform this portion of the movement. Tip: At the upper end of the movement, your hips and legs will be at about a 45-degree angle to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('d76bf9aa-b9b4-4f03-a7c2-c2405f77fd87', 'Keep pulling until your collarbone passes the bar and your lower chest or sternum area touches it. Hold that contraction for a second. Tip: By the time you''ve completed this portion of the movement; your head will be parallel to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('5cfb2cf5-4413-4e1c-af11-20434e4320ca', 'Slowly start going back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('3d03b63c-21bc-4373-af64-0ebf2152bdc4', 'Begin by adjusting the equipment to fit your body. Place your feet against the footplate in between the rollers as you lie facedown. Your knees should be just behind the pad.');
INSERT INTO instructions (id, instruction) VALUES ('df029e49-f551-4dda-b006-434c330fced2', 'Start from the bottom of the movement. Keep your back arched as you begin the movement by flexing the knees. Drive your toes into the foot plate as you do so. Keep your upper body straight, and continue until your body is upright.');
INSERT INTO instructions (id, instruction) VALUES ('a70efca6-3986-489f-b7ad-10be870585dc', 'Return to the starting position, keeping your descent under control.');
INSERT INTO instructions (id, instruction) VALUES ('52a9a71d-e8da-4382-98e5-5044ed69abe1', 'Kneel on the floor or an exercise mat and bend at the waist with your arms extended in front of you (perpendicular to the torso) in order to get into a kneeling push-up position but with the arms spaced at shoulder width. Your head should be looking forward and the bend of the knees should create a 90-degree angle between the hamstrings and the calves. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('11fed8d8-6ada-45da-b644-1e4577a0b9d6', 'As you exhale, lift up your right leg until the hamstrings are in line with the back while maintaining the 90-degree angle bend. Contract the glutes throughout this movement and hold the contraction at the top for a second. Tip: At the end of the movement the upper leg should be parallel to the floor while the calf should be perpendicular to it.');
INSERT INTO instructions (id, instruction) VALUES ('e386214f-8fcf-41d9-8eb9-e85da487c19b', 'Go back to the initial position as you inhale and now repeat with the left leg.');
INSERT INTO instructions (id, instruction) VALUES ('73e5892f-ba02-485c-9baa-e94bcdcebbc1', 'Continue to alternate legs until all of the recommended repetitions have been performed.');
INSERT INTO instructions (id, instruction) VALUES ('fbc6b0df-4fa7-4afb-8fee-25bb595e9539', 'Stand holding a light kettlebell by the horns close to your chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fc6e779c-20c0-4830-82a1-3e901fdc7cb0', 'Squat down between your legs until your hamstrings are on your calves. Keep your chest and head up and your back straight.');
INSERT INTO instructions (id, instruction) VALUES ('14357bac-03db-49f5-bf17-b1fc63bd19ca', 'At the bottom position, pause and use your elbows to push your knees out. Return to the starting position, and repeat for 10-20 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('99f88d90-4be8-4954-a4ae-34096bef52a9', 'Begin with a bar on a rack at shoulder height. Rack the bar across the rear of your shoulders as you would a power squat, not on top of your shoulders. Keep your back tight, shoulder blades pinched together, and your knees slightly bent. Step back from the rack.');
INSERT INTO instructions (id, instruction) VALUES ('25cd0902-6a1f-4500-a252-c1b2f27c9ab6', 'Begin by bending at the hips, moving them back as you bend over to near parallel. Keep your back arched and your cervical spine in proper alignment.');
INSERT INTO instructions (id, instruction) VALUES ('64a44977-4b2b-448c-a7b3-ac5dd657ca74', 'Reverse the motion by extending through the hips with your glutes and hamstrings. Continue until you have returned to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d5b66b07-0ec9-4a58-a822-7b5d97f87e08', 'Begin with a bar on a rack at about the same height as your stomach. Bend over underneath the bar and rack the bar across the rear of your shoulders as you would a power squat, not on top of your shoulders. At the proper height, you should be near parallel to the floor when bent over. Keep your back tight, shoulder blades pinched together, and your knees slightly bent. Keep your back arched and your cervical spine in proper alignment.');
INSERT INTO instructions (id, instruction) VALUES ('66618e3f-08d9-48a9-938d-db663c0ebdc0', 'Begin the motion by extending through the hips with your glutes and hamstrings, and you are standing with the weight. Slowly lower the weight back to the pins returning to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('30cc7b29-7ddf-4d7d-849a-eefc6ab8bb80', 'Hang from a chin-up bar using an underhand grip (palms facing you) that is slightly wider than shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('f9539029-4133-472e-8b6c-ce84b75a7179', 'Now bend your knees at a 90 degree angle so that the calves are parallel to the floor while the thighs remain perpendicular to it. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c9f3caa2-b9f5-4828-abb2-c413c806b01a', 'As you exhale, pull yourself up while crunching your knees up at the same time until your knees are at chest level. You will stop going up as soon as your nose is at the same level as the bar. Tip: When you get to this point you should also be finishing the crunch at the same time.');
INSERT INTO instructions (id, instruction) VALUES ('366ba777-f4fa-496d-8fa1-48cdddc8f643', 'Slowly start to inhale as you return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('16a7d2bf-8eb7-4ec2-97ed-bd9a680a0e48', 'Sit on the floor with your knees bent and feet together.');
INSERT INTO instructions (id, instruction) VALUES ('45d7fe9d-b462-4f38-89f5-9e7a9ade44ea', 'Interlock your fingers behind your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d682ddf4-5d5a-4975-8f46-5a24da1f2d97', 'Curl downwards, bringing your elbows to the inside of your thighs. After a brief pause, return to the starting position with your head up and your back straight. Repeat for 10-20 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('0f4932fd-93bd-453d-98ce-1f12d6843497', 'Begin in a pushup position on the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('10c96a20-96b7-428d-8375-14cba4612ce5', 'Using both legs, jump forward landing with your feet next to your hands. Keep your head up as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('fe8816aa-406c-477c-af82-42ae1701fc65', 'Return to the starting position and immediately repeat the movement, continuing for 10-20 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('cd5a6f61-2550-4d86-91da-4a2de686beb5', 'Place the back of your torso against the back pad of the machine and hook your shoulders under the shoulder pads provided.');
INSERT INTO instructions (id, instruction) VALUES ('bdb40737-be76-4a0a-9dbf-0c08b7471445', 'Position your legs in the platform using a shoulder width medium stance with the toes slightly pointed out. Tip: Keep your head up at all times and also maintain the back on the pad at all times.');
INSERT INTO instructions (id, instruction) VALUES ('f0c93ef0-12cf-4488-93cf-288bfcbc0b6c', 'Place your arms on the side handles of the machine and disengage the safety bars (which on most designs is done by moving the side handles from a facing front position to a diagonal position).');
INSERT INTO instructions (id, instruction) VALUES ('508d445a-93bf-4288-9d80-5851e9274b03', 'Now straighten your legs without locking the knees. This will be your starting position. (Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances described in the foot positioning section).');
INSERT INTO instructions (id, instruction) VALUES ('2b431c97-38be-48f2-b3d9-f8bf6608cf3f', 'Begin to slowly lower the unit by bending the knees as you maintain a straight posture with the head up (back on the pad at all times). Continue down until the angle between the upper leg and the calves becomes slightly less than 90-degrees (which is the point in which the upper legs are below parallel to the floor). Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('090ab1f3-8116-4d40-984a-6063f11a001f', 'Begin to raise the unit as you exhale by pushing the floor with mainly with the heel of your foot as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('334b9f08-f192-4063-a775-7037cd86b2dc', 'Stand up with your torso upright and a dumbbell on each hand being held at arms length. The elbows should be close to the torso.');
INSERT INTO instructions (id, instruction) VALUES ('8011c144-814f-481c-91de-ee30a3d0bbb9', 'Now, while holding your upper arm stationary, exhale and curl the weight forward while contracting the biceps. Continue to raise the weight until the biceps are fully contracted and the dumbbell is at shoulder level. Hold the contracted position for a brief moment as you squeeze the biceps. Tip: Focus on keeping the elbow stationary and only moving your forearm.');
INSERT INTO instructions (id, instruction) VALUES ('d1a2bf6e-8e5d-49cb-8c91-85fa9711fab3', 'After the brief pause, inhale and slowly begin the lower the dumbbells back down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6ffab116-30f4-4991-852a-c8e469468949', 'Lie back on an incline bench with a dumbbell on each hand on top of your thighs. The palms of your hand will be facing each other.');
INSERT INTO instructions (id, instruction) VALUES ('2751aad7-bacb-4892-b27c-eb663bbb9a50', 'By using your thighs to help you get the dumbbells up, clean the dumbbells one arm at a time so that you can hold them at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('fb5fffab-806e-4906-ba14-f19024e5a0e2', 'Once at shoulder width, keep the palms of your hands with a neutral grip (palms facing each other). Keep your elbows flared out with the upper arms in line with the shoulders (perpendicular to the torso) and the elbows bent creating a 90-degree angle between the upper arm and the forearm. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7ad29adf-61fa-4f68-b9a2-ce7dfccb9857', 'Now bring down the weights slowly to your side as you breathe in. Keep full control of the dumbbells at all times.');
INSERT INTO instructions (id, instruction) VALUES ('1921bf4a-75bf-4878-9767-4bf05baeff9d', 'As you breathe out, push the dumbbells up using your pectoral muscles. Lock your arms in the contracted position, hold for a second and then start coming down slowly. Tip: It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('6c031c4c-4e43-40bf-aaf6-c2fbd0a863d2', 'When you are done, place the dumbbells back in your thighs and then on the floor. This is the safest manner to dispose of the dumbbells.');
INSERT INTO instructions (id, instruction) VALUES ('f9c4fa72-42db-4cce-bfae-a0c2a14e9ccb', 'In a seated position, extend your legs over a foam roll so that it is position on the back of the upper legs. Place your hands to the side or behind you to help support your weight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ae4b767f-0996-4453-87d4-af65bf7e5be6', 'Using your hands, lift your hips off of the floor and shift your weight on the foam roll to one leg. Relax the hamstrings of the leg you are stretching.');
INSERT INTO instructions (id, instruction) VALUES ('2c5f6f95-4801-49fe-9298-bdca9bf764a0', 'Roll over the foam from below the hip to above the back of the knee, pausing at points of tension for 10-30 seconds. Repeat for the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('01317602-6ce5-442b-a0ce-ed5bc715acd7', 'Lie on your back with one leg extended above you, with the hip at ninety degrees. Keep the other leg flat on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('d6975ea9-368a-4ea3-8c6a-8d364378ecb4', 'Loop a belt, band, or rope over the ball of your foot. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9288f449-e10b-4b5f-b47f-dbf6a448be4c', 'Pull on the belt to create tension in the calves and hamstrings. Hold this stretch for 10-30 seconds, and repeat with the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('1fb8e9ab-85ac-414d-9dc9-9d41f1252515', 'With your back to the wall bend at the waist and place both hands on the floor at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('0ffa0840-4e78-4abb-a340-b6a2f4eea48f', 'Kick yourself up against the wall with your arms straight. Your body should be upside down with the arms and legs fully extended. Keep your whole body as straight as possible. Tip: If doing this for the first time, have a spotter help you. Also, make sure that you keep facing the wall with your head, rather than looking down.');
INSERT INTO instructions (id, instruction) VALUES ('243e248c-bbf4-40cf-a414-5bc567be00cd', 'Slowly lower yourself to the ground as you inhale until your head almost touches the floor. Tip: It is of utmost importance that you come down slow in order to avoid head injury.');
INSERT INTO instructions (id, instruction) VALUES ('d38dd0b8-5da0-49cc-8c82-527736e0f68f', 'Push yourself back up slowly as you exhale until your elbows are nearly locked.');
INSERT INTO instructions (id, instruction) VALUES ('c98caf1f-df35-4185-be23-194c7b764435', 'Begin by aggressively extending through the hips, knees and ankles, driving the weight upward. As you do so, shrug your shoulders towards your ears.');
INSERT INTO instructions (id, instruction) VALUES ('1fb53bf0-0931-4cc8-81e4-a80c1520b69c', 'Begin with a shoulder width, double overhand or hook grip, with the bar hanging just below the knees. Your back should be straight and inclined slightly forward.');
INSERT INTO instructions (id, instruction) VALUES ('4e500182-0884-4de8-bf0a-c39296428d7f', 'Begin by aggressively extending through the hips, knees and ankles, driving the weight upward. As you do so, shrug your shoulders towards your ears. As full extension is achieved, transition into the third pull by aggressively shrugging and flexing the arms with the elbows up and out.');
INSERT INTO instructions (id, instruction) VALUES ('cd1363e4-36a0-4258-919f-4b0234b6739a', 'At peak extension, aggressively pull yourself down, rotating your elbows under the bar as you do so. Receive the bar in a front squat position, the depth of which is dependent upon the height of the bar at the end of the third pull. The bar should be racked onto the protracted shoulders, lightly touching the throat with the hands relaxed. Continue to descend to the bottom squat position, which will help in the recovery.');
INSERT INTO instructions (id, instruction) VALUES ('13652d71-6776-4686-b3d8-7692585092a9', 'Begin with a wide grip on the bar, with an overhand or hook grip. The feet should be directly below the hips with the feet turned out. Your knees should be slightly bent, and the torso inclined forward. The spine should be fully extended and the head facing forward. The bar should be at the hips. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4dfa6976-60df-429f-92d6-b090644c7539', 'Aggressively extend through the legs and hips. At peak extension, shrug the shoulders and allow the elbows to flex to the side.');
INSERT INTO instructions (id, instruction) VALUES ('b9682826-4451-4437-98a0-9cbcc7637e1d', 'As you move your feet into the receiving position, forcefully pull yourself below the bar as you elevate the bar overhead. Receive the bar with your body as low as possible and the arms fully extended overhead.');
INSERT INTO instructions (id, instruction) VALUES ('530a5496-2292-4e46-b01e-68fe27b979a7', 'Return to a standing position with the weight overhead. Follow by returning the weight to the ground under control.');
INSERT INTO instructions (id, instruction) VALUES ('f63c313c-a0df-496c-a536-1525f13358f4', 'Begin with a wide grip on the bar, with an overhand or hook grip. The feet should be directly below the hips with the feet turned out. Your knees should be slightly bent, and the torso inclined forward. The spine should be fully extended and the head facing forward. The bar should be just below the knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('24332005-fc5c-45aa-8ce3-b2d7b761d2b6', 'Return to a standing position with the weight overhead, and then return the weight to the floor under control.');
INSERT INTO instructions (id, instruction) VALUES ('a282a6a3-27e1-4b0f-92fa-4a6b18f13f6b', 'Begin with a bar on a rack at about the same height as your stomach. Suspend the bar using chains or suspension straps.');
INSERT INTO instructions (id, instruction) VALUES ('15978ad0-8c3f-4539-af4a-0652afeecedf', 'Bend over underneath the bar and rack the bar across the rear of your shoulders as you would a power squat, not on top of your traps. At the proper height, you should be near parallel to the floor when bent over. Keep your back tight, shoulder blades pinched together, and your knees slightly bent. Keep your back arched and your cervical spine in proper alignment.');
INSERT INTO instructions (id, instruction) VALUES ('4d89ac71-9bd2-4baf-9e8c-ab51c97adc47', 'Begin the motion by extending through the hips with your glutes and hamstrings, and you are standing with the weight.');
INSERT INTO instructions (id, instruction) VALUES ('3c343f21-eb1e-40dc-a8a4-e89e43e0d669', 'Slowly lower the weight back to the starting position, where it is supported by the chains.');
INSERT INTO instructions (id, instruction) VALUES ('aaba39b7-ce11-47ed-92e0-acd29f903a85', 'Hang from a chin-up bar with both arms extended at arms length in top of you using either a wide grip or a medium grip. The legs should be straight down with the pelvis rolled slightly backwards. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5bd96e3d-b37e-4042-9c3a-85ce498c745e', 'Raise your legs until the torso makes a 90-degree angle with the legs. Exhale as you perform this movement and hold the contraction for a second or so.');
INSERT INTO instructions (id, instruction) VALUES ('d16e891f-6d6f-468b-8516-fd193d629212', 'Go back slowly to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('c426bf33-ca73-454b-84cd-d15fcf668c02', 'Hang from a chin-up bar with your legs and feet together using an overhand grip (palms facing away from you) that is slightly wider than shoulder width. Tip: You may use wrist wraps in order to facilitate holding on to the bar.');
INSERT INTO instructions (id, instruction) VALUES ('454c11ab-3a94-4ed8-a3a5-abf9244120cb', 'Now bend your knees at a 90 degree angle and bring the upper legs forward so that the calves are perpendicular to the floor while the thighs remain parallel to it. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f034c277-cb56-489e-95cb-de67f5c2a44b', 'Pull your legs up as you exhale until you almost touch your shins with the bar above you. Tip: Try to straighten your legs as much as possible while at the top.');
INSERT INTO instructions (id, instruction) VALUES ('4914bd3a-98fb-4909-9667-8582c485eeb3', 'Lower your legs as slowly as possible until you reach the starting position. Tip: Avoid swinging and using momentum at all times.');
INSERT INTO instructions (id, instruction) VALUES ('2665f8a0-ecda-45f2-bf56-18140cfed190', 'This drill helps you learn the snatch. Begin by holding a light weight across the back of the shoulders. Your feet should be slightly wider than hip width apart with the feet turned out, the same position that you would perform a squat with.');
INSERT INTO instructions (id, instruction) VALUES ('7bde6720-d524-4275-9423-4bd149c7200c', 'Begin by dipping with the knees slightly, and popping back up to briefly unload the bar. Drive yourself underneath the bar, elevating it overhead as you descend into a full squat.');
INSERT INTO instructions (id, instruction) VALUES ('fad78479-5fa2-42aa-8dad-a764f0d3d96f', 'Return to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('e6ae4eb8-d939-41fd-922f-597917bec69b', 'Utilize a heavy bag for this exercise. Assume an upright stance next to the bag, with your feet staggered, fairly wide apart. Place your hand on the bag at about chest height. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5add9e18-8a19-4c7c-aea5-9c4bbc886234', 'Begin by twisting at the waist, pushing the bag forward as hard as possible. Perform this move quickly, pushing the bag away from your body.');
INSERT INTO instructions (id, instruction) VALUES ('e8743c27-2a85-4723-82b2-912a0cf2a780', 'Receive the bag as it swings back by reversing these steps.');
INSERT INTO instructions (id, instruction) VALUES ('e26d88a3-557e-44b4-83fb-4effc2e6630f', 'Stand between a couple of high pulleys and grab a handle in each arm. Position your upper arms in a way that they are parallel to the floor with the palms of your hands facing you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8bb68a6e-65ab-4031-b16d-e00ad80041e2', 'Curl the handles towards you until they are next to your ears. Make sure that as you do so you flex your biceps and exhale. The upper arms should remain stationary and only the forearms should move. Hold for a second in the contracted position as you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('5a4c7156-766a-4c6b-82fe-6df6fe2111e0', 'Slowly bring back the arms to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2ef534c5-07d5-422d-aee2-ffe0da3a3de6', 'Position yourself on your hands and knees on the ground. Maintaining good posture, raise one bent knee off of the ground. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('63cdb59f-7e03-43d9-b1c8-eceae98ec16d', 'Keeping the knee in a bent position, rotate the femur in an arc, attempting to make a big circle with your knee.');
INSERT INTO instructions (id, instruction) VALUES ('fa0ea34f-a693-474e-a4b3-90c63d42cc38', 'Perform this slowly for a number of repetitions, and repeat on the other side.');
INSERT INTO instructions (id, instruction) VALUES ('a991d2c0-6d17-484b-94e7-d3ff72b37fd9', 'Secure one end of the band to the lower portion of a post and attach the other to one ankle.');
INSERT INTO instructions (id, instruction) VALUES ('324e2866-73ec-44d6-a743-cba5cdc43b2f', 'Facing the attachment point of the band, hold on to the column to stabilize yourself.');
INSERT INTO instructions (id, instruction) VALUES ('4640d3de-9d64-4404-a720-70f17132f225', 'Keeping your head and your chest up, move the resisted leg back as far as you can while keeping the knee straight.');
INSERT INTO instructions (id, instruction) VALUES ('42c3d289-d520-4774-9dd7-50b086ec964d', 'Return the leg to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1cd8cbbb-b6b2-4e79-90ba-a5e0d17757ac', 'Face away from the attachment point of the band.');
INSERT INTO instructions (id, instruction) VALUES ('49722279-6447-4302-93d0-0777f67d9641', 'Keeping your head and your chest up, raise your knee up to 90 degrees and pause.');
INSERT INTO instructions (id, instruction) VALUES ('878451fe-21c3-4b81-a422-26300c30655f', 'After choosing a suitable band, lay down in the middle of the rack, after securing the band on either side of you. If your rack doesn''t have pegs, the band can be secured using heavy dumbbells or similar objects, just ensure they won''t move.');
INSERT INTO instructions (id, instruction) VALUES ('c9d42e1a-a391-4c35-b444-9304527bd84f', 'Adjust your position so that the band is directly over your hips. Bend your knees and place your feet flat on the floor. Your hands can be on the floor or holding the band in position.');
INSERT INTO instructions (id, instruction) VALUES ('3d130519-0086-49eb-80dd-05d48578e26f', 'Keeping your shoulders on the ground, drive through your heels to raise your hips, pushing into the band as high as you can.');
INSERT INTO instructions (id, instruction) VALUES ('706ec3ef-36d3-4886-9540-608f80a9bb15', 'Pause at the top of the motion, and return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0f0c10c9-5482-44e5-b69c-8aee22db65f2', 'Seat yourself on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('870f777c-32b7-4d55-a924-4afda4495891', 'Straddle an exercise ball between both legs and lower your hips down toward the floor.');
INSERT INTO instructions (id, instruction) VALUES ('253c6586-b418-4040-8db9-bb78f57f5650', 'Hug your arms around the ball to support your body. Adjust your legs so that your feet are flat on the floor and your knees line up over your ankles. Keep a good grip on the ball so it doesn''t roll away from you and send you back onto your buttocks.');
INSERT INTO instructions (id, instruction) VALUES ('a88ea52f-f646-4f20-9d33-8d89be207aba', 'Lie down on your back and pull both knees up to your chest.');
INSERT INTO instructions (id, instruction) VALUES ('21e06775-879c-4aca-987d-4abf25e072fa', 'Hold your arms under the knees, not over (that would put to much pressure on your knee joints).');
INSERT INTO instructions (id, instruction) VALUES ('0e34a2b4-af7d-422f-8690-c40f49b2d2ed', 'Slowly pull the knees toward your shoulders. This also stretches your buttocks muscles.');
INSERT INTO instructions (id, instruction) VALUES ('a62687c2-9948-471b-8cea-e7cda4b91add', 'Set up a row of hurdles or other small barriers, placing them a few feet apart.');
INSERT INTO instructions (id, instruction) VALUES ('01de7051-9720-4822-aacc-7dc1744453b0', 'Stand in front of the first hurdle with your feet shoulder width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1c33d18b-d5d9-4859-903d-03083228f34a', 'Begin by jumping with both feet over the first hurdle, swinging both arms as you jump.');
INSERT INTO instructions (id, instruction) VALUES ('42a46f72-f4a5-4eb8-bf50-dfe023695948', 'Absorb the impact of landing by bending the knees, rebounding out of the first leap by jumping over the next hurdle. Continue until you have jumped over all of the hurdles.');
INSERT INTO instructions (id, instruction) VALUES ('27a3a3c3-c0fa-4625-9469-b0c02560146c', 'Lie face down on a hyperextension bench, tucking your ankles securely under the footpads.');
INSERT INTO instructions (id, instruction) VALUES ('d6c8f172-a9c1-4479-8643-4ed6b3fede6f', 'Adjust the upper pad if possible so your upper thighs lie flat across the wide pad, leaving enough room for you to bend at the waist without any restriction.');
INSERT INTO instructions (id, instruction) VALUES ('6af2113b-a905-454d-85c8-40b3e9cbb03e', 'With your body straight, cross your arms in front of you (my preference) or behind your head. This will be your starting position. Tip: You can also hold a weight plate for extra resistance in front of you under your crossed arms.');
INSERT INTO instructions (id, instruction) VALUES ('6ecad95c-0be6-420c-9f47-51623ed904fb', 'Start bending forward slowly at the waist as far as you can while keeping your back flat. Inhale as you perform this movement. Keep moving forward until you feel a nice stretch on the hamstrings and you can no longer keep going without a rounding of the back. Tip: Never round the back as you perform this exercise. Also, some people can go farther than others. The key thing is that you go as far as your body allows you to without rounding the back.');
INSERT INTO instructions (id, instruction) VALUES ('57dba01c-5c6a-45a5-a1ca-f441c2feebf8', 'Slowly raise your torso back to the initial position as you inhale. Tip: Avoid the temptation to arch your back past a straight line. Also, do not swing the torso at any time in order to protect the back from injury.');
INSERT INTO instructions (id, instruction) VALUES ('0d57e9f3-0834-40a7-92ff-551c7ed355c4', 'With someone holding down your legs, slide yourself down to the edge a flat bench until your hips hang off the end of the bench. Tip: Your entire upper body should be hanging down towards the floor. Also, you will be in the same position as if you were on a hyperextension bench but the range of motion will be shorter due to the height of the flat bench vs. that of the hyperextension bench.');
INSERT INTO instructions (id, instruction) VALUES ('a08e6cb7-d1fc-4469-99e9-14def3f30927', 'Start bending forward slowly at the waist as far as you can while keeping your back flat. Inhale as you perform this movement. Keep moving forward until you almost touch the floor or you feel a nice stretch on the hamstrings (whichever comes first). Tip: Never round the back as you perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('632bef48-e6c8-403d-9aa4-87d81a7695f7', 'Slowly raise your torso back to the initial position as you exhale. Tip: Avoid the temptation to arch your back past a straight line. Also, do not swing the torso at any time in order to protect the back from injury.');
INSERT INTO instructions (id, instruction) VALUES ('159bc338-0db6-4393-bcc5-6f3cf596c56f', 'Loop a belt, rope, or band around one of your feet, and swing that leg across your body to the opposite side, keeping the leg extended as you lay on the ground. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e56d5e8d-a735-4269-8e63-09b6275ea7ee', 'Keeping your foot off of the floor, pull on the belt, using the tension to pull the toes up. Hold for 10-20 seconds, and repeat on the other side.');
INSERT INTO instructions (id, instruction) VALUES ('d82d0424-1c37-4ca3-8955-61f57b57ceab', 'Lay on your side, with the bottom leg placed onto a foam roller between the hip and the knee. The other leg can be crossed in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('cbd4ce31-2f00-46bb-9ab6-6835cabb9fd4', 'Place as much of your weight as is tolerable onto your bottom leg; there is no need to keep your bottom leg in contact with the ground. Be sure to relax the muscles of the leg you are stretching.');
INSERT INTO instructions (id, instruction) VALUES ('0179336b-735e-4c39-abd7-492e617553fc', 'Roll your leg over the foam from you hip to your knee, pausing for 10-30 seconds at points of tension. Repeat with the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('1d02f29a-40ab-4f84-9c5c-f90edb0c698f', 'Stand with your feet close together. Keeping your legs straight, stretch down and put your hands on the floor directly in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('daa09a6e-a346-4a3e-b809-8ec8b358ae98', 'Begin by walking your hands forward slowly, alternating your left and your right. As you do so, bend only at the hip, keeping your legs straight.');
INSERT INTO instructions (id, instruction) VALUES ('30f5c825-92ce-4968-b1a9-ea243e5dca7e', 'Keep going until your body is parallel to the ground in a pushup position.');
INSERT INTO instructions (id, instruction) VALUES ('c5ae1022-ed51-4bd0-a124-a4e4917a585b', 'Now, keep your hands in place and slowly take short steps with your feet, moving only a few inches at a time.');
INSERT INTO instructions (id, instruction) VALUES ('e1449414-72e2-40f3-b77a-f533ed2e1e4d', 'Continue walking until your feet are by hour hands, keeping your legs straight as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('ef48aea8-8db5-42ae-8af5-9ee4d175b5a2', 'Hold a barbell with an overhand grip (palms down) that is a little closer together than shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('5e06964d-a236-4c14-af18-e6394dad74cc', 'Lie back on an incline bench set at any angle between 45-75-degrees.');
INSERT INTO instructions (id, instruction) VALUES ('aafa4415-67e3-40d5-a7fa-4239af75eb60', 'Bring the bar overhead with your arms extended and elbows in. The arms should be in line with the torso above the head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('47e44ff0-52f3-4327-bcff-06a521d13e4a', 'Now lower the bar in a semicircular motion behind your head until your forearms touch your biceps. Inhale as you perform this movement. Tip: Keep your upper arms stationary and close to your head at all times. Only the forearms should move.');
INSERT INTO instructions (id, instruction) VALUES ('f96bab48-7f06-46ed-ada6-08b152a2ef82', 'Return to the starting position as you breathe out and you contract the triceps. Hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('2af828b6-de25-4a6c-ba22-347c1777c28e', 'Grab a dumbbell in each hand and lie face down on an incline bench that is set to an incline that is approximately 30 degrees.');
INSERT INTO instructions (id, instruction) VALUES ('b296a866-ff2a-45b1-8132-40747f9819b9', 'Let the arms hang to your sides fully extended as they point to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('5de75cf4-d5d9-4593-b47d-f5d171086dfe', 'Turn the wrists until your hands have a pronated (palms down) grip.');
INSERT INTO instructions (id, instruction) VALUES ('9c49c915-1158-4e69-8f55-9e2d6832e061', 'Now flare the elbows out. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('69ee3872-6320-44cb-b13c-8df715d8cf64', 'As you breathe out, start to pull the dumbbells up as if you are doing a reverse bench press. You will do this by bending at the elbows and bringing the upper arms up as you let the forearms hang. Continue this motion until the upper arms are at the same level as your back. Tip: The elbows will come out to the side and your upper arms and torso should make the letter "T" at the top of the movement. Hold the contraction at the top for a second.');
INSERT INTO instructions (id, instruction) VALUES ('b9e0aa27-311c-47ec-9364-298d176f463b', 'Slowly go back down to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('2c5d8e53-6c01-49e7-b7b2-eda132f0fb7c', 'After pausing at full extension, return to the starting position, keeping tension on the cables.');
INSERT INTO instructions (id, instruction) VALUES ('97cce815-7c94-4025-a33b-18b4cf5ddeee', 'To get yourself into the starting position, set the pulleys at the floor level (lowest level possible on the machine that is below your torso).');
INSERT INTO instructions (id, instruction) VALUES ('fac69e43-0838-47df-9f7c-a280711f2f5c', 'Place an incline bench (set at 45 degrees) in between the pulleys, select a weight on each one and grab a pulley on each hand.');
INSERT INTO instructions (id, instruction) VALUES ('082b9eaf-68cf-4e5b-9b0b-fa843761d241', 'With a handle on each hand, lie on the incline bench and bring your hands together at arms length in front of your face. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('258459ae-80ac-4163-9b10-544a2dd92464', 'With a slight bend of your elbows (in order to prevent stress at the biceps tendon), lower your arms out at both sides in a wide arc until you feel a stretch on your chest. Breathe in as you perform this portion of the movement. Tip: Keep in mind that throughout the movement, the arms should remain stationary. The movement should only occur at the shoulder joint.');
INSERT INTO instructions (id, instruction) VALUES ('08c5fdca-dbad-4509-b714-7aca858aa6d5', 'Return your arms back to the starting position as you squeeze your chest muscles and exhale. Hold the contracted position for a second. Tip: Make sure to use the same arc of motion used to lower the weights.');
INSERT INTO instructions (id, instruction) VALUES ('c39b7086-707f-4528-bb9c-bf702a46720f', 'Sit back on an incline bench with a dumbbell in each hand held at arms length. Keep your elbows close to your torso and rotate the palms of your hands until they are facing forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cd940da7-8ba7-40fd-8119-082ad7693c6b', 'While holding the upper arm stationary, curl the weights forward while contracting the biceps as you breathe out. Only the forearms should move. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('40798b16-f5c7-4dc7-9ee0-079f0f4e0208', 'Hold a dumbbell on each hand and lie on an incline bench that is set to an incline angle of no more than 30 degrees.');
INSERT INTO instructions (id, instruction) VALUES ('25b75c85-1923-4ea5-9170-323dac9a660b', 'Extend your arms above you with a slight bend at the elbows.');
INSERT INTO instructions (id, instruction) VALUES ('d5ee4351-9a9b-46d1-8a1c-5dee84a86f8c', 'Now rotate the wrists so that the palms of your hands are facing you. Tip: The pinky fingers should be next to each other. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('524c8268-437d-48f5-8bfa-4f6a5eba0dad', 'As you breathe in, start to slowly lower the arms to the side while keeping the arms extended and while rotating the wrists until the palms of the hand are facing each other. Tip: At the end of the movement the arms will be by your side with the palms facing the ceiling.');
INSERT INTO instructions (id, instruction) VALUES ('5d3d3ea0-bf96-4917-b4e8-b4d110c24826', 'As you exhale start to bring the dumbbells back up to the starting position by reversing the motion and rotating the hands so that the pinky fingers are next to each other again. Tip: Keep in mind that the movement will only happen at the shoulder joint and at the wrist. There is no motion that happens at the elbow joint.');
INSERT INTO instructions (id, instruction) VALUES ('5dfd4bd0-4076-456c-816b-11ff22e3a338', 'Hold a dumbbell in each hand and lie on an incline bench that is set to an incline angle of no more than 30 degrees.');
INSERT INTO instructions (id, instruction) VALUES ('031e7d07-6fd2-4cbf-a119-d29819ac57f6', 'Lie back on an incline bench with a dumbbell in each hand atop your thighs. The palms of your hands will be facing each other.');
INSERT INTO instructions (id, instruction) VALUES ('e9a23bb2-978d-4ae8-9e00-e645be00d1cf', 'Then, using your thighs to help push the dumbbells up, lift the dumbbells one at a time so that you can hold them at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('6ce8e04b-80fc-41dc-80ae-b8279a2659c2', 'Once you have the dumbbells raised to shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('42e0cd47-c305-4b93-8297-9be34a8a9968', 'Be sure to keep full control of the dumbbells at all times. Then breathe out and push the dumbbells up with your chest.');
INSERT INTO instructions (id, instruction) VALUES ('c7ff7357-2de0-42ad-a94a-cec51b54b1b6', 'Lock your arms at the top, hold for a second, and then start slowly lowering the weight. Tip Ideally, lowering the weights should take about twice as long as raising them.');
INSERT INTO instructions (id, instruction) VALUES ('b32fdce5-1f4c-4713-9c8f-ab826f7b040e', 'When you are done, place the dumbbells back on your thighs and then on the floor. This is the safest manner to release the dumbbells.');
INSERT INTO instructions (id, instruction) VALUES ('62a64c1e-ed04-4067-9af1-2c2c4b1ca00d', 'Seat yourself on an incline bench with a dumbbell in each hand. You should pressed firmly against he back with your feet together. Allow the dumbbells to hang straight down at your side, holding them with a neutral grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('530376ff-6d95-42a5-b7eb-dd193449808b', 'Initiate the movement by flexing at the elbow, attempting to keep the upper arm stationary.');
INSERT INTO instructions (id, instruction) VALUES ('774ca07f-ab07-40af-8505-129ca3d46cec', 'Continue to the top of the movement and pause, then slowly return to the start position.');
INSERT INTO instructions (id, instruction) VALUES ('507b7592-b558-40ea-84ad-e7d7c0d2ecde', 'Hold a dumbbell in each hand and lie back on an incline bench.');
INSERT INTO instructions (id, instruction) VALUES ('6004c300-f57d-449c-a749-dda36c5af720', 'The dumbbells should be at arm''s length hanging at your sides and your palms should be facing out. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5cdd6d2f-0846-4964-a4c1-9868137780e1', 'Now as you exhale curl the weight outward and up while keeping your forearms in line with your side deltoids. Continue the curl until the dumbbells are at shoulder height and to the sides of your deltoids. Tip: The end of the movement should look similar to a double biceps pose.');
INSERT INTO instructions (id, instruction) VALUES ('04f6feef-e905-4568-8bd3-0778946b226d', 'After a second contraction at the top of the movement, start to inhale and slowly lower the weights back to the starting position using the same path used to bring them up.');
INSERT INTO instructions (id, instruction) VALUES ('925e6506-9dd8-41dc-9815-9768b858b4de', 'Stand facing bench or sturdy elevated platform. Place hands on edge of bench or platform, slightly wider than shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('0bc7cf67-1f4f-4823-a3df-715eb998318a', 'Position forefoot back from bench or platform with arms and body straight. Arms should be perpendicular to body. Keeping body straight, lower chest to edge of box or platform by bending arms.');
INSERT INTO instructions (id, instruction) VALUES ('9152f88a-d34e-4466-8a94-4a681e286ad6', 'Push body up until arms are extended. Repeat.');
INSERT INTO instructions (id, instruction) VALUES ('d016ec3e-39f3-483e-b132-8b96d4b75cc1', 'Stand facing a Smith machine bar or sturdy elevated platform at an appropriate height.');
INSERT INTO instructions (id, instruction) VALUES ('9240f68d-6d1b-4d4a-9237-35f89c3bd4c3', 'Place your hands next to one another on the bar.');
INSERT INTO instructions (id, instruction) VALUES ('659d552a-f1f7-4023-b5ae-ed2de0f0d6f7', 'Position your feet back from the bar with arms and body straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6bdeb95a-50c7-466e-bdd1-c6662f277357', 'Keeping your body straight, lower your chest to the bar by bending the arms.');
INSERT INTO instructions (id, instruction) VALUES ('e7c7d00e-ad42-4f95-93ce-407d0feb8262', 'Return to the starting position by extending the elbows, pressing yourself back up.');
INSERT INTO instructions (id, instruction) VALUES ('926501d6-cdad-4918-b380-aced159c383d', 'For this drill you will need a box about 12 inches high, and two thick mats or aerobics steps.');
INSERT INTO instructions (id, instruction) VALUES ('07b81921-8d51-42b2-9800-e3c38cd2829e', 'Place the steps just outside of your shoulders, and place your feet on top of the box so that you are in an incline pushup position, your hands just inside the steps. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9d024033-cee4-4f97-9360-b3a9e889811a', 'Begin by bending at the elbows to lower your body, quickly reversing position to push your body off of the ground. As you leave the ground, move your hands onto the steps, bending your elbows to absorb the impact.');
INSERT INTO instructions (id, instruction) VALUES ('b07a09c8-a22e-43f9-a1bd-5c606b4d2b23', 'Repeat the motion to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4e9ebcff-1e3f-4828-b1ae-3d951797a0e2', 'Place your hands on the bar, with your hands about shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('e8fa049c-861c-44db-9ddb-5ca9e5e6f307', 'Place your hands on the bar palms up, with your hands about shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('92ff5a64-054d-46a8-adab-28b28a22f643', 'Place your hands on the bar, with your hands wider than shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('64f87776-689a-448d-a701-253155ae30ae', 'Position your feet back from the bar with arms and body straight. Your arms should be perpendicular to the body. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e8f7e7cb-37ec-4f1a-ae84-472aad1c8ecb', 'Lie on your back with your legs extended. Loop a belt, rope, or band around one of your feet, and swing that leg as far to the side as you can. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('beb7f0ef-e9ca-4558-85a3-6f41c560a66e', 'Pull gently on the belt to create tension in your groin and hamstring muscles. Hold for 10-20 seconds, and repeat on the other side.');
INSERT INTO instructions (id, instruction) VALUES ('343017ad-6b68-4d04-b66d-0d99720d3754', 'Lie face down on the floor, with a rope, belt, or band looped around one foot.');
INSERT INTO instructions (id, instruction) VALUES ('e841429e-9770-4ed5-bf82-035c55842165', 'Flex the knee and extend the hip of the leg to be stretched, using both hands to pull on the belt. Your knee and your hip should come off of the floor, creating tension in the hip flexors and quadriceps. Hold the stretch for 10-20 seconds, and repeat on the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('12000f85-53a2-425d-91a2-a650ffa244a2', 'Choke the band around a post. The band should be at the same height as your elbow. Stand with your right side to the band a couple of feet away.');
INSERT INTO instructions (id, instruction) VALUES ('834502c0-fd3d-4a67-9305-d3edf862674c', 'With your upper arm in position, your elbow should be flexed to 90 degrees with your hand reaching away from your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b453751e-ad25-442f-8cdb-443a8f653bdd', 'Execute the movement by rotating your arm in a forehand motion, keeping your elbow in place.');
INSERT INTO instructions (id, instruction) VALUES ('15a406b3-5789-4f78-9172-2bcfb0d5b60e', 'Position a bar in a rack to about waist height. You can also use a smith machine.');
INSERT INTO instructions (id, instruction) VALUES ('e3e27563-3f45-417e-8867-53ebd7e9a6c9', 'Take a wider than shoulder width grip on the bar and position yourself hanging underneath the bar. Your body should be straight with your heels on the ground with your arms fully extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7c4e0977-868b-44e9-b2e0-d840bb99ee0b', 'Begin by flexing the elbow, pulling your chest towards the bar. Retract your shoulder blades as you perform the movement.');
INSERT INTO instructions (id, instruction) VALUES ('73b66439-0bcb-4abc-b5fc-65d1ff5febb6', 'Pause at the top of the motion, and return yourself to the start position.');
INSERT INTO instructions (id, instruction) VALUES ('c227fd9f-4a15-47b8-a0d2-97c8156116cf', 'Repeat for the desired number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('028407ab-87bc-4db8-b943-a3ebb6122905', 'Hang a rope or suspension straps from a rack or other stable object. Grasp the ends and position yourself in a supine position hanging from the ropes. Your body should be straight with your heels on the ground with your arms fully extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3b7271bf-eaeb-446d-9bd3-a7388bceb556', 'Begin by flexing the elbow, pulling your chest to your hands. Retract your shoulder blades as you perform the movement.');
INSERT INTO instructions (id, instruction) VALUES ('f092eeb9-c236-48cb-a4df-411eca464716', 'Lie face down on the floor, with your arms extended out to your side, palms pressed to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('de1c6217-1e3a-4ba7-a0f1-3333c2d14d77', 'To begin, flex one knee and bring that leg across the back of your body, attempting to touch it to the ground near the opposite hand.');
INSERT INTO instructions (id, instruction) VALUES ('62d3e618-8511-445c-a7a6-7de401db6a7e', 'Promptly return the leg to the starting postion, and quickly repeat with the other leg. Continue alternating for 10-20 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('2bb648b1-c0e9-47d5-bf27-612e09ab3d5e', 'While either seating or standing, bend your arms at a 90-degree angle and place the palms of your hands together in front of your chest. Tip: Your hands should be open with the palms together and fingers facing forward (perpendicular to your torso).');
INSERT INTO instructions (id, instruction) VALUES ('7cce1810-f1ee-4881-92e6-af910cfb94be', 'Push both hands against each other as you contract your chest. Start with slow tension and increase slowly. Keep breathing normally as you execute this contraction.');
INSERT INTO instructions (id, instruction) VALUES ('737b016c-75ba-4369-b8bf-231c3e876ffd', 'Hold for the recommended number of seconds.');
INSERT INTO instructions (id, instruction) VALUES ('0ec88810-570c-453b-8070-a4074992daec', 'Now release the tension slowly.');
INSERT INTO instructions (id, instruction) VALUES ('de64d935-21f5-42f7-b8bd-fca43fa74ab3', 'Rest for the recommended amount of time and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('c96d4043-475d-4159-b909-fff2429f562f', 'With your head and neck in a neutral position (normal position with head erect facing forward), place both of your hands on the front side of your head.');
INSERT INTO instructions (id, instruction) VALUES ('441bd2b7-6bf7-4e32-b679-b07d519ad7e7', 'Now gently push forward as you contract the neck muscles but resisting any movement of your head. Start with slow tension and increase slowly. Keep breathing normally as you execute this contraction.');
INSERT INTO instructions (id, instruction) VALUES ('b3d68b40-bf8b-45a2-b429-998a2ccdee69', 'Rest for the recommended amount of time and repeat with your hands placed on the back side of your head.');
INSERT INTO instructions (id, instruction) VALUES ('bd439ff8-4cbe-481d-932f-1f63f7e0636b', 'With your head and neck in a neutral position (normal position with head erect facing forward), place your left hand on the left side of your head.');
INSERT INTO instructions (id, instruction) VALUES ('1d748d38-ff7f-429a-ae8e-85b78bc809f5', 'Now gently push towards the left as you contract the left neck muscles but resisting any movement of your head. Start with slow tension and increase slowly. Keep breathing normally as you execute this contraction.');
INSERT INTO instructions (id, instruction) VALUES ('1480be10-e8a7-4068-b2a9-b2b2103b9253', 'Rest for the recommended amount of time and repeat with your right hand placed on the right side of your head.');
INSERT INTO instructions (id, instruction) VALUES ('9104dc6e-aecb-4502-8c9f-e578f4c1bad2', 'Assume a push-up position, supporting your weight on your hands and toes while keeping your body straight. Your hands should be just outside of shoulder width. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('00739f05-47d1-48aa-93e0-656f92134f96', 'Begin by shifting your body weight as far to one side as possible, allowing the elbow on that side to flex as you lower your body.');
INSERT INTO instructions (id, instruction) VALUES ('85cb6c1e-3bc8-46fa-9a47-d396a67647a3', 'Reverse the motion by extending the flexed arm, pushing yourself up and then dropping to the other side.');
INSERT INTO instructions (id, instruction) VALUES ('f8ef339c-9efc-4e99-b3fb-f3d00c426b07', 'Start the exercise the same way you would a close grip bench press. You will lie on a flat bench while holding a barbell at arms length (fully extended) with the elbows in. However, instead of having the arms perpendicular to the torso, make sure the bar is set in a direct line above the upper chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e9492917-a76f-418a-9774-71817247cedc', 'Now beginning from a fully extended position lower the bar down as if performing a lying triceps extension. Inhale as you perform this movement. When you reach the half way point, let the bar roll back about one inch by moving the upper arms towards your legs until they are perpendicular to the torso. Tip: Keep the bend at the elbows constant as you bring the upper arms forward.');
INSERT INTO instructions (id, instruction) VALUES ('0f755564-bc09-4cac-99eb-b69825985716', 'As you exhale, press the bar back up by using the triceps to perform a close grip bench press.');
INSERT INTO instructions (id, instruction) VALUES ('072354b1-3976-4c76-83fb-5abd8d237d23', 'Now go back to the starting position and start over.');
INSERT INTO instructions (id, instruction) VALUES ('fa848060-db31-4e1f-8f2f-6b670ee9fa22', 'Lie flat on the floor (or exercise mat) on your back with your arms extended straight back behind your head and your legs extended also. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7358827f-efe5-41ca-ad08-c5c3dfcf8613', 'As you exhale, bend at the waist while simultaneously raising your legs and arms to meet in a jackknife position. Tip: The legs should be extended and lifted at approximately a 35-45 degree angle from the floor and the arms should be extended and parallel to your legs. The upper torso should be off the floor.');
INSERT INTO instructions (id, instruction) VALUES ('1bafc98e-79bb-425f-9b8f-e355a77126ce', 'While inhaling, lower your arms and legs back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6153421c-6224-44e0-b5f5-94247ec331ff', 'Position your body on the floor in the basic sit-up position; knees to a ninety degree angle with feet flat on the floor and arms either crossed over your chest or to the sides. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e60f6768-4f49-4ef1-8a90-e3b8df732702', 'As you strongly tighten your glutes and hamstrings, fill your lungs with air and in a slow (three to six second count) ascent, slowly exhale. Tip: It is important to tighten the glutes and hamstrings as this will cause the hip flexors to be inactivated in a process called reciprocal inhibition, which basically means that opposite muscles to the contracted ones will relax.');
INSERT INTO instructions (id, instruction) VALUES ('6839b701-646a-433d-a7d0-9979ee38ce6b', 'As you inhale, slowly go back in a controlled manner to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7ca2bab9-48e1-4f70-892c-6e6fa29b0a55', 'Place a barbell on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('62a13282-10bc-4cc9-a67a-23d05e946017', 'Stand in the middle of the bar length wise.');
INSERT INTO instructions (id, instruction) VALUES ('49601b61-09c5-431f-b83f-83069a5b7b89', 'Bend down by bending at the knees and keeping your back straight and grasp the front of the bar with your right hand. Your palm should be in (neutral grip) facing the left side.');
INSERT INTO instructions (id, instruction) VALUES ('3f1ebd7c-b41a-4f88-9175-05a42574dd02', 'Grasp the rear of the bar with your left hand. The palm of your hand should be in neutral grip alignment (palms facing the right side). Tip: Ensure that your grip is even on the bar. Your torso should be positioned right in the middle of the bar and the distance between your torso and your right hand (which should be at the front) should be the same as the distance between your torso and your left hand (which should be to your back).');
INSERT INTO instructions (id, instruction) VALUES ('f283551c-d31f-484d-84ad-c743b230ff40', 'Now stand straight up with the weight. Tip: Your feet should be shoulder width apart and your toes slightly pointed out.');
INSERT INTO instructions (id, instruction) VALUES ('3054f604-7f22-4f42-81c4-d06d57548653', 'Squat down by bending at the knees and keeping your back straight until your upper thighs are parallel with the floor. Tip: Keep your back as vertical as possible with the floor and your head up. Also remember to not let your knees go past your toes. Inhale during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('83989d07-bdf0-42ad-996e-4ded1ea1e623', 'Now drive yourself back up to the starting position by pushing with the feet . Tip: Keep the bar hanging at arm''s length and your elbows locked with a slight bend. The arms only serve as hooks. Avoid doing any lifting with them. Do the lifting with your thighs; not your arms.');
INSERT INTO instructions (id, instruction) VALUES ('51027a04-0520-45b3-9833-16105f37d9ab', 'This drill helps you learn to drive yourself low enough during the jerk and corrects those who move backward during the movement. Begin with the bar racked in the jerk position, with the shoulders forward, torso upright, and the feet split slightly apart.');
INSERT INTO instructions (id, instruction) VALUES ('cd4588f4-7d7b-4bd7-8766-6a6434ffc6ef', 'Initiate the movement as you would a normal jerk, dipping at the knees while keeping your torso vertical, and driving back up forcefully, using momentum and not your arms to elevate the weight.');
INSERT INTO instructions (id, instruction) VALUES ('992a31c8-661d-43da-9375-bf677f8201b8', 'Keep the rear foot in place, using it to drive your body forward into a full split as you jerk the weight. Recover by standing up with the weight overhead.');
INSERT INTO instructions (id, instruction) VALUES ('212fdf2e-670b-4bd5-99c2-b5e0f9cbb7bd', 'This movement strengthens the dip portion of the jerk. Begin with the bar racked in the jerk position, with the shoulders forward to create a shelf and the bar lightly contacting the throat. The feet should be directly under the hips, with the feet turned out as is comfortable.');
INSERT INTO instructions (id, instruction) VALUES ('3d4663fb-9483-49bc-84f7-9a579e07eb26', 'Keeping the torso vertical, dip by flexing the knees, allowing them to travel forward and without moving the hips to the rear. The dip should not be excessive. Return the weight to the starting position by driving forcefully though the feet.');
INSERT INTO instructions (id, instruction) VALUES ('2333e657-3dd2-4257-b7b7-f4ad293bd06e', 'To begin, step onto the treadmill and select the desired option from the menu. Most treadmills have a manual setting, or you can select a program to run. Typically, you can enter your age and weight to estimate the amount of calories burned during exercise. Elevation can be adjusted to change the intensity of the workout.');
INSERT INTO instructions (id, instruction) VALUES ('96cc9210-8e9c-4bba-b6f7-6bb55467adc9', 'Treadmills offer convenience, cardiovascular benefits, and usually have less impact than jogging outside. A 150 lb person will burn almost 250 calories jogging for 30 minutes, compared to more than 450 calories running. Maintain proper posture as you jog, and only hold onto the handles when necessary, such as when dismounting or checking your heart rate.');
INSERT INTO instructions (id, instruction) VALUES ('ce1436b2-cb8a-41da-9744-3498f4793f3b', 'To load kegs, place the desired number a distance from the loading platform, typically 30-50 feet.');
INSERT INTO instructions (id, instruction) VALUES ('05a75626-7e98-476c-aba5-41216d1ce1bc', 'Begin by grabbing the close handle of the first keg, tilting it onto its side to grab the opposite edge of the bottom of the keg. Lift the keg up to your chest.');
INSERT INTO instructions (id, instruction) VALUES ('d04d0fb9-0424-459b-857f-37ec027c7b58', 'The higher you can place the keg, the faster you should be able to move to the platform. Shouldering is usually not allowed. Be sure to keep a firm hold on the keg. Move as quickly as possible to the platform, and load it, extending through your hips, knees, and ankles to get it as high as possible.');
INSERT INTO instructions (id, instruction) VALUES ('61249303-f165-4f6b-959a-c407809ba6c9', 'Return to the starting position to retrieve the next keg, and repeat until the event is completed.');
INSERT INTO instructions (id, instruction) VALUES ('f9ce431e-096c-49fa-a976-998b3e94597d', 'Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you raise the kettlebell towards your shoulder. The palm should be facing inward.');
INSERT INTO instructions (id, instruction) VALUES ('39d93118-ec47-426c-8bc0-fb618778c249', 'Looking straight ahead, press the kettlebell out and overhead, rotating your wrist so that your palm faces forward at the top of the motion.');
INSERT INTO instructions (id, instruction) VALUES ('cccc9968-44cf-4615-a128-b839d51b4d2a', 'Return the kettlebell to the starting position, with the palm facing in.');
INSERT INTO instructions (id, instruction) VALUES ('d8263721-b5a4-4148-b753-163641499965', 'Place kettlebell between your feet. To get in the starting position, push your butt back and look straight ahead.');
INSERT INTO instructions (id, instruction) VALUES ('1e45c581-1fc9-459b-bf31-f8b9da364659', 'Clean the kettlebell to your shoulder. Clean the kettlebell to your shoulders by extending through the legs and hips as you raise the kettlebell towards your shoulder. The wrist should rotate as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('90f2b89a-fb65-4a4f-a9fd-1da241ff8181', 'Lower the kettlebell, keeping the hamstrings loaded by keeping your back straight and your butt out.');
INSERT INTO instructions (id, instruction) VALUES ('4b9ceb4d-e835-44b1-be87-bf66a397d569', 'Place one kettlebell between your legs and take a wider than shoulder width stance. Bend over by pushing your butt out and keeping your back flat.');
INSERT INTO instructions (id, instruction) VALUES ('135d29b2-aff6-4014-84b5-a3dfa7ae1f7f', 'Pick up a kettlebell and pass it to your other hand between your legs. The receiving hand should reach from behind the legs. Go back and forth for several repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('103c9d88-aa30-480b-8652-f84c01581fc2', 'Clean kettlebell to your shoulder. Clean the kettlebell to your shoulders by extending through the legs and hips as you raise the kettlebell towards your shoulder. The wrist should rotate as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('63bb816f-badb-4e0e-8108-443495f084e0', 'Lower kettlebell to a hanging position between your legs while keeping the hamstrings loaded. Keep your head up at all times.');
INSERT INTO instructions (id, instruction) VALUES ('602bff45-d0ba-4fb9-ab00-f5234f9166ad', 'Hold a kettlebell by the handle in one hand. Stand on one leg, on the same side that you hold the kettlebell.');
INSERT INTO instructions (id, instruction) VALUES ('66a3999a-5c64-494f-a8bc-18485cb241fb', 'Keeping that knee slightly bent, perform a stiff legged deadlift by bending at the hip, extending your free leg behind you for balance.');
INSERT INTO instructions (id, instruction) VALUES ('c7b8b1a1-6454-4fb0-9b02-bdfb82aa5429', 'Continue lowering the kettlebell until you are parallel to the ground, and then return to the upright position.');
INSERT INTO instructions (id, instruction) VALUES ('d41695dd-cfff-4481-8093-ade6018e69ec', 'Place one kettlebell between your legs and take a comfortable stance. Bend over by pushing your butt out and keeping your back flat.');
INSERT INTO instructions (id, instruction) VALUES ('4acc2726-bcc3-4c9c-a2b7-2663aefa2f75', 'Pick up a kettlebell and pass it to your other hand between your legs, in the fashion of a "W". Go back and forth for several repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('48962a29-da24-4811-ac63-f85361d0fdeb', 'With a wide stance, hold a kettlebell with both hands. Allow it to hang at waist level with your arms extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('75a38847-abfa-4581-aa1a-be0cd0ff16b9', 'Initiate the movement by turning to one side, swinging the kettlebell to head height. Briefly pause at the top of the motion.');
INSERT INTO instructions (id, instruction) VALUES ('db79fd37-aba4-4318-ae81-514dc090a911', 'Allow the bell to drop as you rotate to the opposite side, again raising the kettlebell to head height.');
INSERT INTO instructions (id, instruction) VALUES ('5a51d50d-4069-42a0-94fc-2b896166fc0e', 'Repeat for the desired amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('81126093-a427-49be-bd8d-2b940b002b84', 'Pick up a kettlebell with two hands and hold it by the horns. Hold one leg off of the floor and squat down on the other.');
INSERT INTO instructions (id, instruction) VALUES ('862b7b21-269f-4dd2-8efb-98c8534df427', 'Squat down by flexing the knee and sitting back with the hips, holding the kettlebell up in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('de87c550-e3bc-42f9-a296-355aaafbfec1', 'Hold the bottom position for a second and then reverse the motion, driving through the heel and keeping your head and chest up.');
INSERT INTO instructions (id, instruction) VALUES ('5fe7ee0a-d95e-44f0-bf90-3904a071a0c8', 'Lower yourself again and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('c370b564-a94f-493d-9a6d-1bc937b69e81', 'Sit on the floor and spread your legs out comfortably.');
INSERT INTO instructions (id, instruction) VALUES ('34730990-5e00-4b85-9973-2989559b63f5', 'Clean one kettlebell to your shoulder.');
INSERT INTO instructions (id, instruction) VALUES ('58079ec5-1c75-4b3d-8432-f0570dcf7d29', 'Press the kettlebell up and out until it is locked out overhead. Return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('91a7fbe7-9c42-4264-b009-177c941b26ca', 'Clean two kettlebells two your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('ead79613-2b7c-4ba7-a928-0abe1a1c1c0a', 'Press one kettlebell.');
INSERT INTO instructions (id, instruction) VALUES ('d7728407-c476-4615-afd8-988e4d6bfb4a', 'Lower the kettlebell and immediately press the other kettlebell. Make sure to do the same amount of reps on both sides.');
INSERT INTO instructions (id, instruction) VALUES ('236edf7a-ca10-4bce-8ceb-e810b5db235a', 'Place a kettlebell on the ground between your feet. Position your feet in a wide stance, and grasp the kettlebell with two hands. Set your hips back as far as possible, with your knees bent. Keep your chest and head up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('31970137-eb0b-4f4e-9c7d-e5beafb0c19e', 'Begin by extending the hips and knees, simultaneously pulling the kettlebell to your shoulders, raising your elbows as you do so. Reverse the motion to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5b9955e3-eb8e-459d-b8d2-99f76acc6b16', 'Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7d5b0c91-cb13-4df1-96bb-bf17e26b1872', 'Begin to squat by flexing your hips and knees, lowering your hips between your legs. Maintain an upright, straight back as you descend as low as you can.');
INSERT INTO instructions (id, instruction) VALUES ('36286736-3c42-4af3-93e1-b403d10bf260', 'At the bottom, reverse direction and squat by extending your knees and hips, driving through your heels. As you do so, press both kettlebells overhead by extending your arms straight up, using the momentum from the squat to help drive the weights upward.');
INSERT INTO instructions (id, instruction) VALUES ('752ddac0-4dab-479f-a637-184ef72b5784', 'As you begin the next repetition, return the weights to the shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('2ac609d6-d95b-4722-b2b6-ad64392012c6', 'Lie on your back on the floor and press a kettlebell to the top position by extending the elbow. Bend the knee on the same side as the kettlebell.');
INSERT INTO instructions (id, instruction) VALUES ('b03937a1-5c2d-4e21-b626-fec668722c8a', 'Keeping the kettlebell locked out at all times, pivot to the opposite side and use your non- working arm to assist you in driving forward to the lunge position. Using your free hand, push yourself to a seated position, then progressing to one knee.');
INSERT INTO instructions (id, instruction) VALUES ('c23a755d-e219-4e30-937e-17c788c92078', 'While looking up at the kettlebell, slowly stand up. Reverse the motion back to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('8e67e4ed-475c-47e4-8a21-b40d956fd8bd', 'Keeping the kettlebell locked out at all times, pivot to the opposite side and use your non- working arm to assist you in driving forward to the lunge position.');
INSERT INTO instructions (id, instruction) VALUES ('7e261e38-1d29-48dc-a328-57d2c16f133e', 'Using your free hand, push yourself to a seated position, then progressing to your feet. While looking up at the kettlebell, slowly stand up. Reverse the motion back to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('65697a83-8cd4-4c40-b111-16d3be76b07c', 'Place a kettlebell in front of your lead foot and clean and press it overhead with your opposite arm. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulders. Rotate your wrist as you do so, so that the palm faces forward. Press it overhead by extending the elbow.');
INSERT INTO instructions (id, instruction) VALUES ('4281c482-3290-4138-af75-e12e38aaca75', 'Keeping the kettlebell locked out at all times, push your butt out in the direction of the locked out kettlebell. Turn your feet out at a forty-five degree angle from the arm with the locked out kettlebell. Bending at the hip to one side, sticking your butt out, slowly lean until you can touch the floor with your free hand. Keep your eyes on the kettlebell that you hold over your head at all times.');
INSERT INTO instructions (id, instruction) VALUES ('b7310282-2265-479e-beb0-6d095230f14e', 'Pause for a second after reaching the ground and reverse the motion back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d2d38b58-6e49-40f6-ae60-cbd736219559', 'Grip the rings using a false grip, with the base of your palms on top of the rings.');
INSERT INTO instructions (id, instruction) VALUES ('3c0a45ad-4691-4daa-8a9b-ff6d0d1da649', 'Begin with a movement swinging your legs backward slightly.');
INSERT INTO instructions (id, instruction) VALUES ('6af738ce-e774-47b6-97ec-70688b08e869', 'Counter that movement by swinging your legs forward and up, jerking your chin and chest back, pulling yourself up with both arms as you do so. As you reach the top position of the pull-up, pull the rings to your armpits as you roll your shoulders forward, allowing your elbows to move straight back behind you. This puts you into the proper position to continue into the dip portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('4a2ec7ee-674d-4020-908c-d4f2efb7ec69', 'Maintaining control and stability, extend through the elbow to complete the motion.');
INSERT INTO instructions (id, instruction) VALUES ('424a5fa0-177d-4a55-a6a6-3dc43197950e', 'Use care when lowering yourself to the ground.');
INSERT INTO instructions (id, instruction) VALUES ('6db39504-e9cb-428d-97ee-1c1be4382299', 'Lie down on the floor with your right leg straight. Bend your left leg and lower it across your body, holding the knee down toward the floor with your right hand. (The knee doesn''t need to touch the floor if you''re tight.)');
INSERT INTO instructions (id, instruction) VALUES ('40b894ec-a564-4770-8b91-2495730bc548', 'Place your left arm comfortably beside you and turn your head to the left. Imagine you have a weight tied to your tailbone. let your tailbone fall back toward the floor as your chest reaches in the opposite direction to stretch your lower back. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('081b8984-db43-4098-aa46-90a1426afbbe', 'Stand with your legs together and hands by your waist.');
INSERT INTO instructions (id, instruction) VALUES ('39087455-0788-46a2-80de-24a10665677e', 'Now move your knees in a circular motion as you breathe normally.');
INSERT INTO instructions (id, instruction) VALUES ('d6929d3c-f1c0-4aea-9296-80b7d1494d9b', 'Position your body on the vertical leg raise bench so that your forearms are resting on the pads next to the torso and holding on to the handles. Your arms will be bent at a 90 degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('62ba3f3f-2a03-462e-bfd9-1dd72cbd5732', 'The torso should be straight with the lower back pressed against the pad of the machine and the legs extended pointing towards the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0804ad4a-2b0d-4e56-a957-66cbc1df001d', 'Now as you breathe out, lift your legs up as you keep them extended. Continue this movement until your legs are roughly parallel to the floor and then hold the contraction for a second. Tip: Do not use any momentum or swinging as you perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('cab19b5c-0d38-41df-a811-9656f7de29a7', 'Begin in a comfortable standing position with your knees slightly bent. Hold your hands in front of you, palms down with your fingertips together at chest height. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f8341242-a0df-4b12-a248-eacd88347b9e', 'Rapidly dip down into a quarter squat and immediately explode upward. Drive the knees towards the chest, attempting to touch them to the palms of the hands.');
INSERT INTO instructions (id, instruction) VALUES ('b5332472-b4fb-4014-9b82-96a12d0ec213', 'Jump as high as you can, raising your knees up, and then ensure a good land be re-extending your legs, absorbing impact through be allowing the knees to rebend.');
INSERT INTO instructions (id, instruction) VALUES ('374af693-7642-4e64-b7fc-75730de5cbfc', 'This drill helps increase arm efficiency during the run. Begin kneeling, left foot in front, right knee down. Apply pressure through the front heel to keep your glutes and hamstrings activated.');
INSERT INTO instructions (id, instruction) VALUES ('f2ff567b-f781-4a10-b7ee-f8857446de28', 'Begin by blocking the arms in long, pendulum like swings. Close the arm angle, blocking with the arms as you would when jogging, progressing to a run and finally a sprint.');
INSERT INTO instructions (id, instruction) VALUES ('0dea23c5-6ea0-4167-a9a5-ae3706252ab1', 'As soon as your hands pass the hip, accelerate them forward during the sprinting motion to move them as quickly as possible.');
INSERT INTO instructions (id, instruction) VALUES ('d6fbc6e3-6d2b-4d07-9892-2713db18e455', 'Switch knees and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('7844bca2-d09c-426f-972a-011564f149d4', 'Connect a rope attachment to a high pulley cable and position a mat on the floor in front of it.');
INSERT INTO instructions (id, instruction) VALUES ('805c4688-6ac9-4e59-af04-44ae52bd7134', 'Grab the rope with both hands and kneel approximately two feet back from the tower.');
INSERT INTO instructions (id, instruction) VALUES ('0a2a8505-f740-47a0-ae8e-d8997f817ca2', 'Position the rope behind your head with your hands by your ears.');
INSERT INTO instructions (id, instruction) VALUES ('9d84aee1-da22-46fb-86c3-d1d688fc6ea0', 'Keep your hands in the same place, contract your abs and pull downward on the rope in a crunching movement until your elbows reach your knees.');
INSERT INTO instructions (id, instruction) VALUES ('3001441d-52fa-47a6-add2-b5ac1539b278', 'Pause briefly at the bottom and rise up in a slow and controlled manner until you reach the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7414a92d-956e-4621-9110-216e3ae918c4', 'Repeat the same downward movement until you''re halfway down, at which time you''ll begin rotating one of your elbows to the opposite knee.');
INSERT INTO instructions (id, instruction) VALUES ('e1b66635-0386-4e3f-9ac8-ed357aa817d0', 'Again, pause briefly at the bottom and rise up in a slow and controlled manner until you reach the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('81236da7-901a-4f2d-8fd3-b6e673c3e016', 'Repeat the same movement as before, but alternate the other elbow to the opposite knee.');
INSERT INTO instructions (id, instruction) VALUES ('40c70ed7-a112-41cf-82b6-0e619c5f2658', 'Continue this series of movements to failure.');
INSERT INTO instructions (id, instruction) VALUES ('1c1d536a-63dd-43fb-bcb9-66f38ca22a49', 'Place a bench sideways in front of a high pulley machine.');
INSERT INTO instructions (id, instruction) VALUES ('777531a7-3407-49ff-9894-c6e8cdfe297e', 'Hold a straight bar attachment above your head with your hands about 6 inches apart with your palms facing down.');
INSERT INTO instructions (id, instruction) VALUES ('7fe45622-0ad1-4652-ab1e-990aa51547a9', 'Face away from the machine and kneel.');
INSERT INTO instructions (id, instruction) VALUES ('322afb14-3b52-4705-9b76-80a08402615e', 'Place your head and the back of your upper arms on the bench. Your elbows should be bent with the forearms pointing towards the high pulley. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('16ed8766-31b4-4e6c-bfd8-365c71fb21ef', 'While keeping your upper arms close to your head at all times with the elbows in, press the bar out in a semicircular motion until the elbows are locked and your arms are parallel to the floor. Contract the triceps hard and keep this position for a second. Exhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('c9e33b41-de8c-4b3e-9a17-58e5c42a8480', 'Start by kneeling on a mat with your palms flat and your fingers pointing back toward your knees.');
INSERT INTO instructions (id, instruction) VALUES ('d13f67d2-39e6-4df1-9a91-75cc0aea21df', 'Slowly lean back keeping your palms flat on the floor until you feel a stretch in your wrists and forearms. Hold for 20-30 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('9a3ef889-cb31-4138-8f0b-b239e528587b', 'Select the appropriate weight using a pulley that is above your head. Attach a rope to the cable and kneel a couple of feet away, holding the rope out in front of you with both arms extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8ab3927f-6b49-4830-9b71-3dfae0dc7939', 'Initiate the movement by flexing the elbows and fully retracting your shoulders, pulling the rope toward your upper chest with your elbows out.');
INSERT INTO instructions (id, instruction) VALUES ('4003399e-6335-4ec5-b8be-10524f520b3b', 'After pausing briefly, slowly return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0ec4e852-3250-4142-a29c-b4841162f5a4', 'Kneel on a mat and bring your right knee up so the bottom of your foot is on the floor and extend your left leg out behind you so the top of your foot is on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('a5adf70c-6784-418c-bba6-060a3fd2026e', 'Shift your weight forward until you feel a stretch in your hip. Hold for 15 seconds, then repeat for your other side.');
INSERT INTO instructions (id, instruction) VALUES ('41049078-8052-4b5c-8564-5ea0c671ec68', 'Begin kneeling on the floor with a barbell racked across the back of your shoulders, or you can use your body weight for this exercise. This can be done inside of a power rack to make unracking easier.');
INSERT INTO instructions (id, instruction) VALUES ('c4bb7370-9c5d-40cb-87d0-cce1cb5e5736', 'Sit back with your hips until your glutes touch your feet, keeping your head and chest up.');
INSERT INTO instructions (id, instruction) VALUES ('70399b2b-1286-4ec1-9305-eb04ef9489c9', 'Explode up with your hips, generating enough power to land with your feet flat on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('10848f87-c16e-40fa-baa5-c2a71e9f5d5f', 'Continue with the squat by driving through your heels and extending the knees to come to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('684c6f3f-1e1e-42a4-aa98-6c6243b01539', 'Attach a single handle to a high pulley and make your weight selection.');
INSERT INTO instructions (id, instruction) VALUES ('bb8bc46d-cc58-42e2-87b7-1ead675c0e48', 'Kneel in front of the cable tower, taking the cable with one hand with your arm extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d9d9cf2a-d2af-4678-8f23-20499651ae72', 'Starting with your palm facing forward, pull the weight down to your torso by flexing the elbow and retract the shoulder blade. As you do so, rotate the wrist so that at the completion of the movement, your palm is now facing you.');
INSERT INTO instructions (id, instruction) VALUES ('725cc52d-2ba0-417d-b7b0-176d9adfdc15', 'Set the bar to the proper height in a power rack. Kneel behind the bar; it may be beneficial to put a mat down to pad your knees. Slide under the bar, racking it across the back of your shoulders. Your shoulder blades should be retracted and the bar tight across your back. Unrack the weight.');
INSERT INTO instructions (id, instruction) VALUES ('fef0d218-5bc4-405b-bfba-0b5c8dc6474d', 'With your head looking forward, sit back with your butt until you touch your calves.');
INSERT INTO instructions (id, instruction) VALUES ('cf87497f-f672-4995-9f88-df5add702756', 'Reverse the motion, returning the torso to an upright position.');
INSERT INTO instructions (id, instruction) VALUES ('bfa6129f-e6a7-46dc-8c54-305ff73f2180', 'Position a bar into a landmine or securely anchor it in a corner. Load the bar to an appropriate weight.');
INSERT INTO instructions (id, instruction) VALUES ('7e337ee8-486a-4495-8a22-d01d6a12cac2', 'Raise the bar from the floor, taking it to shoulder height with both hands with your arms extended in front of you. Adopt a wide stance. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b7490931-332c-4996-bd2d-305ff9abadb7', 'Perform the movement by rotating the trunk and hips as you swing the weight all the way down to one side. Keep your arms extended throughout the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('60c41ace-547b-4a28-93fc-f15c2a945176', 'Reverse the motion to swing the weight all the way to the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('5ba9db17-ae94-4c9c-973f-72549f279747', 'Continue alternating the movement until the set is complete.');
INSERT INTO instructions (id, instruction) VALUES ('0e52091d-db64-4f7a-bf72-57cd4ba1cd3a', 'Position a bar into landmine or, lacking one, securely anchor it in a corner. Load the bar to an appropriate weight and position the handle attachment on the bar.');
INSERT INTO instructions (id, instruction) VALUES ('d8de9645-a522-4012-b7a3-265ee0a5c227', 'Raise the bar from the floor, taking the handles to your shoulders. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('01546039-d617-46ad-9e3f-faf58909c9ca', 'In an athletic stance, squat by flexing your hips and setting your hips back, keeping your arms flexed.');
INSERT INTO instructions (id, instruction) VALUES ('a9077434-5585-4736-aaec-1a345dfd69c9', 'Reverse the motion by powerfully extending through the hips, knees, and ankles, while also extending the elbows to straighten the arms. This movement should be done explosively, coming out of the squat to full extension as powerfully as possible.');
INSERT INTO instructions (id, instruction) VALUES ('2d1e154c-0ee9-4ed4-94f7-b5f4abcd8db7', 'Return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c2356323-b27c-4400-bd83-afaa62cc5c0e', 'Assume a half squat position facing 90 degrees from your direction of travel. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ec5e08d0-b26f-43dc-8301-3bdaed2b6810', 'Allow your lead leg to do a countermovement inward as you shift your weight to the outside leg.');
INSERT INTO instructions (id, instruction) VALUES ('9c9e6dd1-b82c-4789-9a2d-b102858b51e1', 'Immediately push off and extend, attempting to bound to the side as far as possible.');
INSERT INTO instructions (id, instruction) VALUES ('593405c9-1b15-4564-91d7-4c7c68037cbb', 'Upon landing, immediately push off in the opposite direction, returning to your original start position.');
INSERT INTO instructions (id, instruction) VALUES ('21e1f119-9429-4d91-bb1c-3021439897fd', 'Continue back and forth for several repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('acd5a8b6-6a12-449c-8b41-96b7c683d437', 'Assume a comfortable standing position, with a short box positioned next to you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('36d48c0a-f9e0-481a-855a-c3ba57eafe9b', 'Quickly dip into a quarter squat to initiate the stretch reflex, and immediately reverse direction to jump up and to the side.');
INSERT INTO instructions (id, instruction) VALUES ('8e5d47db-533d-4429-bfc0-f0cd60b36a7d', 'Bring your knees high enough to ensure your feet have good clearance over the box.');
INSERT INTO instructions (id, instruction) VALUES ('a15bc422-5b48-4aa9-91ae-648f93684d2f', 'Land on the center of the box, using your legs to absorb the impact.');
INSERT INTO instructions (id, instruction) VALUES ('b5fe09a7-16d6-422f-8d76-63a2a5879cb8', 'Carefully jump down to the other side of the box, and continue going back and forth for several repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('9cac9a5b-38c3-44cb-9ed7-aada8adf9137', 'Position a number of cones in a row several feet apart.');
INSERT INTO instructions (id, instruction) VALUES ('8f602f00-8181-4cee-9bd0-2d404e350bee', 'Stand next to the end of the cones, facing 90 degrees to the direction of travel. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fc6ec864-2c7a-47c5-94da-5c8e4efadc28', 'Begin the jump by dipping with the knees to initiate a stretch reflex, and immediately reverse direction to push off the ground, jumping up and sideways over the cone.');
INSERT INTO instructions (id, instruction) VALUES ('eec27352-1db6-42e3-a452-2f81c6e1b068', 'Use your legs to absorb impact upon landing, and rebound into the next jump, continuing down the row of cones.');
INSERT INTO instructions (id, instruction) VALUES ('5a9d37c4-df8f-4706-9fdc-7580db191b4a', 'To begin, stand on an exercise band so that tension begins at arm''s length. Grasp the handles using a pronated (palms facing your thighs) grip that is slightly less than shoulder width. The handles should be resting on the sides of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a1a26cc5-3bf0-4a45-8ad5-192df736a692', 'Use your side shoulders to lift the handles to the sides as you exhale. Continue to lift the handles until they are slightly above parallel. Tip: As you lift the handles, slightly tilt the hand as if you were pouring water and keep your arms extended. Also, keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d53ca5ed-fe44-4754-8fb8-0b2dc5c757ee', 'Lower the handles back down slowly to the starting position. Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d6b254cf-bacb-450f-89c4-d9e79b79e3c9', 'While lying on the floor, place a foam roll under your back and to one side, just behind your arm pit. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fad18163-1fd4-4245-bddf-221c69403aad', 'Keep the arm of the side being stretched behind and to the side of you as you shift your weight onto your lats, keeping your upper body off of the ground. Hold for 10-30 seconds, and switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('4d6700c9-557f-4563-bd8f-16aa33815a48', 'Lie on the floor with one kettlebell in place on your chest, holding it by the handle. Extend leg on working side over leg on non-working side.Your free arm can be extended out to your side for support.');
INSERT INTO instructions (id, instruction) VALUES ('0e5e7281-6e34-42cd-ac6c-9ceb36be5ef1', 'Press the kettlebll into a locked out position.');
INSERT INTO instructions (id, instruction) VALUES ('ba3fcf48-f384-46a8-9b30-7a3131c79077', 'Lower the weight until the elbow touches the ground, keeping the kettlebell above the elbow. Repeat for the desired number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('3109bf3a-7974-4793-8069-f4b776444139', 'Lie flat on your back, bend one knee, and put that foot flat on the floor to stabilize your spine.');
INSERT INTO instructions (id, instruction) VALUES ('c2ee6328-c1ea-4a08-9641-2f8588b65404', 'Extend the other leg in the air. If you''re tight, you wont be able to straighten it. That''s okay. Extend the knee so that the sole of the lifted foot faces the ceiling (or as close as you can get it).');
INSERT INTO instructions (id, instruction) VALUES ('644d9db9-99d7-47aa-a585-7c3e6ecec7f6', 'Slowly straighten the legs as much as possible and then pull the leg toward your nose. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('d390beda-68ee-4907-bc03-7c5c1fd70029', 'For this exercise you will need to use a leg extension machine. First choose your weight and sit on the machine with your legs under the pad (feet pointed forward) and the hands holding the side bars. This will be your starting position. Tip: You will need to adjust the pad so that it falls on top of your lower leg (just above your feet). Also, make sure that your legs form a 90-degree angle between the lower and upper leg. If the angle is less than 90-degrees then that means the knee is over the toes which in turn creates undue stress at the knee joint. If the machine is designed that way, either look for another machine or just make sure that when you start executing the exercise you stop going down once you hit the 90-degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('295de39e-b525-47c1-ac29-f42aba6b8308', 'Using your quadriceps, extend your legs to the maximum as you exhale. Ensure that the rest of the body remains stationary on the seat. Pause a second on the contracted position.');
INSERT INTO instructions (id, instruction) VALUES ('b74ae00f-492a-43be-9ba3-85c2fb217de3', 'Slowly lower the weight back to the original position as you inhale, ensuring that you do not go past the 90-degree angle limit.');
INSERT INTO instructions (id, instruction) VALUES ('f1cbff8e-794c-487e-899d-8e7f52cf28a9', 'While standing up straight with both feet next to each other at around shoulder width, grab a sturdy surface such as the sides of a squat rack or the top of a chair to brace yourself and keep balance.');
INSERT INTO instructions (id, instruction) VALUES ('6fe4aca8-de32-4055-ba6b-29810aa42295', 'With or without an ankle weight, lift one leg behind you as if performing a leg curl but standing up while keeping the other leg straight. Breathe out as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('3bc8658d-e695-424b-b602-499b62e3cca0', 'Slowly bring the raised leg back to the floor as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('97e60c18-ee79-43bf-9c57-4a1162a83afc', 'Repeat the movement with the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('f97edab1-3c60-4d27-8709-974c98297c26', 'Using a leg press machine, sit down on the machine and place your legs on the platform directly in front of you at a medium (shoulder width) foot stance. (Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances described in the foot positioning section).');
INSERT INTO instructions (id, instruction) VALUES ('62e1b19f-f5a4-4490-9b6b-c5e24995b63b', 'Lower the safety bars holding the weighted platform in place and press the platform all the way up until your legs are fully extended in front of you. Tip: Make sure that you do not lock your knees. Your torso and the legs should make a perfect 90-degree angle. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4ffbb29c-bbb7-4529-bb8e-215a3cd4e237', 'As you inhale, slowly lower the platform until your upper and lower legs make a 90-degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('17282698-9989-4301-b4f1-1a4040d74af8', 'Pushing mainly with the heels of your feet and using the quadriceps go back to the starting position as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('9bafdf94-c9b4-49a0-8fe9-1f7477caa80e', 'Repeat for the recommended amount of repetitions and ensure to lock the safety pins properly once you are done. You do not want that platform falling on you fully loaded.');
INSERT INTO instructions (id, instruction) VALUES ('98e56c48-97cb-4441-82f0-49e00d3c4c68', 'Lie on an exercise mat with your legs extended and your hands either palms facing down next to you or under your glutes. Tip: My preference is with the hands next to me. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0c290deb-3478-4c3a-8382-db7ca6acf85b', 'Bend your knees and pull your upper thighs into your midsection as you breathe out. Continue the motion until your knees are around chest level. Contract your abs as you execute this movement and hold for a second at the top. Tip: As you perform the motion, the lower legs (calves) should always remain parallel to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('774225cd-28ee-4b30-87d1-842bb76c0cca', 'Return to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('9173c6ce-4ebe-430e-87e3-e00d365135b5', 'Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the bottom or middle of the pectorals at the beginning of the motion.');
INSERT INTO instructions (id, instruction) VALUES ('bffc6cd1-00da-45cd-ab05-f57e65d61b93', 'Your chest and head should be up and your shoulder blades retracted. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('be687777-b8a6-4954-83b8-7e7527711c14', 'Press the handles forward by extending through the elbow.');
INSERT INTO instructions (id, instruction) VALUES ('eff9003c-7b16-421a-ba3f-c283cacf0a9d', 'After a brief pause at the top, return the weight just above the start position, keeping tension on the muscles by not returning the weight to the stops until the set is complete.');
INSERT INTO instructions (id, instruction) VALUES ('d958f67a-1884-4720-bde1-efb77a7e061c', 'Load the pins to an appropriate weight. Position yourself directly between the handles. Grasp the bottom handles with a comfortable grip, and then lower your hips as you take a breath. Look forward with your head and keep your chest up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4994b038-2a0e-4639-9e36-ef72f878b57d', 'Return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3a83c145-a939-44d5-81d9-ee73e8c42789', 'Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the bottom of the pectorals at the beginning of the motion. Your chest and head should be up and your shoulder blades retracted. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0ebbe041-00b8-4c8e-8bdc-d257fb387d8f', 'Load an appropriate weight onto the pins and adjust the seat height so that you can just reach the handles above you. Adjust the knee pad to help keep you down. Grasp the handles with a pronated grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('343f514b-99f3-4457-8683-32d56f7d6f06', 'Pull the handles towards your torso, retracting your shoulder blades as you flex the elbow.');
INSERT INTO instructions (id, instruction) VALUES ('a7dae017-5140-43a6-9d2e-220c4327eae4', 'Pause at the bottom of the motion, and then slowly return the handles to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('328ac531-c824-41ca-8b28-41f63086c69c', 'For multiple repetitions, avoid completely returning the weight to the stops to keep tension on the muscles being worked.');
INSERT INTO instructions (id, instruction) VALUES ('29f315ad-b70e-49fa-bbb1-d1d7dc920608', 'Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the top of the pectorals at the beginning of the motion. Your chest and head should be up and your shoulder blades retracted. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3438e658-430c-4e0a-98f8-3cc406117de4', 'Load an appropriate weight onto the pins and adjust the seat height so that the handles are at chest level. Grasp the handles with either a neutral or pronated grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3b60a5cb-cce7-467f-9a5b-52cc6c73afa8', 'Pause at the bottom of the motion, and then slowly return the handles to the starting position. For multiple repetitions, avoid completely returning the weight to the stops to keep tension on the muscles being worked.');
INSERT INTO instructions (id, instruction) VALUES ('54fb3ed6-9e1c-4e51-8091-f8aa31688a6a', 'Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the top of the shoulders at the beginning of the motion. Your chest and head should be up and handles held with a pronated grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('27e4130c-efb2-42d3-afc3-bba94fe726ed', 'Press the handles upward by extending through the elbow.');
INSERT INTO instructions (id, instruction) VALUES ('81b67c5c-a73d-4137-878d-7bd2172c3e9f', 'After a brief pause at the top, return the weight to just above the start position, keeping tension on the muscles by not returning the weight to the stops until the set is complete.');
INSERT INTO instructions (id, instruction) VALUES ('1b4e0d72-8a97-4980-95bb-e54d6f34fc2f', 'Load the pins to an appropriate weight. Position yourself directly between the handles.');
INSERT INTO instructions (id, instruction) VALUES ('53056df2-3258-4bc7-9623-6d91d1c24a1a', 'Grasp the top handles with a comfortable grip, and then lower your hips as you take a breath. Look forward with your head and keep your chest up.');
INSERT INTO instructions (id, instruction) VALUES ('1d153215-09a9-4391-ad73-8b21df3b4c33', 'Drive through the floor with your heels, extending your hips and knees as you rise to a standing position. Keep your arms straight throughout the movement, finishing with your shoulders back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('715c6057-e7cb-45e0-9572-a65902c8f6c5', 'Raise the weight by shrugging the shoulders towards your ears, moving straight up and down.');
INSERT INTO instructions (id, instruction) VALUES ('dc03ae35-3afb-439d-951d-b935d5ca6614', 'Pause at the top of the motion, and then return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('53bbfef1-bce7-4fad-957b-cccbe86df671', 'This drill helps you accelerate as quickly as possible into a sprint from a dead stop. It helps to use a line to start from. Begin with two feet on the line. Place your left foot with the toe next to your right ankle. Place your right foot 4-6 inches behind the left.');
INSERT INTO instructions (id, instruction) VALUES ('8eb49fe9-ad4b-4f5c-bcfc-8da409d708f2', 'Place your right hand onto the line, and thing bring your nose close to your left knee.');
INSERT INTO instructions (id, instruction) VALUES ('7c5837a0-e066-4ac6-a290-66458bdcb897', 'Squat down as you lean foward, your head being lower than your hips and your weight loaded onto the left leg. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5d0fa330-8190-4ca2-8c1a-0ca7059cdb11', 'Take your left hand up so that it is parallel to the ground, pointing behind you, and explode out when ready.');
INSERT INTO instructions (id, instruction) VALUES ('e3426253-5242-423c-a7cb-a4a33bce0e15', 'Lean at around 45 degrees against a wall. Your feet should be together, glutes contracted.');
INSERT INTO instructions (id, instruction) VALUES ('e2fa2871-7919-4bd7-ad03-a7f016425892', 'Begin by lifting your right knee quickly, pausing, and then driving it straight down into the ground.');
INSERT INTO instructions (id, instruction) VALUES ('3113cb74-d406-4bb2-85e4-7d15112c4201', 'Switch legs, raising the opposite knee, and then attacking the ground straight down.');
INSERT INTO instructions (id, instruction) VALUES ('f56f7daa-5b09-4bb1-810d-6854612cde97', 'Repeat once more with your right leg, and as soon as the right foot strikes the ground hammer them out rapidly, alternating left and right as fast as you can.');
INSERT INTO instructions (id, instruction) VALUES ('96afb628-98a5-4143-91c1-dcde5cdfad8b', 'You will need two boxes or benches spaced a few feet away from each other. Begin by standing on one box facing towards the other platform.');
INSERT INTO instructions (id, instruction) VALUES ('8f344c16-bca6-492e-aad9-ab88890b83e5', 'To initiate the movement, gently drop down to the ground between your platforms, allowing the knees and hips to flex.');
INSERT INTO instructions (id, instruction) VALUES ('34db1507-d286-409d-9cda-a92cffce5d69', 'Reverse the motion by exploding, extending through the hips, knees, and ankles to jump onto the other platform.');
INSERT INTO instructions (id, instruction) VALUES ('ecb6cbf0-6324-4167-8cd7-84b78f39de6b', 'Land softly, asborbing the impact through the legs.');
INSERT INTO instructions (id, instruction) VALUES ('9725409f-bd63-4220-9331-7fe47dcddcb6', 'Begin standing with the log in front of you. Grasp the handles, and begin to clean the log. As you are bent over to start the clean, attempt to get the log as high as possible, pulling it into your chest. Extend through the hips and knees to bring it up to complete the clean.');
INSERT INTO instructions (id, instruction) VALUES ('e3b35429-b298-41d7-8808-bd5dff3377c4', 'Push your head back and look up, creating a shelf on your chest to rest the log. Begin the press by dipping, flexing slightly through the knees and reversing the motion. This push press will generate momentum to start the log moving vertically. Continue by extending through the elbows to press the log above your head. There are no strict rules on form, so use whatever techniques you are most efficient with. As the log is pressed, ensure that you push your head through on each repetition, looking forward.');
INSERT INTO instructions (id, instruction) VALUES ('2347e271-b6bd-4b77-bde9-6dd3e970496b', 'Repeat as many times as possible. Attempt to control the descent of the log as it is returned to the ground.');
INSERT INTO instructions (id, instruction) VALUES ('9e40f0f3-176a-471d-bcc6-cc68edf07b8b', 'Attach a climbing rope to a high beam or cross member. Below it, ensure that the smith machine bar is locked in place with the safeties and cannot move. Alternatively, a secure box could also be utilized.');
INSERT INTO instructions (id, instruction) VALUES ('f16d5a3e-a986-49ac-a237-32c74ccb84c2', 'Stand on the bar, using the rope to balance yourself. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('924e4a05-d9d7-4212-8411-ed844ee5d73e', 'Keeping your body straight, lean back and lower your body by slowly going hand over hand with the rope. Continue until you are perpendicular to the ground.');
INSERT INTO instructions (id, instruction) VALUES ('40f6b9c0-e2ca-462c-86d8-85bfbdfa19ae', 'Keeping your body straight, reverse the motion, going hand over hand back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('67b54c27-bd54-459d-894d-aea460176ddd', 'Kneel on the floor, holding your heels with both hands.');
INSERT INTO instructions (id, instruction) VALUES ('5be54712-cb88-4df3-a30e-9cb0d08ee155', 'Lift your buttocks up and forward while bringing your head back to look up at the ceiling, to give an arch in your back.');
INSERT INTO instructions (id, instruction) VALUES ('d43dcca9-26aa-4c4d-9873-6444d779fc84', 'To move into the starting position, place the pulleys at the low position, select the resistance to be used and grasp a handle in each hand.');
INSERT INTO instructions (id, instruction) VALUES ('355abae4-1ac6-4004-9817-a2e61d5100d5', 'Step forward, gaining tension in the pulleys. Your palms should be facing forward, hands below the waist, and your arms straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6d01da9b-8f39-4dd2-8c79-ba8d606fcf66', 'With a slight bend in your arms, draw your hands upward and toward the midline of your body. Your hands should come together in front of your chest, palms facing up.');
INSERT INTO instructions (id, instruction) VALUES ('1cd1265e-9af5-4fc1-a373-47b007e9293e', 'Return your arms back to the starting position after a brief pause.');
INSERT INTO instructions (id, instruction) VALUES ('39a3e5fd-353a-4a22-90c1-423d181c8b98', 'Select the desired weight and lay down face up on the bench of a seated row machine that has a rope attached to it. Your head should be pointing towards the attachment.');
INSERT INTO instructions (id, instruction) VALUES ('fed5274a-8eab-41bf-8953-5c8e5acb0c7b', 'Grab the outside of the rope ends with your palms facing each other (neutral grip).');
INSERT INTO instructions (id, instruction) VALUES ('84e39efb-5bf2-4bd7-a8af-f28f3d0f03e7', 'Position your elbows so that they are bent at a 90 degree angle and your upper arms are perpendicular (90 degree angle) to your torso. Tip: Keep the elbows in and make sure that the upper arms point to the ceiling while your forearms point towards the pulley above your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5cd414b2-25d7-4607-8ab2-2a90e26297a5', 'As you breathe out, extend your lower arms until they are straight and vertical. The upper arms and elbows remain stationary throughout the movement. Only the forearms should move. Contract the triceps hard for a second.');
INSERT INTO instructions (id, instruction) VALUES ('b1fa7669-36ce-4499-b419-9222ed850e05', 'As you breathe in slowly return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ef7c8af1-c1fe-4b07-bed7-85028c8a406d', 'Sit on a low pulley row machine with a rope attachment.');
INSERT INTO instructions (id, instruction) VALUES ('c2dba52c-a1df-4041-90b1-725497df4d42', 'Grab the ends of the rope using a palms-down grip and sit with your back straight and your knees slightly bent. Tip: Keep your back almost completely vertical and your arms fully extended in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('def2d31b-d075-4ff7-a678-278f115d84fa', 'While keeping your torso stationary, lift your elbows and start bending them as you pull the rope towards your neck while exhaling. Throughout the movement your upper arms should remain parallel to the floor. Tip: Continue this motion until your hands are almost next to your ears (the forearms will not be parallel to the floor at the end of the movement as they will be angled a bit upwards) and your elbows are out away from your sides.');
INSERT INTO instructions (id, instruction) VALUES ('631ff8ea-cfa2-4810-8411-20b435762148', 'After holding for a second or so at the contracted position, come back slowly to the starting position as you inhale. Tip: Again, during no part of the movement should the torso move.');
INSERT INTO instructions (id, instruction) VALUES ('47bd70df-b1ad-46b8-93d0-44e07f1b76a3', 'In a seated position, place a foam roll under your lower back. Cross your arms in front of you and protract your shoulders. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3c83a504-aa8a-4499-b65f-f2775d6b67e5', 'Raise your hips off of the floor and lean back, keeping your weight on your lower back. Now shift your weight slightly to one side, keeping your weight off of the spine and on the muscles to the side of it. Roll over your lower back, holding points of tension for 10-30 seconds. Repeat on the other side.');
INSERT INTO instructions (id, instruction) VALUES ('6c83b675-d904-493c-a48c-e219189961a6', 'Lie on your stomach with your arms out to your sides. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('95a9a333-da5e-4cc1-b2dd-f73a17fce39c', 'Using your lower back muscles, extend your spine lifting your chest off of the ground. Do not use your arms to push yourself up. Keep your head up during the movement. Repeat for 10-20 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('fac223b6-50a5-406d-b62d-7a289763af7b', 'Stand with your torso upright holding a kettlebell in your right hand. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2ddd4f6c-4d40-41e2-bbbf-dba3b1321a57', 'Step forward with your left foot and lower your upper body down by flexing the hip and the knee, keeping the torso upright. Lower your back knee until it nearly touches the ground.');
INSERT INTO instructions (id, instruction) VALUES ('5ebf2121-0a00-43df-9581-fea44f0508bf', 'As you lunge, pass the kettlebell under your front leg to your opposite hand.');
INSERT INTO instructions (id, instruction) VALUES ('5725d4fa-cbb1-4412-82f2-60d57c931b62', 'Pressing through the heel of your foot, return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ed694acd-ac89-4803-8335-c289486505b9', 'Repeat the movement for the recommended amount of repetitions, alternating legs.');
INSERT INTO instructions (id, instruction) VALUES ('9776ab7d-37ea-4367-b071-bc98669192c6', 'Adjust a bar in a Smith machine to an appropriate height. Position yourself under the bar, racking it across the back of your shoulders. Unrack the bar, and then split your feet, moving one foot forward and one foot back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b11c0fe0-d787-4222-aa2d-e6c88553987b', 'Lower your back knee nearly to the ground, flexing the knees and lowering your hips as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('aaeb8a54-9c93-4d0f-8af8-988ad4645974', 'At the bottom of the descent, immediately reverse direction. Explosively drive through the heel of your front foot with light pressure from your back foot. Jump up and reverse the position of your legs.');
INSERT INTO instructions (id, instruction) VALUES ('f7acf6a8-d8bd-4159-a47b-6803f33d26a7', 'Lie on your back with your knees bent and the soles of the feet pressed together. Have your partner hold your knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2835e674-e0a1-48e7-b423-581c5393dfdb', 'Attempt to squeeze your knees together, while your partner prevents any movement from occurring.');
INSERT INTO instructions (id, instruction) VALUES ('a178431f-685a-4dd2-95df-34036244f2d0', 'After 10-20 seconds, relax your muscles as your partner gently pushes your knees towards the floor. Be sure to inform your helper when the stretch is adequate to prevent injury or overstretching.');
INSERT INTO instructions (id, instruction) VALUES ('8aa628d1-d274-480f-b51b-77e5e0be5df1', 'Grab a straight bar or E-Z bar attachment that is attached to the low pulley with both hands, using an underhand (palms facing up) shoulder-width grip.');
INSERT INTO instructions (id, instruction) VALUES ('964e1ad2-67e0-4f3a-a86f-ab50d1823171', 'Lie flat on your back on top of an exercise mat in front of the weight stack with your feet flat against the frame of the pulley machine and your legs straight.');
INSERT INTO instructions (id, instruction) VALUES ('ee0becbb-3486-4b90-b55a-ab2a640d706d', 'With your arms extended and your elbows close to your body slightly bend your arms. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fdca4701-b9bb-444d-a7c1-081ace088d78', 'While keeping your upper arms stationary and the elbows close to your body, curl the bar up slowly toward your chest as you breathe out and you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('1d41abad-2c72-4e55-a76f-9c7f8ac8059d', 'After a second squeeze at the top of the movement, slowly return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d4b09b23-4ba8-4802-ae33-7340b1bc4827', 'Place a cambered bar underneath an exercise bench.');
INSERT INTO instructions (id, instruction) VALUES ('f5f764d4-0e1e-4d62-b0ed-32fb3fe2077b', 'Lie face down on the exercise bench and grab the bar using a palms down (pronated grip) that is wider than shoulder width. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('505b0c09-acbe-41e9-8260-bde09fdb8faf', 'As you exhale row the bar up as you keep the elbows close to your body to either your chest, in order to target the upper mid back, or to your stomach if targeting the lats is your goal.');
INSERT INTO instructions (id, instruction) VALUES ('1a3d145d-e9d7-4d3e-b7c2-2b6447519a98', 'After a second hold at the top, lower back down to the starting position slowly as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('f257cc6c-b261-4661-8850-e6660875754b', 'Place a flat bench in front of a high pulley or lat pulldown machine.');
INSERT INTO instructions (id, instruction) VALUES ('0c5ad2d5-002a-4eaa-8b39-d0d281bedba1', 'Hold the straight bar attachment using an underhand grip (palms up) that is about shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('f2734198-66c9-4c76-b732-1e9de72065fb', 'Lie on your back with your head over the end of the bench.');
INSERT INTO instructions (id, instruction) VALUES ('dc10864a-7a5d-4fa9-b964-88f1e6095ac6', 'Now extend your arms straight above your shoulders. Your torso and your arms should make a 90-degree angle and the elbows should be in. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('36d8ad84-4837-4095-92ac-b3d8d73a0008', 'As you breathe out, curl the bar down in a semicircular motion until it touches your chin. Squeeze the biceps for a second at the top contracted position. Tip: As you execute this motion only the forearms should move. At no time should the upper arms be moving at all. They are to remain perpendicular throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('19b21273-ddc1-495f-aca3-2978ccd7845a', 'Return to starting position slowly.');
INSERT INTO instructions (id, instruction) VALUES ('4e1da762-6b40-47cc-a455-e21378c1be9f', 'While holding a barbell or EZ Curl bar with a pronated grip (palms facing forward), lie on your back on a flat bench with your head close to the end of the bench. Tip: If you are holding a barbell grab it using a shoulder-width grip and if you are using an E-Z Bar grab it on the inner handles.');
INSERT INTO instructions (id, instruction) VALUES ('7151c25f-5e81-4e70-ab7c-55c7e965d446', 'Extend your arms in front of you and slowly bring the bar back in a semi circular motion (while keeping the arms extended) to a position over your head. At the end of this step your arms should be overhead and parallel to the floor. This will be your starting position. Tip: Keep your elbows in at all times.');
INSERT INTO instructions (id, instruction) VALUES ('2943c542-d7f3-4a43-93cc-be5f2039f75e', 'As you inhale, lower the bar by bending at the elbows and while keeping the upper arm stationary. Keep lowering the bar until your forearms are perpendicular to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('63131819-f8f6-4c45-9a08-2cdb48345024', 'As you exhale bring the bar back up to the starting position by pushing the bar up in a semi-circular motion until the lower arms are also parallel to the floor. Contract the triceps hard at the top of the movement for a second. Tip: Again, only the forearms should move. The upper arms should remain stationary at all times.');
INSERT INTO instructions (id, instruction) VALUES ('fd9713bf-eab8-4d6d-9d8a-f0746f2442b1', 'While holding a barbell or EZ Curl bar with a pronated grip (palms facing forward), lie on your back on a flat bench with your head off the end of the bench. Tip: If you are holding a barbell grab it using a shoulder-width grip and if you are using an E-Z Bar grab it on the inner handles.');
INSERT INTO instructions (id, instruction) VALUES ('e1b676c7-50f6-4dc3-8dcc-6d527135da59', 'Extend your arms in front of you as you hold the barbell over your chest. The arms should be perpendicular to your torso (90-degree angle). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8266de6a-0ba3-4421-b983-032a95e19e54', 'As you inhale, lower the bar in a semi-circular motion by bending at the elbows and while keeping the upper arm stationary and elbows in. Keep lowering the bar until it lightly touches your chin.');
INSERT INTO instructions (id, instruction) VALUES ('1a630c1d-cb97-49c2-a73c-7cb5025fbae5', 'As you exhale bring the bar back up to the starting position by pushing the bar up in a semi-circular motion. Contract the triceps hard at the top of the movement for a second. Tip: Again, only the forearms should move. The upper arms should remain stationary at all times.');
INSERT INTO instructions (id, instruction) VALUES ('17ade354-b550-4d1a-a545-cc529b741521', 'Lie on your back with your legs extended.');
INSERT INTO instructions (id, instruction) VALUES ('3e031279-7eaf-4523-aadd-b45ddc3ce2e1', 'Cross one leg over your body with the knee bent, attempting to touch the knee to the ground. Your partner should kneel beside you, holding your shoulder down with one hand and controlling the crossed leg with the other. this will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ea455b89-2649-4648-a05f-bb348e9ac975', 'Attempt to raise the bent knee off of the ground as your partner prevents any actual movement.');
INSERT INTO instructions (id, instruction) VALUES ('b1b936e6-9d23-40cd-8b46-4f0bf004cd98', 'After 10-20 seconds, relax the leg as your partner gently presses the knee towards the floor. Repeat with the other side.');
INSERT INTO instructions (id, instruction) VALUES ('8bcb96f9-ee41-4b7a-b76a-98c4e2f28ec4', 'Lie on a flat bench while holding two dumbbells directly in front of you. Your arms should be fully extended at a 90-degree angle from your torso and the floor. The palms should be facing in and the elbows should be tucked in. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7e2cae65-062d-42b8-8a39-2a74bbaced68', 'As you breathe in and you keep the upper arms stationary with the elbows in, slowly lower the weight until the dumbbells are near your ears.');
INSERT INTO instructions (id, instruction) VALUES ('4e215706-426a-491b-8083-f347202fa5d3', 'At that point, while keeping the elbows in and the upper arms stationary, use the triceps to bring the weight back up to the starting position as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('6133a8f4-4f50-41df-bbc4-0c261230193c', 'Lie face down with your whole body straight on a flat bench while holding a weight plate behind your head. Tip: You will need to position yourself so that your shoulders are slightly above the end of a flat bench in order for the upper chest, neck and face to be off the bench. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('dbaf8418-7c21-42fa-91d8-bcbdc6de0286', 'While keeping the plate secure on the back of your head slowly lower your head (as in saying "yes") as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('fd871363-e4bb-4ccd-bc5c-e2150c018d62', 'Raise your head back up to the starting position in a semi-circular motion as you breathe out. Hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('44fcc628-d549-4b62-98e9-584fe7fd80dc', 'Lie face up with your whole body straight on a flat bench while holding a weight plate on top of your forehead. Tip: You will need to position yourself so that your shoulders are slightly above the end of a flat bench in order for the traps, neck and head to be off the bench. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('226980d3-0016-4b41-be0c-595b4d03f67d', 'While keeping the plate secure on your forehead slowly lower your head back in a semi-circular motion as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('f3e18fcf-3261-43a4-84ce-9c4ca47e54d9', 'Lie on your back with your partner kneeling beside you.');
INSERT INTO instructions (id, instruction) VALUES ('dcf923d6-9461-4372-83d1-c2a228ed37a4', 'Flex the hip of one leg, raising it off of the floor. Rotate the leg so the foot is over the opposite hip, the lower leg perpendicular to your body. Your partner should hold the knee and ankle in place. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('96965470-c295-4f5f-ae32-42269030a0e7', 'Attempt to push your leg towards your partner, who should be preventing any actual movement of the leg.');
INSERT INTO instructions (id, instruction) VALUES ('e7b473d3-e498-4279-b85e-9807f9fead2a', 'After 10-20 seconds, completely relax as your partner gently pushes the ankle and knee towards your chest. Be sure to inform your helper when the stretch is adequate to prevent injury or overstretching.');
INSERT INTO instructions (id, instruction) VALUES ('47ae0f61-ba1b-44e2-9bb7-d5e702c3ae2b', 'Lie on your back with your legs extended. Your partner should be kneeling beside you. Raise one leg up towards the ceiling and have your partner hold the ankle. Your partner can use their shoulder to brace your leg if necessary. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8bec45a8-b43d-4c1d-8159-edb3cef62eec', 'With your partner holding your leg in place, attempt to flex the knee, contracting the hamstrings for 10-20 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('59a1c669-2644-42fa-8786-20968840c990', 'Then relax your leg, allowing your partner to gently push the leg towards your head. Be sure to inform your helper when the stretch is adequate to prevent injury or overstretching. Switch sides once complete.');
INSERT INTO instructions (id, instruction) VALUES ('0895c4d4-65d8-40cf-93a2-4a9dbdc1d4fd', 'Lie face forward on a tall flat bench while holding a barbell with a supinated grip (palms facing up). Tip: If you are holding a barbell grab it using a shoulder-width grip and if you are using an E-Z Bar grab it on the inner handles. Your upper body should be positioned in a way that the upper chest is over the end of the bench and the barbell is hanging in front of you with the arms extended and perpendicular to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c41473c8-feec-412a-8f87-82d043ccf556', 'While keeping the elbows in and the upper arms stationary, curl the weight up in a semi-circular motion as you contract the biceps and exhale. Hold at the top of the movement for a second.');
INSERT INTO instructions (id, instruction) VALUES ('720faec1-929d-442a-9783-b7fba8dcefc4', 'As you inhale, slowly go back to the starting position. Tip: Maintain full control of the weight at all times and avoid any swinging. Remember, only the forearms should move throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('fe609c1a-ae51-4319-8b0d-2be6960a0b5c', 'Adjust the machine lever to fit your height and lie face down on the leg curl machine with the pad of the lever on the back of your legs (just a few inches under the calves). Tip: Preferably use a leg curl machine that is angled as opposed to flat since an angled position is more favorable for hamstrings recruitment.');
INSERT INTO instructions (id, instruction) VALUES ('69426015-0853-4dcd-a340-629f961a889e', 'Keeping the torso flat on the bench, ensure your legs are fully stretched and grab the side handles of the machine. Position your toes straight (or you can also use any of the other two stances described on the foot positioning section). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cea1c3f6-5513-4762-bd67-314f99ffbba0', 'As you exhale, curl your legs up as far as possible without lifting the upper legs from the pad. Once you hit the fully contracted position, hold it for a second.');
INSERT INTO instructions (id, instruction) VALUES ('830eb359-c3d6-4245-91d0-e53a08c73314', 'As you inhale, bring the legs back to the initial position. Repeat for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('deb4ccb1-7e59-42f7-ab43-b6784d625529', 'Adjust the leg machine to a height that will allow you to get inside it with your knees bent and the thighs slightly below parallel.');
INSERT INTO instructions (id, instruction) VALUES ('2c82848a-4d0b-4688-8d10-40e1d814df27', 'Once you select the weight, position yourself inside the machine face up with the knees bent and thighs slightly below parallel to the platform. Make sure that the knees do not go past the toes. The angle created between the hamstrings and the calves should be one that is slightly less than 90 degrees (since your starting position requires you to start slightly below parallel). Your back and your head should be resting on the machine while your shoulders are pressed under the shoulder pads.');
INSERT INTO instructions (id, instruction) VALUES ('9b940ad7-25fe-4f4b-9fce-fc4164a046a6', 'Place your hands by the handles and position your feet slightly pointing out at a shoulder width position. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f8924ca2-f14e-41d3-8cb7-28b8ed7d0da2', 'While pressing with the balls of the feet as you breathe out, make your whole body erect as you squeeze the quads. Hold the contracted position for a second. Tip: Since you are starting below parallel, you can opt to use your hands to help you up by pressing on your thighs only on the first repetition.');
INSERT INTO instructions (id, instruction) VALUES ('ac8b34d4-7734-4cf1-b7ec-37c6fb85172e', 'Slowly squat down as you inhale but instead of going all the way down to the starting position, just stop once your thighs are parallel to the platform. The angle between your hamstrings and calves should be a 90-degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('14aef1f1-41da-4d52-bc54-31fff189863f', 'While holding a dumbbell in one hand, lay with your chest down on a flat bench. The other hand can be used to hold to the leg of the bench for stability.');
INSERT INTO instructions (id, instruction) VALUES ('82dd283c-5690-48d7-b78d-03e2b6162218', 'Lay face down on the floor with your partner kneeling beside you. Flex one knee and raise that leg off the ground, attempting to touch your glutes with your foot. Your partner should hold the knee and ankle. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('21057950-f988-4e0d-844a-7e2c6f27b4c7', 'Attempt to extend your knee while your partner prevents any actual movement.');
INSERT INTO instructions (id, instruction) VALUES ('f29a82b9-80d7-40cc-9f31-1cfd8ce2fb22', 'After 10-20 seconds, relax your muscles as your partner gently pushes the foot towards your glutes, further stretching the quadriceps and hip flexors.');
INSERT INTO instructions (id, instruction) VALUES ('a325b9a8-405c-4cd7-bb36-4747b33d86e8', 'After 10-20 seconds, switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('cc780362-411d-4171-9893-a13fe42921b6', 'While holding a dumbbell in each hand, lay with your chest down on a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('7b3e3f41-116e-4de3-a196-4c9dbfb064af', 'Lie down on a flat bench face up while holding a dumbbell in each arm on top of your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('c4d9d2f2-0cb6-44fd-8785-984cbcecefec', 'Bring the dumbbells to the sides with the arms extended and the palms of the hands facing your thighs (neutral grip).');
INSERT INTO instructions (id, instruction) VALUES ('e97ea38f-8067-4911-b77f-e5578c5badfd', 'While keeping the arms close to your torso and elbows in, slowly lower your arms (as you keep them extended with a slight bend at the elbows) as far down towards the floor as you can go. Once you cannot go down any further, lock your upper arms in that position and that will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('669a53c0-b177-4bc6-8425-c90a128b2751', 'As you breathe out, slowly begin to curl the weights up as you simultaneously rotate your wrists so that the palms of the hands face up. Continue curling the weight until your biceps are fully contracted and squeeze hard at the top position for a second. Tip: Only the forearms should move. Upper arms should remain stationary and elbows should stay in throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('54859319-3263-42f2-b9bb-ff564a657587', 'Return back to the starting position very slowly.');
INSERT INTO instructions (id, instruction) VALUES ('06b9d0cc-0b2b-4f35-9b9a-a1cc81391013', 'Load up the T-bar Row Machine with the desired weight and adjust the leg height so that your upper chest is at the top of the pad. Tip: In some machines all you can do is stand on the appropriate step that allows you to be at a height that has the upper chest at the top of the pad.');
INSERT INTO instructions (id, instruction) VALUES ('d0720a46-359e-458b-a802-3357e3ba7294', 'Lay face down on the pad and grab the handles. You can either use a palms down, palms up, or palms in position depending on what part of your back you want to emphasize.');
INSERT INTO instructions (id, instruction) VALUES ('2c6e6cdb-1337-4cf8-b461-b4ad49dd638e', 'Lift the bar off the rack and extend your arms in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('61b26188-e5c2-4211-bf2c-6b8d606031ae', 'As you exhale slowly pull the weight up and squeeze your back at the top of the movement. Tip: Keep the upper arms as close to the torso as possible throughout the movement in order to better engage the back muscles. Also, do not lift your body off of the pad at any time and refrain from using the biceps to lift the weight.');
INSERT INTO instructions (id, instruction) VALUES ('37fed26e-5462-49e0-bffa-588eabbf51af', 'After a second contraction at the top of the movement, as you inhale, slowly go back down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2a05f20b-d8d4-440b-9d1c-1b108177f132', 'Lie on a flat bench with either an e-z bar (my preference) or a straight bar placed on the floor behind your head and your feet on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('112789fb-d920-411a-8a05-a909ce135e32', 'Grab the bar behind you, using a medium overhand (pronated) grip, and raise the bar in front of you at arms length. Tip: The arms should be perpendicular to the torso and the floor. The elbows should be tucked in. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cffb0d64-8f48-4469-9d2d-f3be5d2b6528', 'As you breathe in, slowly lower the weight until the bar lightly touches your forehead while keeping the upper arms and elbows stationary.');
INSERT INTO instructions (id, instruction) VALUES ('0d00406b-16ad-4a7e-b19c-e7abdab53ec2', 'At that point, use the triceps to bring the weight back up to the starting position as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('e6c3b8eb-474b-471b-9027-9d545b7ec405', 'Sit down on the Chest Press Machine and select the weight.');
INSERT INTO instructions (id, instruction) VALUES ('45412200-4f46-4147-8b85-b4a543393ca2', 'Step on the lever provided by the machine since it will help you to bring the handles forward so that you can grab the handles and fully extend the arms.');
INSERT INTO instructions (id, instruction) VALUES ('e88cee77-0a7d-45d0-a598-fc4b5df6dded', 'Grab the handles with a palms-down grip and lift your elbows so that your upper arms are parallel to the floor to the sides of your torso. Tip: Your forearms will be pointing forward since you are grabbing the handles. Once you bring the handles forward and extend the arms you will be at the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c1b75a8a-dcd8-4a08-983b-7a3dbbbfe6b0', 'Now bring the handles back towards you as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('67188363-5860-4dd8-9e9d-492dc197ce6e', 'Push the handles away from you as you flex your pecs and you breathe out. Hold the contraction for a second before going back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d04f58c4-c0be-4141-b305-75eda4e29dab', 'Repeat for the recommended amount of reps.');
INSERT INTO instructions (id, instruction) VALUES ('7406ddc3-d114-497a-8c20-e4cd75e977f3', 'When finished step on the lever again and slowly get the handles back to their original place.');
INSERT INTO instructions (id, instruction) VALUES ('f400bd16-916e-4e91-b29b-919801b9bd34', 'Adjust the seat to the appropriate height and make your weight selection. Place your upper arms against the pads and grasp the handles. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1e2960c3-2897-4cac-abc6-7be206cf7c88', 'Perform the movement by flexing the elbow, pulling your lower arm towards your upper arm.');
INSERT INTO instructions (id, instruction) VALUES ('77abdbf2-67b7-4e96-bc6f-9ab7b0ad6c4a', 'Pause at the top of the movement, and then slowly return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e5ba9eb9-eb19-4fdf-8a25-6f9bedce879e', 'Avoid returning the weight all the way to the stops until the set is complete to keep tension on the muscles being worked.');
INSERT INTO instructions (id, instruction) VALUES ('bce6da56-6e76-4949-adc2-f2819b5aec9f', 'Sit down on the Preacher Curl Machine and select the weight.');
INSERT INTO instructions (id, instruction) VALUES ('3c4000dd-c463-48d3-a3ca-15f6d247031d', 'Place the back of your upper arms (your triceps) on the preacher pad provided and grab the handles using an underhand grip (palms facing up). Tip: Make sure that when you place the arms on the pad you keep the elbows in. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cccac300-ef8f-4909-9cbd-4e52f73ae037', 'Now lift the handles as you exhale and you contract the biceps. At the top of the position make sure that you hold the contraction for a second. Tip: Only the forearms should move. The upper arms should remain stationary and on the pad at all times.');
INSERT INTO instructions (id, instruction) VALUES ('44d72c2f-a83d-4aa5-a0b5-a0685206273f', 'Lower the handles slowly back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('a51b218e-7bec-4e94-94e6-278d61c97cff', 'Sit down on the Shoulder Press Machine and select the weight.');
INSERT INTO instructions (id, instruction) VALUES ('7c6cdb1b-625c-41f6-8dcd-b2c9658ae2ee', 'Grab the handles to your sides as you keep the elbows bent and in line with your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('95f3401a-f12a-4f91-8523-9fd0ad0cd0af', 'Now lift the handles as you exhale and you extend the arms fully. At the top of the position make sure that you hold the contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('2f6b7f71-c50c-4cae-82b9-d89c1c129fe0', 'Perform the movement by extending the elbow, pulling your lower arm away from your upper arm.');
INSERT INTO instructions (id, instruction) VALUES ('9b2ab894-f3b6-4118-83b3-76134b35df2c', 'Pause at the completion of the movement, and then slowly return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b4111590-fa8a-4f73-99ac-f2c7d7444b81', 'You will need a partner for this exercise. Lacking one, this movement can be performed against a wall.');
INSERT INTO instructions (id, instruction) VALUES ('eb323039-59d3-4cca-b663-b4f35a890392', 'Begin facing your partner holding the medicine ball at your torso with both hands.');
INSERT INTO instructions (id, instruction) VALUES ('016b191e-1b50-4cb3-83bc-3d122a56ad22', 'Pull the ball to your chest, and reverse the motion by extending through the elbows. For sports applications, you can take a step as you throw.');
INSERT INTO instructions (id, instruction) VALUES ('ca9be0f1-1729-4e8c-9a56-402429eacb74', 'Your partner should catch the ball, and throw it back to you.');
INSERT INTO instructions (id, instruction) VALUES ('eee97e4d-e213-480a-a201-aa41af9810bd', 'Receive the throw with both hands at chest height.');
INSERT INTO instructions (id, instruction) VALUES ('23c4923b-e523-4443-b7d5-0125e9ad1f42', 'For this exercise you will need a medicine ball and a partner. Stand back to back with your partner, spaced 2-3 feet apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9b28bc49-0744-4b1b-a836-20a7bca98ae1', 'Hold the ball in front of the trunk. Open the hips and turn the shoulders at the same time as your partner.');
INSERT INTO instructions (id, instruction) VALUES ('713565a4-e88a-49ef-9314-57f5ac96e06d', 'For full rotation, you and your partner should twist in the same direction, i.e. counter-clockwise.');
INSERT INTO instructions (id, instruction) VALUES ('b8371146-8575-450a-8484-a8294b48d255', 'Pass the ball to your partner, and both of you can now twist in the opposite direction to repeat the procedure.');
INSERT INTO instructions (id, instruction) VALUES ('b8d0b322-fd99-4135-81f0-7fbc418c3563', 'Assume a semisquat stance with a medicine ball in your hands. Your arms should hang so the ball is near your feet.');
INSERT INTO instructions (id, instruction) VALUES ('f8c9f2af-f356-43fd-8f53-bb87663fa562', 'Begin by thrusting the hips forward as you extend through the legs, jumping up.');
INSERT INTO instructions (id, instruction) VALUES ('dc02df5b-b414-4ede-b9c7-644f69e830c2', 'As you do, swing your arms up and over your head, keeping them extended, releasing the ball at the peak of your movement. The goal is to throw the ball the greatest distance behind you.');
INSERT INTO instructions (id, instruction) VALUES ('d01c637d-d052-48f9-b97f-0dc9753cddb5', 'Lie facedown on an incline bench while holding a dumbbell in each hand. Your arms should be fully extended hanging down and pointing towards the floor. The palms of your hands should be facing each other. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ba7d2ae2-dbd3-4733-99f8-7643ca085610', 'As you exhale, squeeze your shoulder blades together and hold the contraction for a full second. Tip: This movement is just like the reverse action of a hug, or trying to perform rear laterals as if you had no arms.');
INSERT INTO instructions (id, instruction) VALUES ('b9b29953-3245-457f-b7be-5e91698907e5', 'As you inhale go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e2141dfe-8e5c-434c-a6c2-e63814dd0c2f', 'Stand so your feet are shoulder width apart and your hands are on your hips.');
INSERT INTO instructions (id, instruction) VALUES ('c918d403-bb16-44a5-9749-6c21239ee93a', 'Twist at your waist until you feel a stretch. Hold for 10 to 15 seconds, then twist to the other side.');
INSERT INTO instructions (id, instruction) VALUES ('a15296fb-c612-497f-ba5b-2f004f980309', 'Using a spacing that is just about 1 inch wider than shoulder width, grab a pull-up bar with the palms of one hand facing forward and the palms of the other hand facing towards you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9ac775ff-a9c0-4a99-8148-280c0f4097ac', 'Now start to pull yourself up as you exhale. Tip: With the arm that has the palms facing up concentrate on using the back muscles in order to perform the movement. The elbow of that arm should remain close to the torso. With the other arm that has the palms facing forward, the elbows will be away but in line with the torso. You will concentrate on using the lats to pull your body up.');
INSERT INTO instructions (id, instruction) VALUES ('89e594e6-eeee-4fce-845b-6083de021669', 'After a second contraction at the top, start to slowly come down as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('bd7dd429-6581-47c3-8413-a530a9b5113c', 'On the following set, switch grips; so if you had the right hand with the palms facing you and the left one with the palms facing forward, on the next set you will have the palms facing forward for the right hand and facing you for the left.');
INSERT INTO instructions (id, instruction) VALUES ('45c5d556-45bb-4473-bb81-4f0786364555', 'Place a band around both ankles and another around both knees. There should be enough tension that they are tight when your feet are shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('d8b8e580-c238-4194-bc4e-5e547d65fd67', 'To begin, take short steps forward alternating your left and right foot.');
INSERT INTO instructions (id, instruction) VALUES ('2f0a5cba-7c1c-4ae5-b7e9-be8ee0b5b406', 'After several steps, do just the opposite and walk backward to where you started.');
INSERT INTO instructions (id, instruction) VALUES ('6a878082-c756-4865-9897-1783fbfc8296', 'Begin in a pushup position, with your weight supported by your hands and toes. Flexing the knee and hip, bring one leg until the knee is approximately under the hip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('573e610b-bfcc-4b90-b190-944d017bb2b2', 'Explosively reverse the positions of your legs, extending the bent leg until the leg is straight and supported by the toe, and bringing the other foot up with the hip and knee flexed. Repeat in an alternating fashion for 20-30 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('f03bb4c4-246c-40e6-a904-2c4ca53ff4f6', 'This move helps prepare your running form to help you excel at sprinting. As you run, be sure to flex the knee, aiming to kick your glutes as the hip extends.');
INSERT INTO instructions (id, instruction) VALUES ('9c320c42-ec2a-439b-9679-2c6a98b2c726', 'Reload the quad as the leg moves back forward, attacking the ground on the next step.');
INSERT INTO instructions (id, instruction) VALUES ('a6fde18f-1147-4994-b1a2-c03c6a7cb9cc', 'Ensure that as you run, you block with the arms, punching through in a rapid 1-2 motion.');
INSERT INTO instructions (id, instruction) VALUES ('35f4e61e-1de7-4182-87d3-9705665d6719', 'Begin with a loaded barbell held at the mid thigh position with a wide grip. The feet should be directly below the hips, with the feet turned out as needed. Lower the hips, with the chest up and the head looking forward. The shoulders should be just in front of the bar. This will be the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('23add5e5-77eb-4844-8ce1-a58504c2aea5', 'Begin the pull by driving through the front of the heels, raising the bar. Transition into the second pull by extending through the hips knees and ankles, driving the bar up as quickly as possible. The bar should be close to the body.');
INSERT INTO instructions (id, instruction) VALUES ('b3bdb7d2-e4bb-4984-9773-f22506619f5f', 'Continue raising the bar to the overhead position, without rebending the knees.');
INSERT INTO instructions (id, instruction) VALUES ('64719056-5b7b-4a4f-a47d-4469c6f08db0', 'Grip the rings using a false grip, with the base of your palms on top of the rings. Initiate a pull up by pulling the elbows down to your side, flexing the elbows.');
INSERT INTO instructions (id, instruction) VALUES ('96a70519-83c9-46ca-ac5e-259415099e3a', 'As you reach the top position of the pull-up, pull the rings to your armpits as you roll your shoulders forward, allowing your elbows to move straight back behind you. This puts you into the proper position to continue into the dip portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('fb58831c-dedd-4fb2-a3ad-d9c755c3702a', 'Position your legs in the platform using a less than shoulder width narrow stance with the toes slightly pointed out. Your feet should be around 3 inches or less apart. Tip: Keep your head up at all times and also maintain the back on the pad at all times.');
INSERT INTO instructions (id, instruction) VALUES ('54bceff4-ab19-47dc-8321-1d80fe07f82f', 'Now straighten your legs without locking the knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('78127ca9-f369-4cc2-bc2d-8b85da720d0a', 'Begin to slowly lower the unit by bending the knees as you maintain a straight posture with the head up (back on the pad at all times). Continue down until the angle between the upper leg and the calves becomes slightly less than 90-degrees (which is the point in which the upper legs are below parallel to the floor). Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d60fa9bd-fe57-46a9-8c8b-13b68424ddb2', 'Begin to raise the unit as you exhale by pushing the floor with mainly with the heels of your feet as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5458042d-774d-4ef4-82ab-3261fbac1a94', 'Using a leg press machine, sit down on the machine and place your legs on the platform directly in front of you at a less-than-shoulder-width narrow stance with the toes slightly pointed out. Your feet should be around 3 inches or less apart. Tip: Keep your head up at all times and also maintain the back on the pad at all times.');
INSERT INTO instructions (id, instruction) VALUES ('bac30de2-22d3-4be0-9c86-02dd72c05cb6', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack that best matches your height. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('822a1f17-fbb3-4a5f-8873-ffeb1a9a9e9c', 'Step away from the rack and position your legs using a less-than-shoulder-width narrow stance with the toes slightly pointed out. Feet should be around 3-6 inches apart. Keep your head up at all times (looking down will get you off balance) and maintain a straight back. This will be your starting position. (Note: For the purposes of this discussion we will use the medium stance described above which targets overall development; however you can choose any of the three stances discussed in the foot stances section).');
INSERT INTO instructions (id, instruction) VALUES ('b8486b3d-6268-4fb9-9776-5da2abd2beb0', 'Using the leg pad of a lat pulldown machine or a preacher bench, position yourself so that your ankles are under the pads, knees on the seat, and you are facing away from the machine. You should be upright and maintaining good posture.');
INSERT INTO instructions (id, instruction) VALUES ('71c12aea-3c23-4b28-9fb8-77ceb4692631', 'This will be your starting position. Lower yourself under control until your knees are almost completely straight.');
INSERT INTO instructions (id, instruction) VALUES ('cd2a42dc-f758-4fd0-a4c0-12abe90ae9d2', 'Remaining in control, raise yourself back up to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bda38a67-f884-4790-930f-2c53249d3048', 'If you are unable to complete a rep, use a band, a partner, or push off of a box to aid in completing a repetition.');
INSERT INTO instructions (id, instruction) VALUES ('4b53426a-6003-41f4-ac4a-f22bdd1377d7', 'Using a muscle roller or a rolling pin, place the roller behind your head and against your neck. Make sure that you do not place the roller directly against the spine, but turned slightly so that the roller is pressed against the muscles to either side of the spine. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1355119a-fa39-4342-b172-1a0d7900c513', 'Starting at the top of your neck, slowly roll down the muscles of your neck, pausing at points of tension for 10-30 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('bce62397-b225-4d19-9500-3b3d5ea9dde0', 'Lie back on a flat bench. Using a medium-width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over your neck with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6480f8e7-a3fb-4444-9771-5c99a318f567', 'As you breathe in, come down slowly until you feel the bar on your neck.');
INSERT INTO instructions (id, instruction) VALUES ('c910a879-bf44-46e9-b3bf-51f3ef40ce50', 'Lie flat on the floor with your lower back pressed to the ground. For this exercise, you will need to put one hand beside your head and the other to the side against the floor.');
INSERT INTO instructions (id, instruction) VALUES ('c5d7995c-2f73-4a68-873f-6895b43684a2', 'Make sure your feet are elevated and resting on a flat surface.');
INSERT INTO instructions (id, instruction) VALUES ('84a91b87-d368-4f53-9383-846b0ad9c2c4', 'Now lift the shoulder in which your hand is touching your head.');
INSERT INTO instructions (id, instruction) VALUES ('f28d36dd-62f4-4e4a-8df1-1103a86d8ebf', 'Simply elevate your shoulder and body upward until you touch your knee. For example, if you have your right hand besides your head, then you want to elevate your body upwards until your right elbow touches your left knee. The same variation can be applied doing the inverse and using your left elbow to touch your right knee.');
INSERT INTO instructions (id, instruction) VALUES ('95fc86fd-8d78-426e-909b-b7a71fa93755', 'After your knee touches your elbow, lower your body until you have reached the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6d00d1d8-53a0-4239-be70-9f4ced9de7cc', 'Remember to breathe in during the eccentric (lowering) part of the exercise and to breathe out during the concentric (upward) part of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('cca08031-72ad-4a0c-9f92-f535e51bc22b', 'Start out by lying on your right side with your legs lying on top of each other. Make sure your knees are bent a little bit.');
INSERT INTO instructions (id, instruction) VALUES ('d41d9dff-3032-468e-81d4-9e28e4794205', 'Place your left hand behind your head.');
INSERT INTO instructions (id, instruction) VALUES ('967a88ab-302d-48bb-ac09-6450acb58d49', 'Once you are in this set position, begin by moving your left elbow up as you would perform a normal crunch except this time the main emphasis is on your obliques.');
INSERT INTO instructions (id, instruction) VALUES ('aa829c7f-7287-427d-aa3c-2fff43594902', 'Crunch as high as you can, hold the contraction for a second and then slowly drop back down into the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3042e114-9d87-425a-8b11-2b84aac18d78', 'Remember to breathe in during the eccentric (lowering) part of the exercise and to breathe out during the concentric (elevation) part of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('e7c17f8b-9182-45e4-8209-95d5969080fb', 'Begin with a barbell supported on top of the traps. The chest should be up, and the head facing forward. Adopt a hip width stance with the feet turned out as needed.');
INSERT INTO instructions (id, instruction) VALUES ('32c0c1f3-1750-4520-bbf0-3d77f02d7af2', 'Descend by flexing the knees, refraining from moving the hips back as much as possible. This requires that the knees travel forward; ensure that they stay aligned with the feet. The goal is to keep the torso as upright as possible. Continue all the way down, keeping the weight on the front of the heel.');
INSERT INTO instructions (id, instruction) VALUES ('2fb0d422-b655-43f1-b169-399e1da4b43a', 'At the moment the upper legs contact the lower, reverse the motion, driving the weight upward.');
INSERT INTO instructions (id, instruction) VALUES ('40fdae45-3165-49c5-a218-c0e62a135928', 'Lie on a flat bench or step, and hang one leg and arm over the side.');
INSERT INTO instructions (id, instruction) VALUES ('1e9da5c9-376b-45f7-aaff-b2ed2daf2df8', 'Bend the knee and hold the top of the foot. As you do this, be careful not to arch your lower back.');
INSERT INTO instructions (id, instruction) VALUES ('0eabe0f4-6a0a-4004-aad1-f0d092cd5139', 'Pull the belly button to the spine to stay in neutral. Press your foot down and into your hand. To add the hip stretch, lift the hip of the leg you''re holding up toward the ceiling.');
INSERT INTO instructions (id, instruction) VALUES ('ecd4ec72-cf19-433c-a2a9-7f0e9ee6eb4f', 'Start off by lying on your right side, with your right knee bent at a 90-degree angle resting on the floor in front of you (this stabilizes the torso).');
INSERT INTO instructions (id, instruction) VALUES ('6e0d18d3-8fe2-4c03-a5aa-d3cac981856f', 'Bend your left knee behind you and hold your left foot with your left hand. To stretch your hip flexor, press your left hip forward as you push your left foot back into your hand. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('375f3395-88fd-4b75-827f-8baea030ee2e', 'Choose a flat bench and place a dumbbell on each side of it.');
INSERT INTO instructions (id, instruction) VALUES ('f683583c-7d77-4e60-b2af-2115f3b99944', 'Place the right leg on top of the end of the bench, bend your torso forward from the waist until your upper body is parallel to the floor, and place your right hand on the other end of the bench for support.');
INSERT INTO instructions (id, instruction) VALUES ('a79f9b61-2106-4d6b-9438-830341236205', 'Use the left hand to pick up the dumbbell on the floor and hold the weight while keeping your lower back straight. The palm of the hand should be facing your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b32aae35-c08e-41b7-810c-f1b3b745d772', 'Pull the resistance straight up to the side of your chest, keeping your upper arm close to your side and keeping the torso stationary. Breathe out as you perform this step. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. Also, make sure that the force is performed with the back muscles and not the arms. Finally, the upper torso should remain stationary and only the arms should move. The forearms should do no other work except for holding the dumbbell; therefore do not try to pull the dumbbell up using the forearms.');
INSERT INTO instructions (id, instruction) VALUES ('9702a942-579b-4c71-ae88-63f130e17c8b', 'Lower the resistance straight down to the starting position. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('5afd308e-f828-4e37-b312-1f2133edd438', 'Repeat the movement for the specified amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('4a267ae6-7cbd-4536-a27c-246d83085f6d', 'Switch sides and repeat again with the other arm.');
INSERT INTO instructions (id, instruction) VALUES ('e9edae2f-8f54-45f9-9fee-930540b4fb60', 'Lie down on a flat bench with a dumbbell in one hand resting on top of your thigh. The palm of your hand with the dumbbell in it should be at a neutral grip.');
INSERT INTO instructions (id, instruction) VALUES ('97fd2568-eac6-4dbc-a358-23f7c9f25812', 'By using your thighs to help you get the dumbbell up, clean the dumbbell so that you can hold it in front of you with your lifting arm being fully extended. Remember to maintain a neutral grip with this exercise. Your non lifting hand should be to the side holding the flat bench for better support. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('524cf3c6-43a2-4443-b9dc-5945d7ba20de', 'Your arm with the weight should have a slight bend on your elbow in order to prevent stress at the biceps tendon. Begin by lowering your arm with the weight in it out in a wide arc until you feel a stretch on your chest. Breathe in as you perform this portion of the movement. Tip: Keep in mind that throughout the movement, your lifting arm should remain stationary; the movement should only occur at the shoulder joint.');
INSERT INTO instructions (id, instruction) VALUES ('13fa6d81-e37c-489a-b7fd-d5691515df0c', 'Return your lifting arm back to the starting position as you squeeze your chest muscles and breathe out. Tip: Make sure to use the same arc of motion used to lower the weights.');
INSERT INTO instructions (id, instruction) VALUES ('0f931ca3-3d27-4389-8570-3b35e3456195', 'Switch arms and repeat the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('9903dc2a-b222-4968-837f-df123c575586', 'Connect a standard handle to a tower. Move cable to highest pulley position.');
INSERT INTO instructions (id, instruction) VALUES ('6d8536fa-9015-4bd4-86ac-1dc12246433c', 'Stand with side to cable. With one hand, reach up and grab handle with underhand grip.');
INSERT INTO instructions (id, instruction) VALUES ('fbc2473b-3135-4d0d-8b6e-ed99cb48a185', 'Pull down cable until elbow touches your side and the handle is by your shoulder.');
INSERT INTO instructions (id, instruction) VALUES ('7bbcce89-cda0-416c-8e0d-0977a1edc0e9', 'Position feet hip-width apart. Place free hand on hip to help gauge pivot point.');
INSERT INTO instructions (id, instruction) VALUES ('6fb00fa2-2c2c-4c75-a075-40d62f6bc154', 'Keep arm in static position. Contract oblique to bring the weight down in a side crunch.');
INSERT INTO instructions (id, instruction) VALUES ('e76335b8-8f0e-41fc-9a12-ad0543ed668d', 'Once you reach maximum contraction, slowly release the weight to the starting position. The weight stack should never be unloaded in a resting position. The aim is constant tension during the set.');
INSERT INTO instructions (id, instruction) VALUES ('1605c395-a070-466d-b424-f70e507baa43', 'Repeat to failure.');
INSERT INTO instructions (id, instruction) VALUES ('f8284fa1-4587-4c83-b88c-914ef4cd6a28', 'Lie down sideways on an incline bench press with a dumbbell in the hand. Make sure the shoulder is pressing against the incline bench and the arm is lying across your body with the palm around your navel.');
INSERT INTO instructions (id, instruction) VALUES ('ea961e72-0c02-42fb-97d9-015dccccc6e6', 'Hold a dumbbell in your uppermost arm while keeping it extended in front of you parallel to the floor. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9f44e053-1ef0-48ba-abb6-dbd106bb8eda', 'While keeping the dumbbell parallel to the floor at all times, perform a lateral raise. Your arm should travel straight up until it is pointing at the ceiling. Tip: Exhale as you perform this movement. Hold the dumbbell in the position and feel the contraction in the shoulders for a second.');
INSERT INTO instructions (id, instruction) VALUES ('0d4ed83a-6503-4d96-9834-f3e2d1db0815', 'While inhaling lower the weight across your body back into the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('89194ae7-d9fd-40ad-b0ad-04d97cc5be81', 'Switch arms and repeat the movement.');
INSERT INTO instructions (id, instruction) VALUES ('75af54e7-691a-44b0-89cd-27d07994c058', 'Place a kettlebell between your feet. As you bend down to grab the kettlebell, push your butt back and keep your eyes looking forward.');
INSERT INTO instructions (id, instruction) VALUES ('d7b39b82-442f-43b5-8eef-59f63c7f9a01', 'Clean the kettlebell to your shoulders by extending through the legs and hips as you raise the kettlebell towards your shoulder. The wrist should rotate as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('56cab8ae-6214-4c50-bcd4-f8e41dfb3b37', 'Hold a kettlebell by the handle.');
INSERT INTO instructions (id, instruction) VALUES ('deee4175-490a-4972-bf29-fb4f194d1ea0', 'Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward.');
INSERT INTO instructions (id, instruction) VALUES ('d3f2f49c-6d4b-46b1-be8c-d95869becefc', 'Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body''s momentum to move the weight.');
INSERT INTO instructions (id, instruction) VALUES ('6f57ad0e-b079-4db9-83e6-19181d36f75c', 'Receive the weight overhead by returning to a squat position underneath the weight.');
INSERT INTO instructions (id, instruction) VALUES ('4fecf1c3-c2dc-4aeb-a185-37085bd3692f', 'Keeping the weight overhead, return to a standing position. Lower the weight to the floor to perform the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('d2bef946-2bfb-47ad-93d5-62db64c5fd69', 'Lie on the floor holding a kettlebell with one hand, with your upper arm supported by the floor. The palm should be facing in.');
INSERT INTO instructions (id, instruction) VALUES ('09f32520-5bf7-4eed-a914-8b30454fabc2', 'Press the kettlebell straight up toward the ceiling, rotating your wrist.');
INSERT INTO instructions (id, instruction) VALUES ('2aa22c84-8afd-4cc8-95d1-a27ff8182c6b', 'Lower the kettlebell back to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('0397f0e1-d3a7-4b01-be40-bfb3eddde9ab', 'Hold a kettlebell by the handle. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ed7778f3-0a2e-4bfd-9e7e-8720ecbc4d4d', 'Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body''s momentum to move the weight. Receive the weight overhead by returning to a squat position underneath the weight. Keeping the weight overhead, return to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('a6cb758e-4909-4712-8577-43337db088d9', 'Lower the weight to perform the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('0ef6b1d3-f271-42a6-b717-c1a077dbbf2d', 'Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces inward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('797030a3-aaff-47dc-8d62-6516cef4e597', 'Look at the kettlebell and press it up and out until it is locked out overhead.');
INSERT INTO instructions (id, instruction) VALUES ('4f14a05a-4450-4b87-86d0-3018576ba2d4', 'Lower the kettlebell back to your shoulder under control and repeat. Make sure to contract your lat, butt, and stomach forcefully for added stability and strength.');
INSERT INTO instructions (id, instruction) VALUES ('f22835cf-b7bc-438c-a744-60869d4fc982', 'Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1c717796-1dff-4d68-ac2c-4e9f6fa7f9c8', 'Hold the kettlebell with the elbow out to the side, and press it up and out until it is locked out overhead.');
INSERT INTO instructions (id, instruction) VALUES ('ddd20229-ef19-4f46-9be0-d9f84c422198', 'Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body''s momentum to move the weight. Lower the weight to perform the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('054aa8fb-ba14-4e38-9144-8dbaef64956a', 'Place a kettlebell in front of your feet. Bend your knees slightly and then push your butt out as much as possible as you bend over to get in the starting position. Grab the kettlebell and pull it to your stomach, retracting your shoulder blade and flexing the elbow. Keep your back straight. Lower and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('4440c4ec-7e1b-4b2a-bca7-5265e8d7ca84', 'Place a kettlebell between your feet. Bend your knees and push your butt back to get in the proper starting position.');
INSERT INTO instructions (id, instruction) VALUES ('db21c3d6-3165-4c69-977e-d76ad0378997', 'Look straight ahead and swing the kettlebell back between your legs.');
INSERT INTO instructions (id, instruction) VALUES ('9c6d2440-3c65-4c58-8831-97736abe2343', 'Immediately reverse the direction and drive through with your hips and knees, accelerating the kettlebell upward. As the kettlebell rises to your shoulder rotate your hand and punch straight up, using momentum to receive the weight locked out overhead.');
INSERT INTO instructions (id, instruction) VALUES ('90640fb9-d122-49c4-a2f3-7313dd714e5b', 'Receive the weight overhead by returning to a squat position underneath the weight, positioning one leg in front of you and one leg behind you.');
INSERT INTO instructions (id, instruction) VALUES ('71f2fb4b-b649-4d93-a7de-1a6e3ecc5db9', 'Keeping the weight overhead, return to a standing position and bring your feet together. Lower the weight to perform the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('84b91f3c-355b-4ae0-b02c-4bcbf41293ed', 'Hold a kettlebell in one hand by the handle.');
INSERT INTO instructions (id, instruction) VALUES ('1b0fac19-e917-4c84-b2c9-174ad075af03', 'Squat towards the floor, and then reverse the motion, extending the hips, knees, and finally the ankles, to raise the kettlebell overhead.');
INSERT INTO instructions (id, instruction) VALUES ('f95823e4-1702-47d8-9d4a-aff6f52b36e8', 'After fully extending the body, descend into a lunge position to receive the weights overhead, one leg forward and one leg back. Ensure you drive through with your hips and lock the ketttlebells overhead in one uninterrupted motion.');
INSERT INTO instructions (id, instruction) VALUES ('f6b85fdd-07a4-43f8-95d8-95d2bb9ef73a', 'Return to a standing position, holding the weight overhead, and bring the feet together. Lower the weight to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7d6d6d02-d3ed-458d-b28e-aecd61f663a8', 'Position a bar into a landmine or in a corner to keep it from moving. Load an appropriate weight onto your end.');
INSERT INTO instructions (id, instruction) VALUES ('e16bd3c1-9160-4e94-87e0-ae9ee6305846', 'Stand next to the bar, and take a grip with one hand close to the collar. Using your hips and legs, rise to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('ddf1297f-1e2e-493a-957b-8aaf1bfd542e', 'Assume a bent-knee stance with your hips back and your chest up. Your arm should be extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('92eec170-5be2-40f2-88f6-7f5b234d0e1d', 'Pull the weight to your side by retracting the shoulder and flexing the elbow. Do not jerk the weight or cheat during the movement.');
INSERT INTO instructions (id, instruction) VALUES ('65da64f6-a03a-4366-bd44-ec0b389b982e', 'Start in a standing position with a staggered, athletic stance. Hold a medicine ball in one hand, on the same side as your back leg. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2335398e-1b96-4f07-b58f-df99be9e3c97', 'Begin by winding the arm, raising the medicine ball above your head. As you do so, extend through the hips, knees, and ankles to load up for the slam.');
INSERT INTO instructions (id, instruction) VALUES ('bcd65ba2-7ab3-44ca-a3aa-c495987142b8', 'At peak extension, flex the shoulders, spine, and hips to throw the ball hard into the ground directly in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('7eacaffc-9846-4203-919d-e1420ece592a', 'Catch the ball on the bounce and continue for the desired number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('ec2aea01-39a3-4fcc-a16c-850f1add914c', 'Place one kettlebell between your feet.');
INSERT INTO instructions (id, instruction) VALUES ('578edbd5-2f6e-4d4a-b3d6-7c6d6e46c466', 'Grab the handle with one hand and raise the kettlebell rapidly, let it flip so that the ball of the kettlebell lands in the palm of your hand.');
INSERT INTO instructions (id, instruction) VALUES ('2eb9bcfe-0eba-46b7-afb6-83f3cd332757', 'Throw the kettlebell out in front of you and catch the handle with one hand.');
INSERT INTO instructions (id, instruction) VALUES ('c35167ed-941f-4ca0-b8d6-9d5a7b90f3ab', 'Take the kettlebell to the floor and repeat. Make sure to work both arms.');
INSERT INTO instructions (id, instruction) VALUES ('cdcbb7d3-47ec-497c-abb6-bebf1a788007', 'Clean and press a kettlebell with one arm. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so. Press the weight overhead by extending through the elbow.This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5b42bd4c-e5a3-4b3a-be43-dd546765052f', 'Looking straight ahead and keeping a kettlebell locked out above you, flex the knees and hips and lower your torso between your legs, keeping your head and chest up.');
INSERT INTO instructions (id, instruction) VALUES ('7a6d7d49-bb1f-4ce9-9447-1e7d9ad1a747', 'Pause at the bottom position for a second before rising back to the top, driving through the heels of your feet.');
INSERT INTO instructions (id, instruction) VALUES ('f980923f-cc76-4d34-8613-874025b6937a', 'Stand to the side of a barbell next to its center. Bend your knees and lower your body until you are able to reach the barbell.');
INSERT INTO instructions (id, instruction) VALUES ('f067c580-6ac4-40a9-a932-7910b076e847', 'Grasp the bar as if you were grabbing a briefcase (palms facing you since the bar is sideways). You may need a wrist wrap if you are using a significant amount of weight. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cdcb5e34-b2d0-44de-9d14-04b59e732770', 'Use your legs to help lift the barbell up while exhaling. Your arms should extend fully as bring the barbell up until you are in a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('759601a2-48ef-40ea-8896-7b6379813f1a', 'Slowly bring the barbell back down while inhaling. Tip: Make sure to bend your knees while lowering the weight to avoid any injury from occurring.');
INSERT INTO instructions (id, instruction) VALUES ('e88302c1-9ddd-49b0-91d8-1004d6795b81', 'Pick a dumbbell and place it in one of your hands. Your non lifting hand should be used to grab something steady such as an incline bench press. Lean towards your lifting arm and away from the hand that is gripping the incline bench as this will allow you to keep your balance.');
INSERT INTO instructions (id, instruction) VALUES ('0907c7b0-b257-4335-825c-cc45227536eb', 'Stand with a straight torso and have the dumbbell by your side at arm''s length with the palm of the hand facing you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('82a365f6-41fe-4ed3-a272-f9c2008fcb69', 'While maintaining the torso stationary (no swinging), lift the dumbbell to your side with a slight bend on the elbow and your hand slightly tilted forward as if pouring water in a glass. Continue to go up until you arm is parallel to the floor. Exhale as you execute this movement and pause for a second at the top.');
INSERT INTO instructions (id, instruction) VALUES ('8626468c-2ffc-4811-a4bf-4c0048334cbc', 'Lower the dumbbell back down slowly to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('d1738c70-9d3d-4422-8180-d44ef6824263', 'Hook a leather ankle cuff to a low cable pulley and then attach the cuff to your ankle.');
INSERT INTO instructions (id, instruction) VALUES ('57a221ef-52c8-4032-9844-e46ec8b6f5da', 'Face the weight stack from a distance of about two feet, grasping the steel frame for support.');
INSERT INTO instructions (id, instruction) VALUES ('3dde0932-dd2c-4c4e-a4c6-e21c14b89124', 'While keeping your knees and hips bent slightly and your abs tight, contract your glutes to slowly "kick" the working leg back in a semicircular arc as high as it will comfortably go as you breathe out. Tip: At full extension, squeeze your glutes for a second in order to achieve a peak contraction.');
INSERT INTO instructions (id, instruction) VALUES ('9bfb3cc3-f947-4b69-bb88-30d45a1d5759', 'Now slowly bring your working leg forward, resisting the pull of the cable until you reach the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('36ce3bf9-6531-4fc3-9b26-85acb31cc67a', 'Switch legs and repeat the movement for the other side.');
INSERT INTO instructions (id, instruction) VALUES ('7c961815-7b15-4e4f-b5e3-115f163e0bcc', 'From a standing position, place a bent arm against a wall or doorway.');
INSERT INTO instructions (id, instruction) VALUES ('ad0db2ba-7f31-46f8-a3cf-7802f2778a13', 'Slowly lean toward your arm until you feel a stretch in your lats.');
INSERT INTO instructions (id, instruction) VALUES ('88975df7-30a7-4a2a-a408-e03ad5e7d1b6', 'For this exercise, start out by placing a towel around a chin up bar.');
INSERT INTO instructions (id, instruction) VALUES ('9ad52bf6-c98d-4235-b00c-032bd50958fa', 'Grab the chin-up bar with your palm facing you. One hand will be grabbing the chin-up bar and the other will be grabbing the towel.');
INSERT INTO instructions (id, instruction) VALUES ('914e71f1-ad3b-4ff7-9d18-7857429d8fde', 'Bring your torso back around 30 degrees or so while creating a curvature on your lower back and sticking your chest out. This is your starting position.v');
INSERT INTO instructions (id, instruction) VALUES ('805a2504-ca82-4876-9080-dfd3c3cb8d8a', 'Pull your torso up until the bar touches your upper chest by drawing the shoulders and the upper arms down and back. Exhale as you perform this portion of the movement. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary as it moves through space and only the arms should move. The forearms should do no other work other than hold the bar.');
INSERT INTO instructions (id, instruction) VALUES ('5bf15153-60a9-473c-a3d7-838e109eed4b', 'After a second on the contracted position, start to inhale and slowly lower your torso back to the starting position when your arms are fully extended and the lats are fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('fb330788-ca0c-43e4-b3c1-6a5de4fd2124', 'Lie down on a flat bench with a dumbbell in one hand on top of your thigh.');
INSERT INTO instructions (id, instruction) VALUES ('ef9f22e2-1159-41fd-822f-47a05bf51652', 'By using your thigh to help you get the dumbbell up, clean the dumbbell up so that you can hold it in front of you at shoulder width. Use the hand you are not lifting with to help position the dumbbell over you properly.');
INSERT INTO instructions (id, instruction) VALUES ('fea74f16-643e-44f8-b54a-74a7d626a259', 'Once at shoulder width, rotate your wrist forward so that the palm of your hand is facing away from you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c8b1c677-e073-42df-b1a1-019a602499ac', 'Bring down the weights slowly to your side as you breathe in. Keep full control of the dumbbell at all times. Tip: Use the hand that you are not lifting with to help keep the dumbbell balance as you may struggle a bit at first. Only use your non-lifting hand if it is needed. Otherwise, keep it resting to the side.');
INSERT INTO instructions (id, instruction) VALUES ('6b0a3aac-f4d5-4e81-983a-940570b8d45a', 'As you breathe out, push the dumbbells up using your pectoral muscles. Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly. Tip: It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('59c71db4-946e-4ea1-938d-1e5419924422', 'Grab a dumbbell with the right arm and place the upper arm on top of the preacher bench or the incline bench. The dumbbell should be held at shoulder length. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d280874a-c727-4691-a1d3-50967c06cdf3', 'As you breathe in, slowly lower the dumbbell until your upper arm is extended and the biceps is fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('67926a00-99e4-4982-9d36-befa0bd833ef', 'As you exhale, use the biceps to curl the weight up until your biceps is fully contracted and the dumbbell is at shoulder height. Again, remember that to ensure full contraction you need to bring that small finger higher than the thumb.');
INSERT INTO instructions (id, instruction) VALUES ('dbcc9887-05fc-41a5-b1bf-2ced1efd2dfd', 'Squeeze the biceps hard for a second at the contracted position and repeat for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('8abb2330-9ea5-4a6d-b8da-cb382bb96797', 'Lie down on a flat surface with your back pressing against the floor or an exercise mat. Make sure your knees are bent.');
INSERT INTO instructions (id, instruction) VALUES ('8e6b7ace-72c3-47be-baaa-274488ba4004', 'Have a partner hand you the bar on one hand. When starting, your arm should be just about fully extended, similar to the starting position of a barbell bench press. However, this time your grip will be neutral (palms facing your torso).');
INSERT INTO instructions (id, instruction) VALUES ('194389e1-da74-4143-a942-67408284fbfe', 'Make sure the hand you are not using to lift the weight is placed by your side.');
INSERT INTO instructions (id, instruction) VALUES ('e5b412c9-3c0f-4107-b2e3-d7ee54b1b2fe', 'Begin the exercise by lowering the barbell until your elbow touches the ground. Make sure to breathe in as this is the eccentric (lowering part of the exercise).');
INSERT INTO instructions (id, instruction) VALUES ('54665bad-680e-4d61-8c46-ed50f4ebf63a', 'Then start lifting the barbell back up to the original starting position. Remember to breathe out during the concentric (lifting part of the exercise).');
INSERT INTO instructions (id, instruction) VALUES ('e94a4459-469b-4b31-9ca6-4a4a88fd3d62', 'Repeat until you have performed your recommended repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('cbcbfb11-3792-4cb2-9af4-0eab9fe90c28', 'Select an appropriate weight and adjust the knee pad to help keep you down. Grasp the handle with a pronated grip. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b9b5b0f3-3320-41b9-ad50-0522d39300d8', 'Pull the handle down, squeezing your elbow to your side as you flex the elbow.');
INSERT INTO instructions (id, instruction) VALUES ('2c7adc17-d9f1-4eba-86b4-6832fca266b6', 'Pause at the bottom of the motion, and then slowly return the handle to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('126ffe99-ba6e-4a4d-afed-ddd1e993ee25', 'For multiple repetitions, avoid completely returning the weight to keep tension on the muscles being worked.');
INSERT INTO instructions (id, instruction) VALUES ('7bced045-e2c5-4dc0-aff4-827d0d1063a7', 'Lie flat on a bench while holding a dumbbell at arms length. Your arm should be perpendicular to your body. The palm of your hand should be facing towards your feet as a pronated grip is required to perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('ea6ac4a2-b573-4b05-8447-99f1486e4e51', 'Place your non lifting hand on your bicep for support.');
INSERT INTO instructions (id, instruction) VALUES ('5fb5e204-0124-4155-9266-9194c13fcb69', 'Slowly begin to lower the dumbbell down as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('45482a45-7b04-48c9-b422-68a59725fc16', 'Then, begin lifting the dumbbell upward as you contract the triceps. Remember to breathe out during the concentric (lifting part of the exercise).');
INSERT INTO instructions (id, instruction) VALUES ('7e775dee-0379-45d0-9790-772988fbd4a6', 'Repeat until you have performed your set repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('df12eaf4-4c9f-4815-932e-fc246ed9cf67', 'Lie flat on a bench while holding a dumbbell at arms length. Your arm should be perpendicular to your body. The palm of your hand should be facing towards your face as a supinated grip is required to perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('348ddafc-2166-43d8-a048-4f105fd6cb58', 'Switch arms again and repeat the movement.');
INSERT INTO instructions (id, instruction) VALUES ('5b339c99-a1a1-4aae-94d9-b45b79c71e52', 'Lie facedown on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('7dbb543a-7f93-4866-8578-93aafc4958d2', 'Put your left hand under your left hipbone to pad your hip and pubic bone.');
INSERT INTO instructions (id, instruction) VALUES ('67a8bb53-ae5d-43b1-b042-61b69ce42710', 'Bend your right knee so you can hold the foot in your right hand.');
INSERT INTO instructions (id, instruction) VALUES ('eff5c738-b11d-40ef-a1ec-cdb9ac43618e', 'Lift the foot in the air and simultaneously lift your shoulders off the floor. This also stretches the right hip flexor and the chest and shoulders. Switch sides. If it doesn''t bother your back, you can try it with both arms and legs at the same time.');
INSERT INTO instructions (id, instruction) VALUES ('64e2f46c-de8c-4540-88e9-2716241496d6', 'Grab onto a chinup bar with one hand, using a pronated grip. Keep your feet on the floor or a step. Allow the majority of your weight to hang from that hand, while keeping your feet on the ground. Hold for 10-20 seconds and switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('25a5b45d-345a-46b7-ba96-856a1b39eaa7', 'Start off by lying on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('f969271a-c726-4dc8-9310-5293c94f0d20', 'Extend one leg straight and pull the other knee to your chest. Hold under the knee joint to protect the kneecap.');
INSERT INTO instructions (id, instruction) VALUES ('e0151145-bf87-4a7d-9441-30db66a1d771', 'Gently tug that knee toward your nose.');
INSERT INTO instructions (id, instruction) VALUES ('00541e89-59da-41cb-8369-8bf88dd0e6fb', 'Switch sides. This stretches the buttocks and lower back of the bent leg and the hip flexor of the straight leg.');
INSERT INTO instructions (id, instruction) VALUES ('7c568c5e-f089-4f95-aa15-4e91a6e1a0a8', 'Start by standing about 2 to 3 feet in front of a flat bench with your back facing the bench. Have a barbell in front of you on the floor. Tip: Your feet should be shoulder width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('7cd7be7d-e43b-4d67-84e5-87d5a53f6809', 'Bend the knees and use a pronated grip with your hands being wider than shoulder width apart from each other to lift the barbell up until you can rest it on your chest.');
INSERT INTO instructions (id, instruction) VALUES ('c66c372a-d959-4dc8-bc1e-784a85f871a7', 'Then lift the barbell over your head and rest it on the base of your neck. Move one foot back so that your toe is resting on the flat bench. Your other foot should be stationary in front of you. Keep your head up at all times as looking down will get you off balance and also maintain a straight back. Tip: Make sure your back is straight and chest is out while performing this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('0e9b0edc-b316-460f-bb64-b4016ccd6d59', 'As you inhale, slowly lower your leg until your thigh is parallel to the floor. At this point, your knee should be over your toes. Your chest should be directly above the middle of your thigh.');
INSERT INTO instructions (id, instruction) VALUES ('866759e0-6892-413b-b9e4-59fb22740c92', 'Leading with the chest and hips and contracting the quadriceps, elevate your leg back to the starting position as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('eb6c2932-9d16-4d5c-9c51-fb05dfc09be6', 'Switch legs and repeat the movement.');
INSERT INTO instructions (id, instruction) VALUES ('09bd75e6-4c23-4b84-83cf-237ee26f7c5f', 'Place one kettlebell between your feet. Clean the kettlebell by extending through the legs and hips as you raise the kettlebell towards your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('2d01a3db-59d6-4253-9751-8571d0241a8b', 'Release the kettlebell as it comes up, and let it flip so that the ball of the kettlebell lands in the palms of your hands.');
INSERT INTO instructions (id, instruction) VALUES ('83aca73e-d6e6-4acc-abe3-4d7767871fe8', 'Release the kettlebell out in front of you and catch the handle with both hands. Lower the kettlebell to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('2143676d-4bd4-4f3c-9631-d3ce0d6e165d', 'Secure your feet and lay back on the floor. Your knees should be bent. Hold a weight with both hands to your chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f5b8a4dc-e864-4b18-9340-f737d0a61a87', 'Initiate the movement by flexing the hips and spine to raise your torso up from the ground.');
INSERT INTO instructions (id, instruction) VALUES ('8498634a-ae02-46b9-b62f-d8f85873ec3d', 'As you move up, press the weight up so that it is above your head at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d7ccad57-8c88-442e-841a-3b0bd5db6d00', 'Return the weight to your chest as you reverse the sit-up motion, ensuring not to go all the way down to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('adcc06e0-809d-4db5-b4ba-5e75ca80bea9', 'To begin, set a weight that is comfortable on each side of the pulley machine. Note: Make sure that the amount of weight selected is the same on each side.');
INSERT INTO instructions (id, instruction) VALUES ('727aebe1-1034-4e07-9d21-325db9a84cb9', 'Now adjust the height of the pulleys on each side and make sure that they are positioned at a height higher than that of your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('8effb61f-f634-426d-9f2d-30c6ba5115a1', 'Stand in the middle of both sides and use an underhand grip (palms facing towards the ceiling) to grab each handle. Your arms should be fully extended and parallel to the floor with your feet positioned shoulder width apart from each other. Your body should be evenly aligned the handles. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('96c19bdf-f0e2-4d48-a794-5f5a8917ce3d', 'While exhaling, slowly squeeze the biceps on each side until your forearms and biceps touch.');
INSERT INTO instructions (id, instruction) VALUES ('17b30aa1-eb25-46d9-aca6-488f68dd794f', 'While inhaling, move your forearms back to the starting position. Note: Your entire body is stationary during this exercise except for the forearms.');
INSERT INTO instructions (id, instruction) VALUES ('9f2d1e40-7820-4578-bb28-c8cca8a18448', 'Repeat for the recommended amount of repetitions prescribed in your program.');
INSERT INTO instructions (id, instruction) VALUES ('40a8923a-716f-4fce-a36a-5dc293d26634', 'Sit upright on the floor with your partner behind you. Raise one arm straight up, and flex the elbow, attempting to touch your hand to your back. Your parner should hold your tricep and wrist. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('149e2bf4-3fc7-4ace-b6f7-a2a3e96d16d6', 'Attempt to pull your upper arm to your side as your partner prevents you from doing actually doing so.');
INSERT INTO instructions (id, instruction) VALUES ('54a95a5a-6007-4ac8-9451-6e3f6d4ec751', 'After 10-20 seconds, relax the arm and allow your partner to further stretch the lat by applying gentle pressure to the tricep. Hold for 10-20 seconds, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('2425ce83-e4b3-498c-906b-af9e91c0281f', 'Hold a medine ball with both hands and stand with your feet at shoulder width. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f719f048-b50d-40e3-9118-11bf272a1933', 'Initiate the countermovement by raising the ball above your head and fully extending your body.');
INSERT INTO instructions (id, instruction) VALUES ('ca527f66-209f-47cf-b5dc-64281c063982', 'Reverse the motion, slamming the ball into the ground directly in front of you as hard as you can.');
INSERT INTO instructions (id, instruction) VALUES ('fcbc01b3-c18b-49f4-958e-0509e938d67c', 'Receive the ball with both hands on the bounce and repeat the movement.');
INSERT INTO instructions (id, instruction) VALUES ('7f769556-cdd6-4750-aa51-64a373f1fd97', 'Start out by having a barbell in front of you on the floor. Your feet should be wider than shoulder width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('61cce224-92c7-484d-bc03-ecaed2abf97b', 'Bend the knees and use a pronated grip (palms facing you) to grab the barbell. Your hands should be at a wider than shoulder width apart from each other before lifting. Once you are positioned, lift the barbell up until you can rest it on your chest.');
INSERT INTO instructions (id, instruction) VALUES ('0c782b82-2fbc-4fec-933b-c5e73bb46c8a', 'Move the barbell over and slightly behind your head and make sure your arms are fully extended. Keep your head up at all times and also maintain a straight back. Retract your shoulder blades. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b30b5978-510b-46f0-86f6-feaedee57e0e', 'Slowly lower the weight by bending your knees until your thighs are parallel to the ground while inhaling. Tip: Keep your back straight while performing this exercise to avoid any injuries and your arms should remain extended and over your head at all times.');
INSERT INTO instructions (id, instruction) VALUES ('b124a169-54f7-4b6c-9bb6-4847f3b5f681', 'Now use your feet and legs to help bring the weight back up to the starting position while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('3b7e77df-2aca-4a1f-91fb-6d33c5239e41', 'Standing straight up, lace your fingers together and open your palms to the ceiling. Keep your shoulders down as you extend your arms up.');
INSERT INTO instructions (id, instruction) VALUES ('b72e3f03-c8fe-4318-8085-e047d57ceb5f', 'To create a full torso stretch, pull your tailbone down and stabilize your torso as you do this. Stretch the muscles on both the front and the back of the torso.');
INSERT INTO instructions (id, instruction) VALUES ('ff62d612-0a0c-4a9f-bd8a-322835066861', 'Sit upright on the floor with your partner behind you. Raise one arm straight up, and flex the elbow, attempting to touch your hand to your back. Your parner should hold your elbow and wrist. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ea5161e6-463a-4f01-8328-9d957bb528b3', 'Attempt to extend the arm straight into the air as your partner prevents you from doing actually doing so.');
INSERT INTO instructions (id, instruction) VALUES ('f18294fd-9012-43e8-aff5-a8b3b6c43493', 'After 10-20 seconds, relax the arm and allow your partner to further stretch the tricep by applying gentle pressure to the wrist. Hold for 10-20 seconds, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('a061cb9e-d74b-4082-99bc-ad3702208308', 'Connect a standard handle to a tower, andif possibleposition the cable to shoulder height. If not, a low pulley will suffice.');
INSERT INTO instructions (id, instruction) VALUES ('40595402-24cf-4f57-a8b2-757ab400c735', 'With your side to the cable, grab the handle with both hands and step away from the tower. You should be approximately arm''s length away from the pulley, with the tension of the weight on the cable.');
INSERT INTO instructions (id, instruction) VALUES ('a80147f9-9713-43ef-ab55-b9d82d3abc17', 'With your feet positioned hip-width apart and knees slightly bent, hold the cable to the middle of your chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('08722ffd-a26a-4b29-8073-2699e52805d4', 'Press the cable away from your chest, fully extending both arms. You core should be tight and engaged.');
INSERT INTO instructions (id, instruction) VALUES ('f3fb45d9-f3e9-4e6b-a223-874b829a7381', 'Hold the repetition for several seconds before returning to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('90199e9b-a6ee-46b3-8e7e-00090efa5306', 'At the conclusion of the set, repeat facing the other direction.');
INSERT INTO instructions (id, instruction) VALUES ('5b949e33-1a4c-49cb-9d87-ad850af6a413', 'Connect a standard handle to a tower, and position the cable to shoulder height.');
INSERT INTO instructions (id, instruction) VALUES ('43cee2f1-bc67-4407-8517-0575d5696228', 'With your side to the cable, grab the handle with one hand and step away from the tower. You should be approximately arm''s length away from the pulley, with the tension of the weight on the cable. Align outstretched arm with cable.');
INSERT INTO instructions (id, instruction) VALUES ('2e27bbc7-7a08-407f-80ec-279e252eaa2f', 'With your feet positioned hip-width apart, pull the cable into your chest and grab the handle with your other hand. Both hands should be on the handle at this time.');
INSERT INTO instructions (id, instruction) VALUES ('c531f0eb-b35f-481e-923d-523f950e10f9', 'Facing forward, press the cable away from your chest. You core should be tight and engaged.');
INSERT INTO instructions (id, instruction) VALUES ('a412f777-89e7-442c-8d66-71d50389b625', 'Keeping your hips straight, twist your torso away from the pulley until you get a full quarter rotation.');
INSERT INTO instructions (id, instruction) VALUES ('0fc6eb98-b794-45b1-9722-3a8c047f9563', 'Maintain your rigid stance and straight arms. Return to the neutral position in a slow and controlled manner. Your arms should be extended in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('7e704800-e01f-4599-a7b1-0f435eab91aa', 'With the side tension still engaging your core, bring your hands to your chest and immediately press outward to a fully extended position. This constitutes one rep.');
INSERT INTO instructions (id, instruction) VALUES ('de0f9d26-5a25-400e-a323-fed314f1b8b6', 'Start out by placing two dumbbells on one side of a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('27184d85-1935-457e-ae4c-a15c2ae44eb7', 'Kneel down on both of your knees so that your body is facing the flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('c135b19e-58d7-4dfd-97f8-62b603bdf47d', 'Use your arms to grab both of the dumbbells with a pronated grip (palms facing down) and bring them up so that your forearms are resting against the flat bench. Your wrists should be hanging over the edge.');
INSERT INTO instructions (id, instruction) VALUES ('574d4951-0e0a-435f-ae23-01d6ecfeffff', 'Start out by curling your wrist upwards and exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('fcd44f6f-2c35-47de-9c74-3dc220ad7d8d', 'Start out by placing a barbell on one side of a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('e3fb395d-03fb-4368-a7e1-4f878aeede67', 'Use your arms to grab the barbell with a pronated grip (palms down) and bring them up so that your forearms are resting against the flat bench. Your wrists should be hanging over the edge.');
INSERT INTO instructions (id, instruction) VALUES ('0ffec9c3-56b7-4778-b813-5ec1c1e21c70', 'Use your arms to grab the barbell with a supinated grip (palms up) and bring them up so that your forearms are resting against the flat bench. Your wrists should be hanging over the edge.');
INSERT INTO instructions (id, instruction) VALUES ('6aff49ca-7949-4b23-b962-26a81459d1af', 'Use your arms to grab both of the dumbbells with a supinated grip (palms up) and bring them up so that your forearms are resting against the flat bench. Your wrists should be hanging over the edge.');
INSERT INTO instructions (id, instruction) VALUES ('04650f41-aafe-480c-aec2-a6403426133e', 'Slowly lower your wrists back down to the starting position while inhaling. Make sure to inhale during this part of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('bb0b8d54-cc9d-4496-a62f-09bf8026408d', 'Stand between a set of parallel bars. Place a hand on each bar, and then take a small jump to help you get into the starting position with your arms locked out.');
INSERT INTO instructions (id, instruction) VALUES ('f98c1c62-8767-4314-b705-87c14ccd192b', 'Begin by flexing the elbow, lowering your body until your arms break 90 degrees. Avoid swinging, and maintain good posture throughout the descent.');
INSERT INTO instructions (id, instruction) VALUES ('1cd885a7-5503-4bb6-a9de-ed8331ff0eb6', 'Reverse the motion by extending the elbow, pushing yourself back up into the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a390f11d-9155-4d2f-8e01-17352c222bf4', 'Lie down with your feet on the floor, heels directly under your knees.');
INSERT INTO instructions (id, instruction) VALUES ('1cf6c16e-f43b-411f-aa3a-dc1b9013da74', 'Lift only your tailbone to the ceiling to stretch your lower back. (Don''t lift the entire spine yet.) Pull in your stomach.');
INSERT INTO instructions (id, instruction) VALUES ('dccad888-ba5f-4556-92d0-2bda6059acb8', 'To go into a bridge, lift the entire spine except the neck.');
INSERT INTO instructions (id, instruction) VALUES ('14a06fc8-7896-4ec4-898b-7a67ea492bb8', 'Lay on your side, supporting your weight on your forearm and on a foam roller placed on the outside of your lower leg. Your upper leg can either be on top of your lower leg, or you can cross it in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('565cee01-7e2c-4ca3-9945-a9723d5e1a6f', 'Raise your hips off of the ground and begin to roll from below the knee to above the ankle on the side of your leg, pausing at points of tension for 10-30 seconds. Repeat on the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('d3949ca4-7554-403d-a634-7c1b27eb0ef9', 'In a seated position, loop a belt, rope, or band around one foot. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a9cf6f12-0317-4fc9-81c8-b036fb3f576b', 'With the leg extended and the heel off of the ground, pull on the belt so that the foot is inverted, with the inside of the foot being pulled towards you. Hold for 10-20 seconds, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('a51d11c4-56c9-4642-b69f-6718780eeefb', 'Lay on a ball so that your upper back is on the ball with your hips unsupported. Both feet should be flat on the floor, hip width apart or wider. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a3088f1d-15e3-49d8-a7d0-80fe264bd8f2', 'Begin by extending the hips using your glutes and hamstrings, raising your hips upward as you bridge.');
INSERT INTO instructions (id, instruction) VALUES ('18a275cf-6c5b-4ebc-8aa0-41da019d5339', 'Pause at the top of the motion and return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f4a5785f-335c-417e-aa88-38710ff98a4b', 'Pin presses remove the eccentric phase of the bench press, developing starting strength. They also allow you to train a desired range of motion.');
INSERT INTO instructions (id, instruction) VALUES ('ae4166eb-fad7-46ab-9fe3-179305705f32', 'The bench should be set up in a power rack. Set the pins to the desired point in your range of motion, whether it just be lockout or an inch off of your chest. The bar should be moved to the pins and prepared for lifting.');
INSERT INTO instructions (id, instruction) VALUES ('de01fe54-dfde-487d-a51f-fbad4354474b', 'Begin by lying on the bench, with the bar directly above the contact point during your regular bench. Tuck your feet underneath you and arch your back. Using the bar to help support your weight, lift your shoulder off the bench and retract them, squeezing the shoulder blades together. Use your feet to drive your traps into the bench. Maintain this tight body position throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d091470e-b449-4c93-bf9c-54351885ad90', 'You can take a standard bench grip, or shoulder width to focus on the triceps. The bar, wrist, and elbow should stay in line at all times. Focus on squeezing the bar and trying to pull it apart.');
INSERT INTO instructions (id, instruction) VALUES ('43ab4d6e-3546-45dd-86d8-6114a743395b', 'Drive the bar up with as much force as possible. The elbows should be tucked in until lockout.');
INSERT INTO instructions (id, instruction) VALUES ('d827b3ef-d671-4d6d-b0c3-abb616334e81', 'Return the bar to the pins, pausing before beginning the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('e4ded051-9643-41f1-abb0-0d2e61a3a782', 'Sit with your buttocks on top of a foam roll. Bend your knees, and then cross one leg so that the ankle is over the knee. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ad2a1f16-a73e-4df2-ad6b-9a574e7204a5', 'Shift your weight to the side of the crossed leg, rolling over the buttocks until you feel tension in your upper glute. You may assist the stretch by using one hand to pull the bent knee towards your chest. Hold this position for 10-30 seconds, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('beb65955-9f20-4f41-9901-bb967ced2b6f', 'Get into a prone position on the floor, supporting your weight on your toes and your forearms. Your arms are bent and directly below the shoulder.');
INSERT INTO instructions (id, instruction) VALUES ('7aa45b45-cd91-4496-8554-13b65597d76c', 'Keep your body straight at all times, and hold this position as long as possible. To increase difficulty, an arm or leg can be raised.');
INSERT INTO instructions (id, instruction) VALUES ('019a7ece-c1e7-45ff-870e-85334ca8288e', 'Grab two wide-rimmed plates and put them together with the smooth sides facing outward');
INSERT INTO instructions (id, instruction) VALUES ('57683612-9078-46d2-b71e-11c6bea18f69', 'Use your fingers to grip the outside part of the plate and your thumb for the other side thus holding both plates together. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0f50483c-b9b2-44de-9d61-5944faa53c4c', 'Squeeze the plate with your fingers and thumb. Hold this position for as long as you can.');
INSERT INTO instructions (id, instruction) VALUES ('664b35c4-6993-4a44-a8e8-12b2937e0d8a', 'Repeat for the recommended amount of sets prescribed in your program.');
INSERT INTO instructions (id, instruction) VALUES ('84eb88e4-f71e-48bf-ac2c-5a624c387115', 'Switch arms and repeat the movements.');
INSERT INTO instructions (id, instruction) VALUES ('7b57e333-9dff-425e-ba6f-34b7dd8c6c2e', 'Lie down on the floor or an exercise mat with your legs fully extended and your upper body upright. Grab the plate by its sides with both hands out in front of your abdominals with your arms slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('e265bc40-dd03-43f8-a640-3f7e0419dc6b', 'Slowly cross your legs near your ankles and lift them up off the ground. Your knees should also be bent slightly. Note: Move your upper body back slightly to help keep you balanced turning this exercise. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a56b7a21-9b5d-4722-9ce7-1150a2664cc0', 'Move the plate to the left side and touch the floor with it. Breathe out as you perform that movement.');
INSERT INTO instructions (id, instruction) VALUES ('89a28b22-e8e4-4877-9d1a-125f2ff2a8d6', 'Come back to the starting position as you breathe in and then repeat the movement but this time to the right side of the body. Tip: Use a slow controlled movement at all times. Jerking motions can injure the back.');
INSERT INTO instructions (id, instruction) VALUES ('0af4d0cc-2d46-474f-906d-82a93cefa0fe', 'For this movement a wooden floor or similar is needed. Lay on your back with your legs extended. Place a gym towel or a light weight underneath your heel. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9d5987a1-bc7d-4f48-b9b9-13ae68793f72', 'Begin the movement by flexing the knee, keeping your other leg straight.');
INSERT INTO instructions (id, instruction) VALUES ('9f685be4-5caf-4ff1-a332-7069752b63f0', 'Continue bringing the heel closer to you, sliding it on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('f0f6ef86-f523-44a6-84ff-d303b0f1a9d6', 'At full knee flexion, reverse the movement to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('54def5df-3b1c-459f-92c6-b9c092fce18b', 'Hold a dumbbell at the base with both hands and stand straight up. Move your legs so that they are wider than shoulder width apart from each other with your knees slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('336f993c-403e-42b9-bb2d-977896594bfd', 'Your toes should be facing out. Note: Your arms should be stationary while performing the exercise. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('98c89cb2-9d30-43cd-bbf8-ff898b726da2', 'Slowly bend the knees and lower your legs until your thighs are parallel to the floor. Make sure to inhale as this is the eccentric part of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('f70a0007-ae82-46ec-aff0-9822ffeb1a80', 'Press mainly with the heel of the foot to bring the body back to the starting position while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('bd6f4092-f7ae-4428-ab14-72fdc6384aa9', 'Place a kettlebell on the floor. Place yourself in a pushup position, on your toes with one hand on the ground and one hand holding the kettlebell, with your elbows extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d154067b-0ae7-4884-a0c0-0f7b257f03bc', 'Begin by lowering yourself as low as you can, keeping your back straight.');
INSERT INTO instructions (id, instruction) VALUES ('60e24c6d-4d22-4b25-9ac3-76cda2abf272', 'Quickly and forcefully reverse direction, pushing yourself up to the other side of the kettlebell, switching hands as you do so. Continue the movement by descending and repeating the movement back and forth.');
INSERT INTO instructions (id, instruction) VALUES ('61bbac59-8fc7-4338-b7be-3ce4816ca798', 'Descend by flexing at the elbow, lowering your chest towards the ground.');
INSERT INTO instructions (id, instruction) VALUES ('5bc7c487-9b55-4be5-8d5f-eef20ba7abcd', 'At the bottom, reverse the motion by pushing yourself up through elbow extension as quickly as possible. Attempt to push your upper body up until your hands leave the ground.');
INSERT INTO instructions (id, instruction) VALUES ('a6017f66-db69-4ae6-96a9-605da3fa551a', 'Return to the starting position and repeat the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('30108dbd-53ca-4073-9fc4-452d82b2f14c', 'For added difficulty, add claps into the movement while you are air borne.');
INSERT INTO instructions (id, instruction) VALUES ('8c38f4bc-3d07-4428-9979-7cd441202f6f', 'With the leg extended and the heel off of the ground, pull on the belt so that the foot is everted, with the outside of the foot being pulled towards you. Hold for 10-20 seconds, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('0f565d23-6576-4da4-8e2e-2a8514410534', 'Stand with your feet slightly wider than shoulder width apart and toes pointing out slightly.');
INSERT INTO instructions (id, instruction) VALUES ('4b577c44-878e-49a5-b519-aedb799dd725', 'Squat down and grasp bar with a closed, pronated grip. Your hands should be slightly wider than shoulder width apart outside knees with elbows fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('39cef7c2-1adf-4523-9e13-4ef6de3bb660', 'Place the bar about 1 inch in front of your shins and over the balls of your feet.');
INSERT INTO instructions (id, instruction) VALUES ('9048bb97-1c78-4671-adc3-e39c8b53826a', 'Your back should be flat or slightly arched, your chest held up and out and your shoulder blades should be retracted.');
INSERT INTO instructions (id, instruction) VALUES ('9048a21e-0ee1-49df-ba7a-6a41b24d368a', 'Keep your head in a neutral position (in line with vertebral column and not tilted or rotated) with your eyes focused straight ahead. Inhale during this phase.');
INSERT INTO instructions (id, instruction) VALUES ('95451cac-1335-4887-ac7f-994e4a740212', 'Lift the bar from the floor by forcefully extending the hips and the knees as you exhale. Tip: The upper torso should maintain the same angle. Do not bend at the waist yet and do not let the hips rise before the shoulders (this would have the effect of pushing the glutes in the air and stretching the hamstrings.');
INSERT INTO instructions (id, instruction) VALUES ('1a649923-6e80-4ed5-943e-c5cb399f3fe1', 'Keep elbows fully extended with the head in a neutral position and the shoulders over the bar.');
INSERT INTO instructions (id, instruction) VALUES ('70d9c5a9-82b7-4601-a116-5a03a5af00cf', 'As the bar raises keep it as close to the shins as possible.');
INSERT INTO instructions (id, instruction) VALUES ('a12f7ff9-4f8f-4983-8315-4cc986eff1c7', 'As the bar passes the knees, thrust your hips forward and slightly bend the knees to avoid locking them. Tip: At this point your thighs should be against the bar.');
INSERT INTO instructions (id, instruction) VALUES ('45827c7c-4c4c-492f-9331-ab32b2dbf76c', 'Keep the back flat or slightly arched, elbows fully extended and your head neutral. Tip: You will hold your breath until the next phase.');
INSERT INTO instructions (id, instruction) VALUES ('67e5164c-2c4c-4d2f-b1d5-d2536e682de0', 'Inhale and then forcefully and quickly extend your hips and knees and stand on your toes.');
INSERT INTO instructions (id, instruction) VALUES ('345cd0f9-bb88-47c9-a1a4-c6a922c001c3', 'Keep the bar as close to your body as possible. Tip: Your back should be flat with the elbows pointed out to the sides and your head in a neutral position. Also, keep your shoulders over the bar and arms straight as long as possible.');
INSERT INTO instructions (id, instruction) VALUES ('332231be-23c8-4fd0-8d48-b8b17e1ae88d', 'When your lower body joints are fully extended, shrug the shoulders upward rapidly without letting the elbows flex yet. Exhale during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('b3e0dc7a-5381-4f3e-8057-2c37014e0299', 'As the shoulders reach their highest elevation flex your elbows to begin pulling your body under the bar.');
INSERT INTO instructions (id, instruction) VALUES ('7f1c2b91-fad0-447f-8514-8986a293c123', 'Continue to pull the arms as high and as long as possible. Tip: Due to the explosive nature of this phase, your torso will be erect or with an arched back, your head will be tilted back slightly and your feet may lose contact with the floor.');
INSERT INTO instructions (id, instruction) VALUES ('29309ae2-ea2d-48ad-8045-9bea20343381', 'After the lower body has fully extended and the bar reaches near maximal height, pull your body under the bar and rotate the arms around and under the bar.');
INSERT INTO instructions (id, instruction) VALUES ('69dbfbc5-0a9d-4a03-975e-041b5df70da4', 'Simultaneously, flex the hips and knees into a quarter squat position.');
INSERT INTO instructions (id, instruction) VALUES ('44e95566-a7a0-4ae0-8048-a8b0fd0508c7', 'Once the arms are under the bar, inhale and then lift your elbows to position the upper arms parallel to the floor. Rack the bar across the front of your collar bones and front shoulder muscles.');
INSERT INTO instructions (id, instruction) VALUES ('e8bd0fab-96c7-4837-a8ab-20d5a4f63fe7', 'Catch the bar with an erect and tight torso, a neutral head position and flat feet. Exhale during this movement.');
INSERT INTO instructions (id, instruction) VALUES ('be7183c1-2aea-4d01-a537-36b948645101', 'Stand up by extending the hips and knees to a fully erect position.');
INSERT INTO instructions (id, instruction) VALUES ('175e6cb4-13ae-40b4-89fd-433134184023', 'Lower the bar by gradually reducing the muscular tension of the arms to allow a controlled descent of the bar to the thighs. Inhale during this movement.');
INSERT INTO instructions (id, instruction) VALUES ('2450654c-fb82-4a13-8e0d-d7de1104a12c', 'Simultaneously flex the hips and knees to cushion the impact of the bar on the thighs.');
INSERT INTO instructions (id, instruction) VALUES ('d83e2829-9cee-4027-90ee-72b8b0ca05c3', 'Squat down with the elbows fully extended until the bar touches the floor.');
INSERT INTO instructions (id, instruction) VALUES ('4fae28ed-257d-4995-9d71-09c0134366f8', 'Start over at Phase 1 and repeat for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('098c150a-2218-4a38-bfda-2a96b91460c9', 'With a barbell on boxes of the desired height, take a grip just outside the legs. Lower your hips with the weight focused on the heels, back straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d0224b58-7062-4e4c-849e-29166fbaa0fa', 'Begin the first pull by driving through the heels, extending your knees. Your back angle should stay the same, and your arms should remain straight. As the bar approaches the mid-thigh position, begin extending through the hips.');
INSERT INTO instructions (id, instruction) VALUES ('07644653-b054-4d4c-a41e-2066589e08c8', 'In a jumping motion, accelerate by extending the hips, knees, and ankles, using speed to move the bar upward. There should be no need to actively pull through the arms to accelerate the weight. At the end of the second pull, the body should be fully extended, leaning slightly back, with the arms still extended.');
INSERT INTO instructions (id, instruction) VALUES ('0d87f884-84e7-4ea9-b7a1-1f0c9d2ce4eb', 'As full extension is achieved, transition into the third pull by aggressively shrugging and flexing the arms with the elbows up and out. At peak extension, pull yourself under the bar far enough that it can be racked onto the shoulders, rotating your elbows under the bar as you do so. The bar should be racked onto the protracted shoulders, lightly touching the throat with the hands relaxed.');
INSERT INTO instructions (id, instruction) VALUES ('44ee9dbb-6050-440a-a3e2-f0c476952426', 'Immediately recover by driving through the heels, keeping the torso upright and elbows up. Continue until you have risen to a standing position, and complete the repetition by returning the weight to the boxes.');
INSERT INTO instructions (id, instruction) VALUES ('6beda1f7-be5b-4a6f-9e2f-70aa95ba6c88', 'Standing with the weight racked on the front of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible.');
INSERT INTO instructions (id, instruction) VALUES ('8c2fd035-10c4-43cc-b6f9-81fcfdc5f808', 'At this moment as the feet leave the floor, the feet must be placed into the receiving position as quickly as possible. In the brief moment the feet are not actively driving against the platform, the athletes effort to push the bar up will drive them down. The feet should be moved to a slightly wider stance, with the knees partially bent.');
INSERT INTO instructions (id, instruction) VALUES ('24b4557f-3922-4907-8880-0071483374c2', 'Receive the bar with the arms locked out overhead.');
INSERT INTO instructions (id, instruction) VALUES ('4d211df9-b21a-4ad6-a860-18929baed1da', 'The palms of the hands should be facing your torso. Your feet should be about shoulder width apart. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('29cd7d4e-fda2-41fc-bf62-1093fab4d5f6', 'Keeping your arms straight and the torso stationary, lift the weights out to your sides until they are about shoulder level height while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('8a33c0a6-ff01-471b-806c-2fd57feab440', 'Feel the contraction for a second and begin to lower the weights back down to the starting position while inhaling. Tip: Keep the palms facing down with the little finger slightly higher while lifting and lowering the weights as it will concentrate the stress on your shoulders mainly.');
INSERT INTO instructions (id, instruction) VALUES ('8d2e5943-7618-49ad-9d9e-2196ebd19878', 'Begin with a loaded barbell on the floor. The bar should be close to or touching the shins, and a wide grip should be taken on the bar. The feet should be directly below the hips, with the feet turned out as needed. Lower the hips, with the chest up and the head looking forward. The shoulders should be just in front of the bar. This will be the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a6ee74e4-e2d8-4173-aee6-c0c2a2c777b8', 'Begin the first pull by driving through the front of the heels, raising the bar from the ground. The back angle should stay the same until the bar passes the knees.');
INSERT INTO instructions (id, instruction) VALUES ('3476e550-026f-4557-bd29-998c48485892', 'Transition into the second pull by extending through the hips knees and ankles, driving the bar up as quickly as possible. The bar should be close to the body. At peak extension, shrug the shoulders and allow the elbows to flex to the side.');
INSERT INTO instructions (id, instruction) VALUES ('c58ba304-2007-4a72-a4a3-4d9606ef051b', 'As you move your feet into the receiving position, a slightly wider position, pull yourself below the bar as you elevate the bar overhead. The bar should be received in a partial squat. Continue raising the bar to the overhead position, receiving the bar locked out overhead.');
INSERT INTO instructions (id, instruction) VALUES ('380ceb0d-9ce8-4225-b60c-3c05007f7a72', 'Return to a standing position with the weight over head.');
INSERT INTO instructions (id, instruction) VALUES ('9c47a238-caea-4255-b083-53694f00a96e', 'Begin with a loaded barbell on boxes or stands of the desired height. A wide grip should be taken on the bar. The feet should be directly below the hips, with the feet turned out as needed. Lower the hips, with the chest up and the head looking forward. The shoulders should be just in front of the bar, with the elbows pointed out. This will be the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6da96674-e36e-4fcb-87d8-bc4444690b4a', 'Begin the first pull by driving through the front of the heels, raising the bar from the boxes.');
INSERT INTO instructions (id, instruction) VALUES ('6eea7893-d9d3-4216-b37d-5235c1eb3341', 'As you move your feet into the receiving position, forcefully pull yourself below the bar as you elevate the bar overhead. The feet should move to just outside the hips, turned out as necessary. Receive the bar above a full squat and with the arms fully extended overhead.');
INSERT INTO instructions (id, instruction) VALUES ('9f86f1d5-78dc-4a08-8fa6-6eda08f1fc90', 'Keeping the bar aligned over the front of the heels, your head and chest up, drive through heels of the feet to move to a standing position. Carefully return the weight to the boxes.');
INSERT INTO instructions (id, instruction) VALUES ('2fa2e46b-6adf-4778-bc8b-88477089f71a', 'In the power stairs, implements are moved up a staircase. For training purposes, these can be performed with a tire or box.');
INSERT INTO instructions (id, instruction) VALUES ('240734d6-1063-49c1-a960-0f371ac84059', 'Begin by taking the implement with both hands. Set your feet wide, with your head and chest up. Drive through the ground with your heels, extending your knees and hips to raise the weight from the ground.');
INSERT INTO instructions (id, instruction) VALUES ('456cb853-a589-4f09-aae9-ef4c5fc3803b', 'As you lean back, attempt to swing the weight onto the stairs, which are usually around 16-18" high. You can use your legs to help push the weight onto the stair.');
INSERT INTO instructions (id, instruction) VALUES ('17462467-8e95-4b3e-b7ba-594e898e084e', 'Repeat for 3-5 repetitions, and continue with a heavier weight, moving as fast as possible.');
INSERT INTO instructions (id, instruction) VALUES ('7c13186b-42b9-46aa-9a11-b26ab99be031', 'To perform this movement you will need a preacher bench and an E-Z bar. Grab the E-Z curl bar at the close inner handle (either have someone hand you the bar which is preferable or grab the bar from the front bar rest provided by most preacher benches). The palm of your hands should be facing forward and they should be slightly tilted inwards due to the shape of the bar.');
INSERT INTO instructions (id, instruction) VALUES ('1f998801-1147-49d9-b533-0f6d94d54bcf', 'With the upper arms positioned against the preacher bench pad and the chest against it, hold the E-Z Curl Bar at shoulder length. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f289a048-9b6a-4bb8-9228-dd86648bc193', 'As you breathe in, slowly lower the bar until your upper arm is extended and the biceps is fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('a23e28fa-f5cd-437e-8375-b8a2ce2042e8', 'As you exhale, use the biceps to curl the weight up until your biceps is fully contracted and the bar is at shoulder height. Squeeze the biceps hard and hold this position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('a7facf66-a890-4b3e-b13a-36361978f695', 'Place the upper part of both arms on top of the preacher bench as you hold a dumbbell in each hand with the palms facing each other (neutral grip).');
INSERT INTO instructions (id, instruction) VALUES ('db6d09ee-4531-4a3d-8351-99ba6f59bb73', 'As you breathe in, slowly lower the dumbbells until your upper arm is extended and the biceps is fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('e4ac8898-2a86-4a2e-b609-52563bc82db8', 'As you exhale, use the biceps to curl the weight up until your biceps is fully contracted and the dumbbells are at shoulder height.');
INSERT INTO instructions (id, instruction) VALUES ('239e094a-64d1-4772-803f-3bed20954b72', 'To begin, lie down on a bench with a barbell resting on your chest. Position your legs so they are secure on the extension of the abdominal bench. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6135dd80-7583-4ae5-a61a-64942581e895', 'While inhaling, tighten your abdominals and glutes. Simultaneously curl your torso as you do when performing a sit-up and press the barbell to an overhead position while exhaling. Tip: Use your arms to push the barbell out as you perform this exercise while still focusing on the abdominal muscles.');
INSERT INTO instructions (id, instruction) VALUES ('c2b1d0dc-0358-449b-9eed-a71a1b106986', 'Lower your upper body back down to the starting position while bringing the barbell back down to your torso. Remember to breathe in while lowering the body.');
INSERT INTO instructions (id, instruction) VALUES ('33882d36-7e50-47cd-b22e-553b69a57202', 'You will need a partner for this exercise. Lay face down with your legs straight. Your assistant will place their hand on your heel.');
INSERT INTO instructions (id, instruction) VALUES ('131807ec-e1d0-48c6-8dff-cf238db2b581', 'To begin, flex the knee to curl your leg up. Your partner should provide resistance, starting light and increasing the pressure as the movement is completed. Communicate with your partner to monitor appropriate resistance levels.');
INSERT INTO instructions (id, instruction) VALUES ('fb407d49-c273-482d-b050-7ab0409a0ca8', 'Pause at the top, returning the leg to the starting position as your partner provides resistance going the other direction.');
INSERT INTO instructions (id, instruction) VALUES ('c660395c-c3c8-4723-acd7-43e301bfed26', 'Place your sled on an appropriate surface, loaded to a suitable weight. The sled should provide enough resistance to require effort, but not so heavy that you are significantly slowed down.');
INSERT INTO instructions (id, instruction) VALUES ('89e08a69-4dcf-4427-84c6-3a8f88708939', 'You may use the upright or the low handles for this exercise. Place your hands on the handles with your arms extended, leaning into the implement.');
INSERT INTO instructions (id, instruction) VALUES ('4564fbc6-97fe-40a1-a356-6a873c2ed658', 'With good posture, drive through the ground with alternating, short steps. Move as fast as you can for a short distance.');
INSERT INTO instructions (id, instruction) VALUES ('0551c370-b729-425c-8908-695627e34278', 'Begin standing a few feet in front of a low pulley with a rope or handle attached. Face away from the machine, straddling the cable, with your feet set wide apart.');
INSERT INTO instructions (id, instruction) VALUES ('f8433ce3-50c2-4b98-9f7b-cc3edc5a903a', 'Begin the movement by reaching through your legs as far as possible, bending at the hips. Keep your knees slightly bent. Keeping your arms straight, extend through the hip to stand straight up. Avoid pulling upward through the shoulders; all of the motion should originate through the hips.');
INSERT INTO instructions (id, instruction) VALUES ('aecfdfeb-087d-4b47-a3be-262b8ca737c1', 'Grab the pull-up bar with the palms facing forward using the prescribed grip. Note on grips: For a wide grip, your hands need to be spaced out at a distance wider than your shoulder width. For a medium grip, your hands need to be spaced out at a distance equal to your shoulder width and for a close grip at a distance smaller than your shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('549b2be2-851b-4660-9754-57bb57cada94', 'As you have both arms extended in front of you holding the bar at the chosen grip width, bring your torso back around 30 degrees or so while creating a curvature on your lower back and sticking your chest out. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7a2fee9f-0942-461e-a799-84d830674f5b', 'With your hands wide apart, support your body on your toes and hands in a plank position. Your elbows should be extended and your body straight. Do not allow your hips to sag. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b79644b4-6d04-4525-a385-cb313c9f5731', 'To begin, allow the elbows to flex, lowering your chest to the floor as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('4bca4dd7-0bdc-47ac-8112-89e1250b8d76', 'Using your pectoral muscles, press your upper body back up to the starting position by extending the elbows. Exhale as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('3ab87ef0-7c31-48bb-a1bc-43547dd4d446', 'After pausing at the contracted position, repeat the movement for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('afda952e-05ae-4092-9a94-9892d3f91054', 'Lie on the floor face down and place your hands closer than shoulder width for a close hand position. Make sure that you are holding your torso up at arms'' length.');
INSERT INTO instructions (id, instruction) VALUES ('9cc40ff3-1c78-404c-9863-adc83dd2161d', 'Lower yourself until your chest almost touches the floor as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('5133018e-3f7a-4e07-bf7b-fb448c4c0af1', 'Using your triceps and some of your pectoral muscles, press your upper body back up to the starting position and squeeze your chest. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('e842415d-defb-43da-88ad-20eb0bfbda71', 'After a second pause at the contracted position, repeat the movement for the prescribed amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('4396c55c-bb81-4ca2-889d-5a413e5cefce', 'Lie on the floor face down and place your hands about 36 inches apart from each other holding your torso up at arms length.');
INSERT INTO instructions (id, instruction) VALUES ('9aa137be-70a2-406c-8dba-0d8f1905423c', 'Place your toes on top of a flat bench. This will allow your body to be elevated. Note: The higher the elevation of the flat bench, the higher the resistance of the exercise is.');
INSERT INTO instructions (id, instruction) VALUES ('e0ab328f-9643-4078-a063-fed2fcee6df5', 'Using your pectoral muscles, press your upper body back up to the starting position and squeeze your chest. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('1e788b6a-9104-4ab2-a706-8e272744c262', 'Place your toes on top of an exercise ball. This will allow your body to be elevated.');
INSERT INTO instructions (id, instruction) VALUES ('597517f8-0121-453b-86e0-455bb3e36297', 'Standing with the weight racked on the back of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible. Drive through the heels create as much speed and force as possible, moving the bar in a vertical path.');
INSERT INTO instructions (id, instruction) VALUES ('417cb1f1-b87e-4ee9-877e-efafa2f0e616', 'Using the momentum generated, finish pressing the weight overhead be extending through the arms.');
INSERT INTO instructions (id, instruction) VALUES ('9ebb6fad-b981-44b9-bb4e-bfb4ed73010a', 'Return to the starting position, using your legs to absorb the impact.');
INSERT INTO instructions (id, instruction) VALUES ('e9c6ffc5-5e02-47a0-9c77-17942458a0e7', 'Get into pushup position on the toes with your hands just outside of shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('da23083f-f2f2-4e97-9a72-238cf0afa936', 'Perform a pushup by allowing the elbows to flex. As you descend, keep your body straight.');
INSERT INTO instructions (id, instruction) VALUES ('991e7d99-a28b-4ffa-8087-693f9fa853e4', 'Do one pushup and as you come up, shift your weight on the left side of the body, twist to the side while bringing the right arm up towards the ceiling in a side plank.');
INSERT INTO instructions (id, instruction) VALUES ('2bc89b58-51bb-4c70-aec8-07825f2d4ad8', 'Lower the arm back to the floor for another pushup and then twist to the other side.');
INSERT INTO instructions (id, instruction) VALUES ('80eceacc-0ba8-4db8-b30b-99a07afae39c', 'Repeat the series, alternating each side, for 10 or more reps.');
INSERT INTO instructions (id, instruction) VALUES ('59f23dbb-9abd-4ddc-b6e8-82c0bcaab445', 'Lie on the floor face down and place your hands about 36 inches apart while holding your torso up at arms length.');
INSERT INTO instructions (id, instruction) VALUES ('e660342a-011b-4223-8162-2a9ebdda723a', 'Lie on the floor face down and body straight with your toes on the floor and the hands wider than shoulder width for a wide hand position and closer than shoulder width for a close hand position. Make sure you are holding your torso up at arms length.');
INSERT INTO instructions (id, instruction) VALUES ('67509f5f-5092-465f-8f41-b97d930a2074', 'Start off by rolling your torso forward onto the ball so your hips rest on top of the ball and become the highest point of your body.');
INSERT INTO instructions (id, instruction) VALUES ('84e98011-6c95-4524-84c8-53c493ef799e', 'Rest your hands and feet on the floor. Your arms and legs can be slightly bent or straight, depending on the size of the ball, your flexibility, and the length of your limbs. This also helps develop stabilizing strength in your torso and shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('454790f4-3fe0-4a63-b48f-3220e45e68e7', 'Lay on your side. Loop a belt, rope, or band around your top foot. Flex the knee and extend your hip, attempting to touch your glutes with your foot, and holding the belt with your hands. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8940fe06-867d-4f88-a342-a7e8091bc118', 'With the belt being held over the shoulder or overhead, gently pull to increase the stretch in the quadriceps. Hold for 10-20 seconds, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('87a3e0ea-38b0-4c59-b19d-f9d77dbd92e0', 'Lay facedown on the floor with your weight supported by your hands or forearms. Place a foam roll underneath one leg on the quadriceps, and keep the foot off of the ground. Make sure to relax the leg as much as possible. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ea674d9f-2fa8-499e-91d6-7b8054543920', 'Shifting as much weight onto the leg to be stretched as is tolerable, roll over the foam from above the knee to below the hip, holding points of tension for 10-30 seconds. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('112d52e7-85d7-49e8-8f66-d18bce8c870e', 'You will need a box for this exerise.');
INSERT INTO instructions (id, instruction) VALUES ('42f6ea53-0e90-4ac6-a036-c79ce3145483', 'Begin facing the box standing 1-2 feet from its edge.');
INSERT INTO instructions (id, instruction) VALUES ('23196744-8f62-4bab-9e27-bbb44e4c2345', 'By utilizing your hips, hop onto the box, landing on both legs. Ensure that you land with your legs bent and your feet flat.');
INSERT INTO instructions (id, instruction) VALUES ('8f3916a1-431a-47b0-88eb-77aa7d4317ee', 'Immediately upon landing, fully extend through the entire body and swing your arms overhead to explode off of the box. Use your legs to absorb the impact of landing.');
INSERT INTO instructions (id, instruction) VALUES ('f309b0ac-0cc7-4d42-a1e9-5574af454b8d', 'This drill teaches the delivery of the barbell to the rack position on the shoulders. Begin holding a bar in the scarecrow position, with the upper arms parallel to the floor, and the forearms hanging down. Use a hook grip, with your fingers wrapped over your thumbs.');
INSERT INTO instructions (id, instruction) VALUES ('3add20bf-8c96-47d4-b4a1-bcc536e40930', 'Begin by rotating the elbows around the bar, delivering the bar to the shoulders. As your elbows come forward, relax your grip. The shoulders should be protracted, providing a shelf for the bar, which should lightly contact the throat.');
INSERT INTO instructions (id, instruction) VALUES ('1d7c5fcb-489b-450e-ba61-c2ee849890d5', 'It is important that the bar stay close to the body at all times, as with a heavier load any distance will result in an unwanted collision. As the movement becomes smoother, speed and load can be increased before progressing further.');
INSERT INTO instructions (id, instruction) VALUES ('22925573-700a-4b7e-b3a0-b690becba520', 'Set up in a power rack with the bar on the pins. The pins should be set to the desired point; just below the knees, just above, or in the mid thigh position. Attach bands to the base of the rack, or secure them with dumbbells. Attach the other end to the bar. You may need to choke the bands to provide tension.');
INSERT INTO instructions (id, instruction) VALUES ('a50db765-c46f-4147-b0eb-2e1a62aa250c', 'Position yourself against the bar in proper deadlifting position. Your feet should be under your hips, your grip shoulder width, back arched, and hips back to engage the hamstrings. Since the weight is typically heavy, you may use a mixed grip, a hook grip, or use straps to aid in holding the weight.');
INSERT INTO instructions (id, instruction) VALUES ('8a0bef0b-7de2-4640-b8be-f618c52f6ef6', 'With your head looking forward, extend through the hips and knees, pulling the weight up and back until lockout. Be sure to pull your shoulders back as you complete the movement. Return the weight to the pins and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('39522e1b-4009-4829-82e4-2ccde2f142ee', 'Set up in a power rack with the bar on the pins. The pins should be set to the desired point; just below the knees, just above, or in the mid thigh position. Position yourself against the bar in proper deadlifting position. Your feet should be under your hips, your grip shoulder width, back arched, and hips back to engage the hamstrings. Since the weight is typically heavy, you may use a mixed grip, a hook grip, or use straps to aid in holding the weight.');
INSERT INTO instructions (id, instruction) VALUES ('abacbb01-cfd3-444c-aa05-3964898bfbd1', 'With your head looking forward, extend through the hips and knees, pulling the weight up and back until lockout. Be sure to pull your shoulders back as you complete the movement.');
INSERT INTO instructions (id, instruction) VALUES ('78c04134-c449-4d85-8cbe-ad8039177c5e', 'Return the weight to the pins and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('222732dc-6c21-4e12-92e9-643674908acd', 'Place yourself on your hands knees on an exercise mat. Your head should be looking forward and the bend of the knees should create a 90-degree angle between the hamstrings and the calves. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0bd496e8-d600-4e12-86d3-a961f27e970e', 'Extend one leg up and behind you. The knee and hip should both extend. Repeat for 5-10 repetitions, and then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('fff246e0-02a4-483a-9d89-c77158183943', 'Recumbent bikes offer convenience, cardiovascular benefits, and have less impact than other activities. A 150 lb person will burn about 230 calories cycling at a moderate rate for 30 minutes, compared to 450 calories or more running.');
INSERT INTO instructions (id, instruction) VALUES ('4e6d5e4c-2cf1-4922-b00e-708b5f0224e1', 'You will need a partner for this drill.');
INSERT INTO instructions (id, instruction) VALUES ('530e6a70-f012-4f3f-964f-b20a23c5d092', 'Begin in an athletic 2 or 3 point stance.');
INSERT INTO instructions (id, instruction) VALUES ('f5c3454e-d0d9-415f-bbf6-b8eaa07c03f7', 'At the signal, move into a position to receive the pass from your partner.');
INSERT INTO instructions (id, instruction) VALUES ('8dcac933-a579-467e-abab-d61be856cc36', 'Catch the medicine ball with both hands and immediately throw it back to your partner.');
INSERT INTO instructions (id, instruction) VALUES ('c8ae1188-bc8e-42dc-a1ed-6a856971ab74', 'You can modify this drill by running different routes.');
INSERT INTO instructions (id, instruction) VALUES ('27fd04fc-0add-4550-ad2d-efed82516d82', 'Position a bench inside a power rack, with the bar set to the correct height. Begin by anchoring bands either to band pegs or to the top of the rack. Ensure that you will be position properly under the bands. Attach the other end to the barbell.');
INSERT INTO instructions (id, instruction) VALUES ('3d8e099b-8ee2-4fe4-b3df-9ab78efbf7b9', 'Lie on the bench, tuck your feet underneath you and arch your back. Using the bar to help support your weight, lift your shoulder off the bench and retract them, squeezing the shoulder blades together. Use your feet to drive your traps into the bench. Maintain this tight body position throughout the movement. However wide your grip, it should cover the ring on the bar.');
INSERT INTO instructions (id, instruction) VALUES ('a1729699-a29b-4612-9b55-94fd4351d370', 'Begin in a power rack with a box at the appropriate height behind you. Set up the bands either on band pegs or attached to the top of the rack, ensuring they will be directly above the bar during the squat. Attach the other end to the bar.');
INSERT INTO instructions (id, instruction) VALUES ('2654c00d-3ea2-4f2c-9830-379699809bf0', 'Set the bar up in a power rack. Attach bands to the top of the rack, using either bands pegs or the frame itself. Attach the other end of the bands to the bar.');
INSERT INTO instructions (id, instruction) VALUES ('eb3bfb48-6d13-4365-b115-f239ecd5a73d', 'Approach the bar so that it is centered over your feet. You feet should be about hip width apart. Bend at the hip to grip the bar at shoulder width, allowing your shoulder blades to protract. Typically, you would use an overhand grip or an over/under grip on heavier sets.');
INSERT INTO instructions (id, instruction) VALUES ('5f299007-b8f4-4ef5-b1c2-8d5428b56228', 'With your feet, and your grip set, take a big breath and then lower your hips and bend the knees until your shins contact the bar. Look forward with your head, keep your chest up and your back arched, and begin driving through the heels to move the weight upward.');
INSERT INTO instructions (id, instruction) VALUES ('45bbc549-84f2-4cae-b562-0be829b45998', 'Begin in a power rack with the pins and bar set at the appropriate height. After loading the bar, attach bands to the top of the rack, using either pegs or the frame itself. Attach the other end of the bands to the bar.');
INSERT INTO instructions (id, instruction) VALUES ('6af665f0-f720-4b6d-b4d1-701a6e3dedd5', 'Begin by stepping under the bar and placing it across the back of the shoulders. Squeeze your shoulder blades together and rotate your elbows forward, attempting to bend the bar across your shoulders. Remove the bar from the rack, creating a tight arch in your lower back, and step back into position. Place your feet wide for more emphasis on the back, glutes, adductors, and hamstrings.');
INSERT INTO instructions (id, instruction) VALUES ('9d5bf135-4b88-4c4d-8dfc-303dc627f349', 'Keep your head facing forward. With your back, shoulders, and core tight, push your knees and butt out and you begin your descent. Sit back with your hips as much as possible. Ideally, your shins should be perpendicular to the ground. Lower bar position necessitates a greater torso lean to keep the bar over the heels. Continue until you break parallel, which is defined as the crease of the hip being in line with the top of the knee.');
INSERT INTO instructions (id, instruction) VALUES ('880ab55e-03b0-433c-9955-5a3e7e43d58e', 'Keeping the weight on your heels and pushing your feet and knees out, drive upward as you lead the movement with your head. Continue upward, maintaining tightness head to toe, until you have returned to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7821f243-2ab7-4d3c-b61c-ede7b55aac35', 'Begin with a bar loaded on the floor inside of a power rack. Attach bands to the top of the rack, using either pegs or the frame itself. Attach the other end to the barbell.');
INSERT INTO instructions (id, instruction) VALUES ('2dc68d93-7d8a-4ac5-859d-990e60a73b17', 'Approach the bar so that the bar intersects the middle of the feet. The feet should be set very wide, near the collars. Bend at the hips to grip the bar. The arms should be directly below the shoulders, inside the legs, and you can use a pronated grip, a mixed grip, or hook grip. Relax the shoulders, which in effect lengthens your arms.');
INSERT INTO instructions (id, instruction) VALUES ('1b04126a-a0b9-4464-a9db-a30f77bdfb7d', 'Take a breath, and then lower your hips, looking forward with your head with your chest up. Drive through the floor, spreading your feet apart, with your weight on the back half of your feet. Extend through the hips and knees.');
INSERT INTO instructions (id, instruction) VALUES ('c6337f3a-2676-4d15-8e44-13ad138e1123', 'As the bar passes through the knees, lean back and drive the hips into the bar, pulling your shoulder blades together.');
INSERT INTO instructions (id, instruction) VALUES ('bd07501d-fa41-404a-959f-7e71ec459e86', 'Return the weight to the ground by bending at the hips and controlling the weight on the way down.');
INSERT INTO instructions (id, instruction) VALUES ('f7a6ac00-0576-42eb-81b2-bea7f830985e', 'Stand up with your torso upright while holding a barbell at shoulder width with the elbows close to the torso. The palm of your hands should be facing down (pronated grip). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a40c31ae-0650-4ee2-aa7a-d08953c7688a', 'While holding the upper arms stationary, curl the weights while contracting the biceps as you breathe out. Only the forearms should move. Continue the movement until your biceps are fully contracted and the bar is at shoulder level. Hold the contracted position for a second as you squeeze the muscle.');
INSERT INTO instructions (id, instruction) VALUES ('fbc3c263-d579-4797-9790-7f8ee0cc025c', 'Grab an EZ-bar using a shoulder width and palms down (pronated) grip.');
INSERT INTO instructions (id, instruction) VALUES ('a7316b36-39b8-4222-ac08-4281c65902ed', 'Now place the upper part of both arms on top of the preacher bench and have your arms extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('acbb1ed1-b7b7-4980-87c7-58639e9c1398', 'As you exhale, use the biceps to curl the weight up until your biceps are fully contracted and the barbell is at shoulder height. Squeeze the biceps hard for a second at the contracted position.');
INSERT INTO instructions (id, instruction) VALUES ('35e763aa-022d-4e68-b157-4a6a588b3b88', 'As you breathe in, slowly lower the barbell until your upper arms are extended and the biceps is fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('bf9bd604-8fff-43a8-bfa4-808dff406312', 'Stand up with your torso upright while holding a bar attachment that is attached to a low pulley using a pronated (palms down) and shoulder width grip. Make sure also that you keep the elbows close to the torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('88091f3c-773f-4eb7-a7b6-c4dc31dfe08f', 'Lie down on the floor with your legs fully extended and arms to the side of your torso with the palms on the floor. Your arms should be stationary for the entire exercise.');
INSERT INTO instructions (id, instruction) VALUES ('ee746c19-eeab-4b31-a283-4a8ae73d1389', 'Move your legs up so that your thighs are perpendicular to the floor and feet are together and parallel to the floor. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c89f3d39-74a4-41a5-832c-b7cb765ce59a', 'While inhaling, move your legs towards the torso as you roll your pelvis backwards and you raise your hips off the floor. At the end of this movement your knees will be touching your chest.');
INSERT INTO instructions (id, instruction) VALUES ('2ddf209e-a62d-4086-994c-61ce71219768', 'Hold the contraction for a second and move your legs back to the starting position while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('324341a8-4774-4a0e-ac5c-5bea24e16b34', 'To begin, lie down on an incline bench with the chest and stomach pressing against the incline. Have the dumbbells in each hand with the palms facing each other (neutral grip).');
INSERT INTO instructions (id, instruction) VALUES ('415f9901-34d4-4e24-8fca-dc1b3eac07b9', 'Extend the arms in front of you so that they are perpendicular to the angle of the bench. The legs should be stationary while applying pressure with the ball of your toes. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('15e5fb7b-9b8c-4b8c-b807-b377e41b1fc5', 'Maintaining the slight bend of the elbows, move the weights out and away from each other (to the side) in an arc motion while exhaling. Tip: Try to squeeze your shoulder blades together to get the best results from this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('86397da1-74b2-4aad-a13f-ec13f0611480', 'The arms should be elevated until they are parallel to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('312f1efa-93b4-4c7c-b445-50ff3dc01475', 'Feel the contraction and slowly lower the weights back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('0c307ea0-1b7e-4311-9a1c-61e4ddb3c0ab', 'To begin, lie down on an incline bench set at a 30-degree angle with the chest and stomach pressing against the incline.');
INSERT INTO instructions (id, instruction) VALUES ('c0ea7665-4842-4a7e-8421-8eeef3998bf1', 'Have the dumbbells in each hand with the palms facing down to the floor. Your arms should be in front of you so that they are perpendicular to the angle of the bench. Tip: Your elbows should have a slight bend. The legs should be stationary while applying pressure with the ball of your toes (your heels should not be touching the floor). This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b500d90b-d6eb-4ca3-af38-cf00b021e6e9', 'Maintaining the slight bend of the elbows, move the weights out and away from each other in an arc motion while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('e70b65af-2349-4bc8-9c4e-efa7f014d72b', 'As you lift the weight, your wrist should externally rotate by 90-degrees so that you go from a palms down (pronated) grip to a palms facing each other (neutral) grip. Tip: Try to squeeze your shoulder blades together to get the best results from this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('2ce5d3f9-533f-4e00-9924-269b74d6857f', 'The arms should be elevated until they are level with the head.');
INSERT INTO instructions (id, instruction) VALUES ('19e437ec-a218-4e7b-b8ed-272a703c5951', 'Stand erect while holding a barbell with a supinated grip (palms facing up).');
INSERT INTO instructions (id, instruction) VALUES ('8760055e-526e-4dc6-90d5-cc92e597c285', 'Bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Tip: Make sure that you keep the head up. The barbell should hang directly in front of you as your arms hang perpendicular to the floor and your torso. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d4204923-fc5e-405c-8ab7-4f700b35524b', 'While keeping the torso stationary, lift the barbell as you breathe out, keeping the elbows close to the body and not doing any force with the forearm other than holding the weights. On the top contracted position, squeeze the back muscles and hold for a second.');
INSERT INTO instructions (id, instruction) VALUES ('cf78989a-25d9-4dad-9b5f-43ee65c5b445', 'Start by setting a bar attachment (straight or e-z) on a high pulley machine.');
INSERT INTO instructions (id, instruction) VALUES ('df658a7e-9a24-4510-90d7-3ec4d5bc3058', 'Facing the bar attachment, grab it with the palms facing up (supinated grip) at shoulder width. Lower the bar by using your lats until your arms are fully extended by your sides. Tip: Elbows should be in by your sides and your feet should be shoulder width apart from each other. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7acfbe1d-fe97-44ff-a0c8-6e55fe456cfa', 'Slowly elevate the bar attachment up as you inhale so it is aligned with your chest. Only the forearms should move and the elbows/upper arms should be stationary by your side at all times.');
INSERT INTO instructions (id, instruction) VALUES ('c40a7c59-6cfb-4f5d-83c6-62103eb582d8', 'Then begin to lower the cable bar back down to the original staring position while exhaling and contracting the triceps hard.');
INSERT INTO instructions (id, instruction) VALUES ('03cd49f5-f44e-43d7-ab33-8db025575367', 'Place your feet between the pads after loading an appropriate weight. Lay on the top pad, allowing your hips to hang off the back, while grasping the handles to hold your position.');
INSERT INTO instructions (id, instruction) VALUES ('767703fb-0ec7-4453-a8cb-996b7bc82b49', 'To begin the movement, flex the hips, pulling the legs forward.');
INSERT INTO instructions (id, instruction) VALUES ('fbc6433e-5ef9-4164-aa3f-51c44d2e8cd3', 'Reverse the motion by extending the hips, kicking the leg back. It is very important not to over-extend the hip on this movement, stopping short of your full range of motion.');
INSERT INTO instructions (id, instruction) VALUES ('3fa1b756-5c5c-4597-a3d8-a54ad71c8988', 'Return by again flexing the hip, pulling the carriage forward as far as you can.');
INSERT INTO instructions (id, instruction) VALUES ('f2b5149c-fe7b-482d-9b6c-8d6c05b293eb', 'Adjust the handles so that they are fully to the rear. Make an appropriate weight selection and adjust the seat height so the handles are at shoulder level. Grasp the handles with your hands facing inwards. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0f2eb4b2-074b-42c5-807f-c91a3ab824d1', 'In a semicircular motion, pull your hands out to your side and back, contracting your rear delts.');
INSERT INTO instructions (id, instruction) VALUES ('ac2b8611-01b9-4836-96bc-f3c5d7655b62', 'Keep your arms slightly bent throughout the movement, with all of the motion occurring at the shoulder joint.');
INSERT INTO instructions (id, instruction) VALUES ('b8149d77-9ae5-4e5f-86f9-c4bd5e791042', 'Pause at the rear of the movement, and slowly return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d42dde86-2670-4bdb-b6b2-5f1b581ed29b', 'Start by standing straight with a weighted plate held by both hands and arms fully extended. Use a pronated grip (palms facing down) and make sure your fingers grab the rough side of the plate while your thumb grabs the smooth side. Note: For the best results, grab the weighted plate at an 11:00 and 1:00 o''clock position.');
INSERT INTO instructions (id, instruction) VALUES ('b1c8e5d2-cf8a-4390-926c-069ad47a936d', 'Your feet should be shoulder width apart from each other and the weighted plate should be near the groin area. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5925d707-5d6e-44fc-aa2d-202c06090593', 'Slowly lift the plate up while keeping the elbows in and the upper arms stationary until your biceps and forearms touch while exhaling. The plate should be evenly aligned with your torso at this point.');
INSERT INTO instructions (id, instruction) VALUES ('af8b199c-16b0-4790-a40e-80a5cd43e4d2', 'Feel the contraction for a second and begin to lower the weight back down to the starting position while inhaling');
INSERT INTO instructions (id, instruction) VALUES ('2b2d5a20-b95f-46b9-a248-9a63e51b4211', 'Lie back on a flat bench. Using a close, supinated grip (around shoulder width), lift the bar from the rack and hold it straight over you with your arms locked extended in front of you and perpendicular to the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ebb0ace1-1d99-4ba6-8062-aaa476e39407', 'As you breathe in, come down slowly until you feel the bar on your middle chest. Tip: Make sure that as opposed to a regular bench press, you keep the elbows close to the torso at all times in order to maximize triceps involvement.');
INSERT INTO instructions (id, instruction) VALUES ('6b74210e-2ea7-4569-888d-d53a150acfd2', 'Lay down with your back on the floor. Place a foam roll underneath your upper back, and cross your arms in front of you, protracting your shoulders. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d0db9cd9-f44b-4b5d-a541-38f5ae2ab4c3', 'Raise your hips off of the ground, placing your weight onto the foam roll. Shift your weight to one side at a time, rolling over your middle and upper back. Pause at points of tension for 10-30 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('25867848-985a-4cab-b413-6bd6ed6197c0', 'Position the frame at the starting point, and load with the appropriate weight. Standing in the center of the frame, begin by gripping the handles and driving through your heels to lift the frame. Ensure your chest and head are up and your back is straight.');
INSERT INTO instructions (id, instruction) VALUES ('11d6413f-d2de-4bb9-85b8-aa2b5dbe57b9', 'Immediately begin walking briskly with quick, controlled steps. Keep your chest up and head forward, and make sure you continue breathing. Bring the frame to the ground after you have reached the end point.');
INSERT INTO instructions (id, instruction) VALUES ('20494cf0-853f-43dc-b83b-f22184a7a2f5', 'Load the frame with the desired weight. Center yourself between the handles. You feet should be about hip width apart. Bend at the hips to grip the handles, allowing your shoulder blades to protract.');
INSERT INTO instructions (id, instruction) VALUES ('f20bead3-50e2-4b5f-8e88-66b4bbd8909a', 'With your feet and your grip set, take a big breath and then lower your hips and flex the knees. Look forward with your head, keep your chest up and your back arched, and begin driving through the heels to move the weight upward. As the weight comes up, pull your shoulder blades together as you drive your hips forward.');
INSERT INTO instructions (id, instruction) VALUES ('db685a88-68ec-4156-9ec7-2b749831323d', 'Lower the weight by bending at the hips and guiding it to the ground.');
INSERT INTO instructions (id, instruction) VALUES ('8e0fe372-1e3f-4596-b686-ee6f53e5c970', 'Grip a ring in each hand, and then take a small jump to help you get into the starting position with your arms locked out.');
INSERT INTO instructions (id, instruction) VALUES ('991535d1-4d21-4e68-90da-31fc44a4b8fe', 'Begin in a relaxed stance with your feet shoulder width apart and hold your arms close to the body.');
INSERT INTO instructions (id, instruction) VALUES ('5a2b5cbc-8446-466b-a54e-b1e818390761', 'To initiate the move, squat down halfway and explode back up as high as possible.');
INSERT INTO instructions (id, instruction) VALUES ('c402be35-9a2a-4cbf-9705-c073f8d81d7b', 'Fully extend your entire body, reaching overhead as far as possible. As you land, absorb your impact through the legs.');
INSERT INTO instructions (id, instruction) VALUES ('f26d39ba-82c2-40a4-906c-bafc19382350', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack that best matches your height. Once the correct height is chosen and the bar is loaded, step under the bar and place it on the back of your shoulders (slightly below the neck).');
INSERT INTO instructions (id, instruction) VALUES ('60dd4896-8423-4cbe-a3a5-0aa993a609b6', 'Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times as looking down will get you off balance. Also maintain a straight back and keep the knees with a slight bend; never locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5071a40b-6e69-4c25-a65a-c4c48b61682a', 'Raise your heels as you breathe out by extending your ankles as high as possible and flexing your calf. Ensure that the knee is kept stationary at all times. There should be no bending (other than the slight initial bend we created during positioning) at any time. Hold the contracted position by a second before you start to go back down.');
INSERT INTO instructions (id, instruction) VALUES ('a1db1b55-c309-49f9-bae9-7cfa6dbe4e65', 'Now lift your toes by contracting the tibia muscles in the front of the calves as you breathe out.');
INSERT INTO instructions (id, instruction) VALUES ('4b77a43f-e4e5-452b-8d2d-58a6b6414526', 'Hold for a second and bring them back down as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('9326a508-5c4d-442e-9b8a-c1b508b3631d', 'Grab the pull-up bar with the palms facing forward using a wide grip.');
INSERT INTO instructions (id, instruction) VALUES ('2a929919-dad8-4b2a-a0cc-5973109bb941', 'Now repeat the same movements as described above except this time your torso will remain straight as you go up and the bar will touch the back of the neck instead of the upper chest. Tip: Use the head to lean forward slightly as it will help you properly execute this portion of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('d3fcc6ae-abf0-4cbb-a1bc-60e1fdab9611', 'Once you have lowered yourself back down to the starting position, repeat the exercise for the prescribed amount of repetitions in your program.');
INSERT INTO instructions (id, instruction) VALUES ('63996375-ef6a-4908-abb1-fc826e9ab242', 'Put a barbell in front of you on the ground and grab it using a pronated (palms facing down) grip that a little wider than shoulder width. Tip: Depending on the weight used, you may need wrist wraps to perform the exercise and also a raised platform in order to allow for better range of motion.');
INSERT INTO instructions (id, instruction) VALUES ('e6d6a2b6-c793-41dd-9615-45e00e8d0432', 'Bend the knees slightly and keep the shins vertical, hips back and back straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('559da44b-a021-403f-b12f-b47dca995111', 'Keeping your back and arms completely straight at all times, use your hips to lift the bar as you exhale. Tip: The movement should not be fast but steady and under control.');
INSERT INTO instructions (id, instruction) VALUES ('d86d0cbe-61d9-4e74-9c72-aa20b8b0de7b', 'Once you are standing completely straight up, lower the bar by pushing the hips back, only slightly bending the knees, unlike when squatting. Tip: Take a deep breath at the start of the movement and keep your chest up. Hold your breath as you lower and exhale as you complete the movement.');
INSERT INTO instructions (id, instruction) VALUES ('82694e2c-262a-400a-bfa9-0752bad59a25', 'Begin standing while holding a bar at arm''s length in front of you. You can stand on a raised platform to increase the range of motion.');
INSERT INTO instructions (id, instruction) VALUES ('8523fce1-c04a-40cc-b189-d9b26a8225ff', 'Begin by flexing the knees slightly, and then flex at the hip, moving your butt back as far as possible, lowering the torso as far as flexibility allows. The back should remain in absolute extension at all times, and the bar should remain in contact with the legs. If done properly, there should be heavy tension felt in the hamstrings.');
INSERT INTO instructions (id, instruction) VALUES ('8c452bf1-8e41-4b4a-878d-035ab0a0b3f0', 'Reverse the motion to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('63226ffd-489e-4759-b1f8-eabe62a1b473', 'Grab the rope with both hands above your head. Pull down on the rope as you take a small jump.');
INSERT INTO instructions (id, instruction) VALUES ('31eb273f-ff42-4281-9637-508a86687fa0', 'Wrap the rope around one leg, using your feet to pinch the rope. Reach up as high as possible with your arms, gripping the rope tightly.');
INSERT INTO instructions (id, instruction) VALUES ('86dec2f6-5747-4f12-9a45-9b83bec4882a', 'Release the rope from your feet as you pull yourself up with your arms, bringing your knees towards your chest.');
INSERT INTO instructions (id, instruction) VALUES ('d53c00ad-0a9c-4ac2-899d-038595fd57b5', 'Resecure your feet on the rope, and then stand up to take another high hold on the rope. Continue until you reach the top of the rope.');
INSERT INTO instructions (id, instruction) VALUES ('c47afbe3-4b70-4bb0-bddd-85fc9c296d44', 'To lower yourself, loosen the grip of your feet on the rope as you slide down using a hand over hand motion.');
INSERT INTO instructions (id, instruction) VALUES ('86aac1e3-4cb5-42cb-a623-313305d8f988', 'Kneel 1-2 feet in front of a cable system with a rope attached.');
INSERT INTO instructions (id, instruction) VALUES ('d16b5c80-df55-400a-83b2-d3653f5d235e', 'After selecting an appropriate weight, grasp the rope with both hands reaching overhead. Your torso should be upright in the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('edbb962b-3e02-4960-9f08-59612c2a10a4', 'To begin, flex at the spine, attempting to bring your rib cage to your legs as you pull the cable down.');
INSERT INTO instructions (id, instruction) VALUES ('2861c123-44fe-4a85-a3a3-194339609f79', 'Pause at the bottom of the motion, and then slowly return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3547fee7-764e-4ba6-971e-e135c02188cb', 'These can be done with twists or to the side to hit the obliques.');
INSERT INTO instructions (id, instruction) VALUES ('6428aec6-094c-4206-8455-4334fb1d4979', 'Hold an end of the rope in each hand. Position the rope behind you on the ground. Raise your arms up and turn the rope over your head bringing it down in front of you. When it reaches the ground, jump over it. Find a good turning pace that can be maintained. Different speeds and techniques can be used to introduce variation.');
INSERT INTO instructions (id, instruction) VALUES ('e5fce15a-23e0-4cc8-b790-f9293c07b0fd', 'Rope jumping is exciting, challenges your coordination, and requires a lot of energy. A 150 lb person will burn about 350 calories jumping rope for 30 minutes, compared to over 450 calories running.');
INSERT INTO instructions (id, instruction) VALUES ('6cfd254b-cad4-40a1-b3c3-928bf891a039', 'Attach a rope to a high pulley and make your weight selection. Stand a couple feet back from the pulley with your feet staggered and take the rope with both hands. Lean forward from the hip, keeping your back straight, with your arms extended up in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('56198b54-5106-48ec-80ce-8218f08df8b8', 'Keeping your arms straight, extend the shoulder to pull the rope down to your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('ac6d9395-ac0a-4556-91cb-7d9ee4bdcebc', 'Pause at the bottom of the motion, squeezing your lats.');
INSERT INTO instructions (id, instruction) VALUES ('11a8e175-d58b-4167-9f55-02fbe2d194d7', 'Return to the starting position without allowing the weight to fully rest on the stack.');
INSERT INTO instructions (id, instruction) VALUES ('995298eb-de23-4f86-a945-128883c331fd', 'Stand up straight with your legs together, holding a bodybar or broomstick.');
INSERT INTO instructions (id, instruction) VALUES ('019a0726-949d-406f-a1e1-042ffb5f21cd', 'Hold the pole behind your hips with a wider than shoulder width grip. Your palms should be down and your thumbs facing out.');
INSERT INTO instructions (id, instruction) VALUES ('345df3d4-c9d0-4058-88d1-e1c9855a2ca4', 'Slowly lift your arms up behind your head. Don''t force it if it gets hard to lift further.');
INSERT INTO instructions (id, instruction) VALUES ('546e57bf-72e1-4d86-8bf6-f873f8fe1749', 'To begin, seat yourself on the rower. Make sure that your heels are resting comfortably against the base of the foot pedals and that the straps are secured. Select the program that you wish to use, if applicable. Sit up straight and bend forward at the hips.');
INSERT INTO instructions (id, instruction) VALUES ('fe8e2d91-a003-4b1c-92ed-d6fd261ccef1', 'There are three phases of movement when using a rower. The first phase is when you come forward on the rower. Your knees are bent and against your chest. Your upper body is leaning slightly forward while still maintaining good posture. Next, push against the foot pedals and extend your legs while bringing your hands to your upper abdominal area, squeezing your shoulders back as you do so. To avoid straining your back, use primarily your leg and hip muscles.');
INSERT INTO instructions (id, instruction) VALUES ('322b5069-3549-4632-a7b2-2450afafecbc', 'The recovery phase simply involves straightening your arms, bending the knees, and bringing your body forward again as you transition back into the first phase.');
INSERT INTO instructions (id, instruction) VALUES ('afde3e57-1020-4f4f-a572-728c1b920255', 'It''s easiest to get into this stretch if you start standing up, put one leg behind you, and slowly lower your torso down to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('98221560-4956-434c-8ca6-b356aa367fd6', 'Keep the front heel on the floor (if it lifts up, scoot your other leg further back).');
INSERT INTO instructions (id, instruction) VALUES ('b639a819-15d9-4f73-b74a-dd582941eab5', 'Place your hands on either side of your front leg. To get more out of this stretch, push your butt up toward the ceiling, and then gradually lower it back toward the floor. You''ll Stretch the hip flexor of the back leg and the hamstring and buttocks of the front.');
INSERT INTO instructions (id, instruction) VALUES ('0fccf22c-7e74-415f-8b18-9ca7b5b98aae', 'Treadmills offer convenience, cardiovascular benefits, and usually have less impact than running outside. A 150 lb person will burn over 450 calories running 8 miles per hour for 30 minutes. Maintain proper posture as you run, and only hold onto the handles when necessary, such as when dismounting or checking your heart rate.');
INSERT INTO instructions (id, instruction) VALUES ('5b38934e-6f85-445e-8474-ca97244073fa', 'Lie down on the floor placing your feet either under something that will not move or by having a partner hold them. Your legs should be bent at the knees.');
INSERT INTO instructions (id, instruction) VALUES ('4d93b8b2-9b18-4f3d-b0d5-f439178e1f3e', 'Elevate your upper body so that it creates an imaginary V-shape with your thighs. Your arms should be fully extended in front of you perpendicular to your torso and with the hands clasped. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bfab5965-26a1-46cb-9024-ab400b771224', 'Twist your torso to the right side until your arms are parallel with the floor while breathing out.');
INSERT INTO instructions (id, instruction) VALUES ('3744ac39-caab-435c-b2d6-b253e85e2928', 'Hold the contraction for a second and move back to the starting position while breathing out. Now move to the opposite side performing the same techniques you applied to the right side.');
INSERT INTO instructions (id, instruction) VALUES ('618c8ecd-ff07-4aed-bcc6-14c83a8ae731', 'To load sandbags or other objects, begin with the implements placed a distance from the loading platform, typically 50 feet.');
INSERT INTO instructions (id, instruction) VALUES ('11522bab-c79c-4bec-8bb3-bc5e7cadbcac', 'Begin by lifting the sandbag. Sandbags are extremely awkward, and the manner of lifting them can vary depending on the particular sandbag used. Reach as far around it as possible, extending through the hips and knees to pull it up high. Shouldering is usually not allowed.');
INSERT INTO instructions (id, instruction) VALUES ('db0d5a14-86d4-439d-9bd8-dc2a93f062ac', 'Move as quickly as possible to the platform, and load it, extending through your hips, knees, and ankles to get it as high as possible. Place it onto the platform, ensuring it doesn''t fall off.');
INSERT INTO instructions (id, instruction) VALUES ('e1e8600a-fc68-445c-8e2d-abb044aa7d9b', 'Return to the starting position to retrieve the next sandbag, and repeat until the event is completed.');
INSERT INTO instructions (id, instruction) VALUES ('bf060501-16de-4bc4-823a-2b44653ad08e', 'Take a pronated grip on a pull-up bar.');
INSERT INTO instructions (id, instruction) VALUES ('ce201ef4-cc69-4a58-9e8e-1af9be936f4c', 'From a hanging position, raise yourself a few inches without using your arms. Do this by depressing your shoulder girdle in a reverse shrugging motion.');
INSERT INTO instructions (id, instruction) VALUES ('ac1d5ba5-76d8-4f68-a6c7-141dfc5ab9a9', 'Pause at the completion of the movement, and then slowly return to the starting position before performing more repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('5a2ba4fd-b4d6-44d2-a501-3d3815ff4089', 'To begin, lie down with your back pressed against the floor or on an exercise mat (optional). Your arms should be fully extended to the sides with your palms facing down. Note: The arms should be stationary the entire time.');
INSERT INTO instructions (id, instruction) VALUES ('ffa76dcb-710a-4ce9-bc57-27b252f389ca', 'With a slight bend at the knees, lift your legs up so that your heels are about 6 inches off the ground. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('002478c9-d6ce-46f6-ac4a-adf737dced25', 'Now lift your left leg up to about a 45 degree angle while your right leg is lowered until the heel is about 2-3 inches from the ground.');
INSERT INTO instructions (id, instruction) VALUES ('87dc2e49-a350-4d3f-89d4-3f6aebf76f32', 'Switch movements by raising your right leg up and lowering your left leg. Remember to breathe while performing this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('ebe3118f-f5e7-49da-8904-4647bcfb618d', 'Assume a lunge stance position with one foot forward with the knee bent, and the rear knee nearly touching the ground.');
INSERT INTO instructions (id, instruction) VALUES ('0a03133d-0021-40a8-b6ba-ce45fe9e4c63', 'Ensure that the front knee is over the midline of the foot. Extending through both legs, jump as high as possible, swinging your arms to gain lift.');
INSERT INTO instructions (id, instruction) VALUES ('13acfd57-5e2f-4a5e-83b0-8b2f4112edae', 'As you jump as high as you can, switch the position of your legs, moving your front leg to the back and the rear leg to the front.');
INSERT INTO instructions (id, instruction) VALUES ('f7ba4149-c9ff-4392-93f0-5bf68c89df68', 'As you land, absorb the impact through the legs by adopting the lunge position, and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('4e55cdb6-9edd-487a-933f-38e64a1f9d6b', 'Secure a band close to the ground and place a bench a couple feet away from it.');
INSERT INTO instructions (id, instruction) VALUES ('4b231c26-3f74-4246-8e42-3a6d4e9ac134', 'Seat yourself on the bench and secure the band behind your ankles, beginning with your legs straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('275aa9ac-b9a2-4696-beb7-30c67c856564', 'Flex the knees, bringing your feet towards the bench. You may need to lean back slightly to keep your feet from striking the floor.');
INSERT INTO instructions (id, instruction) VALUES ('f3f80935-9fb1-4d7c-bb64-f7052560b1e9', 'Pause at the completion of the movement, and then slowly return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2ce345f7-a821-4375-85e2-f5dfb2e83e69', 'Sit on a Military Press Bench with a bar behind your head and either have a spotter give you the bar (better on the rotator cuff this way) or pick it up yourself carefully with a pronated grip (palms facing forward). Tip: Your grip should be wider than shoulder width and it should create a 90-degree angle between the forearm and the upper arm as the barbell goes down.');
INSERT INTO instructions (id, instruction) VALUES ('95034695-4a52-4273-9f4b-084b915e6cc8', 'Once you pick up the barbell with the correct grip length, lift the bar up over your head by locking your arms. Hold at about shoulder level and slightly in front of your head. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a1480216-0612-49c9-afa7-54c350626f2a', 'Lower the bar down to the collarbone slowly as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('1e3fa547-9a9d-4b28-baf1-5fc7439034ff', 'Start out by sitting at the end of a flat bench with a barbell placed on top of your thighs. Your feet should be shoulder width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('e093b4de-347a-44e9-803d-b7805349ad48', 'Grip the bar with your palms facing down and make sure your hands are wider than shoulder width apart from each other. Begin to lift the barbell up over your head until your arms are fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('c2bcb541-d17c-429d-9b5d-e39b9396074d', 'Now lower the barbell behind your head until it is resting along the base of your neck. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8de1ecea-e718-49cc-a429-e91efce6fca9', 'While keeping your feet and head stationary, move your waist from side to side so that your oblique muscles feel the contraction. Only move from side to side as far as your waist will allow you to go. Stretching or moving too far can cause an injury to occur. Tip: Use a slow and controlled motion.');
INSERT INTO instructions (id, instruction) VALUES ('e3147075-836a-4de7-ab51-b09f1edd3c8c', 'Remember to breathe out while twisting your body to the side and in when moving back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('be5d610f-e714-4005-9888-55127ab0aecc', 'Sit down at the end of a flat bench with a dumbbell in one arm using a neutral grip (palms of the hand facing you).');
INSERT INTO instructions (id, instruction) VALUES ('d940e4be-5683-41ba-a5bb-bad1903313e1', 'Bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Make sure that you keep the head up.');
INSERT INTO instructions (id, instruction) VALUES ('68499f1d-5617-46ca-9d36-15fcca154235', 'The upper arm with the dumbbell should be close to the torso and aligned with it (lifted up until it is parallel to the floor while the forearms are pointing towards the floor as the hands hold the weights). Tip: There should be a 90-degree angle between the forearms and the upper arm. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('966e935c-ad4e-4882-a9f8-bd738a303dfb', 'Keeping the upper arm stationary, use the triceps to lift the weight as you exhale until the forearm is parallel to the floor and the whole arm is extended. Like many other arm exercises, only the forearm moves.');
INSERT INTO instructions (id, instruction) VALUES ('0fbc89a2-e982-420e-9cd7-9f92ac2c0d66', 'After a second contraction at the top, slowly lower the dumbbell back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('c5ed2176-44b9-4011-bf9b-095cb3d44eed', 'Place a couple of dumbbells looking forward in front of a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('cb0a1088-28cc-46b1-9eee-b14a2eff2a6c', 'Sit on the end of the bench with your legs together and the dumbbells behind your calves.');
INSERT INTO instructions (id, instruction) VALUES ('97910dc2-e79c-4e24-a2f7-b13010dd5be8', 'Bend at the waist while keeping the back straight in order to pick up the dumbbells. The palms of your hands should be facing each other as you pick them. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('15c04a48-e057-47d8-9be6-68aba7695f59', 'Keeping your torso forward and stationary, and the arms slightly bent at the elbows, lift the dumbbells straight to the side until both arms are parallel to the floor. Exhale as you lift the weights. (Note: avoid swinging the torso or bringing the arms back as opposed to the side.)');
INSERT INTO instructions (id, instruction) VALUES ('26d84e50-0586-4d8e-9379-ba9f31da89dc', 'Sit down at the end of a flat bench with a dumbbell in both arms using a neutral grip (palms of the hand facing you).');
INSERT INTO instructions (id, instruction) VALUES ('8db35f38-0fec-4bf2-a3e7-7386ffce0d59', 'The upper arms with the dumbbells should be close to the torso and aligned with it (lifted up until they are parallel to the floor while the forearms are pointing towards the floor as the hands hold the weights). Tip: There should be a 90-degree angle between the forearms and the upper arm. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c468845d-fd06-4494-a7fc-45fdea71889a', 'Keeping the upper arms stationary, use the triceps to lift the weight as you exhale until the forearms are parallel to the floor and the whole arm is extended. Like many other arm exercises, only the forearm moves.');
INSERT INTO instructions (id, instruction) VALUES ('48cd4659-712f-4dfb-9db7-368bb84cab1d', 'After a second contraction at the top, slowly lower the dumbbells back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('5b16fbac-846c-4404-9cc5-7f6b4da89d18', 'Sit on the floor with your knees bent and your partner standing behind you. Extend your arms straight behind you with your palms facing each other. Your partner will hold your wrists for you. This will be the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e46e6200-bea9-45f7-be5e-68ed3e99a66c', 'Attempt to flex your elbows, while your partner prevents any actual movement.');
INSERT INTO instructions (id, instruction) VALUES ('9d6c90e9-9b34-4beb-8140-8c7d1df521df', 'After 10-20 seconds, relax your arms while your partner gently pulls your wrists up to stretch your biceps. Be sure to let your partner know when the stretch is appropriate to prevent injury or overstretching.');
INSERT INTO instructions (id, instruction) VALUES ('442e7123-f621-4edf-afa6-f9695a87c05c', 'For this exercise you will need access to a low pulley row machine with a V-bar. Note: The V-bar will enable you to have a neutral grip where the palms of your hands face each other. To get into the starting position, first sit down on the machine and place your feet on the front platform or crossbar provided making sure that your knees are slightly bent and not locked.');
INSERT INTO instructions (id, instruction) VALUES ('618b7798-935d-480f-a89e-c4813224d516', 'Adjust the weight to an appropriate amount and be seated, grasping the handles. Your upper arms should be about 90 degrees to the body, with your head and chest up. The elbows should also be bent to about 90 degrees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0cea281e-25ff-4bd7-bf9a-62d2d7f61ba6', 'Begin by extending through the elbow, pressing the handles together above your head.');
INSERT INTO instructions (id, instruction) VALUES ('e5f0f8d7-a292-47f8-9b20-c4a744fa85d8', 'After pausing at the top, return the handles to the starting position. Ensure that you maintain tension on the cables.');
INSERT INTO instructions (id, instruction) VALUES ('f4562963-cd21-47fa-9088-4a9f7e49071f', 'You can also execute this movement with your back off the pad and alternate hands.');
INSERT INTO instructions (id, instruction) VALUES ('8ebe9e8d-f50b-465d-8798-5ec33d2f7b0a', 'Sit on the machine and place your toes on the lower portion of the platform provided with the heels extending off. Choose the toe positioning of your choice (forward, in, or out) as per the beginning of this chapter.');
INSERT INTO instructions (id, instruction) VALUES ('805ff978-7584-45e4-b492-86d5eef6775f', 'Place your lower thighs under the lever pad, which will need to be adjusted according to the height of your thighs. Now place your hands on top of the lever pad in order to prevent it from slipping forward.');
INSERT INTO instructions (id, instruction) VALUES ('08590062-4beb-4e63-b9a7-3dba2dd24909', 'Lift the lever slightly by pushing your heels up and release the safety bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ea352fe4-712a-413e-a9d6-81ca142cbd16', 'Slowly lower your heels by bending at the ankles until the calves are fully stretched. Inhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('8f69d11d-bbda-4c05-a81e-c578ac1d57f6', 'Raise the heels by extending the ankles as high as possible as you contract the calves and breathe out. Hold the top contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('50e3a5b2-7d05-4e24-9702-116531378775', 'Sit up straight on an exercise mat.');
INSERT INTO instructions (id, instruction) VALUES ('8f3b59b5-97de-4d51-a3fa-6368788ee2d0', 'Bend one knee and put that foot on the floor to stabilize the torso.');
INSERT INTO instructions (id, instruction) VALUES ('3c9a38f9-98b1-4939-b2d0-4d00830d3049', 'Straighten your other leg and flex your ankle.');
INSERT INTO instructions (id, instruction) VALUES ('c4aafae8-ebce-4396-96db-5f827cf0e8bd', 'Using a band, towel, or your hand if you can reach, pull the toes toward you. Hold for 10 to 20 seconds, then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('e7fd769a-feca-4cc8-bcfe-f2df41813051', 'Sit down on a flat bench with a barbell or E-Z Bar in front of you in between your legs. Your legs should be spread with the knees bent and the feet on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('8939080d-f91d-42b7-9ebe-d192ab8ede29', 'Use your arms to pick the barbell up and place the back of your upper arms on top of your inner thighs (around three and a half inches away from the front of the knee). A supinated grip closer than shoulder width is needed to perform this exercise. Tip: Your arm should be extended at arms length and the barbell should be above the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('41613217-f893-4fda-8b99-1a09e7ed5b43', 'While holding the upper arms stationary, curl the weights forward while contracting the biceps as you breathe out. Only the forearms should move. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('29332e5c-7024-4b73-82bb-5fef8de00c76', 'Slowly begin to bring the barbell back to starting position as your breathe in. Tip: Avoid swinging motions at any time.');
INSERT INTO instructions (id, instruction) VALUES ('8e0904ce-9972-4199-a163-085f78484b25', 'Sit on a flat bench with a dumbbell on each hand being held at arms length. The elbows should be close to the torso.');
INSERT INTO instructions (id, instruction) VALUES ('2051f553-8315-46f3-836f-36fac72932ae', 'Rotate the palms of the hands so that they are facing your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9af28d56-9163-496c-97ca-888a06ae00e7', 'While holding the upper arm stationary, curl the weights and start twisting the wrists once the dumbbells pass your thighs so that the palms of your hands face forward at the end of the movement. Make sure that you contract the biceps as you breathe out and make sure that only the forearms move. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('f3fb98a8-2bdf-47e8-8cab-a1e1e5d4d83e', 'Slowly begin to bring the dumbbells back to the starting position as your breathe in and as you rotate the wrists back to a neutral grip.');
INSERT INTO instructions (id, instruction) VALUES ('d9becf3e-631a-434d-92af-42f00e131ab8', 'Sit on the end of a flat bench with a dumbbell in each hand being held at arms length. The elbows should be close to the torso.');
INSERT INTO instructions (id, instruction) VALUES ('5b11d493-b1cb-498c-ae1a-a66b72b80d75', 'Rotate the palms of the hands so that they are facing inward in a neutral position. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('00d95a76-533b-48a2-968f-11037b125724', 'While holding the upper arms stationary, curl the dumbbells out and up, turning the palms out as you lift and keeping your forearms in line with your outer deltoids. Tips:');
INSERT INTO instructions (id, instruction) VALUES ('db7e89e5-4b6b-4e2d-bca1-efdd1c331502', 'Only the forearms should move. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('0096b3cc-92dd-4860-94a9-df4dae4ddb4b', 'Slowly begin to bring the dumbbells back to the starting position as your breathe in. Remember to rotate your arms as you lower the dumbbells so that you can switch back to a neutral grip.');
INSERT INTO instructions (id, instruction) VALUES ('3e77ea45-2c3d-4852-a212-1a50092ab25b', 'Start out by placing two dumbbells on the floor in front of a flat bench.');
INSERT INTO instructions (id, instruction) VALUES ('f2ae52db-c9c2-4c89-b4f9-d6a5ec6ca49e', 'Sit down on the edge of the flat bench with your legs at about shoulder width apart. Make sure to keep your feet on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('0f7f4027-6480-4a3d-a01d-a4fd84c1fab2', 'Use your arms to grab both of the dumbbells and bring them up so that your forearms are resting against your thighs with the palms of the hands facing down. Your wrists should be hanging over the edge of your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('af98d6bf-fec1-4a20-afc5-1057be847d2f', 'Slowly lower your wrists back down to the starting position while inhaling. Make sure to inhale during this part of the exercise. Tip: Your forearms should be stationary as your wrist is the only movement needed to perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('3835ab19-2dbb-465a-ab8b-dce79dfe3624', 'When finished, simply lower the dumbbells to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('c4a77f57-8a19-477a-a77b-99e11c21780d', 'Use your arms to grab both of the dumbbells and bring them up so that your forearms are resting against your thighs with the palms of the hands facing up. Your wrists should be hanging over the edge of your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('0da8a1bc-6bd1-4400-a00f-1485e2cb9030', 'Grab a couple of dumbbells and sit on a military press bench or a utility bench that has a back support on it as you place the dumbbells upright on top of your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('2d81a5a6-8127-4259-9bba-ad130ec47db4', 'Clean the dumbbells up one at a time by using your thighs to bring the dumbbells up to shoulder height at each side.');
INSERT INTO instructions (id, instruction) VALUES ('5b525e9b-8226-45b3-91d2-b807d1f8e572', 'Rotate the wrists so that the palms of your hands are facing forward. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f9b1a7e6-41d7-4e7e-90b5-8f7fe9951d52', 'As you exhale, push the dumbbells up until they touch at the top.');
INSERT INTO instructions (id, instruction) VALUES ('d489bf9d-9c17-455b-a189-d32e2334e11d', 'Sit on a bench with the legs stretched out in front of you slightly below parallel and your arms holding on to the sides of the bench. Your torso should be leaning backwards around a 45-degree angle from the bench. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('71401205-066c-4f58-b02b-40379fa8f1e8', 'Bring the knees in toward you as you move your torso closer to them at the same time. Breathe out as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('082f9c49-d128-451e-bb83-e99fda254ec7', 'After a second pause, go back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('a766d69d-629b-4f39-8053-46e7f9526779', 'Sit on a mat with your right leg extended in front of you and your left leg bent with your foot against your right inner thigh.');
INSERT INTO instructions (id, instruction) VALUES ('35a5e3b8-a689-46f5-b71f-3b8212836696', 'Lean forward from your hips and reach for your ankle until you feel a stretch in your hamstring. Hold for 15 seconds, then repeat for your other side.');
INSERT INTO instructions (id, instruction) VALUES ('a214f5ee-5d09-4880-b548-23133f51a164', 'Sit upright on the floor with your legs bent, your partner standing behind you. Stick your arms straight out to your sides, with your palms facing the ground. Attempt to move them as far behind you as possible, as your assistant holds your wrists. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d01eca9c-b581-41a8-ae69-429b9d7d7e21', 'Keeping your elbows straight, attempt to move your arms to the front, with your partner gently restraining you to prevent any actual movement for 10-20 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('f330d21b-f553-41ec-a88b-4cab01955f48', 'Now, relax your muscles and allow your partner to gently increase the stretch on the shoulders and chest. Hold for 10 to 20 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('37b97310-401b-4bea-ab60-8af46ae4beea', 'In a seated position with your knees bent, cross one ankle over the opposite knee. Your partner will stand behind you. Now, lean forward as your partner braces your shoulders with their hands. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('83638089-7fbe-4c6f-8637-fe0733221d89', 'Attempt to push your torso back for 10-20 seconds, as your partner prevents any actual movement of your torso.');
INSERT INTO instructions (id, instruction) VALUES ('db510e50-6c34-4c93-9e01-7704ac73e6ca', 'Now relax your muscles as your partner increases the stretch by gently pushing your torso forward for 10-20 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('57f387a2-cb37-48fa-b623-d1d51ea9ef0e', 'Set up a box in a power rack. The pins should be set at an appropriate height. Begin by stepping under the bar and placing it across the back of the shoulders, not on top of your traps. Squeeze your shoulder blades together and rotate your elbows forward, attempting to bend the bar across your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('4401837e-68ab-490b-846f-3c13a290a0fa', 'Remove the bar from the rack, creating a tight arch in your lower back. Keep your head facing forward. With your back, shoulders, and core tight, push your knees and butt out and you begin your descent. Sit back with your hips until you are seated on the box. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f9a0f04f-1386-4687-a701-0d49c8230f37', 'Keeping the bar tight, bend forward at the hips as much as possible. If you set the pins to what would be parallel, you not only have a safety if you fail, but know when to stop.');
INSERT INTO instructions (id, instruction) VALUES ('5cf0992f-4eda-40b1-acec-fcf02bd58954', 'Pause just above the pins and reverse the motion until your torso it upright.');
INSERT INTO instructions (id, instruction) VALUES ('998f0620-8aec-4f53-bb14-0b81f6e2516b', 'In a seated position with your legs extended, have your partner stand behind you. Now, lean forward as your partner braces your shoulders with their hands. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4cbd030f-4053-49f3-b0f3-8d721206c052', 'Loop a belt, rope, or band around one foot. Sit down with both legs extended . This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9515b36b-2b2d-4bb5-aa41-d5bcbe0ed833', 'Leaning forward slightly, pull on the belt to draw the toes of your foot back. Hold this position for 10-20 seconds and then repeat with the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('cfb4644f-2b12-4cb4-ad9c-4313f48a385d', 'Place a neck strap on the floor at the end of a flat bench. Once you have selected the weights, sit at the end of the flat bench with your feet wider than shoulder width apart from each other. Your toes should be pointed out.');
INSERT INTO instructions (id, instruction) VALUES ('1ead3207-38b0-4b0c-8e13-66e2358d29a8', 'Slowly move your torso forward until it is almost parallel with the floor. Using both hands, securely position the neck strap around your head. Tip: Make sure the weights are still lying on the floor to prevent any strain on the neck. Now grab the weight with both hands while elevating your torso back until it is almost perpendicular to the floor. Note: Your head and torso needs to be slightly tilted forward to perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('79311ac7-1c0b-4f17-b4bb-317ba686bf91', 'Now place both hands on top of your knees. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ea7791c7-7559-4c3e-bad2-9c26e053c654', 'Slowly lower your neck down until your chin touches the upper part of your chest while breathing in.');
INSERT INTO instructions (id, instruction) VALUES ('a5c2a90e-f359-445d-bf11-63b77d52681a', 'While exhaling, bring your neck back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6786e57a-d10b-42d1-9161-4399cd54f484', 'Adjust the machine lever to fit your height and sit on the machine with your back against the back support pad.');
INSERT INTO instructions (id, instruction) VALUES ('57238618-bcee-42c3-bd0b-01f336aa3549', 'Place the back of lower leg on top of padded lever (just a few inches under the calves) and secure the lap pad against your thighs, just above the knees. Then grasp the side handles on the machine as you point your toes straight (or you can also use any of the other two stances) and ensure that the legs are fully straight right in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('663b5b1a-b341-4ef0-9d62-641cd6896355', 'As you exhale, pull the machine lever as far as possible to the back of your thighs by flexing at the knees. Keep your torso stationary at all times. Hold the contracted position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('e2953d51-9b7b-49e7-b7ae-c71a509cdb1b', 'Sit on a flat bench with a dumbbell in your right hand.');
INSERT INTO instructions (id, instruction) VALUES ('ae2b1379-1565-43ab-995d-b0226065e13a', 'Place your feet flat on the floor, at a distance that is slightly wider than shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('94914e9d-7667-417a-837e-f0fc5e1147d0', 'Lean forward and place your right forearm on top of your upper right thigh with your palm down. Tip: Make sure that the back of the wrist lies on top of your knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('71a9fb78-2647-4af3-850e-26b66c119603', 'Lower the dumbbell as far as possible as you keep a tight grip on the dumbbell. Inhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('702f06f7-43b6-4ea6-8bdb-5926e03e950d', 'Now curl the dumbbell as high as possible as you contract the forearms and as you exhale. Keep the contraction for a second before you lower again. Tip: The only movement should happen at the wrist.');
INSERT INTO instructions (id, instruction) VALUES ('07288c04-6da9-4469-8b58-7540358fb4c8', 'Perform for the recommended amount of repetitions, switch arms and repeat the movement.');
INSERT INTO instructions (id, instruction) VALUES ('fac3d3e2-9114-4852-aff1-b42ee61c9644', 'Lean forward and place your right forearm on top of your upper right thigh with your palm up. Tip: Make sure that the front of the wrist lies on top of your knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b1bd22e8-dab8-416b-b4fc-092d62c3eb56', 'To get into the starting position, first sit down on the machine and place your feet on the front platform or crossbar provided making sure that your knees are slightly bent and not locked.');
INSERT INTO instructions (id, instruction) VALUES ('e0318559-47b9-40d1-832a-ea09ee2dfa4a', 'Lean over as you keep the natural alignment of your back and grab the single handle attachment with your left arm using a palms-down grip.');
INSERT INTO instructions (id, instruction) VALUES ('63206623-1957-4326-ad37-7e6c868d0c2f', 'With your arm extended pull back until your torso is at a 90-degree angle from your legs. Your back should be slightly arched and your chest should be sticking out. You should be feeling a nice stretch on your lat as you hold the bar in front of you. The right arm can be kept by the waist. This is the starting position of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('60aaeb4f-79f6-4fc4-b691-c6c07a0934ce', 'Keeping the torso stationary, pull the handles back towards your torso while keeping the arms close to it as you rotate the wrist, so that by the time your hand is by your abdominals it is in a neutral position (palms facing the torso). Breathe out as you perform that movement. At that point you should be squeezing your back muscles hard.');
INSERT INTO instructions (id, instruction) VALUES ('474c55ac-4581-42ba-ae28-63d50c71fed9', 'Hold that contraction for a second and slowly go back to the original position while breathing in. Tip: Remember to rotate the wrist as you go back to the starting position so that the palms are facing down again.');
INSERT INTO instructions (id, instruction) VALUES ('db7793ad-3ddd-48aa-9e84-e12b1641f2cc', 'Repeat for the recommended amount of repetitions and then perform the same movement with the right hand.');
INSERT INTO instructions (id, instruction) VALUES ('15269dd1-381a-4846-91aa-0dceaf8802fb', 'Touch the soles of your feet together with your feet six to eight inches in front of your hips.');
INSERT INTO instructions (id, instruction) VALUES ('a649a423-ee23-414a-ac8d-9b99296cd654', 'Place one hand on the floor beside you and your other hand behind your head.');
INSERT INTO instructions (id, instruction) VALUES ('0f176830-9cdc-4f49-bbff-66ea210ef37a', 'Lift your elbow to the ceiling as you incline your torso to the other side. Hold for 10 to 20 seconds, then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('e3e44c08-a84e-4940-8c8b-90d7fbe54e5f', 'Lean forward and place your forearms on top of your upper thighs with your palms up. Tip: Make sure that the front of the wrists lay on top of your knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fd422743-462e-4771-9e23-7064ec719f44', 'Lower the bar as far as possible while inhaling and keeping a tight grip.');
INSERT INTO instructions (id, instruction) VALUES ('e1419b70-0150-41e6-ba47-92043cb2a11e', 'Now curl bar up as high as possible while flexing the forearms and exhaling. Hold the contraction at the top for a second and Tip: Only the wrist should move.');
INSERT INTO instructions (id, instruction) VALUES ('fab96ae0-4f9e-4b63-9664-1460aba7adb2', 'Hold a barbell with both hands and your palms facing down; hands spaced about shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('f0f24306-3514-417a-8d06-ead50c2993b9', 'Lean forward and place your forearms on top of your upper thighs with your palms down. Tip: Make sure that the back of the wrists lay on top of your knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fc2c7cf2-7f1d-4ca3-a453-427fc99982d8', 'Pick a couple of dumbbells and sit at the end of a flat bench with your feet firmly on the floor. Hold the dumbbells with your palms facing in and your arms straight down at your sides at arms'' length. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7ed5f42a-dec0-4e10-a2f5-fa8a48bc1828', 'While maintaining the torso stationary (no swinging), lift the dumbbells to your side with a slight bend on the elbow and the hands slightly tilted forward as if pouring water in a glass. Continue to go up until you arms are parallel to the floor. Exhale as you execute this movement and pause for a second at the top.');
INSERT INTO instructions (id, instruction) VALUES ('39a50637-4e09-4795-a7e3-0ad3d0cf1006', 'Lower the dumbbells back down slowly to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('502049ea-5bc2-4fbc-b3f8-983f59280b0b', 'Sit down on a bench with back support and grasp a dumbbell with both hands and hold it overhead at arm''s length. Tip: a better way is to have somebody hand it to you especially if it is very heavy. The resistance should be resting in the palms of your hands with your thumbs around it. The palm of the hand should be facing inward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e7702446-3654-44ba-9b20-6cdab9526347', 'Keeping your upper arms close to your head (elbows in) and perpendicular to the floor, lower the resistance in a semi-circular motion behind your head until your forearms touch your biceps. Tip: The upper arms should remain stationary and only the forearms should move. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('780bfd15-cf4b-43d2-939c-92fb134f412a', 'Go back to the starting position by using the triceps to raise the dumbbell. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('07cb0551-840e-42f4-aa22-07d2e98f38fd', 'Put a bench in front of a low pulley machine that has a barbell or EZ Curl attachment on it.');
INSERT INTO instructions (id, instruction) VALUES ('22c7e135-2ff5-4059-961f-11ad1a242a27', 'Move the bench far enough away so that when you bring the handle to the top of your thighs tension is created on the cable due to the weight stack being moved up.');
INSERT INTO instructions (id, instruction) VALUES ('d8d78690-5917-4ffd-b6a7-505678d2f1fd', 'Now hold the handle with both hands, palms up, using a shoulder-width grip.');
INSERT INTO instructions (id, instruction) VALUES ('4a76e536-00ac-40b3-8916-72fcf7f3cf55', 'Step back and sit on the bench with your feet about shoulder width apart, firmly on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('691308d3-3559-4651-aa34-501821848fd8', 'Lean forward and place the forearms on your thighs with the back of your wrists over your knees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9144842f-64cd-4f82-8b89-4ec0d1309798', 'Lower the bar as far as possible, while inhaling and keeping a tight grip.');
INSERT INTO instructions (id, instruction) VALUES ('22cc477c-8876-48b4-9f75-198e2a4e66e6', 'Now curl the bar up as high as possible while contracting the forearms. Tip: Only the wrist should move; not the forearms.');
INSERT INTO instructions (id, instruction) VALUES ('ab00d798-f88f-4547-8431-f57200f4f712', 'After a second contraction at the top go back to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('4134b90e-28ee-4fdd-a81a-1e0d5bd222bd', 'Grab a dumbbell with each hand and stand up erect.');
INSERT INTO instructions (id, instruction) VALUES ('59f0975e-d3fd-4929-8ea0-1ac9ae4ef773', 'Clean (lift) the dumbbells to the chest/shoulder level and then rotate your wrists so that your palms are facing towards you as if you were getting ready to perform an Arnold Press. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('134f412b-269f-4be9-bcf5-3e66cef35ce1', 'Now start extending your left arm overhead as you rotate the wrist so that the palm of your hand faces forward as you go up. Your elbows should come out also as you lift the weight. Simultaneously, you will also be bending from your hip to your opposite side. Tip: If you perform the exercise correctly, is should look as if you are trying to reach for something overhead on the right hand side of your body, but with your left arm. Breathe out as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('0a49079d-a470-434f-837d-2c461f26de5d', 'Once you reach the top position breathe in. Then, with the weight fully extended overhead and you bent over to your right hand side, begin the movement to the left side.');
INSERT INTO instructions (id, instruction) VALUES ('5b99ebca-6f80-47a5-b929-08bff875ace7', 'Attach a single handle to a low cable.');
INSERT INTO instructions (id, instruction) VALUES ('6319623b-eaae-45ac-a734-252222acf430', 'After selecting the correct weight, stand a couple feet back with a wide-split stance. Your arm should be extended and your shoulder forward. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('31f5f03c-fe6a-4e55-a27a-1ecd3f71217a', 'Perform the movement by retracting the shoulder and flexing the elbow. As you pull, supinate the wrist, turning the palm upward as you go.');
INSERT INTO instructions (id, instruction) VALUES ('548e1c1a-3696-44e6-ac78-9f4e42d890e2', 'With shoulders relaxed and arms resting loosely at your sides (or in your lap if you''re seated), gently roll your shoulders forward, up, back, and down.');
INSERT INTO instructions (id, instruction) VALUES ('2b54fef0-8885-4dd2-8c32-88953e239806', 'Reverse direction. You can do this exercise alternating shoulders or both at the same time.');
INSERT INTO instructions (id, instruction) VALUES ('57c9b235-255d-4dc7-b3db-a41034e5d361', 'To begin, stand on an exercise band so that tension begins at arm''s length. Grasp the handles and lift them so that the hands are at shoulder height at each side.');
INSERT INTO instructions (id, instruction) VALUES ('8b7683c7-9a5c-497a-ae7d-6eaf9548899c', 'Rotate the wrists so that the palms of your hands are facing forward. Your elbows should be bent, with the upper arms and forearms in line to the torso. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ee4b0567-7f25-4f06-8c09-2a6f8d1b6d82', 'As you exhale, lift the handles up until your arms are fully extended overhead.');
INSERT INTO instructions (id, instruction) VALUES ('d0875f7d-5771-49f4-ad5e-62db6d85f12f', 'Relax your arms to your sides and raise your shoulders up toward your ears, then back down.');
INSERT INTO instructions (id, instruction) VALUES ('13911a03-001a-4820-ae85-b4cff713215d', 'Reach your left arm across your body and hold it straight.');
INSERT INTO instructions (id, instruction) VALUES ('befc2c2f-36b3-4d85-b96e-922bd6b80591', 'First lie on your left side, bending your left knee in front of you to stabilize your torso (use your abdominal muscles as well to hold you upright).');
INSERT INTO instructions (id, instruction) VALUES ('d18aa954-1074-4cde-bc48-316191eabc75', 'Straighten your right leg and rest the right foot on the floor behind your left. Straighten your right arm over your head and gently pull on your right wrist to stretch the entire right side of the body. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('3a60f732-9a73-4f22-9306-3f029d5e990c', 'Stand to the side of a cone or hurdle.');
INSERT INTO instructions (id, instruction) VALUES ('e0381787-d5e3-4e50-9bb9-ab46633c74fb', 'Begin this drill by hopping sideways over the obstacle, rebounding out of your landing to hop back to where you started.');
INSERT INTO instructions (id, instruction) VALUES ('21faee18-92c4-44b9-8551-5bdf27f797b7', 'Hop for a prescribed number or repetitions as quickly as possible, and finish this drill by sprinting a short distance upon landing the last hop.');
INSERT INTO instructions (id, instruction) VALUES ('e3576e63-dc29-4b66-ada9-bca54a689c90', 'Pick a couple of dumbbells and stand with a straight torso and the dumbbells by your side at arms length with the palms of the hand facing you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('417dd913-9ebc-4df7-9bc5-47816c5e5243', 'While maintaining the torso in a stationary position (no swinging), lift the dumbbells to your side with a slight bend on the elbow and the hands slightly tilted forward as if pouring water in a glass. Continue to go up until you arms are parallel to the floor. Exhale as you execute this movement and pause for a second at the top.');
INSERT INTO instructions (id, instruction) VALUES ('c07c0a1f-29f5-4e6b-ac20-a4b113dc8c3d', 'In a standing position, hold a pair of dumbbells at your side. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1753860e-5cdb-4b79-9413-9fe4e215ce08', 'At the top of the exercise move the weights out in front of you, keeping your arms extended.');
INSERT INTO instructions (id, instruction) VALUES ('a9de72e9-a5ea-4111-8af1-9806027b0cef', 'Lower the weights with a controlled motion.');
INSERT INTO instructions (id, instruction) VALUES ('e625d933-120c-4722-8851-55758986fa14', 'On the next repetition, raise the weights in front of you to shoulder height before moving the weights laterally to your sides.');
INSERT INTO instructions (id, instruction) VALUES ('12f172b1-69c1-452c-bb2b-d347d013060a', 'Lower the weights to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('58ead47d-21fe-4b81-a1d7-4373e3766082', 'Stand next to a chair, which you may hold onto as a support. Stand on one leg. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8925052b-ee37-4bb7-8ca5-351d539bebe4', 'Keeping your leg straight, raise it as far out to the side as possible, and swing it back down, allowing it to cross the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('bc8df9ba-47ab-48a4-b1ad-281540236584', 'Repeat this swinging motion 5-10 times, increasing the range of motion as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('4e85a57e-2562-4b5f-a7f4-6cf6e9462c3e', 'Start off by lying on your right side and bend your right knee in front of you to stabilize the torso.');
INSERT INTO instructions (id, instruction) VALUES ('5a623b4e-4f65-4600-bc0f-1abc50b5ba62', 'Rest your head on your right hand or shoulder. Lift your left leg upward and hold it by the back of the knee (easier) or the foot (harder).');
INSERT INTO instructions (id, instruction) VALUES ('ee8bc2ea-2ef0-4c3f-a2cd-305dece843d4', 'Pull your left knee in toward your left shoulder and simultaneously press your foot or knee down to the floor. To intensify this stretch, straighten your left leg. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('62cdf6ef-fc03-4850-aaec-48695072707b', 'Start with your shoulders relaxed, gently tilt your head towards your shoulder.');
INSERT INTO instructions (id, instruction) VALUES ('4efeeaca-1a81-43e3-9db3-55af4eb8f984', 'Assist stretch with a gentle pull on the side of the head.');
INSERT INTO instructions (id, instruction) VALUES ('2dff9cff-a6d1-43d9-80d6-60d3f0998947', 'Begin standing with your feet hip width apart in an athletic stance. Your head and chest should be up, knees and hips slightly bent. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ff258c54-558f-43fa-9035-ea93672008cc', 'Leaning to your right, extend through your hips, knees, and ankles to jump into the air. Block with the arms to lead the movement, jumping as far to your right as you can.');
INSERT INTO instructions (id, instruction) VALUES ('bc996679-76f5-44e2-be45-c2bec6129075', 'Land facing the same direction with your feet hip width apart, absorbing the impact through your lower body.');
INSERT INTO instructions (id, instruction) VALUES ('72bc7b13-954f-4093-a84d-6b0faf83feee', 'As you have both arms extended in front of you holding the bar at a wide grip, bring your torso back around 30 degrees or so while creating a curvature on your lower back and sticking your chest out. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('48b2d8d3-9cf6-41bf-aef0-9cb5563b6c8e', 'Pull your torso up while leaning to the left hand side until the bar almost touches your upper chest by drawing the shoulders and the upper arms down and back. Exhale as you perform this portion of the movement. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary as it moves through space (no swinging) and only the arms should move. The forearms should do no other work other than hold the bar.');
INSERT INTO instructions (id, instruction) VALUES ('88bac72b-a2fe-4379-b8ff-193309d6454b', 'After a second of contraction, inhale as you go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('47df66d4-08b8-4dcf-a081-e4d2df907dea', 'Now, pull your torso up while leaning to the right hand side until the bar almost touches your upper chest by drawing the shoulders and the upper arms down and back. Exhale as you perform this portion of the movement. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary as it moves through space and only the arms should move. The forearms should do no other work other than hold the bar.');
INSERT INTO instructions (id, instruction) VALUES ('f227584b-0740-4058-8496-2797292657e7', 'Repeat steps 3-6 until you have performed the prescribed amount of repetitions for each side.');
INSERT INTO instructions (id, instruction) VALUES ('a417c5a5-b63d-438a-a1a4-4218a9d0b98d', 'This stretch works best standing. Cross your left arm over the midline of your body and hold the left wrist in your right hand down at the level of your hips. Start the stretch with a bent left arm.');
INSERT INTO instructions (id, instruction) VALUES ('6f61a9a3-f6f9-4a4a-8891-106387950db9', 'Slowly straighten, pull, and lift it up to shoulder height, as pictured. Feel this stretch originate in your back, not your shoulders, and don''t pull too hard on the shoulders joint. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('aaf643cb-23f7-4061-8c96-d05fc0a958f7', 'Stand to one side of the box with your left foot resting on the middle of it.');
INSERT INTO instructions (id, instruction) VALUES ('a5e0539f-50eb-45c8-945a-a879633f9baf', 'To begin, jump up and over to the other side of the box, landing with your right foot on top of the box and your left foot on the floor. Swing your arms to aid your movement.');
INSERT INTO instructions (id, instruction) VALUES ('7a9bc74b-b5e0-426e-9579-b9389e6ac54a', 'Continue shuffling back and forth across the box.');
INSERT INTO instructions (id, instruction) VALUES ('094b3da2-dbbc-4721-b3ba-52874e7e8132', 'Step forward in front of both pulleys with your arms extended in front of you, bringing your hands together. Your head and chest should be up as you lean forward, while your feet should be staggered. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ea332e6f-78e4-4959-b78c-3701b61db11c', 'Keeping your left arm in place, allow your right arm to extend out to the side, maintaining a slight bend at the elbow. The right arm should be perpendicular to the body at approximately shoulder level.');
INSERT INTO instructions (id, instruction) VALUES ('da34d121-7ce3-4848-9cc8-710dbb12c247', 'Return your arm back to the starting position by pulling your hand back to the midline of the body.');
INSERT INTO instructions (id, instruction) VALUES ('95e53778-4600-4fdd-8d5f-dab916f86ec3', 'Hold for a second at the starting position and repeat the movement on the opposite side. Continue alternating back and forth for the prescribed number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('94042b20-97c0-49d1-94e1-52b5d3078f30', 'Raise the bar from the floor, taking it to your shoulders with one or both hands. Adopt a wide stance. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('518f73c4-cc27-44f0-b40c-155a057b55a8', 'Perform the movement by extending the elbow, pressing the weight up. Move explosively, extending the hips and knees fully to produce maximal force.');
INSERT INTO instructions (id, instruction) VALUES ('169c2038-2b52-4a81-ba47-49174498602d', 'Begin laying prone on the ground. Move yourself into a position supporting your weight on your toes and one arm. Your working arm should be placed directly under the shoulder, fully extended. Your legs should be extended, and for this movement you may need a wider base, placing your feet further apart than in a normal push-up.');
INSERT INTO instructions (id, instruction) VALUES ('c7b54196-bdcd-45c0-9c42-6c6ef29d11ba', 'Maintain good posture, and place your free hand behind your back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3d9d6338-4b1c-422e-81fb-ef46789d679f', 'Lower yourself by allowing the elbow to flex until you touch the ground.');
INSERT INTO instructions (id, instruction) VALUES ('eb0af4cd-98c0-42bb-b4c8-1acf85436894', 'Descend slowly, and reverse direction be extending the arm to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('faa0705e-a601-4643-a774-161ff89ccec2', 'This drill teaches quick foot action. You need a single cone. Begin standing next to the cone with one arm back and one arm forward.');
INSERT INTO instructions (id, instruction) VALUES ('2670b3a0-dbf4-477f-bc45-43427172fd20', 'Chop the feet as quickly as possible, blocking with the arms. Circle the cone, keep your knees up, with violent foot action.');
INSERT INTO instructions (id, instruction) VALUES ('6e9bab90-9237-460b-ad92-6ba3c2e88231', 'Rest after three trips around the cone.');
INSERT INTO instructions (id, instruction) VALUES ('631c77a9-dbb3-4f9e-8a20-d3981b71b8c5', 'Position a box in a rack. Secure a band or rope in place above the box.');
INSERT INTO instructions (id, instruction) VALUES ('a688b257-bd97-4a6b-9bea-e022a246f3d6', 'Standing in front of it, step onto the box to a full standing position, letting your other leg remain unsupported. Hold onto the band for balance');
INSERT INTO instructions (id, instruction) VALUES ('4a9ecac4-ac90-4a1a-8ed1-8e72956142e2', '. Continue stepping up and down on the same leg before switching to the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('e8454726-b234-41a6-bb08-346f2503200d', 'Arrange a line of cones in front of you. Assume a relaxed standing position, balanced on one leg. Raise the knee of your opposite leg. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2f157f5a-bd58-48ed-8013-723c6a24fc59', 'Hop forward, jumping and landing with the same leg over the cone.');
INSERT INTO instructions (id, instruction) VALUES ('7adec0ec-5c1e-487e-9bc7-842233a7b28a', 'Use a countermovement jump to hop from cone to cone.');
INSERT INTO instructions (id, instruction) VALUES ('09fde912-326a-4bf0-9311-e7e630cd5fdf', 'At the end, turn around and go back on the other leg.');
INSERT INTO instructions (id, instruction) VALUES ('9ebc61bd-fdd6-4cf9-b90b-0c223f66e428', 'Stand to the side of a cone or hurdle. To get into the start position, stand on one leg with your knee slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('5fe31e11-5a5d-405e-86f5-57ee526d9190', 'To begin, execute a counterjump to hop sideways over the cone.');
INSERT INTO instructions (id, instruction) VALUES ('c5a2cd68-c040-4c14-9c50-b222eb1c520a', 'Land on your jumping leg, and immediately rebound out of it by jumping back to the start position.');
INSERT INTO instructions (id, instruction) VALUES ('3e2ff92c-514d-43e0-96a8-8b9092acdf9c', 'Continue hopping back and forth.');
INSERT INTO instructions (id, instruction) VALUES ('e18a0b56-ebaf-47ad-a2c2-8426720308e3', 'Seat yourself in the machine and adjust it so that you are positioned properly. The pad should be against the lower part of the shin but not in contact with the ankle. Adjust the seat so that the pivot point is in line with your knee. Select a weight appropriate for your abilities.');
INSERT INTO instructions (id, instruction) VALUES ('2e77677f-00a2-4d60-9618-c276e81fab86', 'Maintaining good posture, fully extend one leg, pausing at the top of the motion.');
INSERT INTO instructions (id, instruction) VALUES ('5022a160-d67c-42a4-ba65-3a6681807114', 'Return to the starting position without letting the weight stop, keeping tension on the muscle.');
INSERT INTO instructions (id, instruction) VALUES ('c5f2a3d9-8c3e-45ef-8fbf-5293b4c37833', 'Stand to the side of a box with your inside foot on top of it, close to the edge.');
INSERT INTO instructions (id, instruction) VALUES ('7e6f3965-3df0-48d3-98ef-8c1740785fa1', 'Begin by swinging the arms upward as you push through the top leg, jumping upward as high as possible. Attempt to drive the opposite knee upward.');
INSERT INTO instructions (id, instruction) VALUES ('5a81c1c7-dcd7-44ee-b18c-7fe07191ecdb', 'Land in the same position that you started, using your inside leg to decelerate the impact.');
INSERT INTO instructions (id, instruction) VALUES ('f10df2d8-ec0e-48ab-8be6-89d715809ebd', 'With a wide stance, hold a dumbell with both hands, grasping the head of the dumbbell instead of the handle. Your arms should be extended and hanging at the waist. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c8ea0a74-70f2-4dd7-a74b-e81adcc8cbd8', 'Raise the weight until it is above shoulder level, keeping your arms extended. Your torso and hips should remain stationary throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('23c5d548-d55b-49f1-be61-4778f5671313', 'Return to the starting position and repeat for the recommended amount of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('d78793ba-1a20-4e0c-8c6c-f27953560c7b', 'Begin by standing on one leg, with the bent knee raised. This will be your start position.');
INSERT INTO instructions (id, instruction) VALUES ('7c005172-1725-44b9-9a29-65cbed977e2e', 'Using a countermovement jump, take off upward by extending the hip, knee, and ankle of the grounded leg.');
INSERT INTO instructions (id, instruction) VALUES ('89a8fd5e-5c35-4690-9013-a964765b1d44', 'Immediately flex the knee and attempt to touch your butt with the heel of your jumping leg.');
INSERT INTO instructions (id, instruction) VALUES ('ef827298-b37c-46ba-8877-46d7f70345d2', 'Return the leg to a partially bent position underneath the hips and land. Your opposite leg should stay in relatively the same position throughout the drill.');
INSERT INTO instructions (id, instruction) VALUES ('2130d9fa-b97a-4dfe-beca-fe2a4bc02c00', 'Lay on the floor with your feet flat and knees bent.');
INSERT INTO instructions (id, instruction) VALUES ('d21ad605-08dc-409d-bc0e-264d2ad42e5f', 'Raise one leg off of the ground, pulling the knee to your chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c47f676e-2285-4678-ba7d-660299b80ea1', 'Execute the movement by driving through the heel, extending your hip upward and raising your glutes off of the ground.');
INSERT INTO instructions (id, instruction) VALUES ('dab531ab-9dab-4ade-b72a-899e4c6e89d2', 'Extend as far as possible, pause and then return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ab7ad812-7d92-4705-9942-34bf5ce29b44', 'Stand on the ground with one foot resting on the box, heel close to the edge.');
INSERT INTO instructions (id, instruction) VALUES ('bc1d0047-9572-4fc5-905f-ba0cd40b9913', 'Push off with your foot on top of the box, trying to gain as much height as possible by extending through the hip and knee.');
INSERT INTO instructions (id, instruction) VALUES ('77005258-058a-49da-baf9-94a98024e5c3', 'Land with the same foot on top of the box, returning your other foot back to the start position.');
INSERT INTO instructions (id, instruction) VALUES ('ea723d6c-4c57-4752-aa06-d4b43ee7b63f', 'Place your hands behind your head and lock them together by clasping your fingers. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6d15f51c-aac7-4a56-97ed-813c021eb758', 'Elevate your upper body so that it creates an imaginary V-shape with your thighs. Breathe out when performing this part of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('fb5c455b-39a8-482a-9421-5a9586d78a7c', 'Once you feel the contraction for a second, lower your upper body back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('538c16aa-037b-4954-a41b-86cf4d4d070b', 'Continue until you have squatted a portion of the way down, but are above parallel, and quickly reverse the motion until you return to the starting position. Repeat for 5-10 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('5cdeb500-4f9e-43f4-a6bd-474aac1fbd4d', 'Roller skating is a fun activity which can be effective in improving cardiorespiratory fitness and muscular endurance. It requires relatively good balance and coordination. It is necessary to learn the basics of skating including turning and stopping and to wear protective gear to avoid possible injury.');
INSERT INTO instructions (id, instruction) VALUES ('f8ac4722-3584-403d-a986-36d1ce174177', 'You can skate at a comfortable pace for 30 minutes straight. If you want a cardio challenge, do interval skating  speed skate two minutes of every five minutes, using the remaining three minutes to recover. A 150 lb person will typically burn about 175 calories in 30 minutes skating at a comfortable pace, similar to brisk walking.');
INSERT INTO instructions (id, instruction) VALUES ('3db1d5a9-1432-4d2c-a59f-8f653db2b254', 'To begin, load the sled with the desired weight and attach the pulling strap. You can pull with handles, use a harness, or attach the pulling strap to a weight belt.');
INSERT INTO instructions (id, instruction) VALUES ('8f866d6e-13e8-45a0-a8b3-20fe917c59fb', 'Whether pulling forwards or backwards, lean in the direction of travel and progress by extending through the hips and knees.');
INSERT INTO instructions (id, instruction) VALUES ('48eedb9d-de15-4389-b7d3-4761a80a2ee4', 'Attach dual handles to a sled connected by a rope or chain. Load the sled to a light weight.');
INSERT INTO instructions (id, instruction) VALUES ('dce7a1c2-2bbd-4d59-9d0f-375dcff40224', 'Face the sled, backing up until there is some tension in the line. Hold your hands directly above your head with your elbows extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a09dff67-e8b3-456a-8c93-79611da20920', 'Walk backwards, keeping your arms raised above your head. Avoid jerky movements.');
INSERT INTO instructions (id, instruction) VALUES ('1cabef5b-228e-4ad6-95d5-9532ccad0309', 'Attach dual handles to a sled using a chain or rope. Load the sled to an appropriate load.');
INSERT INTO instructions (id, instruction) VALUES ('03e7320e-777b-4999-92f6-e2a7b9d211e7', 'Facing away from the sled, step away until there is tension in the line. Raise your hands above your head, keeping them together, palms facing each other. Your elbows should be pointed upward with the elbows flexed. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a210c039-8a33-41c6-bec7-b2c2a4ca7217', 'Extend through the elbow to straighten the arm. Ensure that your upper arm stays in position to isolate the triceps.');
INSERT INTO instructions (id, instruction) VALUES ('9680f45c-f38c-4262-af29-9465d2f076e3', 'Upon full extension, step forward to take the slack out of the line. You may keep your feet staggered for more stability.');
INSERT INTO instructions (id, instruction) VALUES ('07d7e5b0-c996-4bb0-8e1a-c758d7ef7290', 'Load your pushing sled with the desired weight.');
INSERT INTO instructions (id, instruction) VALUES ('597b8abd-2e3c-406d-9613-e55dd196bf03', 'Take an athletic posture, leaning into the sled with your arms fully extended, grasping the handles. Push the sled as fast as possible, focusing on extending your hips and knees to strengthen your posterior chain.');
INSERT INTO instructions (id, instruction) VALUES ('0fab7836-42fe-4945-99a5-71f8847e9152', 'Face the sled, backing up until there is some tension in the line. Take both handles at arms length at about waist level. Bend the knees slightly and keep your chest and head up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3c6cf4da-e168-4502-b96b-ea7c69971ca0', 'Without flexing the elbow, pull the handles upward and apart, performing a reverse fly with some external rotation. Your palms should be facing forward as you do this.');
INSERT INTO instructions (id, instruction) VALUES ('3bdd52aa-7956-4770-9ddc-5521512cf5b7', 'Return to the starting position, taking a couple steps back to take the slack out of the line.');
INSERT INTO instructions (id, instruction) VALUES ('e94f32de-5da6-4945-9772-ddd1bdfddfdf', 'Attach dual handles to a sled connected by a rope or chain. Load the sled to an appropriate weight. Face the sled, backing up until there is some tension in the line.');
INSERT INTO instructions (id, instruction) VALUES ('7acf3a7a-62e3-496d-b64f-717f2d191a30', 'With a handle in each hand, bend the knees slightly, keep your head and chest up, and begin with your arms extended.');
INSERT INTO instructions (id, instruction) VALUES ('cec7e6bd-3e9f-4df8-b580-37019b1acc59', 'To initiate the movement, flex the elbow as you retract your shoulder blades, pulling the sled towards you.');
INSERT INTO instructions (id, instruction) VALUES ('7e05b5d8-d549-4c29-ab83-fb441e99da9c', 'Take a step or two back to get tension in the line and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('a811a6f0-054b-422d-b440-8eb4820cf27a', 'You will need a tire and a sledgehammer for this exercise. Stand in front of the tire about two feet away from it with a staggered stance. Grip the sledgehammer.');
INSERT INTO instructions (id, instruction) VALUES ('ba47b0e3-6f5b-46b0-b7a3-e31410403bfd', 'If you are right handed, your left hand should be at the bottom of the handle, and your right hand should be choking up closer to the head.');
INSERT INTO instructions (id, instruction) VALUES ('e0c5f220-6ea3-41db-9563-5c4164b9101f', 'As you bring the sledge up, your right hand slides toward the head; as you swing down, your right hand will slide down to join your left hand. Slam it down as hard as you can against the tire. Control the bounce of the hammer off of the tire.');
INSERT INTO instructions (id, instruction) VALUES ('c8afac03-d44b-4d4f-afea-61236387f58c', 'Repeat on the other side.');
INSERT INTO instructions (id, instruction) VALUES ('2045122d-e756-410d-8bdd-19a28936251c', 'Place an incline bench underneath the smith machine. Place the barbell at a height that you can reach when lying down and your arms are almost fully extended. Once the weight you need is selected, lie down on the incline bench and make sure your shoulders are aligned right under the barbell.');
INSERT INTO instructions (id, instruction) VALUES ('8928ede2-51f8-41bf-b74e-f4e6c7f8e72a', 'Using a shoulder width pronated (palms forward) grip, lift the bar from the rack and hold it straight over you with a slight bend at the elbows. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('67ae676b-6cd6-4da5-9b15-41f6069ca847', 'As you breathe out, lift the bar up until your arms are fully extended. Note: The contraction should be felt around the shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('4994882a-7f6c-47f8-9cf2-c476c2e43044', 'After a second pause, bring the bar back down to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('2b005a84-ee91-441d-879f-558ffc471760', 'With the bar at thigh level, load an appropriate weight.');
INSERT INTO instructions (id, instruction) VALUES ('45d4a3c7-5ee7-46bf-b66d-237765a3ee4b', 'Stand with the bar behind you, taking a shoulder-width, pronated grip on the bar and unhook the weight. You should be standing up straight with your head and chest up and your arms extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e2634e29-6c4f-477f-a02a-3dadb5dce1eb', 'Initiate the movement by shrugging your shoulders straight up. Do not flex the arms or wrist during the movement.');
INSERT INTO instructions (id, instruction) VALUES ('efc5dcf2-cffa-477f-b0ba-044ee6e904c0', 'After a brief pause return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('17ae7716-0d88-4374-b25d-e16f12ac9864', 'Repeat for the desired number of repetitions before engaging the hooks to rack the weight.');
INSERT INTO instructions (id, instruction) VALUES ('3e685967-0f28-42f2-be96-c3c1e4e3c8a5', 'Place a flat bench underneath the smith machine. Now place the barbell at a height that you can reach when lying down and your arms are almost fully extended. Once the weight you need is selected, lie down on the flat bench. Using a pronated grip that is wider than shoulder width, unlock the bar from the rack and hold it straight over you with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('06400a21-95c2-4eeb-a769-32228e408576', 'As you breathe in, come down slowly until you feel the bar on your middle chest.');
INSERT INTO instructions (id, instruction) VALUES ('7cb3c9d3-22a1-4b8e-98f4-e84835a414b2', 'After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles. Lock your arms in the contracted position, hold for a second and then start coming down slowly again. Tip: It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('8bcbae19-15d1-4196-868c-1f8d18048095', 'When you are done, lock the bar back in the rack.');
INSERT INTO instructions (id, instruction) VALUES ('0500b118-34da-428e-88d3-61a3a59d0537', 'Set the barbell attached to the smith machine to a height that is about 2 inches below your knees.');
INSERT INTO instructions (id, instruction) VALUES ('33b96bdd-4bf7-4ae9-a2df-650e92f93150', 'Bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Tip: Make sure that you keep the head up.');
INSERT INTO instructions (id, instruction) VALUES ('58ed0d35-d6ec-4132-bbd7-7a20698c047c', 'Now grasp the barbell using an overhand (pronated) grip and unlock it from the smith machine rack. Then let it hang directly in front of you as your arms hang extended perpendicular to the floor and your torso. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('382b227f-afe9-4d05-aa11-517723fdbe26', 'Place a block or weight plate below the bar on the Smith machine. Set the bar to a position that best matches your height. Once the correct height is chosen and the bar is loaded, step onto the plates with the balls of your feet and place the bar on the back of your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('cc4bfe5d-ef71-4fe8-94d7-053ab8b88590', 'Take the bar with both hands facing forward. Rotate the bar to unrack it. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('da82102a-3ea3-4e92-8fc6-b3ddc92d76b8', 'Raise your heels as high as possible by pushing off of the balls of your feet, flexing your calf at the top of the contraction. Your knees should remain extended. Hold the contracted position for a second before you start to go back down.');
INSERT INTO instructions (id, instruction) VALUES ('2b2ee33d-764e-485b-b6fc-85c1ad5678ab', 'Return slowly to the starting position as you breathe in while lowering your heels.');
INSERT INTO instructions (id, instruction) VALUES ('79841e32-9ff2-489b-9055-e09db8ca6df8', 'Place a flat bench underneath the smith machine. Place the barbell at a height that you can reach when lying down and your arms are almost fully extended. Once the weight you need is selected, lie down on the flat bench. Using a close and pronated grip (palms facing forward) that is around shoulder width, unlock the bar from the rack and hold it straight over you with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c4600b12-e8e2-45aa-a272-10af6a2458df', 'Position a decline bench in the rack so that the bar will be above your chest. Load an appropriate weight and take your place on the bench.');
INSERT INTO instructions (id, instruction) VALUES ('6bc70366-da4c-4391-8ad2-3cd78fe46027', 'Rotate the bar to unhook it from the rack and fully extend your arms. Your back should be slightly arched and your shoulder blades retracted. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('59db8226-5176-44ad-b01c-86dbdd5c6d34', 'Begin the movement by flexing your arms, lowering the bar to your chest.');
INSERT INTO instructions (id, instruction) VALUES ('b80790a7-ab1e-4256-80d4-af1bb82fce06', 'Pause briefly, and then extend your arms to push the weight back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1b2cb1ad-6b3c-46e5-86ac-11b7f6a581d3', 'After completing the desired number of repetitions, rotate the bar to rack the weight.');
INSERT INTO instructions (id, instruction) VALUES ('23751b23-66a6-4e9b-85e7-c9743929153c', 'Position the bar at knee height and load it to an appropriate weight.');
INSERT INTO instructions (id, instruction) VALUES ('b99d265d-f71d-46cd-8114-2f559d643eb5', 'Take a pronated grip on the bar outside of shoulder width and unhook the bar from the machine. Your arms should be fully extended with your head and chest up. Your elbows should be pointed out with your shoulders back and down. Your hips should be back, loading the tension into the hamstrings. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8a8a1633-2ae8-4486-99a9-134206bfe625', 'Initate the movement by forcefully extending the hips and knees, accelerating into the bar. Ensure that you keep your arms straight during this part of the motion.');
INSERT INTO instructions (id, instruction) VALUES ('ef21041c-f59e-4d93-9eb5-594e818fb269', 'Upon full extension, rebend the hips and knees to lower your receiving position.');
INSERT INTO instructions (id, instruction) VALUES ('569f1138-a183-435e-b4a6-72e60aba9145', 'Allow the arms to flex at this point, rotating the elbows around the bar to receive it on your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('a81ed415-0677-4e80-9a44-b34878ba8c0b', 'Extend through the hips and knees to come to a standing position with the bar racked on your shoulders to complete the movement.');
INSERT INTO instructions (id, instruction) VALUES ('112b4d45-6f6c-4247-b41e-351b912451b5', 'Position a bench in the rack and load the bar to an appropriate weight. Lie down on the bench, placing the bottom of your feet against the bar. Unlock the bar and extend your legs. You may need to use your hands to assist you. For added stability grasp the sides of the Smith Machine. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('319d4f6a-6b64-4fb3-81a9-53d8d6f2301a', 'Initiate the movement by rotating your pelvis, flexing your spine to raise your hips off of the bench. Maintain a slight bend in the knees throughout the motion.');
INSERT INTO instructions (id, instruction) VALUES ('d6b80391-1522-457e-827b-d8aa05a34f5b', 'After a brief pause, return the hips to the bench.');
INSERT INTO instructions (id, instruction) VALUES ('06999cfa-3873-46dc-9e02-9dd7b303c7b6', 'Place an incline bench underneath the smith machine. Place the barbell at a height that you can reach when lying down and your arms are almost fully extended. Once the weight you need is selected, lie down on the incline bench and make sure your upper chest is aligned with the barbell. Using a pronated grip (palms facing forward) that is wider than shoulder width, unlock the bar from the rack and hold it straight over you with your arms locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('81908100-e703-4e99-81e4-ac2abbaa9a8d', 'As you breathe in, come down slowly until you feel the bar on your upper chest.');
INSERT INTO instructions (id, instruction) VALUES ('f80858d8-c258-49a5-884a-33cce9de0b61', 'Position a Smith machine bar a couple feet off of the ground. Ensure that it is resting on the safeties. After loading the bar to an appropriate weight, lie underneath the bar. Place the middle of your feet on the bar, tucking your knees to your chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1d886f07-2907-49d5-b600-5c77be418835', 'Begin the movement by driving through your feet to move the bar upward, extending the hips and knees. Do not lock out your knees.');
INSERT INTO instructions (id, instruction) VALUES ('4fb58908-e63a-468a-b892-74b089b52205', 'At the top of the motion, pause briefly before returning to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('183446c5-51f0-4d97-97d1-2e02a88185f6', 'Take a wide grip on the bar and unhook the weight, removing your off hand from the bar. Your arm should be extended as you stand up straight with your head and chest up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('956a6410-3ac0-4720-9bf5-9e636deea57c', 'Begin the movement by flexing the elbow, raising the upper arm with the elbow pointed out. Continue until your upper arm is parallel to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('2b614b79-5d35-4d9d-9ce5-dd2085ea75b6', 'After a brief pause, return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3aca839d-7da0-4eb2-9286-2aa73c6def60', 'To begin, place a flat bench (or preferably one with back support) underneath a smith machine. Position the barbell at a height so that when seated on the flat bench, the arms must be almost fully extended to reach the barbell.');
INSERT INTO instructions (id, instruction) VALUES ('c83cc767-61fb-4727-9a67-9ef3493cc19c', 'Once you have the correct height, sit slightly in behind the barbell so that there is an imaginary straight line from the tip of your nose to the barbell. Your feet should be stationary. Grab the barbell with the palms facing forward, unlock it and lift it up so that your arms are fully extended. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d7fbc99a-491c-4a06-84a2-35323191fcc4', 'Slowly begin to lower the barbell until it is level with your chin while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('653489c0-9a34-4d16-ba5c-d99a03795cdf', 'Then lift the barbell back to the starting position using your shoulders while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('1425740c-b2a7-47f6-87dc-0eb247775a8b', 'To begin, first set the bar to a position that best matches your height. Step under it and position the bar across the back of your shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('14530ac3-a71d-4498-ac22-a19a1a02c984', 'Take the bar with your hands facing forward, unlock it and lift it off the rack by extending your legs. 3');
INSERT INTO instructions (id, instruction) VALUES ('4cfc295b-ceed-42d8-972d-6fbbb037ad9b', 'Move one foot forward about 12 inches in front of the bar. Extend the other leg out in front of you, holding it off the ground. Look forward at all times and maintain a neutral or slightly arched spine. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4c61a359-b7d6-49df-98c1-7b578d5b3bd8', 'Maintaining good posture, lower yourself by flexing the knee and hip, going down as far as flexibility allows.');
INSERT INTO instructions (id, instruction) VALUES ('bee7ab78-3885-43bc-8bdc-9c631f5b2dfb', 'Pause briefly at the bottom and then return to the starting position by driving through the heel of your foot, extending the knee and hip.');
INSERT INTO instructions (id, instruction) VALUES ('93b7617a-2d3b-4ada-a4a3-75db291ba441', 'Adjust the barbell on the smith machine to fit your height and align a raised platform right under the bar.');
INSERT INTO instructions (id, instruction) VALUES ('eba1e47c-9f28-4ebd-aee7-b5c614198380', 'Stand on the platform with the heels of your feet secured on top of it with the balls of your feet extending off it. Position your toes facing forward with a shoulder width stance.');
INSERT INTO instructions (id, instruction) VALUES ('9df12044-a5fe-4de7-8558-10354ce3e87a', 'Now, place your shoulders under the barbell while maintaining the foot positioning described and push the barbell up by extending your hips and knees until your torso is standing erect. The knees should be kept with a slight bend; never locked. This will be your starting position. Tip: The barbell on your back is only for balance purposes.');
INSERT INTO instructions (id, instruction) VALUES ('db3c2c28-be21-42dc-bd72-4edac8b57be4', 'Raise the balls of your feet as you breathe out by extending your toes as high as possible and flexing your calf. Ensure that the knee is kept stationary at all times. There should be no bending at any time. Hold the contracted position for a second before you start to go back down.');
INSERT INTO instructions (id, instruction) VALUES ('63990844-c634-4264-9242-9ad988570ea9', 'Slowly go back down to the starting position as you breathe in by lowering the balls of your feet and toes.');
INSERT INTO instructions (id, instruction) VALUES ('82b520c8-6ca1-4dba-9e2c-4cd0c2e53b72', 'To begin, first set the bar on the height that best matches your height. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('55cad8b0-e9ef-463a-a937-ef0f8aedef12', 'Hold on to the bar using both arms at each side (palms facing forward), unlock it and lift it off the rack by first pushing with your legs and at the same time straightening your torso.');
INSERT INTO instructions (id, instruction) VALUES ('a1248fc6-0773-4e88-b4cc-a0491c5aaf7d', 'Position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times and also maintain a straight back. This will be your starting position. (Note: For the purposes of this discussion we will use the medium stance which targets overall development; however you can choose any of the three stances discussed in the foot stances section).');
INSERT INTO instructions (id, instruction) VALUES ('a1eb7b7f-9a91-4a6f-afed-8b78ee86c839', 'To begin, set the bar on the smith machine to a height that is around the middle of your thighs. Once the correct height is chosen and the bar is loaded, grasp the bar using a pronated (palms forward) grip that is shoulder width apart. You may need some wrist wraps if using a significant amount of weight.');
INSERT INTO instructions (id, instruction) VALUES ('a72a05fb-a255-467e-a477-28c8920f4c7b', 'Lift the bar up by fully extending your arms while keeping your back straight. Stand with your torso straight and your legs spaced using a shoulder width or narrower stance. The knees should be slightly bent. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a1884992-7297-4861-8e20-244f1a6658d8', 'Keeping the knees stationary, lower the barbell to over the top of your feet by bending at the waist while keeping your back straight. Keep moving forward as if you were going to pick something from the floor until you feel a stretch on the hamstrings. Exhale as you perform this movement');
INSERT INTO instructions (id, instruction) VALUES ('fae7cd47-7f05-4853-b2d0-4a05083ab1b7', 'Start bringing your torso up straight again as soon as you feel the hamstrings stretch by extending your hips and waist until you are back at the starting position. Inhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('4a46661c-69df-4b32-a828-24f1548fdddc', 'Lift the barbell up and fully extend your arms with your back straight. There should be a slight bend at the elbows. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('85d4f442-22fa-45e6-a86f-100aa523339b', 'Use your side shoulders to lift the bar as you exhale. The bar should be close to the body as you move it up. Continue to lift it until it nearly touches your chin. Tip: Your elbows should drive the motion. As you lift the bar, your elbows should always be higher than your forearms. Also, keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('1004d54b-105e-48ea-b7f8-0358a4a06b70', 'Lower the bar back down slowly to the starting position. Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('e67c1d30-3e76-433d-9eb5-8b6b0041e3ac', 'To begin, place a flat bench 2-3 feet behind the smith machine. Then, set the bar on the height that best matches your height. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('535cf776-646f-42b6-b0db-802411213fa7', 'Position your legs by placing one foot slightly forward under the bar and extending your other leg back and place the top of your foot on the bench. This will be your starting position');
INSERT INTO instructions (id, instruction) VALUES ('771b0edb-bdf6-473e-ad5c-124260a02ac4', 'Begin to slowly lower the bar by bending the knee as you maintain a straight posture with the head up. Continue down until the angle between the upper leg and the calf becomes slightly less than 90-degrees (which is the point in which the upper legs are below parallel to the floor). Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knee should make an imaginary straight line with the toes that is perpendicular to the front. If your knee is past that imaginary line (if it is past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('c7e83252-e039-4b7a-8cfb-0302e998e8e6', 'Begin to raise the bar as you exhale by pushing the floor with the heel of your foot mainly as you straighten your leg again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6d590730-4783-4952-928e-1c5ce876f33a', 'Place your feet at a shoulder width stance with the barbell resting right above the connection between the toes and the rest of the foot.');
INSERT INTO instructions (id, instruction) VALUES ('c58a24b5-d94a-4a3f-9fea-665adde886a8', 'With a palms facing down grip, bend at the knees and keeping the back flat grab the bar using a wider than shoulder width grip. Bring the hips down and make sure that your body drops as if you were going to sit on a chair. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8d53829a-7f2e-428f-8901-ccc15913fdba', 'Start pushing the floor as if it were a moving platform with your feet and simultaneously start lifting the barbell keeping it close to your legs.');
INSERT INTO instructions (id, instruction) VALUES ('26a5a18c-6947-4577-a584-59dc8c120108', 'As the bar reaches the middle of your thighs, push the floor with your legs and lift your body to a complete extension in an explosive motion.');
INSERT INTO instructions (id, instruction) VALUES ('a1d4d970-3527-40c2-964b-3297de712bdf', 'Lift your shoulders back in a shrugging movement as you bring the bar up while lifting your elbows out to the side and keeping them above the bar for as long as possible.');
INSERT INTO instructions (id, instruction) VALUES ('0e8b038f-7f07-4bd4-af9e-49e9bbb27a0e', 'Now in a very quick but powerful motion, you have to get your body under the barbell when it has reached a high enough point where it can be controlled and drop while locking your arms and holding the barbell overhead as you assume a squat position.');
INSERT INTO instructions (id, instruction) VALUES ('61857b3d-2edb-4ba1-a843-3006cbd93f45', 'Finalize the movement by rising up out of the squat position to finish the lift. At the end of the lift both feet should be on line and the arms fully extended holding the barbell overhead.');
INSERT INTO instructions (id, instruction) VALUES ('0464de45-55e6-4616-a77e-b5240f74265c', 'Begin with the feet in the pulling position, the bar racked across the back of the shoulders, and the hands placed in a wide snatch grip.');
INSERT INTO instructions (id, instruction) VALUES ('6738d622-6935-4e5e-9569-14c6f57ca0a2', 'Pop the bar with an abrupt dip and drive of the knees, and aggressively drive under the bar, transitioning the feet into the receiving position.');
INSERT INTO instructions (id, instruction) VALUES ('f4dbe756-628e-4287-a1ef-100962d1b991', 'Receive the bar locked out overhead near the bottom of the squat. The torso should remain vertical, lowering the hips between the legs.');
INSERT INTO instructions (id, instruction) VALUES ('45491c07-790c-4688-b526-7e207c547229', 'Continue to descend to full depth, and return to a standing position. Carefully lower the weight.');
INSERT INTO instructions (id, instruction) VALUES ('dae0cbe1-cc04-4f1e-8e16-e936f6c52ade', 'The snatch deadlift strengthens the first pull of the snatch. Begin with a wide snatch grip with the barbell placed on the platform. The feet should be directly under the hips, with the feet turned out. Squat down to the bar, keeping the back in absolute extension with the head facing forward.');
INSERT INTO instructions (id, instruction) VALUES ('4765012a-1cf1-4267-b02b-9c8a1a5333d4', 'Initiate the movement by driving through the heels, raising the hips. The back angle should remain the same until the bar passes the knees.');
INSERT INTO instructions (id, instruction) VALUES ('aacbed62-3a66-4f88-9760-0361389d89dd', 'At that point, drive your hips through the bar as you lay back. Return the bar to the platform by reversing the motion.');
INSERT INTO instructions (id, instruction) VALUES ('5422a7bd-41d9-4996-b716-b6bf1b06e8f7', 'With a barbell on the floor close to the shins, take a wide snatch grip. Lower your hips with the weight focused on the heels, back straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f11081db-eddc-4827-a2bf-96b140c39698', 'Next comes the second pull, the main source of acceleration for the pull. As the bar approaches the mid-thigh position, begin extending through the hips. In a jumping motion, accelerate by extending the hips, knees, and ankles, using speed to move the bar upward.');
INSERT INTO instructions (id, instruction) VALUES ('e6bb96e8-e82e-4bfb-8c9d-c7446f53164d', 'There should be no need to actively pull through the arms to accelerate the weight; at the end of the second pull, the body should be fully extended, leaning slightly back. Full extension should be violent and abrupt, and ensure that you do not prolong the extension for longer than necessary.');
INSERT INTO instructions (id, instruction) VALUES ('78640325-0c43-4cd7-b067-7e3dd8da63a7', 'Begin with a wide grip, with the bar hanging at the mid thigh position. You can use a hook or overhand grip. Your back should be straight and inclined slightly forward.');
INSERT INTO instructions (id, instruction) VALUES ('6e0b8a43-f9e9-4e56-8a54-93f9002ff18c', 'Shrug your shoulders towards your ears. While this exercise can usually by loaded with heavier weight than a snatch, avoid overloading to the point that the execution slows down.');
INSERT INTO instructions (id, instruction) VALUES ('04f84d70-9d0d-408f-8bcf-7126ec56a44e', 'As you move your feet into the receiving position, forcefully pull yourself below the bar as you elevate the bar overhead. The feet should move to just outside the hips, turned out as necessary. Receive the bar with your body as low as possible and the arms fully extended overhead.');
INSERT INTO instructions (id, instruction) VALUES ('7af283e3-c55f-48d2-9df3-9effa321ebca', 'For this exercise anchor a band to the ground. We used an incline bench and anchored the band to the base, standing over the bench. Alternatively, this could be performed standing on the band.');
INSERT INTO instructions (id, instruction) VALUES ('20450cf1-15ff-4130-9f6a-089e3d0eb271', 'To begin, pull the band behind your head, holding it with a pronated grip and your elbows up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9bf23469-da3e-420e-aec5-e8255b0cc3a4', 'To perform the movement, extend through the elbow to to straighten your arms, ensuring that you keep your upper arm in place.');
INSERT INTO instructions (id, instruction) VALUES ('dbc3fcb7-9f09-4195-bc84-c7bf9d411a5f', 'Pause, and then return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('81971099-19dc-443f-82fd-a774336c9463', 'Attach bands to the bar that are securely anchored near the ground. You may need to choke the bands to get adequate tension.');
INSERT INTO instructions (id, instruction) VALUES ('1507908e-2118-4aa0-a9f0-39d986c18843', 'Use a box of an appropriate height for this exercise. Load the bar to a weight that still requires effort, but isn''t so heavy that speed is compromised. Typically, that will be between 50-70% of your one rep max.');
INSERT INTO instructions (id, instruction) VALUES ('d6ff335f-67bb-4c4a-94eb-6136ea10b959', 'Position the bar on your upper back, shoulder blades retracted, back arched and everything tight head to toe. This will be the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('14094129-ef3b-4c0c-bf07-2b449432ac1f', 'Unrack the bar and position yourself in front of the box. Sit back with your hips until you are seated on the box, ensuring that you descend under control and don''t crash onto the surface.');
INSERT INTO instructions (id, instruction) VALUES ('4747eac2-af57-432c-826b-0e04a16e726e', 'Pause briefly, and explode off of the box, extending through the hips and knees.');
INSERT INTO instructions (id, instruction) VALUES ('67e91824-e262-442a-96b9-1d64fcd4d71c', 'Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times as looking down will get you off balance and also maintain a straight back. This will be your starting position. (Note: For the purposes of this discussion we will use the medium stance which targets overall development; however you can choose any of the three stances discussed in the foot stances section).');
INSERT INTO instructions (id, instruction) VALUES ('70cbc6e2-e842-437f-bb44-e6ead5e5bba9', 'Begin to lower the bar by bending the knees as you maintain a straight posture with the head up. Continue down until the angle between the upper leg and the calves becomes slightly less than 90-degrees (which is the point in which the upper legs are below parallel to the floor). Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that is perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('b8d6e6ea-05ca-4b21-9550-9f758fc60f57', 'Begin to raise the bar as fast as possible without involving momentum as you exhale by pushing the floor with the heel of your foot mainly as you straighten the legs again and go back to the starting position. Note: You should perform these exercises as fast as possible but without breaking perfect form and without involving momentum.');
INSERT INTO instructions (id, instruction) VALUES ('1acc6f88-d648-4675-8d95-20188d2bfd03', 'Hold a dumbbell in each hand with a pronated grip. Your feet should be wide with your hips and knees extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('43cf8df2-3ba7-4297-8fa4-f5465ff5128c', 'Begin the movement by pulling both of the dumbbells to one side next to your hip, rotating your torso.');
INSERT INTO instructions (id, instruction) VALUES ('05b40df6-1050-406e-b83e-fbd75f615d79', 'Keeping your arms straight and the dumbbells parallel to the ground, rotate your torso to swing the weights to your opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('c8ab90aa-40d3-4144-b251-9d1c51c95a0d', 'Continue alternating, rotating from one side to the other until the set is complete.');
INSERT INTO instructions (id, instruction) VALUES ('68f948d6-e54d-4e6d-828a-464caada703b', 'Begin in a prone position on the floor. Support your weight on your hands and toes, with your feet together and your body straight. Your arms should be bent to 90 degrees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('419682d9-bfbd-4634-92f1-4de57c003997', 'Initiate the movement by raising one foot off of the ground. Externally rotate the leg and bring the knee toward your elbow, as far forward as possible.');
INSERT INTO instructions (id, instruction) VALUES ('a24608eb-0a1f-4935-b3ca-b238714220d5', 'Return this leg to the starting position and repeat on the opposite side.');
INSERT INTO instructions (id, instruction) VALUES ('e9ea0588-556f-4cf4-9e1f-1ee3c892add9', 'Start out by setting the bar on the part of the preacher bench that you would normally sit on. Make sure to align the barbell properly so that it is balanced and will not fall off.');
INSERT INTO instructions (id, instruction) VALUES ('0f431f09-a2e3-47db-95f2-ab0a671ba828', 'Move to the front side of the preacher bench (the part where the arms usually lay) and position yourself to lay at a 45 degree slant with your torso and stomach pressed against the front side of the preacher bench.');
INSERT INTO instructions (id, instruction) VALUES ('bfdb0ffd-86db-4835-bdab-dc295ac98201', 'Make sure that your feet (especially the toes) are well positioned on the floor and place your upper arms on top of the pad located on the inside part of the preacher bench.');
INSERT INTO instructions (id, instruction) VALUES ('8ae92598-bd71-4894-bca9-f3e305ee64c9', 'Use your arms to grab the barbell with a supinated grip (palms facing up) at about shoulder width apart or slightly closer from each other.');
INSERT INTO instructions (id, instruction) VALUES ('6a07ea9c-a65a-4eb4-84e3-1a65a448031e', 'Slowly begin to lift the barbell upwards and exhale. Hold the contracted position for a second as you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('356cd857-afd2-4763-a0f0-4af5fa56fdf9', 'Slowly begin to bring the barbell back to the starting position as your breathe in. .');
INSERT INTO instructions (id, instruction) VALUES ('685eb384-65f5-48da-bbb4-8e67986459b6', 'Sit in a chair so your back is straight and your feet planted on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('51cb1247-6187-490d-8a6d-9ad26770212f', 'Interlace your fingers behind your head, elbows out and your chin down.');
INSERT INTO instructions (id, instruction) VALUES ('8a790b61-06bb-467e-a69a-274601397bb2', 'Twist your upper body to one side about 3 times as far as you can. Then lean forward and twist your torso to reach your elbow to the floor on the inside of your knee.');
INSERT INTO instructions (id, instruction) VALUES ('5b7088a5-d96f-4d6e-85c0-6e60d5315b0e', 'Return to upright position and then repeat for your other side.');
INSERT INTO instructions (id, instruction) VALUES ('076c3692-fb40-4927-88f6-331bc3d194ab', 'With a barbell on the floor close to the shins, take an overhand grip just outside the legs. Lower your hips with the weight focused on the heels, back straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6302a89a-6dfd-44b2-9040-f13977c00a64', 'As full extension is achieved, transition into the third pull by aggressively shrugging and flexing the arms with the elbows up and out. At peak extension, aggressively pull yourself down, rotating your elbows under the bar as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('740fadde-97e6-4e49-bb85-36f538652e64', 'Receive the bar with the feet split, aggressively moving one foot forward and one foot back. The bar should be racked onto the protracted shoulders, lightly touching the throat with the hands relaxed. Continue to descend to the bottom position, which will help in the recovery.');
INSERT INTO instructions (id, instruction) VALUES ('7f69eba9-5b34-43a9-a93b-a136723eb4b0', 'Immediately recover by driving through the heels, keeping the torso upright and elbows up. Bring the feet together as you stand up.');
INSERT INTO instructions (id, instruction) VALUES ('ffcd68a3-fd1b-48ab-a295-4931f5b8e450', 'Standing with the weight racked on the front of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward.');
INSERT INTO instructions (id, instruction) VALUES ('b51f95f8-930a-491e-8685-57e91d02c29d', 'Go down only slightly, and reverse direction as powerfully as possible. Drive through the heels create as much speed and force as possible, and be sure to move your head out of the way as the bar leaves the shoulders. At this moment as the feet leave the floor, the feet must be placed into the receiving position as quickly as possible.');
INSERT INTO instructions (id, instruction) VALUES ('b9f87570-10f4-4c6f-995a-e5ac5488ca44', 'In the brief moment the feet are not actively driving against the platform, the athlete''s effort to push the bar up will drive them down. The feet should be moved to a split stance, one foot forward, one foot back, with the knees partially bent. Receive the bar with the arms locked out overhead.');
INSERT INTO instructions (id, instruction) VALUES ('28fd2a9c-f86e-46d1-b07e-8c7398c071aa', 'Return to a standing position, bringing the feet together.');
INSERT INTO instructions (id, instruction) VALUES ('e436163b-b016-4f9f-9fed-49f4f318e987', 'Ensure that the front knee is over the midline of the foot.');
INSERT INTO instructions (id, instruction) VALUES ('11d485cf-98d0-40d5-932b-266966391b2e', 'Extending through both legs, jump as high as possible, swinging your arms to gain lift.');
INSERT INTO instructions (id, instruction) VALUES ('f1e1c0f1-b484-4a9b-8d09-a388bc594f9f', 'As you jump, bring your feet together, and move them back to their initial positions as you land.');
INSERT INTO instructions (id, instruction) VALUES ('c682332d-fabf-4bde-a10a-1673d25eaeca', 'Absorb the impact by reverting back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a2eb9b38-61a5-4bf9-9864-82f6dd392525', 'As you move your feet into the receiving position, forcefully pull yourself below the bar as you elevate the bar overhead. The feet should move forcefully to a split position, one foot forward one foot back. Receive the bar with your body as low as possible and the arms fully extended overhead.');
INSERT INTO instructions (id, instruction) VALUES ('90fe2e30-6cfd-4f15-80a7-3ea4ff76320c', 'Keeping the bar aligned over the front of the heels, your head and chest up, drive through heels of the feet to move to a standing position, bringing your feet together.');
INSERT INTO instructions (id, instruction) VALUES ('439e036b-fa27-48be-a28c-eda1b427af3f', 'Carefully return the weight to floor.');
INSERT INTO instructions (id, instruction) VALUES ('b45efc0c-22d6-41de-ac31-48c42449c5ec', 'Position yourself into a staggered stance with the rear foot elevated and front foot forward.');
INSERT INTO instructions (id, instruction) VALUES ('9191cb3c-5b69-4ff3-b2e6-fa0787a8ff0f', 'Hold a dumbbell in each hand, letting them hang at the sides. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8cd8a8c1-fec6-4b93-8764-f4b27c0cce7b', 'Begin by descending, flexing your knee and hip to lower your body down. Maintain good posture througout the movement. Keep the front knee in line with the foot as you perform the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('0fe51027-656e-4a62-941e-22b517f2cf35', 'At the bottom of the movement, drive through the heel to extend the knee and hip to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('57231018-3c1d-447f-ab66-1c11c9c03168', 'Being in a standing position. Jump into a split leg position, with one leg forward and one leg back, flexing the knees and lowering your hips slightly as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('c7d3df50-63a9-462e-9c5d-d1328700f31e', 'As you descend, immediately reverse direction, standing back up and jumping, reversing the position of your legs. Repeat 5-10 times on each leg.');
INSERT INTO instructions (id, instruction) VALUES ('114da6f5-cbbc-4395-8a2f-55b357591b30', 'Standing with the weight racked on the front of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible. Drive through the heels create as much speed and force as possible, and be sure to move your head out of the way as the bar leaves the shoulders.');
INSERT INTO instructions (id, instruction) VALUES ('076083ca-5219-48d6-88d4-11a206abca20', 'At this moment as the feet leave the floor, the feet must be placed into the receiving position as quickly as possible. In the brief moment the feet are not actively driving against the platform, the athlete''s effort to push the bar up will drive them down. The feet should move forcefully to just outside the hips, turned out as necessary. Receive the bar with your body in a full squat and the arms fully extended overhead.');
INSERT INTO instructions (id, instruction) VALUES ('61867ec8-cd7e-48e6-9956-66902b491096', 'Keeping the bar aligned over the front of the heels, your head and chest up, drive throught heels of the feet to move to a standing position. Carefully return the weight to floor.');
INSERT INTO instructions (id, instruction) VALUES ('61ff10a1-938d-4e28-bbb6-abf59d0a8ac6', 'Set up the bands on the sleeves, secured to either band pegs, the rack, or dumbbells so that there is appropriate tension.');
INSERT INTO instructions (id, instruction) VALUES ('343a24da-0e13-46c1-b6b4-5fb32b77a4cf', 'Begin by stepping under the bar and placing it across the back of the shoulders. Squeeze your shoulder blades together and rotate your elbows forward, attempting to bend the bar across your shoulders. Remove the bar from the rack, creating a tight arch in your lower back, and step back into position. Place your feet wide for more emphasis on the back, glutes, adductors, and hamstrings. Keep your head facing forward.');
INSERT INTO instructions (id, instruction) VALUES ('b67f90f6-e1c8-4d6b-83b5-fc4e35523255', 'With your back, shoulders, and core tight, push your knees and butt out and you begin your descent. Sit back with your hips as much as possible. Ideally, your shins should be perpendicular to the ground. Lower bar position necessitates a greater torso lean to keep the bar over the heels. Continue until you break parallel, which is defined as the crease of the hip being in line with the top of the knee.');
INSERT INTO instructions (id, instruction) VALUES ('9fbfea17-893e-4ce5-be02-0280f0c5c8fc', 'To begin, first set the bar on a rack to just below shoulder level. Position a weight plate on the ground a couple feet back from the rack. Once the bar is loaded, step under it and place the back of your shoulders across it.');
INSERT INTO instructions (id, instruction) VALUES ('0c94d5bb-e58c-416a-96e2-0f6988b3dcbe', 'Hold on to the bar with both hands and lift it off the rack by first pushing with your legs and at the same time straighten your torso.');
INSERT INTO instructions (id, instruction) VALUES ('7913a033-343a-43c1-b7b8-70f597590b9b', 'Step away from the rack and adopt a wide stance with the toes slightly pointed out, with one foot on the weight plate. Keep your head up at all times. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('eb5e58ad-8a38-4a98-8f2f-44b21fdd42d4', 'Begin to slowly lower the bar by bending the knees and hips. Continue down until the angle between the upper leg and the calves becomes slightly less than 90-degrees.');
INSERT INTO instructions (id, instruction) VALUES ('b4a7d0e3-c0ed-4cbb-8aed-61ffa7adb14e', 'Raise the bar as you exhale by pushing the floor with the heels of your feet as you extend the hips and knees.');
INSERT INTO instructions (id, instruction) VALUES ('1aea1310-e499-4afd-933d-7c2097011abb', 'At the top of the movement, side step, bringing your feet together on the opposite side of the plate.');
INSERT INTO instructions (id, instruction) VALUES ('7b780378-f457-4722-829e-94ba3f8d67f1', 'Using your inside foot, push the weight plate, sliding it across the floor to where you were just standing.');
INSERT INTO instructions (id, instruction) VALUES ('f14e8d75-948a-4094-b4fc-731ad102602a', 'Place your inside foot on the weight plate, adopting a wide stance for the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('2a6a37e4-ea12-470b-804e-4418c6d0f2e7', 'To start out, make sure that the exercise band is at an even split between both the left and right side of the body. To do this, use your hands to grab both sides of the band and place both feet in the middle of the band. Your feet should be shoulder width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('06b2b9c8-97a9-4a2a-9400-9f193b4d3570', 'When holding the bands, they should be the same height on each side. You should be using a pronated grip (palms facing forward) and have the handles of the bands next to your face for this exercise. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d37f06af-1322-4654-9005-d2df37eb2274', 'Slowly start to bend the knees and lower the legs so that your thighs are parallel to the floor while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('1e156f43-a178-4bb9-b946-ed35a4a0286c', 'Use the heel of your feet to push your body up to the starting position as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('73e1ae1f-0076-4230-9524-2b8ca4c22e8b', 'To begin, step onto the stairmaster and select the desired option from the menu. You can choose a manual setting, or you can select a program to run. Typically, you can enter your age and weight to estimate the amount of calories burned during exercise.');
INSERT INTO instructions (id, instruction) VALUES ('dc5de85d-01eb-48ee-90da-4f9cbc80926f', 'Pump your legs up and down in an established rhythm, driving the pedals down but not all the way to the floor. It is recommended that you maintain your grip on the handles so that you don''t fall. The handles can be used to monitor your heart rate to help you stay at an appropriate intensity.');
INSERT INTO instructions (id, instruction) VALUES ('698004ce-99cd-4086-b6f5-9606a8e474ff', 'Stairmasters offer convenience, cardiovascular benefits, and usually have less impact than running outside. They are typically much harder than other cardio equipment. A 150 lb person will typically burn over 300 calories in 30 minutes, compared to about 175 calories walking.');
INSERT INTO instructions (id, instruction) VALUES ('9aa38643-2781-4164-a35b-2aed9cfb7920', 'Stand with a dumbbell in each hand. Raise the dumbbells to your shoulders with your palms facing forward and your elbows pointed out. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('306aa3db-b1bc-4955-b393-ee3c3f676f49', 'Extend one arm to press the dumbbell straight up, keeping your off hand in place. Do not lean or jerk the weight during the movement.');
INSERT INTO instructions (id, instruction) VALUES ('21a826b0-ef99-42a7-b7cf-82e5e280ec4f', 'Repeat for the opposite side, continuing to alternate between arms.');
INSERT INTO instructions (id, instruction) VALUES ('bb6864bf-7a28-4cd1-aa7e-dcb1b6d8179a', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack that best matches your height. Once the correct height is chosen and the bar is loaded, step under the bar and place the bar on the back of your shoulders (slightly below the neck).');
INSERT INTO instructions (id, instruction) VALUES ('e7ef3822-e3e5-4deb-ad9e-3e09ecdff65f', 'Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Keep your head up at all times as looking down will get you off balance and also maintain a straight back. The knees should be kept with a slight bend; never locked. This will be your starting position. Tip: For better range of motion you may also place the ball of your feet on a wooden block but be careful as this option requires more balance and a sturdy block.');
INSERT INTO instructions (id, instruction) VALUES ('5651e03f-4e70-404f-add1-9a7a6cc94d34', 'This exercise is best performed inside a squat rack for easier pick up of the bar. To begin, first set the bar on a rack that best matches your height. Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.');
INSERT INTO instructions (id, instruction) VALUES ('924ab402-9a56-43b3-b7d6-8092aa450f36', 'Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Your back should be kept straight while performing this exercise. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4cf480eb-1222-465e-9294-55f8933f1d71', 'Elevate the barbell overhead by fully extending your arms while breathing out.');
INSERT INTO instructions (id, instruction) VALUES ('e8b45683-a41f-4d59-a449-6331ffd65af1', 'Hold the contraction for a second and lower the barbell back down to the starting position by inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('e883c471-04f3-448f-acaa-0f5cdb86b0c6', 'With a dumbbell in one hand and the palm facing your torso, bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Make sure that you keep the head up.');
INSERT INTO instructions (id, instruction) VALUES ('3849c13b-bee2-4f02-a831-87ff41c10174', 'The upper arm should be close to the torso and parallel to the floor while the forearm is pointing towards the floor as the hand holds the weight. Tip: There should be a 90-degree angle between the forearm and the upper arm. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('067f508c-3318-4dd3-b94f-2987220fb9e0', 'Keeping the upper arms stationary, use the triceps to lift the weights as you exhale until the forearms are parallel to the floor and the whole arm is extended. Like many other arm exercises, only the forearm moves.');
INSERT INTO instructions (id, instruction) VALUES ('7cfed3e0-85f7-4f12-87d4-9fe4e7e90ddf', 'With a dumbbell in each hand and the palms facing your torso, bend your knees slightly and bring your torso forward, by bending at the waist, while keeping the back straight until it is almost parallel to the floor. Make sure that you keep the head up. The upper arms should be close to the torso and parallel to the floor while the forearms are pointing towards the floor as the hands hold the weights. Tip: There should be a 90-degree angle between the forearms and the upper arm. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ee8a5f06-20bd-4950-b226-57fea9a269e7', 'Keeping the upper arms stationary, use the triceps to lift the weights as you exhale until the forearms are parallel to the floor and the whole arms are extended. Like many other arm exercises, only the forearm moves.');
INSERT INTO instructions (id, instruction) VALUES ('71aa1e81-ca1f-424f-b828-e8cdf32a41e6', 'After a second contraction at the top, slowly lower the dumbbells back to their starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('94afce30-9958-4121-aa94-52344dc29b2c', 'Stand up with your torso upright while holding a cable curl bar that is attached to a low pulley. Grab the cable bar at shoulder width and keep the elbows close to the torso. The palm of your hands should be facing up (supinated grip). This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('aebee8ae-034a-4eed-a069-a967bcdaa98c', 'Slowly begin to bring the curl bar back to starting position as your breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('4f164ffe-d882-44d3-8580-13470bc2b85b', 'Clasp your hands behind your back with your palms together, straighten arms and then rotate them so your palms face downward.');
INSERT INTO instructions (id, instruction) VALUES ('f380665d-bb3b-4281-bc0f-db1f208ce262', 'Raise your arms up and hold until you feel a stretch in your biceps.');
INSERT INTO instructions (id, instruction) VALUES ('cd22dc36-d43a-4d35-8feb-7f8c66e82c08', 'Place a loaded bar at shoulder level in a rack. With a pronated grip at shoulder width, begin with the bar racked across the front of your shoulders. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4fa5ebc7-5f9b-4733-a3b5-f091fa08fd9c', 'Initiate the lift by extending the elbows to press the bar overhead. Avoid locking out the elbow as you move the weight behind your head.');
INSERT INTO instructions (id, instruction) VALUES ('bddfffad-e5a6-4e77-a971-dc2cef6beaf8', 'Lower the bar down to the back of the head until your elbow forms a right angle.');
INSERT INTO instructions (id, instruction) VALUES ('1387223e-5687-4b42-b6ec-c4f74c7d2ac3', 'Lift the bar back over your head by extending the elbows');
INSERT INTO instructions (id, instruction) VALUES ('b32f62c1-47bf-40ca-9267-fd9f37a86e66', 'Lower the bar down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('90a1ff19-a541-4f1d-8453-7a2696381bbb', 'Position dual pulleys to chest height and select an appropriate weight. Stand a foot or two in front of the cables, holding one in each hand. You can stagger your stance for better stability.');
INSERT INTO instructions (id, instruction) VALUES ('862e479f-776e-4e38-b644-536ce2ccd396', 'Position the upper arm at a 90 degree angle with the shoulder blades together. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fdb542ab-2cc6-41bd-88fd-55622d158068', 'Keeping the rest of the body stationary, extend through the elbows to press the handles forward, drawing them together in front of you.');
INSERT INTO instructions (id, instruction) VALUES ('e5cc823e-5984-40f2-9a9d-e82f06ad1046', 'Connect a standard handle on a tower, and move the cable to the lowest pulley position.');
INSERT INTO instructions (id, instruction) VALUES ('edda8c59-ee95-4c51-a6de-ea1806383b40', 'With your side to the cable, grab the handle with one hand and step away from the tower. You should be approximately arm''s length away from the pulley, with the tension of the weight on the cable. Your outstretched arm should be aligned with the cable.');
INSERT INTO instructions (id, instruction) VALUES ('a0b9a10e-0617-4f3c-93fa-a76a0c5813f8', 'With your feet positioned shoulder width apart, squat down and grab the handle with both hands. Your arms should still be fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('6e226a8b-e15e-4b30-8d21-7ac86bfba4a5', 'In one motion, pull the handle up and across your body until your arms are in a fully-extended position above your head.');
INSERT INTO instructions (id, instruction) VALUES ('ec9be873-a722-48d4-ab7c-2f106b70f4ad', 'Keep your back straight and your arms close to your body as you pivot your back foot and straighten your legs to get a full range of motion.');
INSERT INTO instructions (id, instruction) VALUES ('e0a6323d-b0c5-4eea-9a84-6f06f2c3d0a8', 'Retract your arms and then your body. Return to the neutral position in a slow and controlled manner.');
INSERT INTO instructions (id, instruction) VALUES ('9d8e936b-b274-4342-997a-35d0940de3b6', 'Connect a standard handle to a tower, and move the cable to the highest pulley position.');
INSERT INTO instructions (id, instruction) VALUES ('12670286-3a20-416b-a679-0ec642121fc1', 'With your feet positioned shoulder width apart, reach upward with your other hand and grab the handle with both hands. Your arms should still be fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('02b3aa7d-a2f3-4830-8878-d4e631749370', 'In one motion, pull the handle down and across your body to your front knee while rotating your torso.');
INSERT INTO instructions (id, instruction) VALUES ('60b9f993-b3f4-4bab-af33-ff74c28f18d7', 'Keep your back and arms straight and core tight while you pivot your back foot and bend your knees to get a full range of motion.');
INSERT INTO instructions (id, instruction) VALUES ('c1c4be02-66c6-4081-9744-ffaf042bc3a1', 'Maintain your stance and straight arms. Return to the neutral position in a slow and controlled manner.');
INSERT INTO instructions (id, instruction) VALUES ('4b1ddc47-f814-499e-b061-cd75edab6521', 'Adjust the padded lever of the calf raise machine to fit your height.');
INSERT INTO instructions (id, instruction) VALUES ('3060f157-ea73-419b-9655-37f2c930af62', 'Place your shoulders under the pads provided and position your toes facing forward (or using any of the two other positions described at the beginning of the chapter). The balls of your feet should be secured on top of the calf block with the heels extending off it. Push the lever up by extending your hips and knees until your torso is standing erect. The knees should be kept with a slight bend; never locked. Toes should be facing forward, outwards or inwards as described at the beginning of the chapter. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4a8b1f9b-f892-4a9c-be89-153ea7dfe34d', 'Taking a dumbbell in your working hand, lean forward. Allow your working arm to hang perpendicular to the ground with the elbow pointing out. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f132c1d9-95fc-479d-b7c6-3e13b724bd1c', 'Flex the elbow to curl the weight, keeping the upper arm stationary. At the top of the repetition, flex the biceps and pause.');
INSERT INTO instructions (id, instruction) VALUES ('5c29cb9f-da97-413f-aa03-d50ec284e1aa', 'Lower the dumbbell back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c9ab66e3-5b5f-4452-a5ae-83b183f4d5e5', 'Stand with your torso upright holding two dumbbells in your hands by your sides. Place the ball of the foot on a sturdy and stable wooden board (that is around 2-3 inches tall) while your heels extend off and touch the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4276fc7f-50e1-4ffe-be25-2db2dfd1d44a', 'With the toes pointing either straight (to hit all parts equally), inwards (for emphasis on the outer head) or outwards (for emphasis on the inner head), raise the heels off the floor as you exhale by contracting the calves. Hold the top contraction for a second.');
INSERT INTO instructions (id, instruction) VALUES ('7d1903d5-bf05-4b35-93ee-20c50d0cdaf0', 'As you inhale, go back to the starting position by slowly lowering the heels.');
INSERT INTO instructions (id, instruction) VALUES ('1b737a88-9daf-4561-9578-f984b8ed3984', 'Standing with your feet shoulder width apart, take a dumbbell in each hand. Raise the dumbbells to head height, the elbows out and about 90 degrees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('691cb9ee-cc69-4a9c-8736-278fed6a53bf', 'Maintaining strict technique with no leg drive or leaning back, extend through the elbow to raise the weights together directly above your head.');
INSERT INTO instructions (id, instruction) VALUES ('b0fa8406-18d1-470a-9aba-95b5808b34d4', 'Pause, and slowly return the weight to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('dae61f73-a148-4650-bf16-60c85d61ffdc', 'To begin, stand straight with a dumbbell in each hand using a pronated grip (palms facing down). Your arms should be fully extended while your feet are shoulder width apart from each other. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ea3f95ea-d490-4ee5-8d30-041b36e2cf35', 'While holding the upper arms stationary, curl the weights while contracting the biceps as you breathe out. Only the forearms should move. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level. Hold the contracted position for a second as you squeeze the muscle.');
INSERT INTO instructions (id, instruction) VALUES ('16a2e6c5-afca-4bd6-b0f5-0d857eb72895', 'Hold the dumbbells in front of your thighs, palms facing your thighs.');
INSERT INTO instructions (id, instruction) VALUES ('39ce605e-4bd4-4084-b084-3ea94a3758a6', 'Keep your arms straight with a slight bend at the elbows but keep them locked. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('97257421-3f6a-46d7-8553-4773f2f20a02', 'Raise the dumbbells in a semicircular motion to arm''s length overhead as you exhale.');
INSERT INTO instructions (id, instruction) VALUES ('d70f5d88-1f23-47a7-95a8-fcc9db7341f0', 'Slowly return to the starting position using the same path as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('4daa92fb-5a36-4c49-8601-9883b7ab65dc', 'To begin, stand up with a dumbbell held by both hands. Your feet should be about shoulder width apart from each other. Slowly use both hands to grab the dumbbell and lift it over your head until both arms are fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('f8285921-27d1-45f0-89b1-aba94f7e5d5e', 'The resistance should be resting in the palms of your hands with your thumbs around it. The palm of the hands should be facing up towards the ceiling. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ac36a7bc-e373-4945-91b2-dfbb7313c0a1', 'Keeping your upper arms close to your head with elbows in and perpendicular to the floor, lower the resistance in a semicircular motion behind your head until your forearms touch your biceps. Tip: The upper arms should remain stationary and only the forearms should move. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('42d61a26-cc23-467d-b4c8-977d62a14ecb', 'Grasp a dumbbell in each hand with a pronated (palms forward) grip that is slightly less than shoulder width. The dumbbells should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('49ee5db6-1f4c-4f91-a6db-66638a9be470', 'Use your side shoulders to lift the dumbbells as you exhale. The dumbbells should be close to the body as you move it up and the elbows should drive the motion. Continue to lift them until they nearly touch your chin. Tip: Your elbows should drive the motion. As you lift the dumbbells, your elbows should always be higher than your forearms. Also, keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('f65020fa-30bb-4f9b-8b46-2803105df020', 'Start by standing with your back about two to three feet away from a bench or step.');
INSERT INTO instructions (id, instruction) VALUES ('75bce26a-e4b4-4b7f-bafe-9ded9b7b4c60', 'Lift one leg behind you and rest your foot on the step,either on your instep or the ball of your foot, whichever you find most comfortable.');
INSERT INTO instructions (id, instruction) VALUES ('469e38f9-6a27-4cc3-ac0b-5f5cd6293730', 'Keep your supporting knee slightly bent and avoid letting that knee extend out beyond your toes. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('d987a84f-501a-4707-bc52-09541088daf4', 'To begin, stand straight with a barbell in your hands. You should grip the bar with palms facing down and a closer than shoulder width grip apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('e59c433d-da6e-4968-974d-382ed9cbb400', 'Your feet should be shoulder width apart from each other. Your elbows should be slightly bent. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5d0d47cb-c1c1-4d34-9fe6-0b58beb3b4c1', 'Lift the barbell up until it is directly over your head while exhaling. Make sure to keep your elbows slightly bent when performing each repetition.');
INSERT INTO instructions (id, instruction) VALUES ('6989f8fa-1e49-495f-b313-fdb83f897fed', 'Once you feel the contraction, begin to lower the barbell back down to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('ef940165-3adf-4047-8a85-a73dc4849eaa', 'Place your right heel on a step with your knee extended and lean forward to grab your right toe with your right hand. Your left knee should be slightly bent and your back should be straight.');
INSERT INTO instructions (id, instruction) VALUES ('6647bf74-2bac-4477-8156-02bacdc3d8b7', 'Support your weight on your left leg and place your left hand on your left thigh.');
INSERT INTO instructions (id, instruction) VALUES ('ed83c7a1-c716-4ae2-848c-2215b1fc8700', 'Pull your right toes toward your knee until you feel a stretch in your calf.');
INSERT INTO instructions (id, instruction) VALUES ('8b2303d5-4f41-4bb0-a857-343ee92f40d6', 'Being by looping a belt, band, or rope around one foot. While standing, place that foot forward.');
INSERT INTO instructions (id, instruction) VALUES ('36143eaa-5b3d-4687-ad3d-f6e2ce0970b4', 'Bend your back leg, while keeping the front one straight. Now raise the toes of your front foot off of the ground and lean forward.');
INSERT INTO instructions (id, instruction) VALUES ('9da24718-e9b2-4aa9-bccf-743e4d45e2af', 'Using the belt, pull on the top of the foot to increase the stretch in the calf. Hold for 10-20 seconds and repeat with the other foot.');
INSERT INTO instructions (id, instruction) VALUES ('8037afda-42c5-46b0-a719-6d1f3057ab2b', 'Begin standing on one leg, holding to a vertical support.');
INSERT INTO instructions (id, instruction) VALUES ('813f02b9-d928-41e8-98ae-6ff4a823d8b4', 'Raise the unsupported knee to 90 degrees. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('67553580-f07e-4ec3-b440-f0b7101fc529', 'Open the hip as far as possible, attempting to make a big circle with your knee.');
INSERT INTO instructions (id, instruction) VALUES ('e931a7fe-c78d-4663-9730-81f15a5e215d', 'Perform this movement slowly for a number of repetitions, and repeat on the other side.');
INSERT INTO instructions (id, instruction) VALUES ('0515813d-009e-40f3-9fe4-ebc04f3e279a', 'Stand up straight with the spine vertical, the left foot slightly in front of the right.');
INSERT INTO instructions (id, instruction) VALUES ('187864c5-9279-4720-86bb-2bb0236ff887', 'Bend both knees and lift the back heel off the floor as you press the right hip forward. You can''t get a thorough, deep stretch in this position, however, because it''s hard to relax the hip flexor and stand on it at the same time. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('584bf760-ac08-4697-bd1b-155e86773c19', 'Stand up with a dumbbell in each hand being held at arms length. The elbows should be close to the torso. Your legs should be at about shoulder''s width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('09a7d48b-8a9d-426d-8c15-22891374c92d', 'While holding the upper arms stationary, curl the weights out while contracting the biceps as you breathe out. Your wrist should turn so that when the weights are fully elevated you have supinated grip (palms facing up).');
INSERT INTO instructions (id, instruction) VALUES ('b7b617c3-1d96-4540-8c3a-93a7b1bc0685', 'Only the forearms should move. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level. Tip: Keep the forearms aligned with your outer deltoids.');
INSERT INTO instructions (id, instruction) VALUES ('9d711228-69b3-43e5-92bb-ae78108bbe19', 'Hold the contracted position for a second as you squeeze the biceps.');
INSERT INTO instructions (id, instruction) VALUES ('10b44881-e6cf-4f6b-907a-4113e2784be4', 'Slowly begin to bring the dumbbells back to the starting position as your breathe in. Remember to rotate the wrists as you lower the weight in order to switch back to a neutral grip.');
INSERT INTO instructions (id, instruction) VALUES ('923de7aa-2ec2-433a-ac6d-c7b2a03ed4f6', 'Take a slightly wider than hip distance stance with your knees slightly bent.');
INSERT INTO instructions (id, instruction) VALUES ('e1af6eda-a7f8-4696-a571-3fc60167daec', 'Place your right hand on your right hip to support the spine.');
INSERT INTO instructions (id, instruction) VALUES ('3771439d-ef6f-476c-9072-60c23a313032', 'Raise your left arm in a vertical line and place your left hand behind your head. Keep it there as you incline your torso to the right.');
INSERT INTO instructions (id, instruction) VALUES ('7d745482-bd08-41d8-821d-e70a7a50cda0', 'Keep your weight evenly distributed between both legs (don''t lean into your left hip). Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('96d23fb1-d693-4821-9091-4f4bbc456829', 'Adjust the machine lever to fit your height and lie with your torso bent at the waist facing forward around 30-45 degrees (since an angled position is more favorable for hamstrings recruitment) with the pad of the lever on the back of your right leg (just a few inches under the calves) and the front of the right leg on top of the machine pad.');
INSERT INTO instructions (id, instruction) VALUES ('8a944555-e283-4b87-a796-1eca14e1872d', 'Keeping the torso bent forward, ensure your leg is fully stretched and grab the side handles of the machine. Position your toes straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('22e98520-ac9c-46da-bf46-a69bb254c9a7', 'As you exhale, curl your right leg up as far as possible without lifting the upper leg from the pad. Once you hit the fully contracted position, hold it for a second.');
INSERT INTO instructions (id, instruction) VALUES ('fac67051-de5a-4913-99fc-f41904f9ad4f', 'Perform the same exercise now for the left leg.');
INSERT INTO instructions (id, instruction) VALUES ('9c682b3b-68d0-47a1-8404-6cda9ec34f70', 'This drill is best done in sand or other soft landing surface. Ensure that you are able to measure distance. Stand in a partial squat stance with feet shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('587e541e-72e2-4556-8678-61e5f98b3a1b', 'Utilizing a big arm swing and a countermovement of the legs, jump forward as far as you can.');
INSERT INTO instructions (id, instruction) VALUES ('ec9e5f3e-02f5-480b-bc88-e02bdc08d834', 'Attempt to land with your feet out in front you, reaching as far as possible with your legs.');
INSERT INTO instructions (id, instruction) VALUES ('f072e558-62b3-4c83-8cf6-637d610ae933', 'Measure the distance from your landing point to the starting point and track results.');
INSERT INTO instructions (id, instruction) VALUES ('ebbd6664-bbd4-4644-9ca0-9a70afe5a400', 'Start by standing to the right side of a low pulley row. Use your left hand to come across the body and grab a single handle attached to the low pulley with a pronated grip (palms facing down). Rest your arm in front of you. Your right hand should grab the machine for better support and balance.');
INSERT INTO instructions (id, instruction) VALUES ('e3615ea3-d4d3-419c-a1c5-af427ebfbe7b', 'Make sure that your back is erect and your feet are shoulder width apart from each other. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('91a9086d-eb5a-4e4a-8c17-e955a0a2827a', 'Begin to use the left hand and come across your body out until it is elevated to shoulder height while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('a6d42d62-28d5-4150-b765-83c21f4fd037', 'Feel the contraction at the top for a second and begin to slowly lower the handle back down to the original starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('b00895f3-fe03-46aa-996f-c25832b8254d', 'Grab a single handle with your left arm next to the low pulley machine. Turn away from the machine keeping the handle to the side of your body with your arm fully extended. Now use both hands to elevate the single handle directly above the head with the palm facing forward. Keep your upper arm completely vertical (perpendicular to the floor) and put your right hand on your left elbow to help keep it steady. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('61d29dc0-61a9-4804-a580-a5dcb83083dc', 'Keeping your upper arms close to your head (elbows in) and perpendicular to the floor, lower the resistance in a semicircular motion behind your head until your forearms touch your biceps. Tip: The upper arms should remain stationary and only the forearms should move. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('1afe9c90-9fc8-4711-8c92-0890c9d17101', 'Go back to the starting position by using the triceps to raise the single handle. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('c4986a43-515d-48c7-8043-bfa75f684d5b', 'Start by placing a barbell that is about chest high on a squat rack. Once you have selected the weights, grab the barbell using a pronated (palms facing forward) grip. Make sure to grip the bar wider than shoulder width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('82e106c4-cf39-4900-bc81-99da7652a2fd', 'Slightly bend the knees and place the barbell on your collar bone. Lift the barbell up keeping it lying on your chest. Take a step back and position your feet shoulder width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('8f4d4063-f3de-499e-8050-8d4df61a1d44', 'To begin, stand straight while holding a weight plate by the ridge at arm''s length in each hand using a neutral grip (palms facing in). You feet should be shoulder width apart from each other. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('868d2692-4f48-4b70-928b-fac54fc606c0', 'Lower the plates until the fingers are nearly extended but can still hold weights. Inhale as you lower the plates.');
INSERT INTO instructions (id, instruction) VALUES ('209bbf38-6a5f-4497-b860-0da095334c6f', 'Now raise the plates back to the starting position as you exhale by closing your hands.');
INSERT INTO instructions (id, instruction) VALUES ('3d7259a4-dfe9-41f5-af40-a8dbdd1755f9', 'Start out by grabbing single handle next to the low pulley machine. Make sure you are far enough from the machine so that your arm is supporting the weight.');
INSERT INTO instructions (id, instruction) VALUES ('4714b35b-89bf-44b2-8267-7ad74bc9a827', 'Make sure that your upper arm is stationary, perpendicular to the floor with elbows in and palms facing forward. Your non lifting arm should be grabbing your waist. This will allow you to keep your balance.');
INSERT INTO instructions (id, instruction) VALUES ('b4a9aed8-ccf1-4a70-ab36-8f9966cf8799', 'Slowly begin to curl the single handle upwards while keeping the upper arm stationary until your forearm touches your bicep while exhaling. Tip: Only the forearm should move.');
INSERT INTO instructions (id, instruction) VALUES ('58585837-2678-4251-a8a6-5bc15c1ab8f3', 'Hold the contraction position as you squeeze the bicep and then lower the single handle back down to the starting position as you inhale.');
INSERT INTO instructions (id, instruction) VALUES ('3d512ce7-48ab-4caf-9e01-96c1320ca9c5', 'Switch arms while performing this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('2a4c7c1e-a8d4-4175-aec4-8016031c8827', 'Stand on the back side of an incline bench as if you were going to be a spotter for someone. Have a dumbbell in one hand and rest it across the incline bench with a supinated (palms up) grip.');
INSERT INTO instructions (id, instruction) VALUES ('80778b9b-56cc-453d-b625-1d2dee68c85c', 'Position your non lifting hand at the corner or side of the incline bench. The chest should be pressed against the top part of the incline and your feet should be pressed against the floor at a wide stance. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('868319cb-6765-48db-bc8d-54dbf13e2514', 'While holding the upper arm stationary, curl the dumbbell upward while contracting the biceps as you breathe out. Only the forearms should move. Continue the movement until your biceps are fully contracted and the dumbbell is at shoulder level. Hold the contracted position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('f31729e3-3b7a-4ce2-9b30-1353c0725f54', 'To begin, stand up with a dumbbell held in one hand. Your feet should be about shoulder width apart from each other. Now fully extend the arm with the dumbbell over your head. Tip: The small finger of your hand should be facing the ceiling and the palm of your hand should be facing forward. The dumbbell should be above your head.');
INSERT INTO instructions (id, instruction) VALUES ('5c12371d-2be3-42b0-98ee-90475d4e0521', 'This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3c8c614b-608c-466b-ad32-46fe54c20b45', 'Keeping your upper arm close to your head (elbows in) and perpendicular to the floor, lower the resistance in a semicircular motion behind your head until your forearm touch your bicep. Tip: The upper arm should remain stationary and only the forearm should move. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('8715c019-9774-4b1f-be9e-fb5ce4da6a79', 'To begin, stand up holding a barbell or e-z bar using a pronated grip (palms facing forward) with your hands closer than shoulder width apart from each other. Your feet should be about shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('8640877a-e7df-412e-8ace-d85ec82b9985', 'Now elevate the barbell above your head until your arms are fully extended. Keep your elbows in. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('bd644e59-5686-46f1-a6ab-4f5fb55150f9', 'Keeping your upper arms close to your head and elbows in, perpendicular to the floor, lower the resistance in a semicircular motion behind your head until your forearms touch your biceps. Tip: The upper arms should remain stationary and only the forearms should move. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('7174ade9-12ff-420c-b618-e5db559271b6', 'Go back to the starting position by using the triceps to raise the barbell. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('92606605-0daf-4901-8310-c70c96fba5bb', 'Start by having a dumbbell in one hand with your arm fully extended to the side using a neutral grip. Use your other arm to hold on to an incline bench to keep your balance.');
INSERT INTO instructions (id, instruction) VALUES ('d153f133-94e1-4fd8-9eb3-f38070cf647b', 'Your feet should be shoulder width apart from each other. Now slowly lift the dumbbell up until you create a 90 degree angle with your arm. Note: Your forearm should be perpendicular to the floor. Continue to maintain a neutral grip throughout the entire exercise.');
INSERT INTO instructions (id, instruction) VALUES ('9ea0194d-a605-4aca-9347-a03c994e3eed', 'Slowly lift the dumbbell up until your arm is fully extended. This the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('52a6f41e-adeb-43b0-925f-9b0861b1d794', 'While inhaling lower the weight down until your arm is at a 90 degree angle again.');
INSERT INTO instructions (id, instruction) VALUES ('08730b3e-3297-4cb3-bb63-f28f367cece8', 'Feel the contraction for a second and then lift the weight back up towards the starting position while exhaling. Remember to hold on to the incline bench and keep your feet positioned to keep balance during the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('276bf522-3696-4811-8005-eb6cf0f96a70', 'Start by having a dumbbell in each hand with your arm fully extended to the side using a neutral grip. Your feet should be shoulder width apart from each other. Now slowly lift the dumbbells up until you create a 90 degree angle with your arms. Note: Your forearms should be perpendicular to the floor. This the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2d3f5db0-3892-4edc-9286-7d21b845c0d6', 'Continue to maintain a neutral grip throughout the entire exercise. Slowly lift the dumbbells up until your arms are fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('20d751dd-94f4-4087-bfe9-1e8108c4fd2f', 'While inhaling lower the weights down until your arm is at a 90 degree angle again.');
INSERT INTO instructions (id, instruction) VALUES ('1767e57e-7f04-42fa-9649-3255c8462108', 'Start by standing straight and holding a barbell behind your glutes at arm''s length while using a pronated grip (palms will be facing back away from the glutes) and having your hands shoulder width apart from each other.');
INSERT INTO instructions (id, instruction) VALUES ('361f57fa-8df2-4af2-8544-cf4c71baa7bb', 'You should be looking straight forward while your feet are shoulder width apart from each other. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('259f2437-01e4-400a-af01-fd13869acd75', 'While exhaling, slowly elevate the barbell up by curling your wrist in a semi-circular motion towards the ceiling. Note: Your wrist should be the only body part moving for this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('2dd75aef-68ad-418c-9ac3-54d4a4620f6a', 'Hold the contraction for a second and lower the barbell back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('e253251b-79cd-48fa-9dae-aaf96768c3c2', 'When finished, lower the barbell down to the squat rack or the floor by bending the knees. Tip: It is easiest to either pick it up from a squat rack or have a partner hand it to you.');
INSERT INTO instructions (id, instruction) VALUES ('0d145d70-f381-4f70-aaaf-1ad9e6b6b83a', 'Start off with your feet hip-distance apart.');
INSERT INTO instructions (id, instruction) VALUES ('5cc50d15-ed59-4ddf-b6c4-42682254bd9f', 'Bend your knees slightly to keep them soft and springy.');
INSERT INTO instructions (id, instruction) VALUES ('fddbf435-76d7-4192-b387-11680440b213', 'You may want to move your pelvis forward and backward and back few times before holding the tailbone forward in this stretch.');
INSERT INTO instructions (id, instruction) VALUES ('320cd78e-2ecb-40a7-a1f5-b37e93661777', 'Attach a rope to a high pulley and select an appropriate weight.');
INSERT INTO instructions (id, instruction) VALUES ('13d32dd0-23d9-46b2-a90e-dee51595421b', 'Stand with your back to the cable tower. Take the rope with both hands over your shoulders, holding it to your upper chest. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1ec1f28c-4ad0-401e-bfb6-194f7565d6a9', 'Perform the movement by flexing the spine, crunching the weight down as far as you can.');
INSERT INTO instructions (id, instruction) VALUES ('dff75e1a-a9e1-43a0-8d7a-04e08deeeca2', 'Hold the peak contraction for a moment before returning to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('41db9021-1fe9-4e7d-83cb-8b781d842a02', 'Stand with your feet hip-distance apart, one foot slightly in front of the other.');
INSERT INTO instructions (id, instruction) VALUES ('1b129da6-1a25-47de-ab55-376251038641', 'Bend both knees, keeping your back heel on the floor. Switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('c5a8332a-a94e-4ed5-8913-66d44d2da3a7', 'Stand with some space in front and behind you.');
INSERT INTO instructions (id, instruction) VALUES ('d1c8576d-8aa5-44f6-885f-8d3a9d8d49e4', 'Bend at the waist, keeping your legs straight, until you can relax and let your upper body hang down in front of you. Let your arms and hands hang down naturally. Hold for 10 to 20 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('8b7df893-03a7-4234-b0e7-a71546539b0a', 'To begin, stand up with both arms fully extended above the head holding one end of a towel with both hands. Your elbows should be in and the arms perpendicular to the floor with the palms facing each other while your feet should be shoulder width apart from each other. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2f5f106c-8b2d-4b4d-a478-5e593b4fec62', 'Now communicate with your partner so that he/she can grip the other side of the towel to apply resistance. Keeping your upper arms close to your head (elbows in) and perpendicular to the floor, lower the resistance in a semicircular motion behind your head until your forearms touch your biceps. Tip: The upper arms should remain stationary and only the forearms should move. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('0246841b-9c21-470f-9d22-e70327328555', 'Go back to the starting position by using the triceps to raise the towel. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('2d76e73e-1257-4807-9ae4-016626dd309d', 'Stand with your feet shoulder width apart holding a medicine ball in both hands. To begin, reach the medicine ball deep behind your head as you bend the knees slightly and lean back.');
INSERT INTO instructions (id, instruction) VALUES ('ec827dde-a9a6-4538-abe2-8f976f513114', 'Violently throw the ball forward, flexing at the hip and using your whole body to complete the movement.');
INSERT INTO instructions (id, instruction) VALUES ('d5248186-ea51-4c9d-9c78-7dc5cc4396aa', 'The medicine ball can be thrown to a partner or to a wall, receiving it as it bounces back.');
INSERT INTO instructions (id, instruction) VALUES ('6e1dd44c-03d3-4e0f-8fa7-def97405ca17', 'To initiate the move, squat down halfway and explode back up as high as possible. Fully extend your entire body, spreading your legs and arms away from the body.');
INSERT INTO instructions (id, instruction) VALUES ('0a175784-fb0e-4939-9792-ebb51175ac5b', 'As you land, bring your limbs back in and absorb your impact through the legs.');
INSERT INTO instructions (id, instruction) VALUES ('695387f4-8907-4518-b523-5140ad59db32', 'Stand facing a box or bench of an appropriate height with your feet together. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c8a87cde-fe0d-42b0-93ff-99e522c21247', 'Begin the movement by stepping up, putting your left foot on the top of the bench. Extend through the hip and knee of your front leg to stand up on the box. As you stand on the box with your left leg, flex your right knee and hip, bringing your knee as high as you can.');
INSERT INTO instructions (id, instruction) VALUES ('f139d947-426d-4830-9328-b8591828d172', 'Reverse this motion to step down off the box, and then repeat the sequence on the opposite leg.');
INSERT INTO instructions (id, instruction) VALUES ('597b425e-3835-40fa-a3e0-b0e7af70bfe5', 'To begin, step onto the stepmill and select the desired option from the menu. You can choose a manual setting, or you can select a program to run. Typically, you can enter your age and weight to estimate the amount of calories burned during exercise. Use caution so that you don''t trip as you climb the stairs. It is recommended that you maintain your grip on the handles so that you don''t fall.');
INSERT INTO instructions (id, instruction) VALUES ('9ee622f2-0915-4afe-bb2b-95028b1ee83a', 'Stepmills offer convenience, cardiovascular benefits, and usually have less impact than running outside while offering a similar rate of calories burned. They are typically much harder than other cardio equipment. A 150 lb person will typically burn over 300 calories in 30 minutes, compared to about 175 calories walking.');
INSERT INTO instructions (id, instruction) VALUES ('a248c6dc-10dd-4183-8dfa-a4f99abec492', 'Grasp a bar using an overhand grip (palms facing down). You may need some wrist wraps if using a significant amount of weight.');
INSERT INTO instructions (id, instruction) VALUES ('16d75828-ecfa-431e-ac10-3dc59713f548', 'Stand with your torso straight and your legs spaced using a shoulder width or narrower stance. The knees should be slightly bent. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('64e36e61-738f-4221-bc42-cba39333150c', 'Keeping the knees stationary, lower the barbell to over the top of your feet by bending at the hips while keeping your back straight. Keep moving forward as if you were going to pick something from the floor until you feel a stretch on the hamstrings. Inhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('d5d512eb-0d18-4960-b00a-f28d5208be7b', 'Start bringing your torso up straight again by extending your hips until you are back at the starting position. Exhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('9cc3f959-ae58-41ec-b216-e60af4ec06a9', 'Grasp a couple of dumbbells holding them by your side at arm''s length.');
INSERT INTO instructions (id, instruction) VALUES ('12bb5e58-817b-4fab-8014-85d879f7a978', 'Keeping the knees stationary, lower the dumbbells to over the top of your feet by bending at the waist while keeping your back straight. Keep moving forward as if you were going to pick something from the floor until you feel a stretch on the hamstrings. Exhale as you perform this movement');
INSERT INTO instructions (id, instruction) VALUES ('7637b002-2313-4e97-91d5-98c8454cdf21', 'Start bringing your torso up straight again by extending your hips and waist until you are back at the starting position. Inhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('60513200-af50-4913-989f-a449e032431b', 'Step away from the rack and position your legs using a shoulder width medium stance. Keep your head up at all times as looking down will get you off balance and also maintain a straight back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('72d8f14b-4f4c-4905-a045-5c62c9a83c58', 'Keeping your legs stationary, move your torso forward by bending at the hips while inhaling. Lower your torso until it is parallel with the floor.');
INSERT INTO instructions (id, instruction) VALUES ('118ebb8b-f755-40a1-a106-30936b30458b', 'Begin to raise the bar as you exhale by elevating your torso back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('86b6bc7f-4741-4985-a1a8-12c8d5bce9b7', 'To begin, stand straight with your feet shoulder width apart from each other. Place your hands on your hips. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('9d1fddca-1045-4a7b-afb4-dbeed6e5f7e8', 'Now slowly inhale as much air as possible and then start to exhale as much as possible while bringing your stomach in as much as possible and hold this position. Try to visualize your navel touching your backbone.');
INSERT INTO instructions (id, instruction) VALUES ('f996392d-f707-46d8-85a3-ba40373163a4', 'One isometric contraction is around 20 seconds. During the 20 second hold, try to breathe normally. Then inhale and bring your stomach back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ccf4c9b8-5f72-46cb-a7b4-3310298d6ab8', 'Once you have practiced this exercise, try to perform this exercise for longer than 20 seconds. Tip: You can work your way up to 40-60 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('5cba684e-52c2-4404-9740-9df5cd925a59', 'Repeat for the recommended amount of sets.');
INSERT INTO instructions (id, instruction) VALUES ('1b1e86b3-f8a9-4e66-8569-4839984f4782', 'Grasp the dumbbell with both hands and hold it straight over your chest at arms length. Both palms should be pressing against the underside one of the sides of the dumbbell. This will be your starting position.
INSERT INTO instructions (id, instruction) VALUES ('b027f654-e198-4808-a58b-6c1df7d2e58c', 'While keeping your arms straight, lower the weight slowly in an arc behind your head while breathing in until you feel a stretch on the chest.');
INSERT INTO instructions (id, instruction) VALUES ('a6941da9-3ee1-49bc-b6b4-b2084c17fb3b', 'You will start by grabbing the wide bar from the top pulley of a pulldown machine and using a wider than shoulder-width pronated (palms down) grip. Step backwards two feet or so.');
INSERT INTO instructions (id, instruction) VALUES ('2e4bd29c-93dc-4e43-b585-4939f694772d', 'Bend your torso forward at the waist by around 30-degrees with your arms fully extended in front of you and a slight bend at the elbows. If your arms are not fully extended then you need to step a bit more backwards until they are. Once your arms are fully extended and your torso is slightly bent at the waist, tighten the lats and then you are ready to begin.');
INSERT INTO instructions (id, instruction) VALUES ('b20b1e99-0ddb-47f2-ad14-0b7f9782961a', 'While keeping the arms straight, pull the bar down by contracting the lats until your hands are next to the side of the thighs. Breathe out as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('8e9d51cd-2305-4310-87f8-598208652f80', 'While keeping the arms straight, go back to the starting position while breathing in.');
INSERT INTO instructions (id, instruction) VALUES ('a243c13c-b7a2-4847-9199-45f5a22872a5', 'Place a loaded barbell on the end of a bench. Standing on the bench behind the bar, take a medium, pronated grip. Stand with your hips back and chest up, maintaining a neutral spine. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('19a3e259-c7ce-49b7-85e9-977f087732cd', 'Row the bar to your torso by retracting the shoulder blades and flexing the elbows. Use a controlled movement with no jerking.');
INSERT INTO instructions (id, instruction) VALUES ('fb1a904f-a66f-49eb-b750-251afd05c4d7', 'After a brief pause, slowly return the bar to the starting position, ensuring to go all the way down.');
INSERT INTO instructions (id, instruction) VALUES ('816f927d-2562-47e8-966a-09753c76205d', 'Lay on the bench face down. With a pronated grip, pick the barbell up from the floor, keeping your arms straight. Allow the bar to hang straight down. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0c5008fe-fdb0-4bff-b305-54de6d572a98', 'To begin, raise the barbell out in front of your head while keeping your arms extended.');
INSERT INTO instructions (id, instruction) VALUES ('e10a377d-e9e6-4fe4-a024-998073c659aa', 'Land in the opposite position that you started, on the opposite side of the box. The foot that was initially on the box will now be on the ground, with the opposite foot now on the box.');
INSERT INTO instructions (id, instruction) VALUES ('fe7937ea-4030-4752-bb9d-e007d216240f', 'Repeat the movement, crossing back over to the other side.');
INSERT INTO instructions (id, instruction) VALUES ('8b67eaad-f57c-40a3-ae07-1f97bb3f2283', 'Begin with a bar loaded on the ground. Approach the bar so that the bar intersects the middle of the feet. The feet should be set very wide, near the collars. Bend at the hips to grip the bar. The arms should be directly below the shoulders, inside the legs, and you can use a pronated grip, a mixed grip, or hook grip. Relax the shoulders, which in effect lengthens your arms.');
INSERT INTO instructions (id, instruction) VALUES ('05ec4752-efda-48f7-bb8d-c077054a544a', 'To deadlift with short bands, simply loop them over the bar before you start, and step into them to set up. Ensure that they under the back half of your foot, directly where you are driving into the floor.');
INSERT INTO instructions (id, instruction) VALUES ('9c40f1a8-2e66-4b6e-95a3-9920e092eff9', 'Begin with a bar loaded on the ground. Approach the bar so that the bar intersects the middle of the feet. The feet should be set very wide, near the collars. Bend at the hips to grip the bar. The arms should be directly below the shoulders, inside the legs, and you can use a pronated grip, a mixed grip, or hook grip.');
INSERT INTO instructions (id, instruction) VALUES ('70bdf952-858b-4a3d-9143-9a3ade7f6291', 'You can attach the chains to the sleeves of the bar, or just drape the middle over the bar so there is a greater weight increase as you lift. Attempt to keep the ends of the chains away from the plates so you don''t hit them when you lower the weight.');
INSERT INTO instructions (id, instruction) VALUES ('50c8a8c9-fb38-4d9d-954f-58372df085c4', 'To begin, lie straight and face down on the floor or exercise mat. Your arms should be fully extended in front of you. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ff5fd043-b3c8-4d25-bf71-0c7a71b9bb82', 'Simultaneously raise your arms, legs, and chest off of the floor and hold this contraction for 2 seconds. Tip: Squeeze your lower back to get the best results from this exercise. Remember to exhale during this movement. Note: When holding the contracted position, you should look like superman when he is flying.');
INSERT INTO instructions (id, instruction) VALUES ('22a22488-ad9a-49ad-b980-f20b988b3882', 'Slowly begin to lower your arms, legs and chest back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('f8f4b917-4b98-4472-a9ee-844bffa88a73', 'This drill is great for chest passes when you lack a partner or a wall of sufficient strength. Lay on the ground on your back with your knees bent.');
INSERT INTO instructions (id, instruction) VALUES ('61c1d9dd-e85b-46ac-b1b0-08d250ee95d4', 'Begin with the ball on your chest, held with both hands on the bottom.');
INSERT INTO instructions (id, instruction) VALUES ('88ffeb36-f997-42e8-b699-1993ac26cad7', 'Explode up, extending through the elbow to throw the ball directly above you as high as possible.');
INSERT INTO instructions (id, instruction) VALUES ('f96dbe89-263a-4aea-92cc-49a70f40c0ac', 'Catch the ball with both hands as it comes down.');
INSERT INTO instructions (id, instruction) VALUES ('093e67f8-6302-4a3e-8960-c0f1a60fa9fb', 'Lay on the ground on your back with your knees bent. Hold the ball with one hand, extending the arm fully behind your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5631d591-ed96-4cb3-b20f-bc726186a95e', 'Initiate the movement at the shoulder, throwing the ball directly forward of you as you sit up, attempting to go for maximum distance.');
INSERT INTO instructions (id, instruction) VALUES ('bc548542-6c71-42fe-8cdb-feed5cf37eca', 'The ball can be thrown to a partner or bounced off of a wall.');
INSERT INTO instructions (id, instruction) VALUES ('4b3b3886-f41b-4c38-a0b6-0e3e98b95104', 'Lay on the ground on your back with your knees bent.');
INSERT INTO instructions (id, instruction) VALUES ('4324d818-add9-4e17-9eb6-fea7e7910bce', 'Hold the ball with both hands, extending the arms fully behind your head. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('81a6f4ae-772b-433f-b2cc-04d6d9d555f1', 'Adjust the straps so the handles are at an appropriate height, below waist level.');
INSERT INTO instructions (id, instruction) VALUES ('9cc42639-1cfd-45d7-ae6c-acfa819d231a', 'Begin standing and grasping the handles. Lean into the straps, moving to an incline push-up position. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('edad7a4b-1956-44c5-8615-d7aa2adef066', 'Keeping your arms straight, lean further into the suspension straps, bringing your body closer to the ground, allowing your shoulders to extend, raising your arms up and over your head.');
INSERT INTO instructions (id, instruction) VALUES ('8e503015-c00c-4ed9-b8cb-9a7427c7c6af', 'Maintain a neutral spine and keep the rest of your body straight, your shoulders being the only joints allowed to move.');
INSERT INTO instructions (id, instruction) VALUES ('7d338125-f79a-4cdb-ba8e-0ef41be7e000', 'Pause during the peak contraction, and then return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a2628443-f8fb-4e44-a6cd-093b993e129d', 'Anchor your suspension straps securely to the top of a rack or other object.');
INSERT INTO instructions (id, instruction) VALUES ('d1323986-4504-40ce-bf4f-5fdecf86cafe', 'Leaning into the straps, take a handle in each hand and move into a push-up plank position. You should be as close to parallel to the ground as you can manage with your arms fully extended, maintaining good posture.');
INSERT INTO instructions (id, instruction) VALUES ('3ae43b6e-f60f-4f48-b4f5-53eb31bd90f2', 'Maintaining a straight, rigid torso, descend slowly by allowing the elbows to flex.');
INSERT INTO instructions (id, instruction) VALUES ('9afb5f2b-584d-493c-84f3-f4131b2c4b98', 'Continue until your elbows break 90 degrees, pausing before you extend to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5abdfc57-b2c1-45ad-ad7e-141fa6e4052a', 'Secure a set of suspension straps with the handles hanging about a foot off of the ground. Move yourself into a pushup plank position facing away from the rack.');
INSERT INTO instructions (id, instruction) VALUES ('4be00584-228b-4320-b3fa-3e51712b8c01', 'Place your feet into the handles. You should maintain a straight posture, not allowing the hips to sag. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('86b1d3f4-4d59-484b-8334-002c91e86bd2', 'Begin the movement by flexing the knees and hips, drawing the knees to your torso. As you do so, anteriorly tilt your pelvis, allowing your spine to flex.');
INSERT INTO instructions (id, instruction) VALUES ('1d9cb66f-dccf-4466-b5d7-a24e71bdcf46', 'At the top of the controlled motion, return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('2faa6fd6-6997-4387-a7b2-ddaa92a224c2', 'Suspend your straps at around chest height. Take a handle in each hand and lean back. Keep your body erect and your head and chest up. Your arms should be fully extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('408e1644-cb9d-475d-adcc-275fd9f0191f', 'Begin by flexing the elbow to initiate the movement. Protract your shoulder blades as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('05e0df7f-b186-4d80-9bdc-f05e30ba3ff7', 'At the completion of the motion pause, and then return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('67df080d-fbe5-4dd7-bbef-ce50b71ae387', 'Suspend your straps so the handles are 18-30 inches from the floor.');
INSERT INTO instructions (id, instruction) VALUES ('0b7555eb-9c14-4dc0-a5d5-cf1dae592d52', 'Facing away from the setup, place your rear foot into the handle behind you. Keep your head looking forward and your chest up, with your knee slightly bent. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('89a32cbb-8aa7-46f0-af29-e7f9b3504f0c', 'Descend by flexing the knee and hips, lowering yourself to the ground. Keep your weight on the heel of your foot and maintain your posture throughout the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('acb41100-7555-48d5-9eb9-f2edf10c6002', 'At the bottom of the movement, reverse the motion, extending through the hip and knee to return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('4822978e-b6dc-4999-93f1-74a76f9eeb35', 'Begin in a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('c0ed9c23-c969-4c56-b63d-a60d5a296f85', 'Press two lightweight plates together with your hands. Hold the plates together close to your chest to create an isometric contraction in your chest muscles. Your fingers should be pointed forward. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0f91a48e-715f-443f-83fd-1f16261b697e', 'Squeeze the plates between your palms and extend your arms directly out in front of you in a controlled motion.');
INSERT INTO instructions (id, instruction) VALUES ('b4a0437b-4f0c-45fe-94c1-999ed369f7f9', 'Pause at the top of the motion, and then slowly return to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1f932b6d-1ab1-4bef-8077-e9096bcbee5b', 'Stand over the bar, and position a Double D row handle around the bar next to the collar. Using your hips and legs, rise to a standing position.');
INSERT INTO instructions (id, instruction) VALUES ('db8c52b0-c807-4eea-b095-15c32eed845b', 'Assume a wide stance with your hips back and your chest up. Your arms should be extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('1e293b57-c58d-4146-8fb3-2733407c775c', 'Pull the weight to your upper abdomen by retracting the shoulder blades and flexing the elbows. Do not jerk the weight or cheat during the movement.');
INSERT INTO instructions (id, instruction) VALUES ('3ff61e6c-827e-4f53-8972-412951f7a43a', 'Lie down on a flat bench with a dumbbell in each hand on top of your thighs. The palms of your hand will be facing each other.');
INSERT INTO instructions (id, instruction) VALUES ('fcf274bc-25b7-4bd3-94c4-9dedab91b7bf', 'By using your thighs to help you get the dumbbells up, clean the dumbbells one arm at a time so that you can hold them in front of you at shoulder width. Note: when holding the dumbbells in front of you, make sure your arms are wider than shoulder width apart from each other using a pronated (palms forward) grip. Allow your elbows to point out. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('7e9ad03e-1102-4d32-8f57-a699f738980c', 'Keeping the upper arms stationary, slowly move the dumbbells in and down in a semi circular motion until they touch the upper chest while inhaling. Keep full control of the dumbbells at all times and do not move the upper arms nor rest the dumbbells on the chest.');
INSERT INTO instructions (id, instruction) VALUES ('07ddf64e-cedc-4217-bc21-94f2ccf34da9', 'As you breathe out, move the dumbbells up using your triceps and the same semi-circular motion but in reverse. Attempt to keep the dumbbells together as they move up. Lock your arms in the contracted position, hold for a second and then start coming down again slowly again. Tip: It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('2a41bcac-19e7-4f78-ba0d-ca6dbaae3791', 'Begin in a seated, upright position. Start by extending your legs in front of you in a V.');
INSERT INTO instructions (id, instruction) VALUES ('38c8efc8-820e-419c-bbec-b53f5093ff19', 'With your hands on the floor, lean forward as far as possible. Hold for 10 to 20 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('65c0e585-4a02-4bd1-8010-3fd51b5a4f4f', 'To begin, sit down on the abductor machine and select a weight you are comfortable with. When your legs are positioned properly, grip the handles on each side. Your entire upper body (from the waist up) should be stationary. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('be541363-ffd7-4126-91aa-3cd2c8109ae8', 'Slowly press against the machine with your legs to move them away from each other while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('2c4b0698-ee71-4761-b0fb-1651258a7b53', 'Feel the contraction for a second and begin to move your legs back to the starting position while breathing in. Note: Remember to keep your upper body stationary to prevent any injuries from occurring.');
INSERT INTO instructions (id, instruction) VALUES ('08bd09dd-c05f-4f6e-aae6-6e99f4e31e29', 'To begin, sit down on the adductor machine and select a weight you are comfortable with. When your legs are positioned properly on the leg pads of the machine, grip the handles on each side. Your entire upper body (from the waist up) should be stationary. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('903f942a-7aac-4f8f-9e99-ff9930b2583e', 'Slowly press against the machine with your legs to move them towards each other while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('903775ea-ee37-4281-8e6a-9999b463aeed', 'Feel the contraction for a second and begin to move your legs back to the starting position while breathing in. Note: Remember to keep your upper body stationary and avoid fast jerking motions in order to prevent any injuries from occurring.');
INSERT INTO instructions (id, instruction) VALUES ('abcab023-fb37-4aaf-a133-1bee5839f7a6', 'Begin by gripping the bottom of the tire on the tread, and position your feet back a bit. Your chest should be driving into the tire.');
INSERT INTO instructions (id, instruction) VALUES ('94de209e-87b6-40c0-a3c0-3bb02412b817', 'To lift the tire, extend through the hips, knees, and ankles, driving into the tire and up.');
INSERT INTO instructions (id, instruction) VALUES ('4becbb73-b687-4708-80a2-88d4b556b636', 'As the tire reaches a 45 degree angle, step forward and drive a knee into the tire. As you do so adjust your grip to the upper portion of the tire and push it forward as hard as possible to complete the turn. Repeat as necessary.');
INSERT INTO instructions (id, instruction) VALUES ('1f2f6f32-9cf2-4822-ba73-2d024f908ee2', 'To begin, lie down on the floor or an exercise mat with your back pressed against the floor. Your arms should be lying across your sides with the palms facing down.');
INSERT INTO instructions (id, instruction) VALUES ('094a0bba-aeb2-4964-a0e7-7c903a03711f', 'Your legs should be touching each other. Slowly elevate your legs up in the air until they are almost perpendicular to the floor with a slight bend at the knees. Your feet should be parallel to the floor.');
INSERT INTO instructions (id, instruction) VALUES ('82ebb2cf-3b92-4548-8528-4ceb89d8ecd4', 'Move your arms so that they are fully extended at a 45 degree angle from the floor. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e40aa0b2-ca36-4487-a7e3-5f40bdcb25a5', 'While keeping your lower back pressed against the floor, slowly lift your torso and use your hands to try and touch your toes. Remember to exhale while perform this part of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('79374817-afb4-496a-a959-a9316fa12b90', 'Slowly begin to lower your torso and arms back down to the starting position while inhaling. Remember to keep your arms straight out pointing towards your toes.');
INSERT INTO instructions (id, instruction) VALUES ('693734ee-2b13-4853-8a93-a95307ebcd2f', 'Stand upright holding an exercise ball with both hands. Extend your arms so the ball is straight out in front of you. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('26e2f0cd-2240-4a9c-8143-98a06c65bdce', 'Rotate your torso to one side, keeping your eyes on the ball as you move. Now, rotate back to the opposite direction. Repeat for 10-20 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('f4ca0661-448c-44dd-961f-2c5d1ad73c28', 'Running or hiking on trails will get the blood pumping and heart beating almost immediately. Make sure you have good shoes. While you use the muscles in your calves and buttocks to pull yourself up a hill, the knees, joints and ankles absorb the bulk of the pounding coming back down. Take smaller steps as you walk downhill, keep your knees bent to reduce the impact and slow down to avoid falling.');
INSERT INTO instructions (id, instruction) VALUES ('256b36b2-ff09-4adc-9e70-003037dfecf9', 'A 150 lb person can burn over 200 calories for 30 minutes walking uphill, compared to 175 on a flat surface. If running the trail, a 150 lb person can burn well over 500 calories in 30 minutes.');
INSERT INTO instructions (id, instruction) VALUES ('de0be59b-40f9-4188-8c6c-477c41253faf', 'For this exercise load a trap bar, also known as a hex bar, to an appropriate weight resting on the ground. Stand in the center of the apparatus and grasp both handles.');
INSERT INTO instructions (id, instruction) VALUES ('1144fb66-632f-47e1-9a9a-51bdff199cba', 'Lower your hips, look forward with your head and keep your chest up.');
INSERT INTO instructions (id, instruction) VALUES ('c6739b4d-bce7-4afb-a125-01691736099e', 'Begin the movement by driving through the heels and extend your hips and knees. Avoid rounding your back at all times.');
INSERT INTO instructions (id, instruction) VALUES ('3af4eb23-6d7b-4520-b570-6ce9c47ca300', 'At the completion of the movement, lower the weight back to the ground under control.');
INSERT INTO instructions (id, instruction) VALUES ('01052b9a-8562-409d-a775-efec22197a3b', 'Start with a dumbbell in each hand and your palms facing your torso. Keep your back straight with a slight bend in the knees and bend forward at the waist. Your torso should be almost parallel to the floor. Make sure to keep your head up. Your upper arms should be close to your torso and parallel to the floor. Your forearms should be pointed towards the floor as you hold the weights. There should be a 90-degree angle formed between your forearm and upper arm. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('175361d9-55a2-4ba1-930e-a5c6231ebb6d', 'Now, while keeping your upper arms stationary, exhale and use your triceps to lift the weights until the arm is fully extended. Focus on moving the forearm.');
INSERT INTO instructions (id, instruction) VALUES ('887bb855-b415-4718-bf2f-8e6d6cf9923b', 'After a brief pause at the top contraction, inhale and slowly lower the dumbbells back down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b4d63c3b-3756-47d4-ad89-0cb426ab0d0a', 'Bring right arm across your body and over your left shoulder, holding your elbow with your left hand, until you feel a stretch in your tricep. Then repeat for your other arm.');
INSERT INTO instructions (id, instruction) VALUES ('469d01b7-67ad-4a01-8bac-9e030dd97209', 'Attach a rope to a low pulley. After selecting an appropriate weight, grasp the rope with both hands and face away from the cable.');
INSERT INTO instructions (id, instruction) VALUES ('87c17085-9384-493c-8d44-ccfedec04a15', 'Position your hands behind your head with your elbows point straight up. Your elbows should start out flexed, and you can stagger your stance and lean gently away from the machine to create greater stability. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('de386625-53fc-4ffd-82a5-0a4bb2da7eb0', 'To perform the movement, extend through the elbow while keeping the upper arm in position, raising your hands above your head.');
INSERT INTO instructions (id, instruction) VALUES ('e557a90f-1512-480e-9531-afd284cf98c6', 'Squeeze your triceps at the top of the movement, and slowly lower the weight back to the start position.');
INSERT INTO instructions (id, instruction) VALUES ('f497a631-4e58-4357-8a4e-2996c93ffdf7', 'Attach a straight or angled bar to a high pulley and grab with an overhand grip (palms facing down) at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('616f0bf6-e95d-4e1e-9fe1-52acd3ef903a', 'Standing upright with the torso straight and a very small inclination forward, bring the upper arms close to your body and perpendicular to the floor. The forearms should be pointing up towards the pulley as they hold the bar. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('0700bcbc-adbe-4b56-a5de-23393bbaa584', 'Using the triceps, bring the bar down until it touches the front of your thighs and the arms are fully extended perpendicular to the floor. The upper arms should always remain stationary next to your torso and only the forearms should move. Exhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('a16af227-716f-44e9-8af2-4130b003068d', 'After a second hold at the contracted position, bring the bar slowly up to the starting point. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('b266a3c4-a052-47ed-83d5-fb7ff8841573', 'Attach a rope attachment to a high pulley and grab with a neutral grip (palms facing each other).');
INSERT INTO instructions (id, instruction) VALUES ('9c58a2cf-d934-497d-a938-08a27d4635a9', 'Standing upright with the torso straight and a very small inclination forward, bring the upper arms close to your body and perpendicular to the floor. The forearms should be pointing up towards the pulley as they hold the rope with the palms facing each other. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('242cbea2-6634-41c3-b6c9-1bb0c59574b3', 'Using the triceps, bring the rope down as you bring each side of the rope to the side of your thighs. At the end of the movement the arms are fully extended and perpendicular to the floor. The upper arms should always remain stationary next to your torso and only the forearms should move. Exhale as you perform this movement.');
INSERT INTO instructions (id, instruction) VALUES ('3f2ec07c-6151-447d-ba15-c929ac7bafd4', 'After holding for a second, at the contracted position, bring the rope slowly up to the starting point. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('e9754b9d-98cc-4139-bf56-6884c0a9d71b', 'Attach a V-Bar to a high pulley and grab with an overhand grip (palms facing down) at shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('d7ded6b8-4427-4fe9-b2a9-b6b1def09c65', 'Standing upright with the torso straight and a very small inclination forward, bring the upper arms close to your body and perpendicular to the floor. The forearms should be pointing up towards the pulley as they hold the bar. The thumbs should be higher than the small finger. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3581d11d-5647-4199-b341-dfb8f6684aab', 'After a second hold at the contracted position, bring the V-Bar slowly up to the starting point. Breathe in as you perform this step.');
INSERT INTO instructions (id, instruction) VALUES ('d4d1439d-7212-4308-a66f-bd6e158200ee', 'Reach your hand behind your head, grasp your elbow and gently pull. Hold for 10 to 20 seconds, then switch sides.');
INSERT INTO instructions (id, instruction) VALUES ('2971387a-951f-486e-b0e9-d607a8583e47', 'Your legs should be crossed by wrapping one ankle around the other. Slowly elevate your legs up in the air until your thighs are perpendicular to the floor with a slight bend at the knees. Note: Your knees and toes should be parallel to the floor as opposed to the thighs.');
INSERT INTO instructions (id, instruction) VALUES ('67dc1fae-ca84-4dca-8d00-ebb62dc24ffb', 'Move your arms from the floor and cross them so they are resting on your chest. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('5f919a51-9a1b-4545-b0f7-23e5e40552fb', 'While keeping your lower back pressed against the floor, slowly lift your torso. Remember to exhale while perform this part of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('1dca8505-def1-444d-ae80-a698af501cd4', 'Slowly begin to lower your torso back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('1a70ac21-0831-45a9-8004-2893bac9ae00', 'Grab a dumbbell with each arm and place the upper arms on top of the preacher bench or the incline bench. The dumbbell should be held at shoulder length. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('81299d32-6025-4c5e-8fcd-c60a9ea01e47', 'As you exhale, use the biceps to curl the weights up until your biceps is fully contracted and the dumbbells are at shoulder height.');
INSERT INTO instructions (id, instruction) VALUES ('4bccae51-add4-4b45-996b-d1dc67d5569b', 'Clean the kettlebells to your shoulders by extending through the legs and hips as you raise the kettlebells towards your shoulders. Rotate your wrists as you do so.');
INSERT INTO instructions (id, instruction) VALUES ('b888ad9f-e0f2-48d6-a20b-4cd005d4ad5f', 'Lower the kettlebells back to the starting position and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('f367d9d3-7cd6-4331-b145-f92f1258f5bd', 'Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you swing the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward. Squat down a few inches and reverse the motion rapidly driving both kettlebells overhead. Immediately after the initial push, squat down again and get under the kettlebells. Once the kettlebells are locked out, stand upright to complete the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('c4841665-accf-452a-9054-d2589d59bd0d', 'Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you swing the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward.');
INSERT INTO instructions (id, instruction) VALUES ('6b4b9fb8-3ac4-415f-bc4a-cf592783b8f5', 'Press the kettlebells up and out. As the kettlebells pass your head, lean into the weights so that the kettlebells are racked behind your head. Make sure to contract your lats, butt, and stomach for added stability.');
INSERT INTO instructions (id, instruction) VALUES ('56eca751-a889-44dd-932e-6f0d4db15ba7', 'Place two kettlebells in front of your feet. Bend your knees slightly and then push your butt out as much as possible as you bend over to get in the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a19e23bc-193a-43fb-a4bd-7881d7a81473', 'Grab both kettlebells and pull them to your stomach, retracting your shoulder blades and flexing the elbows. Keep your back straight. Lower and repeat.');
INSERT INTO instructions (id, instruction) VALUES ('d3d9a10a-bd53-457a-ad06-bc91de9536c1', 'Sit down on a pull-down machine with a wide bar attached to the top pulley. Adjust the knee pad of the machine to fit your height. These pads will prevent your body from being raised by the resistance attached to the bar.');
INSERT INTO instructions (id, instruction) VALUES ('8c63ed09-a00a-4a44-9b9d-345b6b63f615', 'Grab the pull-down bar with the palms facing your torso (a supinated grip). Make sure that the hands are placed closer than the shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('80e969e5-11f0-4aac-95c6-67bc2b66d6a7', 'As you breathe out, pull the bar down until it touches your upper chest by drawing the shoulders and the upper arms down and back. Tip: Concentrate on squeezing the back muscles once you reach the fully contracted position and keep the elbows close to your body. The upper torso should remain stationary as your bring the bar to you and only the arms should move. The forearms should do no other work other than hold the bar.');
INSERT INTO instructions (id, instruction) VALUES ('b205b85e-5be3-4f4e-bacb-714d93bfcec7', 'After a second on the contracted position, while breathing in, slowly bring the bar back to the starting position when your arms are fully extended and the lats are fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('9aea31fc-e02f-41fe-a2a2-74d54d198bf6', 'While seated, bend forward to hug your thighs from underneath with both arms.');
INSERT INTO instructions (id, instruction) VALUES ('61f5ccae-8399-4dd2-9c98-ee6a602c4f1e', 'Keep your knees together and your legs extended out as you bring your chest down to your knees. You can also stretch your middle back by pulling your back away from your knees as your hugging them.');
INSERT INTO instructions (id, instruction) VALUES ('1dd9aaad-7dd9-4af2-bd34-658fa3693286', 'Clasp fingers together with your thumbs pointing down, round your shoulders as you reach your hands forward.');
INSERT INTO instructions (id, instruction) VALUES ('d048f368-a365-4fc4-b8d3-60a3cad9818d', 'Grasp a barbell with an overhand grip that is slightly less than shoulder width. The bar should be resting on the top of your thighs with your arms extended and a slight bend in your elbows. Your back should also be straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('b3b3583f-3e8c-4969-8de9-c5056cd72f9f', 'Now exhale and use the sides of your shoulders to lift the bar, raising your elbows up and to the side. Keep the bar close to your body as you raise it. Continue to lift the bar until it nearly touches your chin. Tip: Your elbows should drive the motion, and should always be higher than your forearms. Remember to keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('52d566c1-43bf-4c95-86f4-08bc1efd2be5', 'Grasp a straight bar cable attachment that is attached to a low pulley with a pronated (palms facing your thighs) grip that is slightly less than shoulder width. The bar should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('890d66a0-b257-4fc3-afae-9f97b0401b7b', 'Use your side shoulders to lift the cable bar as you exhale. The bar should be close to the body as you move it up. Continue to lift it until it nearly touches your chin. Tip: Your elbows should drive the motion. As you lift the bar, your elbows should always be higher than your forearms. Also, keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('567e95f2-3a76-48de-a7c1-48a5348b53c4', 'To begin, stand on an exercise band so that tension begins at arm''s length. Grasp the handles using a pronated (palms facing your thighs) grip that is slightly less than shoulder width. The handles should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('78a53584-8a10-410b-b13b-09858e26222f', 'Use your side shoulders to lift the handles as you exhale. The handles should be close to the body as you move them up. Continue to lift the handles until they nearly touches your chin. Tip: Your elbows should drive the motion. As you lift the handles, your elbows should always be higher than your forearms. Also, keep your torso stationary and pause for a second at the top of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('c1444440-ed9b-4e5b-916c-222047dbd270', 'Extend both hands straight above your head, palms touching.');
INSERT INTO instructions (id, instruction) VALUES ('cbca24ac-7855-4430-b976-41be7e0ac5b1', 'Slowly push your hands up and back, keeping your back straight.');
INSERT INTO instructions (id, instruction) VALUES ('3b7e5389-4fec-408b-8a97-c64ff91c0736', 'Sit down on a pull-down machine with a V-Bar attached to the top pulley.');
INSERT INTO instructions (id, instruction) VALUES ('be9bb182-2a42-4e3b-908d-d2b53aff0633', 'Adjust the knee pad of the machine to fit your height. These pads will prevent your body from being raised by the resistance attached to the bar.');
INSERT INTO instructions (id, instruction) VALUES ('22ffc6a0-09f0-49ec-bc00-701e61993f67', 'Grab the V-bar with the palms facing each other (a neutral grip). Stick your chest out and lean yourself back slightly (around 30-degrees) in order to better engage the lats. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('e76907a7-0f98-4a75-9d72-17cdc24437ca', 'Using your lats, pull the bar down as you squeeze your shoulder blades. Continue until your chest nearly touches the V-bar. Exhale as you execute this motion. Tip: Keep the torso stationary throughout the movement.');
INSERT INTO instructions (id, instruction) VALUES ('122f339a-26b1-4093-a118-d965f1d896ed', 'After a second hold on the contracted position, slowly bring the bar back to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('c6340f95-c2d9-4f36-a3eb-081e4653768a', 'Repeat for the prescribed number of repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('5127bd28-ed73-42e3-91c5-16194523f2fc', 'Start by placing the middle of the V-bar in the middle of the pull-up bar (assuming that the pull-up station you are using does not have neutral grip handles). The V-Bar handles will be facing down so that you can hang from the pull-up bar through the use of the handles.');
INSERT INTO instructions (id, instruction) VALUES ('10768638-ee0e-4600-bd2a-16abbd00e398', 'Once you securely place the V-bar, take a hold of the bar from each side and hang from it. Stick your chest out and lean yourself back slightly in order to better engage the lats. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('665cb4b7-edf9-4b80-8356-fd1ba6214972', 'Using your lats, pull your torso up while leaning your head back slightly so that you do not hit yourself with the chin-up bar. Continue until your chest nearly touches the V-bar. Exhale as you execute this motion.');
INSERT INTO instructions (id, instruction) VALUES ('60017a91-5186-4511-a3ac-1d64da19c60f', 'After a second hold on the contracted position, slowly lower your body back to the starting position as you breathe in.');
INSERT INTO instructions (id, instruction) VALUES ('6f868af5-7e11-4193-9c19-0d427c008eb0', 'Allow the dumbbell to hang at arms length between your legs, holding it with both hands. Keep your back straight and your head up.');
INSERT INTO instructions (id, instruction) VALUES ('f70e3db1-ddd9-48ac-b239-23ed6b4492d9', 'Swing the dumbbell between your legs, flexing at the hips and bending the knees slightly.');
INSERT INTO instructions (id, instruction) VALUES ('31722e25-057d-44be-8efc-d84eb815575d', 'Powerfully reverse the motion by extending at the hips, knees, and ankles to propel yourself upward, swinging the dumbell over your head.');
INSERT INTO instructions (id, instruction) VALUES ('869ce9bb-21c0-4f11-82af-141c276fda33', 'As you land, absorb the impact through your legs and draw the dumbbell to your torso before the next repetition.');
INSERT INTO instructions (id, instruction) VALUES ('99917721-682d-455f-9bf3-6e29d496fdcf', 'Treadmills offer convenience, cardiovascular benefits, and usually have less impact than walking outside. When walking, you should move at a moderate to fast pace, not a leisurely one. Being an activity of lower intensity, walking doesn''t burn as many calories as some other activities, but still provides great benefit. A 150 lb person will burn about 175 calories walking 4 miles per hour for 30 minutes, compared to 450 calories running twice as fast. Maintain proper posture as you walk, and only hold onto the handles when necessary, such as when dismounting or checking your heart rate.');
INSERT INTO instructions (id, instruction) VALUES ('6a3165cb-cfb9-4955-88d4-66dcb1f57b97', 'To begin, lie down on an exercise ball with your torso pressing against the ball and parallel to the floor. The ball of your feet should be pressed against the floor to help keep you balanced. Place a weighted plate under your chin or behind your neck. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3236d8a3-5638-4f27-945f-8d5fa78ecb1a', 'Slowly raise your torso up by bending at the waist and lower back. Remember to exhale during this movement.');
INSERT INTO instructions (id, instruction) VALUES ('1d162201-32e7-42f2-a5d0-17bc6b5aad7d', 'Hold the contraction on your lower back for a second and lower your torso back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('4bade85c-ad5b-4c71-8fe0-270d75b81776', 'To begin, lie down on an exercise ball with your left side of the torso (waist, hips and shoulder) pressed against the ball.');
INSERT INTO instructions (id, instruction) VALUES ('2b244d93-d0bb-416c-b3c0-22057f7ea4e9', 'Your feet should be on the floor while your legs are crossed and hanging from the ball. Hold a weighted plate with your right hand directly to the right side of your head. Tip: Make sure the smooth side of the plate is resting against your head.');
INSERT INTO instructions (id, instruction) VALUES ('213dfd5a-146f-4898-828e-50f97abb3020', 'Place your left arm across your torso so that your palm is on your obliques. There should be a right angle between your left forearm and upper arm. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c149885f-0a7b-41d2-af76-022752eed99b', 'Raise the side of your torso up by laterally flexing at the waist while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('7ae35021-57ac-40f2-a492-3c96e95cdbab', 'Hold the contraction for a second and slowly lower yourself back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('010faace-f319-4f5a-891f-fed702df2f95', 'Switch sides and repeat the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('9e0445b7-6a4c-4f00-9447-19c17ebf6cc7', 'For this exercise you will need to place a bench behind your back and another one in front of you. With the benches perpendicular to your body, hold on to one bench on its edge with the hands close to your body, separated at shoulder width. Your arms should be fully extended.');
INSERT INTO instructions (id, instruction) VALUES ('0039acf6-6c5d-4389-aed1-6b2cf60097f4', 'The legs will be extended forward on top of the other bench. Your legs should be parallel to the floor while your torso is to be perpendicular to the floor. Have your partner place the dumbbell on your lap. Note: This exercise is best performed with a partner as placing the weight on your lap can be challenging and cause injury without assistance. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('345e2ec4-3878-4d73-8eea-102a9db52554', 'Using your triceps to bring your torso up again, lift yourself back to the starting position while exhaling.');
INSERT INTO instructions (id, instruction) VALUES ('8adb76ad-0bec-49f9-9ad1-cb1e18c2a70d', 'Lie flat on your back with your feet flat on the ground or resting on a bench with your knees bent at a 90 degree angle.');
INSERT INTO instructions (id, instruction) VALUES ('dc6ee92a-08c5-4780-a64d-4ff097916292', 'Hold a weight to your chest, or you may hold it extended above your torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('cee0d8f5-0341-4a3d-9254-45958cce5953', 'Now, exhale and slowly begin to roll your shoulders off the floor. Your shoulders should come up off the floor about 4 inches while your lower back remains on the floor.');
INSERT INTO instructions (id, instruction) VALUES ('76d96a3f-e406-4346-b9a4-6bec178198ab', 'At the top of the movement, flex your abdominals and hold for a brief pause.');
INSERT INTO instructions (id, instruction) VALUES ('2f6118fc-f54a-470a-ba28-649804a7c58c', 'Then inhale and slowly lower yourself back down to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('dc677f52-e15b-4b93-8d7c-f203c9fa976d', 'Position a lightly loaded barbell across the back of your shoulders. You could also use a weighted vest, sandbag, or other type of resistance for this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('72fe398a-f9bc-4faf-b03a-8d632e2e25d3', 'The weight should be light enough that it doesn''t slow you down significantly. Your feet should be just outside of shoulder width with your head and chest up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('ff355d8d-1140-44af-b8bd-529b50bd29ea', 'Using a countermovement, squat partially down and immediately reverse your direction to explode off of the ground, extending through your hips, knees, and ankles. Maintain good posture throughout the jump.');
INSERT INTO instructions (id, instruction) VALUES ('06782105-af97-48f0-b452-49db917bd446', 'As you return to the ground, absorb the impact through your legs.');
INSERT INTO instructions (id, instruction) VALUES ('170f0737-8236-4378-a843-3e44cac0f1ea', 'Attach a weight to a dip belt and secure it around your waist. Grab the pull-up bar with the palms of your hands facing forward. For a medium grip, your hands should be spaced at shoulder width. Both arms should be extended in front of you holding the bar at the chosen grip.');
INSERT INTO instructions (id, instruction) VALUES ('9977f205-d788-49ce-82ac-30dbde693976', 'You''ll want to bring your torso back about 30 degrees while creating a curvature in your lower back and sticking your chest out. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('72c25666-b632-4b90-adff-b028c2509357', 'Now, exhale and pull your torso up until your head is above your hands. Concentrate on squeezing yourshoulder blades back and down as you reach the top contracted position.');
INSERT INTO instructions (id, instruction) VALUES ('6b9d6a64-e1b8-4c1e-99e7-c7f87a5a39db', 'After a brief moment at the top contracted position, inhale and slowly lower your torso back to the starting position with your arms extended and your lats fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('ddc05146-2ed9-43b8-a0b2-06ebd139dd87', 'Standing upright, with feet at shoulder width and toes raised, use one hand to hold onto the beams of a squat rack and the opposite arm to hold a plate on top of your chest. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d695196d-8556-494d-87ff-c802f0524b27', 'As you use one arm to hold yourself, bend at the knees and slowly lower your torso toward the ground by bringing your pelvis and knees forward. Inhale as you go down and stop when your upper and lower legs almost create a 90-degree angle. Hold the stretch position for a second.');
INSERT INTO instructions (id, instruction) VALUES ('ef302f39-afa9-4c39-bfec-8e220630135a', 'After your one second hold, use your thigh muscles to bring your torso back up to the starting position. Exhale as you move up.');
INSERT INTO instructions (id, instruction) VALUES ('8f0a5c6e-705e-4569-b73c-faee16638304', 'Start out by strapping the bands around the base of the decline bench. Place the handles towards the inside of the decline bench so that when lying down, you can reach for both of them.');
INSERT INTO instructions (id, instruction) VALUES ('c00a9305-ed5a-443b-a04f-b887230a2224', 'Position your legs through the decline machine until they are secured. Now reach for the exercise bands with both hands. Use a pronated (palms forward) grip to grasp the handles. Position them near your collar bone and rotate your wrist to a neutral grip (palms facing the torso). Note: Your arms should remain stationary throughout the exercise. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d0482688-7ef3-4a0f-9259-5a9646bce4a9', 'Move your torso upward until your upper body is perpendicular to the floor while exhaling. Hold the contraction for a second and lower your upper body back down to the starting position while inhaling.');
INSERT INTO instructions (id, instruction) VALUES ('76b00b45-9d6b-4cd7-8a8b-e37622637ae1', 'Start by positioning two flat benches shoulder width apart from each other. Stand on top of them and wrap the weighted belt around your waist with the amount of weight you feel comfortable with. Make sure your toes are facing out.');
INSERT INTO instructions (id, instruction) VALUES ('9f32916d-63bb-42a3-8758-78736a036eba', 'Once you are standing straight up with the weight hanging in between your legs, position your arms so that they are fully extended to the side of your body. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('083e904d-53aa-4a73-85bf-feb76975cd7e', 'Begin by bending the knees as you maintain a straight posture with the head up. Continue down until the angle between the upper leg and the calves becomes slightly less than 90-degrees (which is the point in which the upper legs are below parallel to the floor). Inhale as you perform this portion of the movement. Tip: If you performed the exercise correctly, the front of the knees should make an imaginary straight line with the toes that are perpendicular to the front. If your knees are past that imaginary line (if they are past your toes) then you are placing undue stress on the knee and the exercise has been performed incorrectly.');
INSERT INTO instructions (id, instruction) VALUES ('ad6bda70-a43e-480e-9784-d7cd3b4777ad', 'Begin to move the body back up by pushing the floor of the flat bench with the ball of your foot mainly as you straighten the legs again and go back to the starting position. Exhale as you perform this portion of the exercise.');
INSERT INTO instructions (id, instruction) VALUES ('1f270fc9-750b-48d9-af0f-94c7124b6719', 'Lie back on a flat bench with feet firm on the floor. Using a wide, pronated (palms forward) grip that is around 3 inches away from shoulder width (for each hand), lift the bar from the rack and hold it straight over you with your arms locked. The bar will be perpendicular to the torso and the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('6b0a884b-97f4-4d87-aa08-c9b66e97d29d', 'After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles. Lock your arms and squeeze your chest in the contracted position, hold for a second and then start coming down slowly again. Tip: It should take at least twice as long to go down than to come up.');
INSERT INTO instructions (id, instruction) VALUES ('abd16cf9-29b8-4a3a-967c-5bd1d13dfcd2', 'Lie back on a decline bench with the feet securely locked at the front of the bench. Using a wide, pronated (palms forward) grip that is around 3 inches away from shoulder width (for each hand), lift the bar from the rack and hold it straight over you with your arms locked. The bar will be perpendicular to the torso and the floor. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('d2c993f8-c130-446a-8912-72f82b80292e', 'Lie down on a decline bench with both legs securely locked in position. Reach for the barbell behind the head using a pronated grip (palms facing out). Make sure to grab the barbell wider than shoulder width apart for this exercise. Slowly lift the barbell up from the floor by using your arms.');
INSERT INTO instructions (id, instruction) VALUES ('d8604968-b2c8-4f33-9b11-e4ea37fe5026', 'When positioned properly, your arms should be fully extended and perpendicular to the floor. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a9cdddf2-83f7-4c45-81a0-1d0253ea8a99', 'Begin by moving the barbell back down in a semicircular motion as if you were going to place it on the floor, but instead, stop when the arms are parallel to the floor. Tip: Keep the arms fully extended at all times. The movement should only happen at the shoulder joint. Inhale as you perform this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('93168a04-cf23-4ff1-8c5a-a55c4ba49676', 'Now bring the barbell up while exhaling until you are back at the starting position. Remember to keep full control of the barbell at all times.');
INSERT INTO instructions (id, instruction) VALUES ('80f6a64f-914a-4bc4-9b24-cfc24e493521', 'When finished with your set, slowly lower the barbell back down until it is level with your head and release it.');
INSERT INTO instructions (id, instruction) VALUES ('4d2e9beb-226a-46fb-83c1-0f05734fd874', 'Grab the bar with the palms facing forward using the prescribed grip. Note on grips: For a wide grip, your hands need to be spaced out at a distance wider than shoulder width. For a medium grip, your hands need to be spaced out at a distance equal to your shoulder width and for a close grip at a distance smaller than your shoulder width.');
INSERT INTO instructions (id, instruction) VALUES ('5a6ba080-cb03-4f85-b8c1-56dfc80cbe16', 'As you breathe out, bring the bar down until it touches your upper chest by drawing the shoulders and the upper arms down and back. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary and only the arms should move. The forearms should do no other work except for holding the bar; therefore do not try to pull down the bar using the forearms.');
INSERT INTO instructions (id, instruction) VALUES ('eb3bb995-5781-4065-a760-15cb3a6fac59', 'After a second at the contracted position squeezing your shoulder blades together, slowly raise the bar back to the starting position when your arms are fully extended and the lats are fully stretched. Inhale during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('2de29284-b8c9-4b87-bd1a-574285ff161c', 'As you have both arms extended in front of you holding the bar at the chosen grip width, bring your torso and head forward. Think of an imaginary line from the center of the bar down to the back of your neck. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('fab6bea0-8cf0-4d69-b07c-912f707c8611', 'As you breathe out, bring the bar down until it touches the back of your neck by drawing the shoulders and the upper arms down and back. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary and only the arms should move. The forearms should do no other work except for holding the bar; therefore do not try to pull down the bar using the forearms.');
INSERT INTO instructions (id, instruction) VALUES ('53ae8a10-e459-4b0c-b621-d930e9397a07', 'After a second on the contracted position squeezing your shoulder blades together, slowly raise the bar back to the starting position when your arms are fully extended and the lats are fully stretched. Inhale during this portion of the movement.');
INSERT INTO instructions (id, instruction) VALUES ('f621cad0-0597-4464-a4e9-9bc8142f7837', 'As you have both arms extended in front of you holding the bar, bring your torso forward and head so that there is an imaginary line from the pull-up bar to the back of your neck. This is your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('f5ffb3ef-7be6-4c88-9d74-129bf7ff837c', 'Pull your torso up until the bar is near the back of your neck. To do this, draw the shoulders and upper arms down and back while slightly leaning your head forward. Exhale as you perform this portion of the movement. Tip: Concentrate on squeezing the back muscles once you reach the full contracted position. The upper torso should remain stationary as it moves through space and only the arms should move. The forearms should do no other work other than hold the bar.');
INSERT INTO instructions (id, instruction) VALUES ('425c489e-6218-410f-b81c-302e2cbec488', 'Stand up with your torso upright while holding a barbell at the wide outer handle. The palm of your hands should be facing forward. The elbows should be close to the torso. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('c84a3925-a104-436f-94a3-0a9d74b6f52d', 'Step away from the rack and position your legs using a wider-than-shoulder-width stance with the toes slightly pointed out. Keep your head up at all times as looking down will get you off balance, and also maintain a straight back. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('072794f3-596b-4fb2-8fd3-b00ba450c73d', 'Begin with a barbell loaded on the floor. Adopt a wide stance, and then bend at the hips to grab the bar. Your hips should be as far back as possible, and your legs nearly straight. Keep your back straight, and your head and chest up. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8ca86358-edb4-4e3c-b356-66cac0e10db0', 'Begin the movement be engaging the hips, driving them forward as you allow the arms to hang straight. Continue until you are standing straight up, and then slowly return the weight to the starting position. For successive reps, the weight need not touch the floor.');
INSERT INTO instructions (id, instruction) VALUES ('6758a149-2992-422c-b929-f2fd4bb67faf', 'Hang from a pull-up bar using a pronated grip. Your arms and legs should be extended. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('00163d6f-71f4-4d2a-b5c1-e94515c56c40', 'Begin by quickly raising one knee as high as you can. Do not swing your body or your legs. 3');
INSERT INTO instructions (id, instruction) VALUES ('8477eac8-82ad-4b5b-84a4-a8c7b99b1f67', 'Immediately reverse the motion, returning that leg to the starting position. Simultaneously raise the opposite knee as high as possible.');
INSERT INTO instructions (id, instruction) VALUES ('dd6781ab-9672-4494-91b8-5846b1eb6a40', 'Continue alternating between legs until the set is complete.');
INSERT INTO instructions (id, instruction) VALUES ('7905fc99-d6df-4a2b-a8d3-d87580b47413', 'Lie on your back with your arms extended out to the sides and your legs straight. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('404c79af-af22-4169-810c-ca1eaef80aba', 'Lift one leg and quickly cross it over your body, attempting to touch the ground near the opposite hand.');
INSERT INTO instructions (id, instruction) VALUES ('b47bd3e8-983d-44cc-aa3a-6131d6d1e247', 'Return to the starting position, and repeat with the opposite leg. Continue to alternate for 10-20 repetitions.');
INSERT INTO instructions (id, instruction) VALUES ('ca10e932-65fd-47ea-849d-c51fe90b0ded', 'This is a three-part stretch. Begin by lunging forward, with your front foot flat on the ground and on the toes of your back foot. With your knees bent, squat down until your knee is almost touching the ground. Keep your torso erect, and hold this position for 10-20 seconds.');
INSERT INTO instructions (id, instruction) VALUES ('de24285b-04de-4dd7-98c2-b33fe6c7d91c', 'Now, place the arm on the same side as your front leg on the ground, with the elbow next to the foot. Your other hand should be placed on the ground, parallel to your lead leg, to help support you during this portion of the stretch.');
INSERT INTO instructions (id, instruction) VALUES ('0a391b50-1006-42cb-9316-78b81f4df189', 'After 10-20 seconds, place your hands on either side of your front foot. Raise the toes of the front foot off of the ground, and straighten your leg. You may need to reposition your rear leg to do so. Hold for 10-20 seconds, and then repeat the entire sequence for the other side.');
INSERT INTO instructions (id, instruction) VALUES ('905af798-c5ab-4717-b84d-f449a046ef75', 'Start by standing straight with your feet being shoulder width apart from each other. Elevate your arms to the side of you until they are fully extended and parallel to the floor at a height that is evenly aligned with your shoulders. Tip: Your torso and arms should form the letter "T: Your palms should be facing down. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a781053e-b1f2-4711-a57b-c311ce735617', 'Keeping your entire body stationary except for the wrists, begin to rotate both wrists forward in a circular motion. Tip: Pretend that you are trying to draw circles by using your hands as the brush. Breathe normally as you perform this exercise.');
INSERT INTO instructions (id, instruction) VALUES ('0eed5256-4510-4a06-9735-3069f4ba0ea7', 'To begin, stand straight up grabbing a wrist roller using a pronated grip (palms facing down). Your feet should be shoulder width apart.');
INSERT INTO instructions (id, instruction) VALUES ('869f3445-a94e-47d7-9d59-c4a9cb531478', 'Slowly lift both arms until they are fully extended and parallel to the floor in front of you. Note: Make sure the rope is not wrapped around the roller. Your entire body should be stationary except for the forearms. This is the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('03045f80-d63d-49a7-83a6-b71df7e63f34', 'Rotate one wrist at a time in an upward motion to bring the weight up to the bar by rolling the rope around the roller.');
INSERT INTO instructions (id, instruction) VALUES ('4ccf51bc-53de-49e5-8b4d-19944658da6f', 'Once the weight has reached the bar, slowly begin to lower the weight back down by rotating the wrist in a downward motion until the weight reaches the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('a9f54e9e-7aff-4fd8-90b2-17810a29f929', 'Repeat for the prescribed amount of repetitions in your program.');
INSERT INTO instructions (id, instruction) VALUES ('b43c5a1c-e595-46c5-9a19-bd4f6e8b4268', 'Hold a barbell with both hands and your palms facing down; hands spaced about shoulder width. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('8a528dbb-74a5-4712-b884-783bd61d066e', 'Alternating between each of your hands, perform the movement by extending the wrist as though you were rolling up a newspaper. Continue alternating back and forth until failure.');
INSERT INTO instructions (id, instruction) VALUES ('c4d0dcec-dcf6-419e-ba9d-b7d2a4f4ad4f', 'Reverse the motion by flexing the wrist, rolling the opposite direction. Continue the alternating motion until failure.');
INSERT INTO instructions (id, instruction) VALUES ('bb1860d1-efd7-4ce2-b4ab-2e8de5d9d02b', 'The yoke is usually done with a yoke apparatus, but is sometimes seen with refrigerators or other heavy objects.');
INSERT INTO instructions (id, instruction) VALUES ('d0da4918-2c39-41ac-8c25-680d6a91b09a', 'Begin by racking the apparatus across the back of the shoulders. With your head looking forward and back arched, lift the yoke by driving through the heels.');
INSERT INTO instructions (id, instruction) VALUES ('0a4113e4-d28f-4cbd-8d87-723e5757e94c', 'Begin walking as quickly as possible using short, quick steps. You may hold the side posts of the yoke to help steady it and hold it in position. Continue for the given distance as fast as possible, usually 75-100 feet.');
INSERT INTO instructions (id, instruction) VALUES ('382427e1-51dc-4fdc-a287-0b58534f0008', 'This exercise is best performed inside a squat rack for safety purposes. To begin, first set the bar on a rack that best matches your height. The correct height should be anywhere above the waist but below the chest. Once the correct height is chosen and the bar is loaded, lock your hands together and place the bar on top of your arms in between the forearm and upper arm.');
INSERT INTO instructions (id, instruction) VALUES ('6f0b534a-d07e-47a3-927d-7b2e8116ac8b', 'Lift the bar up so that it is resting on top of your forearms. If you are holding the bar properly, it should look as if you have your arms crossed but with a bar running across them.');
INSERT INTO instructions (id, instruction) VALUES ('3fe3bdaf-cb10-403c-8fbb-ac81c47ff48a', 'Begin to raise the bar as you exhale by pushing the floor with the ball of your foot mainly as you straighten the legs again and go back to the starting position.');
INSERT INTO instructions (id, instruction) VALUES ('803bbb6b-797c-4ad8-ad34-98ecf294e963', 'Make sure the palms of the hands are facing each other. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('954562ae-1cdf-452b-bb95-a9569d3209b4', 'While holding the upper arm stationary, curl the weights while contracting the biceps as you breathe out. Only the forearms should move. Your wrist should rotate so that you have a supinated (palms up) grip. Continue the movement until your biceps are fully contracted and the dumbbells are at shoulder level.');
INSERT INTO instructions (id, instruction) VALUES ('5ff2e2bd-d1b7-45da-b52c-93172bd2f9fa', 'Now during the contracted position, rotate your wrist until you now have a pronated (palms facing down) grip with the thumb at a higher position than the pinky.');
INSERT INTO instructions (id, instruction) VALUES ('78c707eb-224b-47f4-b1ec-e79c0211432c', 'Slowly begin to bring the dumbbells back down using the pronated grip.');
INSERT INTO instructions (id, instruction) VALUES ('e6076bce-4bf3-4e82-a72e-efe4484d44ae', 'As the dumbbells close your thighs, start rotating the wrist so that you go back to a neutral (palms facing your body) grip.');
INSERT INTO instructions (id, instruction) VALUES ('5930edc5-474c-401d-a796-fd2b0b404ce4', 'Grab a dumbbell in each hand and place your upper arms on top of the preacher bench or the incline bench. The dumbbells should be held at shoulder height and the elbows should be flexed. Hold the dumbbells with the palms of your hands facing down. This will be your starting position.');
INSERT INTO instructions (id, instruction) VALUES ('3c6059fb-a878-4019-8b41-d72c585006a8', 'As you breathe in, slowly lower the dumbbells keeping the palms down until your upper arm is extended and your biceps are fully stretched.');
INSERT INTO instructions (id, instruction) VALUES ('9274a09b-ef65-436f-be11-564c671e4bf5', 'Now rotate your wrists once you are at the bottom of the movement so that the palms of the hands are facing up.');
INSERT INTO instructions (id, instruction) VALUES ('5f9b71ca-76e0-452d-81f4-1997977425ee', 'As you exhale, use your biceps to curl the weights up until they are fully contracted and the dumbbells are at shoulder height. Again, remember that to ensure full contraction you need to bring that small finger higher than the thumb.');
INSERT INTO instructions (id, instruction) VALUES ('4cc1ac2a-d363-447d-8a67-a70d123bb7e8', 'Squeeze the biceps hard for a second at the contracted position and rotate your wrists so that the palms are facing down again.');
INSERT INTO exercise_instructions (id, instruction_id, exercise_id) VALUES ('6bd79e3c-434f-4b46-8799-c0cc1f813be8', '3de96015-1f9e-4446-ad81-470c4c268390', '0d5d9f8d-48af-4e04-a5b5-18f61e731db4');
INSERT INTO exercise_instructions (id, instruction_id, exercise_id) VALUES ('45c41a61-2bf2-4463-8391-aea15aeda812', '0dc14702-9667-4399-984b-849c23a07c5f', '0d5d9f8d-48af-4e04-a5b5-18f61e731db4');
